	public static class Extensions
	{
		public static Dictionary<TKey, TSource> SafeToDictionary<TSource, TKey>(this IEnumerable<TSource> source, Func<TSource, TKey> keySelector)
		{
			return source.SafeToDictionary(keySelector, x => x);
		}

		public static Dictionary<TKey, TElement> SafeToDictionary<TSource, TKey, TElement>(this IEnumerable<TSource> source, Func<TSource, TKey> keySelector, Func<TSource, TElement> elementSelector)
		{
			var dictionary = new Dictionary<TKey, TElement>();

			if (source == null)
			{
				return dictionary;
			}

			foreach (var item in source)
			{
				var key = keySelector(item);
				var element = elementSelector(item);

				dictionary[key] = element;
			}

			return dictionary;
		}

		public static XElement TryElement(this XContainer container, XName name)
		{
			return container.Element(name) ?? new XElement(name);
		}
	}
