		public static List<CiscoInterface> GetCiscoInterfaces(SLProtocolExt protocol, List<NbmInterface> nbmInterfaces, List<DetailedInterface> detailedInterfaces)
		{
			var ciscoInterfaces = new List<CiscoInterface>();

			foreach (var nbmInterface in nbmInterfaces)
			{
				var detailedInterfaceIndex = detailedInterfaces.FirstOrDefault(x => x.Name.Equals(nbmInterface.Name));

				if (detailedInterfaceIndex == null)
				{
					continue;
				}

				ciscoInterfaces.Add(new CiscoInterface(detailedInterfaceIndex.Index, nbmInterface));
			}

			return ciscoInterfaces;
		}
	}
