		public static List<DeviceresourcetableQActionRow> GetUpdatedResourceRows(Dictionary<string, DeviceresourcetableQActionRow> deviceResourceRows, List<IpigmpsnoopingtableQActionRow> snoopingRows)
		{
			var existingKeys = new HashSet<string>();
			var existingNames = new List<string>();

			// Get current existing keys and names on the device resources table
			foreach (var deviceResourceRow in deviceResourceRows)
			{
				string igmpKey = Convert.ToString(deviceResourceRow.Value.Deviceresourcetableipigmpsnoopingtablefk_1105);

				if (igmpKey != "-1" && !existingKeys.Contains(igmpKey))
				{
					existingKeys.Add(igmpKey);
				}

				existingNames.Add(Convert.ToString(deviceResourceRow.Value.Deviceresourcetablecustomname_1102));
			}

			// For each snooping row, get not mapped resource and update its IGMP FK
			foreach (var snoopingRow in snoopingRows)
			{
				string key = Convert.ToString(snoopingRow.Ipigmpsnoopinginstance_9501);

				if (existingKeys.Contains(key))
				{
					continue;
				}

				string notMappedRowKey = deviceResourceRows.FirstOrDefault(
					x => Convert.ToString(x.Value.Deviceresourcetableipigmpsnoopingtablefk_1105) == "-1").Key;

				if (notMappedRowKey == null)
				{
					var row = Table.GenerateRow(existingNames);
					row.Deviceresourcetableipigmpsnoopingtablefk_1105 = key;
					deviceResourceRows[row.Key] = row;

					continue;
				}

				deviceResourceRows[notMappedRowKey].Deviceresourcetableipigmpsnoopingtablefk_1105 = key;
			}

			return deviceResourceRows.Values.ToList();
		}

		public static void ParseIpIgmpSnooping(SLProtocol protocol, string result, CachedData cachedData)
		{
			var snoopingRows = new List<IpigmpsnoopingtableQActionRow>();

			var rowDataLines = new List<IgmpData>();

			using (var reader = new StringReader(result))
			{
				bool vlanLineHasBeenReached = false;

				string line;

				while ((line = reader.ReadLine()) != null)
				{
					string[] parsedLine = line.Split(new[] { ' ' }, StringSplitOptions.RemoveEmptyEntries);

					if (vlanLineHasBeenReached)
					{
						var data = GetData(parsedLine);
						rowDataLines.Add(data);

						continue;
					}

					if (parsedLine.Contains("Vlan"))
					{
						vlanLineHasBeenReached = true;
					}
				}
			}

			int iValue = Convert.ToInt32(protocol.GetParameter(Parameter.ipigmpsnoopingdisplaykeyconfig_9490));
			var format = (Format)iValue;

			var labels = IpIgmpSnoopingTable.GetLabelsAndForeignKeys(protocol);

			string vlan = Convert.ToString(rowDataLines.FirstOrDefault()?.Vlan);
			List<string> snoopingKeysToDelete = labels.Keys.Where(x => x.Split('/')[0] == vlan).ToList();

			List<string> snoopingPrimaryKeys = new List<string>();
			ParseData(rowDataLines, snoopingRows, format, labels, snoopingPrimaryKeys);
			FetchResourceTable(protocol, snoopingRows);

			var ipIgmpSnoopingTableRows = snoopingRows.Select(ipIgmpSnoopingTableQActionRow => ipIgmpSnoopingTableQActionRow.ToObjectArray()).ToList();

			snoopingKeysToDelete = snoopingKeysToDelete.Except(snoopingPrimaryKeys).ToList();

			if (snoopingKeysToDelete.Count > 0)
				protocol.DeleteRow(Parameter.Ipigmpsnoopingtable.tablePid, snoopingKeysToDelete);

			protocol.FillArray(Parameter.Ipigmpsnoopingtable.tablePid, ipIgmpSnoopingTableRows, NotifyProtocol.SaveOption.Partial);

			var states = new Dictionary<object, object>();
			foreach (var rowDataLine in rowDataLines)
			{
				CheckExpectedSnoopingsTable(snoopingRows, rowDataLine.Vlan, cachedData, states);
			}

			object[] columnsToSet = new object[] { Parameter.Expectedsnooping.tablePid, Parameter.Expectedsnooping.Pid.expectedsnoopingstate_10102 };
			protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnsToSet, new object[] { states.Keys.ToArray(), states.Values.ToArray() });
		}

		public static void SendCommands(SLProtocolExt protocol, List<CommandRow> listSsh, List<CommandRow> listApi, List<CommandRow> listSnmp, List<CommandRow> listApic)
		{
			var now = DateTime.UtcNow;
			uint pollingIp = 9612;

			uint[] paramsToGet = new uint[]
			{
				pollingIp,
				Parameter.sshusername,
				Parameter.sshpassword,
				Parameter.commandtimeouttime,
				Parameter.nxapiversion,
				Parameter.ptpusername_11200,
				Parameter.ptppassword_11201,
			};

			object[] parameters = (object[])protocol.GetParameters(paramsToGet);
			var credentials = new CredentialsData
			{
				Host = Convert.ToString(parameters[0]),
				Username = Convert.ToString(parameters[1]),
				Password = Convert.ToString(parameters[2]),
				CommandTimeout = Convert.ToInt32(parameters[3]),
				UsernamePtp = Convert.ToString(parameters[5]),
				PasswordPtp = Convert.ToString(parameters[6]),
			};

			ProcessCliSsh(protocol, listSsh, now, credentials.Host, credentials.Username, credentials.Password, credentials.CommandTimeout);

			if (listApi.Any())
			{
				string nx_ApiVersion = Convert.ToString(parameters[4]);

				foreach (var commandRow in listApi)
				{
					if (commandRow != null)
					{
						ProcessNxApi(protocol, now, commandRow, credentials, nx_ApiVersion);
					}
				}
			}

			ProcessSnmpCommands(protocol, listSnmp, now);

			if (listApic.Count > 0)
			{
				ProcessApicCommands(protocol, listApic, parameters, now);
			}
		}

		public static string SendHttpPostWithRetries(string host, string userName, string password, string command, int commandTimeout, string contentType)
		{
			string result;
			int retries = 0;

			do
			{
				result = SendHttpPost(host, userName, password, command, commandTimeout, contentType);
				retries++;
			}
			while (retries < 3 && result.Contains(@"<clierror/>"));

			return result;
		}

		public static bool IsIdenticalSnoopingRow(object vlan, object groupAddress, object sourceGroupAddress, object portChannel, object vlanExpected, object groupAddressExpected, object sourceGroupAddressExpected, object portChannelExpected)
		{
			return Convert.ToString(vlan).Trim().Equals(Convert.ToString(vlanExpected).Trim())
				&& Convert.ToString(groupAddress).Trim().Equals(Convert.ToString(groupAddressExpected).Trim())
				&& Convert.ToString(sourceGroupAddress).Trim().Equals(Convert.ToString(sourceGroupAddressExpected).Trim())
				&& Convert.ToString(portChannel).Split(';').Contains(Convert.ToString(portChannelExpected).Trim());
		}

