		private static string BuildPortList(string[] parsedLine, int columns)
		{
			var portList = new StringBuilder();

			for (int i = columns; i < parsedLine.Length; i++)
			{
				portList.Append(parsedLine[i] + ";");
			}

			if (portList.Length > 0)
				portList.Remove(portList.Length - 1, 1);

			return portList.ToString();
		}

		private static void CheckExpectedJoinsTable(SLProtocolExt protocol, List<StaticjoinstableQActionRow> staticJoins, string interfaceName, CachedData cachedData)
		{
			var ids = cachedData.ExpectedStaticJoins.Ids;
			var interfaceNames = cachedData.ExpectedStaticJoins.InterfaceNames;
			var expectedStaticJoins = cachedData.ExpectedStaticJoins.StaticJoins;

			var states = new Dictionary<object, object>();

			for (int i = 0; i < ids.Length; i++)
			{
				if (Convert.ToString(interfaceNames[i]).Trim().Equals(interfaceName.Trim()))
				{
					var expectedRow = staticJoins.FirstOrDefault(x => ExpectStaticJoinRow(x, interfaceNames[i], expectedStaticJoins[i]));
					if (expectedRow != null)
					{
						states.Add(ids[i], (int)ExpectedStates.Available);
					}
					else
					{
						states.Add(ids[i], (int)ExpectedStates.Missing);
					}
				}
			}

			object[] columnsToSet = new object[] { Parameter.Expectedstaticjoins.tablePid, Parameter.Expectedstaticjoins.Pid.expectedstaticjoinsstate_10202 };
			protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnsToSet, new object[] { states.Keys.ToArray(), states.Values.ToArray() });
		}

		private static void CheckExpectedSnoopingsTable(List<IpigmpsnoopingtableQActionRow> snoopingRows, string vlan, CachedData cachedData, Dictionary<object, object> states)
		{
			var ids = cachedData.ExpectedSnooping.Ids;
			var vlans = cachedData.ExpectedSnooping.Vlans;
			var groupAddresses = cachedData.ExpectedSnooping.GroupAddresses;
			var sourceGroupAddresses = cachedData.ExpectedSnooping.SourceGroupAddresses;
			var portChannels = cachedData.ExpectedSnooping.PortChannels;

			for (int i = 0; i < ids.Length; i++)
			{
				if (Convert.ToString(vlans[i]).Trim().Equals(vlan.Trim()))
				{
					var expectedRow = snoopingRows.FirstOrDefault(x => ExpectSnoopingRow(x, vlans[i], groupAddresses[i], sourceGroupAddresses[i], portChannels[i]));
					if (expectedRow != null)
					{
						states[ids[i]] = (int)ExpectedStates.Available;
					}
					else
					{
						states[ids[i]] = (int)ExpectedStates.Missing;
					}
				}
			}
		}

