		private static List<PolicymaptableQActionRow> CreatePolicyRows(string prefix, ROWCmap rowCmap, Root deserializedClass, CommandRow commandRow)
		{
			var rows = new List<PolicymaptableQActionRow>();

			foreach (var rowPolice in rowCmap.TABLE_action.ROW_action.TABLE_police.ROW_police)
			{
				string instance = prefix + "/" + rowCmap.CmapKey + "/" + rowCmap.TABLE_action.ROW_action.ActionKey + "/" + rowPolice.PoliceKey;

				var newRow = new PolicymaptableQActionRow
				{
					Policymapinstance = instance,
					Policymapinterface = deserializedClass.TABLE_ifvlanstr.ROW_ifvlanstr.IfaceStr,
					Policymapkey = rowPolice.PoliceKey,
					Policymapconformedbytes = rowPolice.ConformedBytes != null ? Convert.ToInt64(rowPolice.ConformedBytes) : -1,
					Policymapconformedrate = rowPolice.ConformedRate != null ? Convert.ToInt64(rowPolice.ConformedRate) : -1,
					Policymapcnfact = rowPolice.CnfAct != null ? Convert.ToInt32(rowPolice.CnfAct) : -1,
					Policymapviolatedbytes = rowPolice.ViolatedBytes != null ? Convert.ToInt64(rowPolice.ViolatedBytes) : -1,
					Policymapviolatedrate = rowPolice.ViolatedRate != null ? Convert.ToInt64(rowPolice.ViolatedRate) : -1,
					Policymapvioact = rowPolice.VioAct != null ? Convert.ToInt32(rowPolice.VioAct) : -1,
					Policymapforeignkey = commandRow.Instance,
				};

				rows.Add(newRow);
			}

			return rows;
		}

		private static void ExecuteApicCommands(SLProtocolExt protocol, HttpClient client, List<CommandRow> listApic, string host, string token, DateTime now)
		{
			var apicPath = new Dictionary<string, string>
			{
				{ "NBM Flow Statistics", "/api/node/mo/sys/nbm/show/stats/dom-default.json?query-target=children" },
			};

			foreach (var command in listApic)
			{
				if (command.Command.Equals("NBM Flow Statistics"))
				{
					ExecuteNbmFlowStatisticsCommand(protocol, client, host, token, apicPath["NBM Flow Statistics"], command, now);
				}
			}
		}

		private static void ExecuteNbmFlowStatisticsCommand(SLProtocolExt protocol, HttpClient client, string host, string token, string apicPath, CommandRow commandRow, DateTime now)
		{
			var dataUri = new Uri(String.Format("http://{0}{1}", host, apicPath));
			client.DefaultRequestHeaders.Add("APIC-Challenge", "urlToken");
			client.DefaultRequestHeaders.Add("APIC-Cookie", token);

			var dataResponse = client.GetAsync(dataUri).Result;

			if (!dataResponse.IsSuccessStatusCode)
			{
				return;
			}

			string nbmData = dataResponse.Content.ReadAsStringAsync().Result;
			var nbmBitrate = JsonConvert.DeserializeObject<NbmData>(nbmData);

			ProcessNbmData(protocol, nbmBitrate);

			client.DefaultRequestHeaders.Remove("APIC-Challenge");
			client.DefaultRequestHeaders.Remove("APIC-Cookie");

			protocol.SetRow(Parameter.Pollingtable.tablePid, commandRow.Instance, new object[] { null, null, null, null, null, "Polled Successfully", now.ToOADate() });
		}

		private static bool ExpectSnoopingRow(IpigmpsnoopingtableQActionRow x, object vlan, object groupAddress, object sourceGroupAddress, object portChannel)
