				x.Ipigmpsnoopinggroupaddresssource_9507,
				x.Ipigmpsnoopingportlist_9506,
				vlan,
				groupAddress,
				sourceGroupAddress,
				portChannel);
		}

		private static bool ExpectStaticJoinRow(StaticjoinstableQActionRow x, object interfaceName, object expectedStaticJoin)
		{
			return IsIdenticalStaticJoinsRow(x.Staticjoinsinterfacename_17603, x.Staticjoinsstaticjoin_17602, interfaceName, expectedStaticJoin);
		}

		private static void FetchResourceTable(SLProtocol protocol, List<IpigmpsnoopingtableQActionRow> snoopingRows)
		{
			// Fetch resource table key/ IP IGMP
			uint[] columnsToGet = new uint[]
			{
				Parameter.Deviceresourcetable.Idx.deviceresourcetableindex_1101,
				Parameter.Deviceresourcetable.Idx.deviceresourcetablecustomname_1102,
				Parameter.Deviceresourcetable.Idx.deviceresourcetablestaticjoinstablefk_1103,
				Parameter.Deviceresourcetable.Idx.deviceresourcetableipigmpsnoopingtablefk_1105,
			};

			var deviceResourceRows = protocol.GetColumns(
				Parameter.Deviceresourcetable.tablePid,
				columnsToGet,
				(string idx, string customName, string staticJoinFk, string igmpSnoopingFk) =>
				{
					return new
					{
						Key = idx,
						Row = new DeviceresourcetableQActionRow
						{
							Deviceresourcetableindex_1101 = idx,
							Deviceresourcetablecustomname_1102 = customName,
							Deviceresourcetablestaticjoinstablefk_1103 = staticJoinFk,
							Deviceresourcetableipigmpsnoopingtablefk_1105 = igmpSnoopingFk,
						},
					};
				}).ToDictionary(x => x.Key, x => x.Row);

			var deviceResources = GetUpdatedResourceRows(deviceResourceRows, snoopingRows);

			protocol.SetParameter(Parameter.numberofdevices_1090, deviceResources.Count);

			if (deviceResources.Count > 0)
			{
				var deviceResourceTableRows = deviceResources.Select(deviceResourceTableQActionRow => deviceResourceTableQActionRow.ToObjectArray()).ToList();

				protocol.FillArray(Parameter.Deviceresourcetable.tablePid, deviceResourceTableRows, NotifyProtocol.SaveOption.Partial);
			}
		}

		private static IgmpData GetData(string[] parsedLine)
		{
			if (parsedLine[0].Contains('.'))
			{
				string portList = BuildPortList(parsedLine, 2);
				IgmpData data = new IgmpDataWithoutVlan(parsedLine[0], parsedLine[1], portList);

				return data;
			}

			if (parsedLine[0].Any(Char.IsUpper))
			{
				string portList = BuildPortList(parsedLine, 1);
				IgmpData data = new IgmpDataWithoutVlanAndGroup(parsedLine[0], portList);

				return data;
			}

			if (parsedLine.Length == 3 || parsedLine.Length == 5)
			{
				IgmpData data = new IgmpDataWithoutType(parsedLine[0], parsedLine[1], parsedLine[2]);

				return data;
			}
			else
			{
				string portList = BuildPortList(parsedLine, 4);
				var data = new NormalIgmpData(parsedLine[0], parsedLine[1], parsedLine[1], parsedLine[2], parsedLine[3], portList);

				return data;
			}
		}

		private static List<NbmflowstableQActionRow> GetNewNbmFlows(NbmData nbmData)
		{
			var newNbmFlows = new List<NbmflowstableQActionRow>();

			foreach (var nbmItem in nbmData.Imdata)
			{
				string group = nbmItem.NbmStatsEntry.Attributes.Group;
				string source = nbmItem.NbmStatsEntry.Attributes.Source;
				string key = String.Join("/", group, source);

				var newNbmFlow = new NbmflowstableQActionRow
				{
					Nbmflowsindex_14101 = key,
					Nbmflowsbytes_14113 = Convert.ToInt64(nbmItem.NbmStatsEntry.Attributes.AllowedBytes),
				};

				newNbmFlows.Add(newNbmFlow);
			}

			return newNbmFlows;
		}

		private static Dictionary<string, NbmflowstableQActionRow> GetOldNbmFlows(SLProtocolExt protocol)
		{
			uint[] columnsIdx = new uint[]
			{
				Parameter.Nbmflowstable.Idx.nbmflowsindex_14101,
				Parameter.Nbmflowstable.Idx.nbmflowsbwmbps_14109,
				Parameter.Nbmflowstable.Idx.nbmflowsbytes_14113,
				Parameter.Nbmflowstable.Idx.nbmflowsbitrate_14114,
			};

			var nbmFlowData = protocol.GetColumns(
				Parameter.Nbmflowstable.tablePid,
				columnsIdx,
				(string key, double bandwitdth, ulong bytes, double bitrate) =>
				{
					return new NbmflowstableQActionRow
					{
						Nbmflowsindex_14101 = key,
						Nbmflowsbwmbps_14109 = bandwitdth,
						Nbmflowsbytes_14113 = bytes,
						Nbmflowsbitrate_14114 = bitrate,
					};
				}).ToDictionary(x => x.Key);

			return nbmFlowData;
		}

		private static Dictionary<string, StaticjoinstableQActionRow> GetTableData(SLProtocol protocol)
		{
			uint[] idxs = new uint[]
			{
				Parameter.Staticjoinstable.Idx.staticjoinsinstance_17601,
				Parameter.Staticjoinstable.Idx.staticjoinsresourceforeignkey_17604,
			};

			KeyValuePair<string, StaticjoinstableQActionRow> func(string key, string fk)
			{
				var row = new StaticjoinstableQActionRow
				{
					Staticjoinsinstance_17601 = key,
					Staticjoinsresourceforeignkey_17604 = fk,
				};

				return new KeyValuePair<string, StaticjoinstableQActionRow>(key, row);
			}

			return protocol.GetColumns(Parameter.Staticjoinstable.tablePid, idxs, (Func<string, string, KeyValuePair<string, StaticjoinstableQActionRow>>)func).ToDictionary(x => x.Key, x => x.Value);
		}

		/// <summary>
		///     Together with the AcceptAllCertifications method right
		///     below this causes to bypass errors caused by SLL-Errors.
		/// </summary>
		private static void IgnoreBadCertificates()
		{
			ServicePointManager.ServerCertificateValidationCallback = AcceptAllCertifications;
		}

		private static void Parse(SLProtocolExt protocol, CommandRow commandRow, string result, CachedData cachedData)
		{
			if (String.IsNullOrWhiteSpace(result))
			{
				return;
			}

			if (commandRow.Command.Contains("policy-map") && commandRow.Command.Contains("json"))
			{
				ParsePolicyMap(protocol, commandRow, result);
			}

			if (commandRow.Command.Contains("ip route"))
			{
				ParseIpRoutes(protocol, commandRow, result);
			}

			if (commandRow.Command.Contains("include oif"))
			{
				ParseIncludeOif(protocol, commandRow, result, cachedData);
			}

			if (commandRow.Command.Contains("show ip igmp snooping group vlan"))
			{
				ParseIpIgmpSnooping(protocol, result, cachedData);
			}

			if (commandRow.Command.Contains("show nbm interface bandwidth"))
			{
				// New implementation is using NX API instead of SSH
				protocol.pollingtable[commandRow.Instance, Parameter.Pollingtable.Idx.pollingcommunicationtype] = 2; // CommunicationTypes.API;
			}

			// do nothing.
		}

		private static void ParseData(List<IgmpData> rowDataLines, List<IpigmpsnoopingtableQActionRow> snoopingRows, Format format, Dictionary<string, IpIgmpSnoopingTableData> tableData, List<string> snoopingPrimaryKeys)
		{
			var previousRow = new IgmpData();
			int index = 1;

			int i = rowDataLines.Count;

			foreach (var data in rowDataLines)
			{
				i--;

				if (data.Vlan != "-1")
				{
					index = previousRow.AddRowOrRows(snoopingRows, index, format, tableData, snoopingPrimaryKeys);

					previousRow = data;

					continue;
				}

				previousRow = data.BuildPreviousRow(previousRow);

				if (i == 0)
				{
					index = previousRow.AddRowOrRows(snoopingRows, index, format, tableData, snoopingPrimaryKeys);
				}
			}
		}

		private static void ParseIncludeOif(SLProtocolExt protocol, CommandRow commandRow, string result, CachedData cachedData)
		{
			string interfaceName = commandRow.Command.Split(' ')[3];

			if (String.IsNullOrEmpty(interfaceName))
			{
				return;
			}

			var tableData = GetTableData(protocol);
			var staticJoins = new List<StaticjoinstableQActionRow>();

			using (var reader = new StringReader(result))
			{
				string line;

				while ((line = reader.ReadLine()) != null)
				{
					string instance = interfaceName + "/" + line;
					var row = new StaticjoinstableQActionRow
					{
						Staticjoinsinstance_17601 = instance,
						Staticjoinsstaticjoin_17602 = line,
						Staticjoinsinterfacename_17603 = interfaceName,
						Staticjoinsresourceforeignkey_17604 = tableData.ContainsKey(instance) ? tableData[instance].Staticjoinsresourceforeignkey_17604 : "-1",
					};

					staticJoins.Add(row);
					tableData.Remove(instance);
				}
			}

			if (staticJoins.Any())
			{
				protocol.staticjoinstable.FillArrayNoDelete(staticJoins.ToArray());
				CheckExpectedJoinsTable(protocol, staticJoins, interfaceName, cachedData);
			}

			var keysToDelete = tableData.Keys.Where(x => x.Contains(interfaceName)).ToList();
			if (keysToDelete.Any())
			{
				protocol.staticjoinstable.DeleteRow(keysToDelete);
			}
		}

		private static void ParseIpRoutes(SLProtocolExt protocol, CommandRow commandRow, string result)
		{
			string vrfName = commandRow.Command.Split(' ')[3];

			if (String.IsNullOrEmpty(vrfName))
			{
				return;
			}

			var ipRoutes = new List<RoutestableQActionRow>();

			using (var reader = new StringReader(result))
			{
				string line;

				while ((line = reader.ReadLine()) != null)
				{
					ipRoutes.Add(new RoutestableQActionRow { Routesinstance = vrfName + "/" + line, Routesiproute = line, Routesvrfname = vrfName });
				}
			}

			if (ipRoutes.Any())
			{
				protocol.routestable.FillArrayNoDelete(ipRoutes.ToArray());
			}
		}

		private static void ParsePolicyMap(SLProtocolExt protocol, CommandRow commandRow, string result)
		{
			var deserializedClass = JsonConvert.DeserializeObject<Root>(result);

			List<PolicymaptableQActionRow> rows = null;

			if (deserializedClass.TABLE_ifvlanstr == null)
			{
				return;
			}

			foreach (var row_cmap in deserializedClass.TABLE_ifvlanstr.ROW_ifvlanstr.TABLE_pmap.ROW_pmap.TABLE_cmap.ROW_cmap)
			{
				string prefix = deserializedClass.TABLE_ifvlanstr.ROW_ifvlanstr.IfaceStr + "/" + deserializedClass.TABLE_ifvlanstr.ROW_ifvlanstr.TABLE_pmap.ROW_pmap.PmapKey;

				rows = CreatePolicyRows(prefix, row_cmap, deserializedClass, commandRow);
			}

			if (rows != null && rows.Any())
			{
				protocol.policymaptable.FillArrayNoDelete(rows.ToArray());
			}
		}

		private static void ProcessApicCommands(SLProtocolExt protocol, List<CommandRow> listApic, object[] parameters, DateTime now)
		{
			try
			{
				string host = Convert.ToString(parameters[0]);
				string user = Convert.ToString(parameters[1]);
				string pwd = Convert.ToString(parameters[2]);

				using (var client = new HttpClient())
				{
					// Request: AaaLogin
					var loginUri = new Uri(String.Format("http://{0}/api/aaaLogin.json", host));
					string loginBody = JsonConvert.SerializeObject(new RequestApicCredentials(user, pwd));
					var loginBodyContent = new StringContent(loginBody, Encoding.ASCII, "application/json");

					var loginResponse = client.PostAsync(loginUri, loginBodyContent).Result;

					if (!loginResponse.IsSuccessStatusCode)
					{
						protocol.SetRow(Parameter.Pollingtable.tablePid, "71", new object[] { null, null, null, null, null, "APIC Login error.", "-1" });

						return;
					}

					string loginResponseData = loginResponse.Content.ReadAsStringAsync().Result;
					var apicCredentials = JsonConvert.DeserializeObject<ApicCredentials>(loginResponseData);
					string token = apicCredentials.Imdata.First().AaaLogin.Attributes.Token;

					ExecuteApicCommands(protocol, client, listApic, host, token, now);

					// Request: AaaLogout
					var logoutUri = new Uri(String.Format("http://{0}/api/aaaLogout.json", host));
					string logoutBody = JsonConvert.SerializeObject(new RequestLogout(user));
					var logoutBodyContent = new StringContent(logoutBody, Encoding.ASCII, "application/json");

					var exitResponse = client.PostAsync(logoutUri, logoutBodyContent).Result;
				}
			}
			catch (Exception)
			{
				protocol.Log("APIC command execution error.");

				throw;
			}
		}

		private static void ProcessCliSsh(SLProtocolExt protocol, List<CommandRow> listSsh, DateTime now, string host, string user, string pwd, int commandTimeout)
		{
			if (!listSsh.Any())
			{
				return;
			}

			if (String.IsNullOrWhiteSpace(user) || String.IsNullOrWhiteSpace(pwd))
			{
				SetInvalidCredentialInfo(protocol, listSsh);
				return;
			}

			using (var client = new SshClient(host, user, pwd))
			{
				try
				{
					client.Connect();

					ProcessSshCommands(protocol, listSsh, now, commandTimeout, client);

					client.Disconnect();
				}
				catch (Exception exception)
				{
					protocol.SetRow(Parameter.Pollingtable.tablePid, listSsh.First().Instance, new object[] { null, null, null, null, null, exception.Message, now.ToOADate() });
				}
			}
		}

		private static void ProcessNbmData(SLProtocolExt protocol, NbmData nbmData)
		{
			var newNbmFlows = GetNewNbmFlows(nbmData);
			var oldNbmFlows = GetOldNbmFlows(protocol);

			var nbmFlowKey = new List<object>();
			var nbmFlowBytes = new List<object>();
			var nbmFlowBitrate = new List<object>();
			var nbmFlowBandwidthUtilization = new List<object>();
			var rateCalculatorHelper = new RateCalculatorHelper(protocol, new TimeSpan(0, 0, 1), new TimeSpan(0, 10, 0));
			DateTime now = DateTime.UtcNow;

			foreach (var nbmFlow in newNbmFlows)
			{
				nbmFlowKey.Add(nbmFlow.Key);
				nbmFlowBytes.Add(nbmFlow.Nbmflowsbytes_14113);

				if (!oldNbmFlows.ContainsKey(nbmFlow.Key))
				{
					nbmFlowBitrate.Add(default(int));
					nbmFlowBandwidthUtilization.Add(default(int));

					continue;
				}

				double currentBitrate = Statistics.GetCurrentBitrateInMegaBitsPerSecond(rateCalculatorHelper, nbmFlow.Key, nbmFlow.Nbmflowsbytes_14113, now);
				nbmFlowBitrate.Add(currentBitrate);

				int bandwidth = Convert.ToInt32(oldNbmFlows[nbmFlow.Key].Nbmflowsbwmbps_14109);
				nbmFlowBandwidthUtilization.Add(Statistics.CalculateNbmBandwidth(currentBitrate, bandwidth));
			}

			if (nbmFlowKey.Count <= 0)
			{
				return;
			}

			object[] pids = new object[]
			{
					Parameter.Nbmflowstable.tablePid,
					Parameter.Nbmflowstable.Pid.nbmflowsbytes_14113,
					Parameter.Nbmflowstable.Pid.nbmflowsbitrate_14114,
					Parameter.Nbmflowstable.Pid.nbmflowsbandwidthutilization_14115,
			};

			object[] data = new object[]
			{
					nbmFlowKey.ToArray(),
					nbmFlowBytes.ToArray(),
					nbmFlowBitrate.ToArray(),
					nbmFlowBandwidthUtilization.ToArray(),
			};

			protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, pids, data);
		}

		private static void ProcessNxApi(SLProtocolExt protocol, DateTime now, CommandRow commandRow, CredentialsData credentials, string apiVersion)
		{
			try
			{
				if (Guid.TryParse(commandRow.Instance, out _))
				{
					ProcessNxApiGuid(protocol, now, commandRow, credentials, apiVersion);
				}
				else
				{
					ProcessNxApiPtp(protocol, now, commandRow, credentials, apiVersion);
				}
			}
			catch (Exception e)
			{
				protocol.SetRow(Parameter.Pollingtable.tablePid, commandRow.Instance, new object[] { null, null, null, null, null, e.Message, now.ToOADate() });
			}
		}

		private static void ProcessNxApiGuid(SLProtocolExt protocol, DateTime now, CommandRow commandRow, CredentialsData credentials, string apiVersion)
		{
			var nx_Command = CreateNxApiRequest("json", "cli_conf", commandRow.Command, apiVersion);
			string post_data = Json.Serialize(nx_Command);
			string result = SendHttpPostWithRetries(credentials.Host, credentials.Username, credentials.Password, post_data, credentials.CommandTimeout, "application/json");

			if (result.Contains(@"<clierror/>"))
			{
				return;
			}

			var singleResult = Json.Deserialize<Json.NxSingleResponse.NX_API>(result);

			if (singleResult != null && singleResult.Ins_api != null && singleResult.Ins_api.Outputs != null && singleResult.Ins_api.Outputs.Output != null)
			{
				result = singleResult.Ins_api.Outputs.Output.Body;
			}

			protocol.SetRow(Parameter.Pollingtable.tablePid, commandRow.Instance, new object[] { null, null, null, null, null, result, now.ToOADate() });
		}

		private static void ProcessNxApiPtp(SLProtocolExt protocol, DateTime now, CommandRow commandRow, CredentialsData credentials, string apiVersion)
		{
			var nx_Command = CreateNxApiRequest("xml", "cli_show", commandRow.Command, apiVersion);
			bool isPtpCommand = commandRow.Command.Contains(" ptp ");
			string userName = isPtpCommand ? credentials.UsernamePtp : credentials.Username;
			string password = isPtpCommand ? credentials.PasswordPtp : credentials.Password;

			if (String.IsNullOrWhiteSpace(userName) || String.IsNullOrEmpty(password))
			{
				protocol.SetRow(Parameter.Pollingtable.tablePid, commandRow.Instance, new object[] { null, null, null, null, null, "Please provide Username And Password", "-1" });
				return;
			}

			string post_data = Json.Serialize(nx_Command);
			string result = SendHttpPostWithRetries(credentials.Host, credentials.Username, credentials.Password, post_data, credentials.CommandTimeout, "application/xml");

			if (result.Contains(@"<clierror/>"))
			{
				return;
			}

			var response = new Response(protocol, commandRow.Command, result);
			result = response.Parse();
			protocol.SetRow(Parameter.Pollingtable.tablePid, commandRow.Instance, new object[] { null, null, null, null, null, result, now.ToOADate() });
		}

		private static void ProcessSnmpCommands(SLProtocolExt protocol, List<CommandRow> listSnmp, DateTime now)
		{
			if (!listSnmp.Any())
			{
				return;
			}

			foreach (var commandRow in listSnmp)
			{
				if (commandRow == null)
				{
					continue;
				}

				protocol.CheckTrigger(11000 + Convert.ToInt32(commandRow.Instance));
				protocol.SetRow(Parameter.Pollingtable.tablePid, commandRow.Instance, new object[] { null, null, null, null, null, "Polled Successfully", now.ToOADate() });
			}
		}

		private static void ProcessSshCommands(SLProtocolExt protocol, List<CommandRow> listSsh, DateTime now, int commandTimeout, SshClient client)
		{
			CachedData cachedData = CreateCacheData(protocol);

			foreach (var commandRow in listSsh)
			{
				if (commandRow == null)
				{
					continue;
				}

				var sshCommand = client.CreateCommand(commandRow.Command);
				sshCommand.CommandTimeout = TimeSpan.FromMilliseconds(commandTimeout);

				// Split the command if it's a multiple command line otherwise it will have only one command
				string result;
				try
				{
					int retries = 0;

					do
					{
						sshCommand.Execute();
						result = sshCommand.Result;
						retries++;
					}
					while (retries < 3 && result.Contains(@"<clierror/>"));

					if (!result.Contains(@"<clierror/>"))
					{
						Parse(protocol, commandRow, result, cachedData);
					}
				}
				catch (SshOperationTimeoutException sshException)
				{
					result = sshException.Message;
				}

				protocol.SetRow(Parameter.Pollingtable.tablePid, commandRow.Instance, new object[] { null, null, null, null, null, result, now.ToOADate() });
			}
		}

		private static CachedData CreateCacheData(SLProtocol protocol)
		{
			var columnsToGetExpectedStaticJoins = new uint[]
			{
				Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsid_10201,
				Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsinterfacename_10203,
				Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsstaticjoin_10204,
			};

			var expectedStaticJoinsColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Expectedstaticjoins.tablePid, columnsToGetExpectedStaticJoins);

			var columnsToGetExpectedSnooping = new uint[]
			{
				Parameter.Expectedsnooping.Idx.expectedsnoopingid_10101,
				Parameter.Expectedsnooping.Idx.expectedsnoopingvlan_10103,
				Parameter.Expectedsnooping.Idx.expectedsnoopinggroupaddress_10104,
				Parameter.Expectedsnooping.Idx.expectedsnoopingsourcegroupaddress_10105,
				Parameter.Expectedsnooping.Idx.expectedsnoopingportchannel_10106,
			};

			var columnsExpectedSnooping = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Expectedsnooping.tablePid, columnsToGetExpectedSnooping);

			return new CachedData
			{
				ExpectedStaticJoins = new CachedExpectedStaticJoins
				{
					Ids = (object[])expectedStaticJoinsColumns[0],
					InterfaceNames = (object[])expectedStaticJoinsColumns[1],
					StaticJoins = (object[])expectedStaticJoinsColumns[2],
				},

				ExpectedSnooping = new CachedExpectedSnoopings
				{
					Ids = (object[])columnsExpectedSnooping[0],
					Vlans = (object[])columnsExpectedSnooping[1],
					GroupAddresses = (object[])columnsExpectedSnooping[2],
					SourceGroupAddresses = (object[])columnsExpectedSnooping[3],
					PortChannels = (object[])columnsExpectedSnooping[4],
				},
			};
		}

		private static string SendHttpPost(string host, string username, string password, string command, int commandTimeout, string contentType)
		{
			try
			{
				IgnoreBadCertificates();

				var request = (HttpWebRequest)WebRequest.Create(new Uri(String.Format("https://{0}/ins", host)));

				request.KeepAlive = false;
				request.ProtocolVersion = HttpVersion.Version10;
				request.Method = "POST";
				request.UseDefaultCredentials = false;
				request.Proxy = null;
				request.Timeout = commandTimeout;

				string encoded = Convert.ToBase64String(Encoding.GetEncoding("ISO-8859-1").GetBytes(username + ":" + password));
				byte[] postBytes = Encoding.ASCII.GetBytes(command);

				request.Headers.Add("Authorization", "Basic " + encoded);
				request.ContentType = contentType;
				request.ContentLength = postBytes.Length;

				using (var requestStream = request.GetRequestStream())
				{
					requestStream.Write(postBytes, 0, postBytes.Length); // Send the post
				}

				// grab the response and print it out to the console along with the status code
				using (var response = (HttpWebResponse)request.GetResponse())
				{
					using (var reader = new StreamReader(response.GetResponseStream()))
					{
						string responseData = reader.ReadToEnd();
						request.Abort();

						return responseData;
					}
				}
			}
			catch (Exception)
			{
				return Common.Defaults.CommunicationProblem;
			}
		}

		private static void SetInvalidCredentialInfo(SLProtocol protocol, List<CommandRow> commands)
		{
			object[] columnInfo = new object[]
			{
				Parameter.Pollingtable.tablePid,
				Parameter.Pollingtable.Pid.pollinginformation_17206,
				Parameter.Pollingtable.Pid.pollinglastpolled_17207,
			};

			object[] columnData = new object[]
			{
				commands.Select(command => command.Instance).ToArray<object>(),
				Enumerable.Repeat((object)"Please provide Username And Password.", commands.Count).ToArray(),
				Enumerable.Repeat((object)"-1", commands.Count).ToArray(),
			};

			protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnInfo, columnData);
		}
	}
}
//---------------------------------
// Common.cs
//---------------------------------
namespace Skyline.Protocol
{
	using System;
	using System.Collections.Generic;
	using System.Globalization;
	using System.Linq;

	using Skyline.DataMiner.Scripting;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	public static class Common
	{
		public static bool CheckIfOneColumnIsNull(List<object[]> columns)
		{
			return columns.Any(x => x == null);
		}

		public static string CleanMacAddress(string macAddress)
		{
			string[] macParts = macAddress.Split('.');

			if (macParts.Length != 3)
			{
				return macAddress;
			}

			var mac = new List<string>();

			foreach (string macPart in macParts)
			{
				if (macPart.Length != 4)
				{
					return macAddress;
				}

				mac.Add(macPart.Substring(0, 2));
				mac.Add(macPart.Substring(2, 2));
			}

			return String.Join(".", mac).ToUpperInvariant();
		}

		public static string ConvertHexToDecIP(SLProtocol protocol, string sIp)
		{
			try
			{
				if (String.IsNullOrEmpty(sIp) || sIp.Split('.').Length != 4)
				{
					return null;
				}

				return String.Format(
					"{0}.{1}.{2}.{3}",
					Int32.Parse(sIp.Substring(0, 2), NumberStyles.HexNumber),
					Int32.Parse(sIp.Substring(3, 2), NumberStyles.HexNumber),
					Int32.Parse(sIp.Substring(6, 2), NumberStyles.HexNumber),
					Int32.Parse(sIp.Substring(9, 2), NumberStyles.HexNumber));
			}
			catch (Exception e)
			{
				protocol.Log("QA" + protocol.QActionID + "|ConvertHexToDecIP|IP format is incorrect|" + sIp + "|" + e, LogType.Error, LogLevel.NoLogging);
			}

			return String.Empty;
		}

		public static void DeleteCommandHistoryTableExtraRows(SLProtocol protocol, bool bAdding = true)
		{
			object[] keyObjects = (object[])((object[])protocol.NotifyProtocol(
				(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
				Parameter.Commandhistorytable.tablePid,
				new uint[] { Parameter.Commandhistorytable.Idx.commandhistorytableindex }))[0];

			int[] keys = Array.ConvertAll(keyObjects, item => Convert.ToInt32(item));

			// ordering to delete the first(oldest) rows
			keys = keys.OrderBy(x => x).ToArray();

			string[] sKeys = Array.ConvertAll(keys, item => Convert.ToString(item));

			int maxHistoryNumber = Convert.ToInt32(protocol.GetParameter(Parameter.commandentriestokeep)) - (bAdding ? 1 : 0);

			var rowsToRemove = new List<string>(sKeys.Take(keyObjects.Length - maxHistoryNumber));

			if (rowsToRemove.Count > 0)
			{
				protocol.DeleteRow(Parameter.Commandhistorytable.tablePid, rowsToRemove.ToArray());
			}
		}

		public static bool IsCloseTo(this double value, double reference, double precision)
		{
			return Math.Abs(value - reference) <= precision;
		}

		public static bool IsCloseToZero(double value)
		{
			return value.IsCloseTo(0, 2 * Double.MinValue);
		}

		public static class Defaults
		{
			public static readonly string CommunicationProblem = "communication problem";
		}
	}
}
