namespace QAction_1.DcfHelperExt
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using ProtocolDCF;

	using QAction_1.CiscoInterface;
	using QAction_1.DcfInterface;

	using Skyline.DataMiner.Scripting;

	public class DcfHelperExt
	{
		public static void AddDcfInterfaceProperties(SLProtocolExt protocol, List<string> interfaceProperties, List<CiscoInterface> ciscoInterfaces)
		{
			var opt = new DCFMappingOptions
			{
				HelperType = SyncOption.EndOfPolling,
				PIDcurrentInterfaceProperties = Parameter.map_interfaceproperties_63999,
			};

			using (var dcf = new DCFHelper(protocol, Parameter.map_startupelements_63993, opt))
			{
				var dcfInterfaces = dcf.GetInterfaces(new DCFDynamicLink())[0].allInterfaces;

				if (!dcfInterfaces.Any())
				{
					return;
				}

				var dcfInterfacesData = DcfInterface.MapDcfInterfaces(dcfInterfaces, ciscoInterfaces);

				foreach (var dcfInterface in dcfInterfacesData)
				{
					var dcfInterfaceProperties = new List<ConnectivityInterfaceProperty>();

					foreach (string interfaceProperty in interfaceProperties)
					{
						string propertyIps = GetPropertyIps(dcfInterface, interfaceProperty);

						var connectivityInterface = new ConnectivityInterfaceProperty
						{
							InterfacePropertyName = interfaceProperty,
							InterfacePropertyType = "NBM Flow",
							InterfacePropertyValue = propertyIps,
						};

						dcfInterfaceProperties.Add(connectivityInterface);
					}

					dcf.SaveInterfaceProperties(dcfInterface.ConnectivityInterface, true, dcfInterfaceProperties.ToArray());
				}
			}
		}

		public static void RemoveDcfInterfaceProperties(SLProtocolExt protocol, List<string> interfacePropertiesToRemove)
		{
			var opt = new DCFMappingOptions
			{
				HelperType = SyncOption.Custom,
				PIDcurrentInterfaceProperties = Parameter.map_interfaceproperties_63999,
			};

			using (var dcf = new DCFHelper(protocol, Parameter.map_startupelements_63993, opt))
			{
				var dcfInterfaces = dcf.GetInterfaces(new DCFDynamicLink())[0].allInterfaces;

				foreach (var dcfInterface in dcfInterfaces)
				{
					var dcfInterfaceProperties = dcfInterface.InterfaceProperties;
					int[] propertiesToRemove = dcfInterfaceProperties.Where(x => interfacePropertiesToRemove.Contains(x.Value.InterfacePropertyName)).Select(x => x.Value.InterfacePropertyId)
						.ToArray();

					if (propertiesToRemove.Any())
					{
						dcf.RemoveInterfaceProperties(dcfInterface, false, propertiesToRemove);
					}
				}
			}
		}

		private static string GetPropertyIps(DcfInterface dcfNodeInterface, string propertyType)
		{
			if (propertyType.Equals("MC"))
			{
				return String.Join(";", dcfNodeInterface.CiscoInterface.NbmInterface.MulticastIps);
			}

			if (propertyType.Equals("Source IP"))
			{
				return String.Join(";", dcfNodeInterface.CiscoInterface.NbmInterface.SourceIps);
			}

			return String.Empty;
		}
	}
}
