namespace QAction_1.DcfInterface
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using QAction_1.CiscoInterface;
	using QAction_1.Nbm;

	using Skyline.DataMiner.Scripting;

	public class DcfInterface
	{
		public DcfInterface(ConnectivityInterface connectivityInterface, CiscoInterface ciscoInterface)
		{
			ConnectivityInterface = connectivityInterface;
			CiscoInterface = ciscoInterface;
		}

		public CiscoInterface CiscoInterface { get; set; }

		public ConnectivityInterface ConnectivityInterface { get; set; }

		public static List<DcfInterface> MapDcfInterfaces(ConnectivityInterface[] dcfInterfaces, List<CiscoInterface> ciscoInterfaces)
		{
			var interfaces = new List<DcfInterface>();

			foreach (var dcfInterface in dcfInterfaces)
			{
				var ciscoInterface = ciscoInterfaces.FirstOrDefault(x => x.InterfaceId.Equals(dcfInterface.DynamicPK));

				if (ciscoInterface == null)
				{
					// Make sure that interfaces without intrest are also having the property with empty value
					ciscoInterface = new CiscoInterface(dcfInterface.DynamicPK, new NbmInterface(String.Empty, new List<string>(), new List<string>()));
				}

				interfaces.Add(new DcfInterface(dcfInterface, ciscoInterface));
			}

			return interfaces;
		}
	}
}
