	public class DcfInterfaceProperty
	{
		private readonly List<string> interfaceProperties;

		private readonly SLProtocolExt protocol;

		public DcfInterfaceProperty(SLProtocolExt protocol, List<string> interfaceProperties)
		{
			this.protocol = protocol;
			this.interfaceProperties = interfaceProperties;
		}

		public void AddDcfProperties(List<NbmRowData> nbmRows)
		{
			var nbmInterfaces = NbmInterface.GetNbmInterfaces(nbmRows);
			var detailedInterfaces = DetailedInterface.GetDetailedInterfaces(protocol);
			var ciscoInterfaces = CiscoInterface.GetCiscoInterfaces(protocol, nbmInterfaces, detailedInterfaces);

			DcfHelperExt.AddDcfInterfaceProperties(protocol, interfaceProperties, ciscoInterfaces);
		}

		public void RemoveDcfProperties()
		{
			DcfHelperExt.RemoveDcfInterfaceProperties(protocol, interfaceProperties);
		}
	}
