// Extensions\DictionaryExtensions.cs
//---------------------------------
namespace Extensions
{
	using System.Collections.Generic;
	using System.Linq;

	public static class DictionaryExtensions
	{
		public static bool TryGetKeyByValue<TKey, TValue>(this Dictionary<TKey, TValue> dictionary, TValue value, out TKey key)
		{
			var match = dictionary.
				Where(kvp => EqualityComparer<TValue>.Default.Equals(kvp.Value, value)).
				Select(kvp => (KeyValuePair<TKey, TValue>?)kvp).
				FirstOrDefault();

			if (match != null)
			{
				key = match.Value.Key;
				return true;
			}

			key = default;

			return false;
		}
	}
}
