	using System.Collections.Generic;

	using Skyline.DataMiner.Scripting;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	public static class InterfacesHelper
	{
		public static object[] GetInterfaceAliasDetails(SLProtocol protocol)
		{
			uint[] interfaceColumnsToGet = new uint[]
			{
				Parameter.Interfacetable.Idx.interfaceindex_2801,
				Parameter.Interfacetable.Idx.interfacedescr_2802,
				Parameter.Interfacetable.Idx.interfacealiasdetailed_2813,
			};

			return (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Interfacetable.tablePid, interfaceColumnsToGet);
		}

		public static object[] GetInterfaceIndexAndDescriptionColumns(SLProtocol protocol)
		{
			uint[] columnIdx = new uint[]
			{
				Parameter.Interfacetable.Idx.interfaceindex_2801,
				Parameter.Interfacetable.Idx.interfacedescr_2802,
			};

			return (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Interfacetable.tablePid, columnIdx);
		}

		public static Dictionary<string, InterfaceTableCustomParams> GetInterfaceTableCustomParamsByKey(SLProtocol protocol)
		{
			uint[] customIfTableColumnIdx = new uint[]
			{
				Parameter.Interfacetable.Idx.interfaceindex_2801,
				Parameter.Interfacetable.Idx.interfacemonitoringenabled_2825,
				Parameter.Interfacetable.Idx.interfaceoperstatusdescription_2826,
				Parameter.Interfacetable.Idx.interfacepollpolicymap_2830,
				Parameter.Interfacetable.Idx.interfacepollstaticjoin_2831,
				Parameter.Interfacetable.Idx.interfacedmcustominterfacedescription_2832,
				Parameter.Interfacetable.Idx.interfacecost_2833,
			};

			object[] customIfTableColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Interfacetable.tablePid, customIfTableColumnIdx);

			object[] keyColumn = (object[])customIfTableColumns[0];
			object[] monitoringEnabledColumn = (object[])customIfTableColumns[1];
			object[] operatorStatusDescriptionColumn = (object[])customIfTableColumns[2];
			object[] pollPolicyMapColumn = (object[])customIfTableColumns[3];
			object[] pollStaticJoinColumn = (object[])customIfTableColumns[4];
			object[] customDescription = (object[])customIfTableColumns[5];
			object[] cost = (object[])customIfTableColumns[6];

			var result = new Dictionary<string, InterfaceTableCustomParams>(keyColumn.Length);

			for (int i = 0; i < keyColumn.Length; i++)
			{
				var interfaceTableCustomParams = new InterfaceTableCustomParams
				{
					MonitoringEnabled = Convert.ToBoolean(monitoringEnabledColumn[i]),
					OperatorStatusDescription = Convert.ToString(operatorStatusDescriptionColumn[i]),
					PollPolicyMap = Convert.ToInt32(pollPolicyMapColumn[i]),
					PollStaticJoin = Convert.ToInt32(pollStaticJoinColumn[i]),
					DmCustomDescription = Convert.ToString(customDescription[i]),
					Cost = Convert.ToInt32(cost[i]),
				};

				result.Add((string)keyColumn[i], interfaceTableCustomParams);
			}

			return result;
		}

		public static object[] GetInterfaceVlans(SLProtocol protocol)
		{
			return (object[])((object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Interfacetable.tablePid, new uint[] { Parameter.Interfacetable.Idx.interfacevlan_2834 }))[0];
		}

		public static object[] GetPreviousInterfaceState(SLProtocol protocol)
		{
			return (object[])((object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Interfacetable.tablePid, new uint[] { Parameter.Interfacetable.Idx.interfacepreviousoperationstate_2836 }))[0];
		}

		public static void SetDetailedIfVlansToNA(SLProtocol protocol)
		{
			var keys = Skyline.Protocol.Api.InterfaceTable.GetKeys(protocol);
			Skyline.Protocol.Api.InterfaceTable.Vlan.SetValue(protocol, keys, "-1");
		}
	}
}
