namespace Skyline.DataMiner.Scripting
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using QAction_1.Interfaces;

	using Resources;

	using Skyline.DataMiner.Library.Common.Interfaces;

	public class InterfaceTablesMerger
	{
		private const uint MaxReportableIfSpeed = UInt32.MaxValue;

		private const int NotApplicable = -1;

		private const double SpeedLimitForCounters = 20000000;

		private readonly SLProtocolExt protocol;

		private Dot3StatsTable dot3StatsTable;

		private IfTable ifTable;

		private IfXTable ifxTable;

		private Dictionary<string, InterfaceTableCustomParams> interfaceTableCustomParamsByKey;

		private Dictionary<string, InterfacetableQActionRow> interfaceTableRowsMap;

		private Dictionary<string, IftablerxQActionRow> rxTableRowsMap;

		private Dictionary<string, IftabletxQActionRow> txTableRowsMap;

		public InterfaceTablesMerger(SLProtocolExt protocol)
		{
			this.protocol = protocol;
		}

		public void MergeInterfaceTables()
		{
			ifTable = new IfTable(protocol);
			ifxTable = new IfXTable(protocol);
			if (ifTable.Keys.Length == 0 || ifxTable.IfIndex.Length == 0)
			{
				// Prevent table getting cleared for DCF connections if communication would fail
				return;
			}

			dot3StatsTable = new Dot3StatsTable(protocol);
			interfaceTableCustomParamsByKey = InterfacesHelper.GetInterfaceTableCustomParamsByKey(protocol);

			interfaceTableRowsMap = new Dictionary<string, InterfacetableQActionRow>();
			rxTableRowsMap = new Dictionary<string, IftablerxQActionRow>();
			txTableRowsMap = new Dictionary<string, IftabletxQActionRow>();
			var displayNamesOfInterfaces = new List<string>();

			MergeFromSnmpItfTable();

			MergeFromSnmpItfxTable();

			MergeFromSnmpDot3StatusTable();

			foreach (string key in interfaceTableRowsMap.Keys)
			{
				CalculateCustomBitRateAndUtilizationColumns(key);

				// prevent fill array from clearing these custom columns
				KeepCustomColumnsOfInterfaceTable(key);
				int displayKeyFormat = Convert.ToInt32(protocol.Detailedinterfacedisplaykeyformat_501);
				string displayKey = GetDisplayName(interfaceTableRowsMap[key], displayKeyFormat);
				displayNamesOfInterfaces.Add(displayKey);

				// Fill DisplayKey. It's now being done via QAction
				interfaceTableRowsMap[key].Interfacedescription_2824 = displayKey;
				rxTableRowsMap[key].Iftablerxdescriptionrx_3018 = displayKey;
				txTableRowsMap[key].Iftabletxdescriptiontx_3220 = displayKey;
			}

			List<string> disabledInterfaces = protocol.GetDisabledInterfaces();
			Dictionary<string, MeasurementconfigurationtableQActionRow> measurementConfigTableRowsMap = GetMeasurementConfigTableRowsMap(interfaceTableRowsMap, disabledInterfaces);

			protocol.measurementconfigurationtable.FillArray(measurementConfigTableRowsMap.Values.Cast<QActionTableRow>().ToArray());

			protocol.interfacetable.FillArray(interfaceTableRowsMap.Where(x => !disabledInterfaces.Contains(x.Key)).Select(x => x.Value).Cast<QActionTableRow>().ToArray());
			protocol.iftablerx.FillArray(rxTableRowsMap.Where(x => !disabledInterfaces.Contains(x.Key)).Select(x => x.Value).Cast<QActionTableRow>().ToArray());
			protocol.iftabletx.FillArray(txTableRowsMap.Where(x => !disabledInterfaces.Contains(x.Key)).Select(x => x.Value).Cast<QActionTableRow>().ToArray());

			protocol.SetParameter(Parameter.interfacesnames_326, String.Join(";", displayNamesOfInterfaces));
		}

		private static string GetDisplayName(InterfacetableQActionRow interfaceTableRow, int displayKeyFormat)
		{
			if (displayKeyFormat.Equals(0) || String.IsNullOrEmpty(Convert.ToString(interfaceTableRow.Interfacedmcustominterfacedescription_2832)))
			{
				return interfaceTableRow.Interfacedescr_2802 + "/" + interfaceTableRow.Interfacealiasdetailed_2813;
			}

			return interfaceTableRow.Interfacedescr_2802 + "/" + interfaceTableRow.Interfacealiasdetailed_2813 + "/" + interfaceTableRow.Interfacedmcustominterfacedescription_2832;
		}

		private static double GetJoinedBitrate(double inBitrate, double outBitrate, DuplexStatus duplexStatus)
		{
			switch ((int)duplexStatus)
			{
				case (int)DuplexStatus.HalfDuplex:
				case (int)DuplexStatus.Unknown:
				case NotApplicable: // (N/A) to allow bitrates on loopback and virtual adapters that do not have an entry in the dot3 table
					return inBitrate == NotApplicable ? NotApplicable : inBitrate + outBitrate;

				case (int)DuplexStatus.FullDuplex:
					return Math.Max(inBitrate, outBitrate);

				default:
					return NotApplicable;
			}
		}

		private static double GetSplitUtilization(double bitrate, double speed)
		{
			if (bitrate == NotApplicable || speed == NotApplicable)
			{
				return NotApplicable;
			}

			return bitrate / speed * 100;
		}

		private static void Use32BitCounters(
			InterfacetableQActionRow interfaceTableRow,
			IftablerxQActionRow rxTableRow,
			IftabletxQActionRow txTableRow,
			IfXTable ifxTable,
			int i)
		{
			rxTableRow.Iftablerxinmulticastpkts_3022 = ifxTable.IfInMulticastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfInMulticastPkts[i]);

			rxTableRow.Iftablerxinbroadcastpkts_3023 = ifxTable.IfInBroadcastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfInBroadcastPkts[i]);

			txTableRow.Iftabletxoutmulticastpkts_3224 = ifxTable.IfOutMulticastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfOutMulticastPkts[i]);

			txTableRow.Iftabletxoutbroadcastpkts_3225 = ifxTable.IfOutBroadcastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfOutBroadcastPkts[i]);

			double dBitrateIn = Convert.ToDouble(ifxTable.IfBitRateIn[i]);

			if (dBitrateIn < NotApplicable)
			{
				// indication of discontinuity times, need to set values to N/A
				rxTableRow.Iftablerxbitraterx_3011 = NotApplicable;
				txTableRow.Iftabletxbitratetx_3213 = NotApplicable;
				interfaceTableRow.Interfaceutilizationprcnt_2823 = NotApplicable;
			}
		}

		private static void Use64BitCounters(
			InterfacetableQActionRow interfaceTableRow,
			IftablerxQActionRow rxTableRow,
			IftabletxQActionRow txTableRow,
			IfXTable ifxTable,
			int i)
		{
			rxTableRow.Iftablerxinoctetsrx_3003 = ifxTable.IfHcInOctets[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfHcInOctets[i]);

			rxTableRow.Iftablerxinucastpktsrx_3004 = ifxTable.IfHcInUcastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfHcInUcastPkts[i]);

			rxTableRow.Iftablerxinmulticastpkts_3022 = ifxTable.IfHcInMulticastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfHcInMulticastPkts[i]);

			rxTableRow.Iftablerxinbroadcastpkts_3023 = ifxTable.IfHcInBroadcastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfHcInBroadcastPkts[i]);

			txTableRow.Iftabletxoutoctetstx_3203 = ifxTable.IfHcOutOctets[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfHcOutOctets[i]);

			txTableRow.Iftabletxoutucastpktstx_3204 = ifxTable.IfHcOutUcastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfHcOutUcastPkts[i]);

			txTableRow.Iftabletxoutmulticastpkts_3224 = ifxTable.IfHcOutMulticastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfHcOutMulticastPkts[i]);

			txTableRow.Iftabletxoutbroadcastpkts_3225 = ifxTable.IfHcOutBroadcastPkts[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfHcOutBroadcastPkts[i]);

			interfaceTableRow.Interfaceutilizationprcnt_2823 = Convert.ToDouble(ifxTable.IfBandwidthUtilization[i]);

			double dBitrateIn = Convert.ToDouble(ifxTable.IfBitRateIn[i]);
			double dBitrateOut = Convert.ToDouble(ifxTable.IfBitRateOut[i]);

			if (dBitrateIn >= 0)
			{
				rxTableRow.Iftablerxbitraterx_3011 = dBitrateIn / 1000000;
			}
			else
			{
				rxTableRow.Iftablerxbitraterx_3011 = NotApplicable;
			}

			if (dBitrateOut >= 0)
			{
				txTableRow.Iftabletxbitratetx_3213 = dBitrateOut / 1000000;
			}
			else
			{
				txTableRow.Iftabletxbitratetx_3213 = NotApplicable;
			}
		}

		private void CalculateCustomBitRateAndUtilizationColumns(string key)
		{
			var interfaceTableRow = interfaceTableRowsMap[key];
			var rxTableRow = rxTableRowsMap[key];
			var txTableRow = txTableRowsMap[key];

			var duplexState = (DuplexStatus)Convert.ToInt32(interfaceTableRow.Interfacedot3statsduplexstatus_2812);

			if (rxTableRow.Iftablerxbitraterx_3011 == null)
			{
				return;
			}

			if (txTableRow.Iftabletxbitratetx_3213 == null)
			{
				return;
			}

			if (interfaceTableRow.Interfacebandwidth_2815 == null)
			{
				return;
			}

			double inBitrate = Convert.ToDouble(rxTableRow.Iftablerxbitraterx_3011);
			double outBitrate = Convert.ToDouble(txTableRow.Iftabletxbitratetx_3213);
			double speed = Convert.ToDouble(interfaceTableRow.Interfacebandwidth_2815);

			interfaceTableRow.Interfaceutilizationif_2816 = GetJoinedBitrate(inBitrate, outBitrate, duplexState);
			rxTableRow.Iftablerxbitrateperctrx_3017 = GetSplitUtilization(inBitrate, speed);
			txTableRow.Iftabletxbitratepercttx_3219 = GetSplitUtilization(outBitrate, speed);
		}

		private Dictionary<string, MeasurementconfigurationtableQActionRow> GetMeasurementConfigTableRowsMap(
			Dictionary<string, InterfacetableQActionRow> interfaceTableRowsMap,
			IEnumerable<string> disabledInterfaces)
		{
			return interfaceTableRowsMap
				.ToDictionary(
					x => x.Key,
					x => new MeasurementconfigurationtableQActionRow
					{
						Measurementconfigurationindex_17901 = x.Value.Interfaceindex_2801,
						Measurementconfigurationdescription_17902 = x.Value.Interfacedescription_2824,
						Measurementconfigurationcustomdescription_17903 = x.Value.Interfacealiasdetailed_2813,
						Measurementconfigurationname_17904 = x.Value.Interfacedescr_2802,
						Measurementconfigurationmeasure_17905 = !disabledInterfaces.Contains(Convert.ToString(x.Value.Interfaceindex_2801)) ? 1 : 0,
						Measurementconfigurationifopstate_17906 = x.Value.Interfaceoperstatus_2808,
						Measurementconfigurationifadminstate_17907 = x.Value.Interfaceadminstatus_2807,
					});
		}

		private void IfOperStatusEvaluate(InterfacetableQActionRow interfaceTableRow, int columnPrevExtState)
		{
			object downAfterAdminDown = 11;
			object downAfterUp = 12;
			int valueCurrent = Convert.ToInt32(interfaceTableRow.Interfaceoperstatus_2808);

			if (valueCurrent == 2 && columnPrevExtState == 10)
			{
				interfaceTableRow.Interfaceextendedoperationstate_2835 = downAfterAdminDown; // Extended
				interfaceTableRow.Interfacepreviousoperationstate_2836 = downAfterAdminDown; // Previous
			}
			else if (valueCurrent == 2 && columnPrevExtState == 1)
			{
				interfaceTableRow.Interfaceextendedoperationstate_2835 = downAfterUp; // Extended
				interfaceTableRow.Interfacepreviousoperationstate_2836 = downAfterUp; // Previous
			}
			else
			{
				interfaceTableRow.Interfaceextendedoperationstate_2835 = valueCurrent; // Extended
				interfaceTableRow.Interfacepreviousoperationstate_2836 = valueCurrent; // Previous
			}
		}

		private void KeepCustomColumnsOfInterfaceTable(string key)
		{
			var interfaceTableRow = interfaceTableRowsMap[key];
			var interfacerxRow = rxTableRowsMap[key];
			var interfacetxRow = txTableRowsMap[key];

			if (interfaceTableCustomParamsByKey.TryGetValue(key, out var interfaceTableCustomParams))
			{
				interfaceTableRow.Interfacemonitoringenabled_2825 = interfaceTableCustomParams.MonitoringEnabled ? 1 : 0;
				interfaceTableRow.Interfaceoperstatusdescription_2826 = interfaceTableCustomParams.OperatorStatusDescription;
				interfaceTableRow.Interfacepollpolicymap_2830 = interfaceTableCustomParams.PollPolicyMap;
				interfaceTableRow.Interfacepollstaticjoin_2831 = interfaceTableCustomParams.PollStaticJoin;
				interfaceTableRow.Interfacedmcustominterfacedescription_2832 = interfaceTableCustomParams.DmCustomDescription;
				interfaceTableRow.Interfacecost_2833 = interfaceTableCustomParams.Cost;
				interfacerxRow.Iftablerxdmcustominterfacedescription_3024 = interfaceTableCustomParams.DmCustomDescription;
				interfacetxRow.Iftabletxdmcustominterfacedescription_3226 = interfaceTableCustomParams.DmCustomDescription;
			}
			else
			{
				interfaceTableRow.Interfacemonitoringenabled_2825 = 0;
				interfaceTableRow.Interfaceoperstatusdescription_2826 = null;
				interfaceTableRow.Interfacepollpolicymap_2830 = 0;
				interfaceTableRow.Interfacepollstaticjoin_2831 = 0;
				interfaceTableRow.Interfacedmcustominterfacedescription_2832 = String.Empty;
				interfaceTableRow.Interfacecost_2833 = -1;
				interfacerxRow.Iftablerxdmcustominterfacedescription_3024 = String.Empty;
				interfacetxRow.Iftabletxdmcustominterfacedescription_3226 = String.Empty;
			}
		}

		private void MergeFromSnmpDot3StatusTable()
		{
			for (int i = 0; i < dot3StatsTable.IfIndex.Length; i++)
			{
				string index = Convert.ToString(dot3StatsTable.IfIndex[i]);

				if (!interfaceTableRowsMap.TryGetValue(index, out var interfaceTableRow))
				{
					continue;
				}

				var rxTableRow = rxTableRowsMap[index];
				var txTableRow = txTableRowsMap[index];
				MergeRowFromSnmpDot3StatsTable(interfaceTableRow, rxTableRow, txTableRow, i);
			}
		}

		private void MergeFromSnmpItfTable()
		{
			object[] columnPrevExtState = InterfacesHelper.GetPreviousInterfaceState(protocol);

			int[] previousExtStates = columnPrevExtState.Any() ? columnPrevExtState.Select(value => Convert.ToInt32(value)).ToArray() : Enumerable.Repeat(0, ifTable.Keys.Length).ToArray();

			double uptime = Convert.ToDouble(protocol.GetParameter(Parameter.sysuptime_102));

			var restartedTime = DateTime.Now.Subtract(TimeSpan.FromSeconds(uptime));

			for (int i = 0; i < ifTable.Keys.Length; i++)
			{
				var interfaceTableRow = new InterfacetableQActionRow();
				var rxTableRow = new IftablerxQActionRow();
				var txTableRow = new IftabletxQActionRow();
				int value = -1;

				if (previousExtStates.Length > i)
				{
					value = previousExtStates[i];
				}

				MergeRowFromSnmpItfTable(interfaceTableRow, rxTableRow, txTableRow, i, value, restartedTime);

				interfaceTableRowsMap.Add(Convert.ToString(ifTable.Keys[i]), interfaceTableRow);
				rxTableRowsMap.Add(Convert.ToString(ifTable.Keys[i]), rxTableRow);
				txTableRowsMap.Add(Convert.ToString(ifTable.Keys[i]), txTableRow);
			}
		}

		private void MergeFromSnmpItfxTable()
		{
			for (int i = 0; i < ifxTable.IfIndex.Length; i++)
			{
				string index = Convert.ToString(ifxTable.IfIndex[i]);

				if (!interfaceTableRowsMap.TryGetValue(index, out var interfaceTableRow))
				{
					continue;
				}

				var rxTableRow = rxTableRowsMap[index];
				var txTableRow = txTableRowsMap[index];
				MergeRowFromSnmpItfxTable(interfaceTableRow, rxTableRow, txTableRow, i);
			}
		}

		private void MergeRowFromSnmpDot3StatsTable(
			InterfacetableQActionRow interfaceTableRow,
			IftablerxQActionRow rxTableRow,
			IftabletxQActionRow txTableRow,
			int i)
		{
			interfaceTableRow.Interfacedot3statsduplexstatus_2812 = dot3StatsTable.IfDuplexStatus[i] == null
				? NotApplicable
				: Convert.ToDouble(dot3StatsTable.IfDuplexStatus[i]);

			rxTableRow.Iftablerxalignmenterrorsrx_3009 = dot3StatsTable.IfAlignmentErrors[i] == null
				? NotApplicable
				: Convert.ToDouble(dot3StatsTable.IfAlignmentErrors[i]);

			rxTableRow.Iftablerxfcserrorsrx_3010 = dot3StatsTable.IfFcsErrors[i] == null
				? NotApplicable
				: Convert.ToDouble(dot3StatsTable.IfFcsErrors[i]);

			txTableRow.Iftabletxsinglecollisionframestx_3209 = dot3StatsTable.IfSingleCollisionFrames[i] == null
				? NotApplicable
				: Convert.ToDouble(dot3StatsTable.IfSingleCollisionFrames[i]);

			txTableRow.Iftabletxmultiplecollisionframestx_3210 = dot3StatsTable.IfMultipleCollisionFrames[i] == null
				? NotApplicable
				: Convert.ToDouble(dot3StatsTable.IfMultipleCollisionFrames[i]);

			txTableRow.Iftabletxlatecollisionstx_3211 = dot3StatsTable.IfLateCollisions[i] == null
				? NotApplicable
				: Convert.ToDouble(dot3StatsTable.IfLateCollisions[i]);

			txTableRow.Iftabletxexcessivecollisionstx_3212 = dot3StatsTable.IfExcessiveCollisions[i] == null
				? NotApplicable
				: Convert.ToDouble(dot3StatsTable.IfExcessiveCollisions[i]);
		}

		private void MergeRowFromSnmpItfTable(
			InterfacetableQActionRow interfaceTableRow,
			IftablerxQActionRow rxTableRow,
			IftabletxQActionRow txTableRow,
			int i,
			int columnPrevExtState,
			DateTime restartedTime)
		{
			// Setting N/A on columns that later will be retrieved from the dot3stats table.
			// This is necessary because some (Proprietary Virtual, Software Loopback) interfaces are missing from that table.
			interfaceTableRow.Interfacedot3statsduplexstatus_2812 = NotApplicable;
			rxTableRow.Iftablerxalignmenterrorsrx_3009 = NotApplicable;
			rxTableRow.Iftablerxfcserrorsrx_3010 = NotApplicable;
			txTableRow.Iftabletxsinglecollisionframestx_3209 = NotApplicable;
			txTableRow.Iftabletxmultiplecollisionframestx_3210 = NotApplicable;
			txTableRow.Iftabletxlatecollisionstx_3211 = NotApplicable;
			txTableRow.Iftabletxexcessivecollisionstx_3212 = NotApplicable;

			interfaceTableRow.Interfaceindex_2801 = Convert.ToString(ifTable.Keys[i]);
			rxTableRow.Iftablerxindexrx_3001 = Convert.ToString(ifTable.Keys[i]);
			rxTableRow.Iftablerxfk2800_3025 = Convert.ToString(ifTable.Keys[i]);
			txTableRow.Iftabletxindextx_3201 = Convert.ToString(ifTable.Keys[i]);
			txTableRow.Iftabletxfk2800_3227 = Convert.ToString(ifTable.Keys[i]);

			interfaceTableRow.Interfacedescr_2802 = Convert.ToString(ifTable.IfDescriptions[i]);
			rxTableRow.Iftablerxdescrrx_3002 = Convert.ToString(ifTable.IfDescriptions[i]);
			txTableRow.Iftabletxdescrtx_3202 = Convert.ToString(ifTable.IfDescriptions[i]);

			interfaceTableRow.Interfacetype_2803 = Convert.ToDouble(ifTable.IfTypes[i]);
			interfaceTableRow.Interfacemtu_2804 = Convert.ToDouble(ifTable.IfMtus[i]);
			interfaceTableRow.Interfacephysaddress_2806 = Convert.ToString(ifTable.IfPhysAddress[i]);

			long adminStatus = Convert.ToInt64(ifTable.IfAdminStatus[i]);
			interfaceTableRow.Interfaceadminstatus_2807 = adminStatus;

			if (adminStatus == 2 || adminStatus == 3)
			{
				interfaceTableRow.Interfaceoperstatus_2808 = 10; // Admin Down
			}
			else
			{
				interfaceTableRow.Interfaceoperstatus_2808 = Convert.ToDouble(ifTable.IfOperStatus[i]);
			}

			IfOperStatusEvaluate(interfaceTableRow, columnPrevExtState);

			var lastChange = restartedTime.Add(TimeSpan.FromSeconds(Convert.ToDouble(ifTable.IfLastChange[i]) / 100));

			interfaceTableRow.Interfacelastchange_2809 = lastChange.ToOADate();

			rxTableRow.Iftablerxindiscardsrx_3006 = Convert.ToDouble(ifTable.IfInDiscards[i]);
			interfaceTableRow.Interfaceinerrors_2810 = Convert.ToDouble(ifTable.IfInErrors[i]);
			interfaceTableRow.Interfaceerrorrxrate_2818 = Convert.ToDouble(ifTable.IfInErrorRates[i]);
			rxTableRow.Iftablerxinunknownprotosrx_3007 = Convert.ToDouble(ifTable.IfInUnknownProtos[i]);

			txTableRow.Iftabletxoutdiscardstx_3206 = Convert.ToDouble(ifTable.IfOutDiscards[i]);
			interfaceTableRow.Interfaceouterrors_2811 = Convert.ToDouble(ifTable.IfOutErrors[i]);
			interfaceTableRow.Interfaceerrortxrate_2819 = Convert.ToDouble(ifTable.IfOutErrorRates[i]);

			rxTableRow.Iftablerxinnucastpktsrx_3005 = Convert.ToDouble(ifTable.IfInNUcastpkts[i]);
			txTableRow.Iftabletxoutnucastpktstx_3205 = Convert.ToDouble(ifTable.IfOutNUcastpkts[i]);

			rxTableRow.Iftablerxindiscardsrxrate_3021 = Convert.ToDouble(ifTable.IfInDiscardsRate[i]);
			txTableRow.Iftabletxoutdiscardstxrate_3223 = Convert.ToDouble(ifTable.IfOutDiscardsRate[i]);

			txTableRow.Iftabletxoutqlen_3207 = Convert.ToDouble(ifTable.IfOutPacketQueue[i]);

			object[] vlans = InterfacesHelper.GetInterfaceVlans(protocol);

			if (vlans != null && vlans.Length > i)
			{
				interfaceTableRow.Interfacevlan_2834 = Convert.ToString(vlans[i]);
			}

			interfaceTableRow.Interfacespeed_2805 = Convert.ToDouble(ifTable.IfSpeeds[i]);

			if (Convert.ToUInt32(ifTable.IfSpeeds[i]) < MaxReportableIfSpeed)
			{
				// Speed in ifTable is expressed in bps, whereas speed in Interface table is expressed in Mbps.
				interfaceTableRow.Interfacebandwidth_2815 = Convert.ToDouble(ifTable.IfSpeeds[i]) / 1000000;
			}

			if (Convert.ToDouble(ifTable.IfSpeeds[i]) > SpeedLimitForCounters)
			{
				return; // This means we should use the 64-bit versions.
			}

			rxTableRow.Iftablerxinoctetsrx_3003 = Convert.ToDouble(ifTable.IfInOctets[i]);
			rxTableRow.Iftablerxinucastpktsrx_3004 = Convert.ToDouble(ifTable.IfInUcastpkts[i]);
			rxTableRow.Iftablerxpacketraterx_3014 = Convert.ToDouble(ifTable.IfInPacketRate[i]);
			txTableRow.Iftabletxoutoctetstx_3203 = Convert.ToDouble(ifTable.IfOutOctets[i]);
			txTableRow.Iftabletxoutucastpktstx_3204 = Convert.ToDouble(ifTable.IfOutUcastpkts[i]);
			txTableRow.Iftabletxpacketratetx_3216 = Convert.ToDouble(ifTable.IfOutPacketRate[i]);

			interfaceTableRow.Interfaceutilizationprcnt_2823 = Convert.ToDouble(ifTable.IfBandwidthUtilization[i]);

			double dBitRateIn = Convert.ToDouble(ifTable.IfBitRateIn[i]);

			if (dBitRateIn >= 0)
			{
				rxTableRow.Iftablerxbitraterx_3011 = dBitRateIn / 1000000;
			}
			else
			{
				rxTableRow.Iftablerxbitraterx_3011 = NotApplicable;
			}

			double dBitRateOut = Convert.ToDouble(ifTable.IfBitRateOut[i]);

			if (dBitRateOut >= 0)
			{
				txTableRow.Iftabletxbitratetx_3213 = dBitRateOut / 1000000;
			}
			else
			{
				txTableRow.Iftabletxbitratetx_3213 = NotApplicable;
			}
		}

		private void MergeRowFromSnmpItfxTable(
			InterfacetableQActionRow interfaceTableRow,
			IftablerxQActionRow rxTableRow,
			IftabletxQActionRow txTableRow,
			int i)
		{
			interfaceTableRow.Interfacepromiscuousmode_2827 = ifxTable.IfPromiscuousMode[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfPromiscuousMode[i]);

			interfaceTableRow.Interfacephysicalconnector_2828 = ifxTable.IfConnectorPresent[i] == null
				? NotApplicable
				: Convert.ToDouble(ifxTable.IfConnectorPresent[i]);

			interfaceTableRow.Interfacealiasdetailed_2813 = Convert.ToString(ifxTable.IfAlias[i]);
			rxTableRow.Iftablerxaliasrx_3008 = Convert.ToString(ifxTable.IfAlias[i]);
			txTableRow.Iftabletxaliastx_3208 = Convert.ToString(ifxTable.IfAlias[i]);

			interfaceTableRow.Interfacecounterdiscontinuitytime_2829 =
				Convert.ToDouble(ifxTable.IfCounterDiscontinuitytime[i]) / 100;

			interfaceTableRow.Interfacelinkupdowntrapenabledetailed_2814 =
				Convert.ToDouble(ifxTable.IfLinkUpDownTrapEnable[i]);

			if (interfaceTableRow.Interfacebandwidth_2815 == null)
			{
				interfaceTableRow.Interfacebandwidth_2815 = ifxTable.IfHighSpeed[i] == null
					? NotApplicable
					: Convert.ToDouble(ifxTable.IfHighSpeed[i]);
			}

			if (rxTableRow.Iftablerxpacketraterx_3014 == null)
			{
				rxTableRow.Iftablerxpacketraterx_3014 = ifxTable.IfInPacketRate[i] == null
					? NotApplicable
					: Convert.ToDouble(ifxTable.IfInPacketRate[i]);
			}

			if (txTableRow.Iftabletxpacketratetx_3216 == null)
			{
				txTableRow.Iftabletxpacketratetx_3216 = ifxTable.IfOutPacketRate[i] == null
					? NotApplicable
					: Convert.ToDouble(ifxTable.IfOutPacketRate[i]);
			}

			if (rxTableRow.Iftablerxinoctetsrx_3003 == null)
			{
				Use64BitCounters(interfaceTableRow, rxTableRow, txTableRow, ifxTable, i);
			}
			else
			{
				Use32BitCounters(interfaceTableRow, rxTableRow, txTableRow, ifxTable, i);
			}
		}
	}
}
