//---------------------------------
// IpIgmpSnooping\ContextMenu.cs
//---------------------------------
namespace IpIgmpSnooping
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using Resources;

	using Skyline.DataMiner.Scripting;
	using Skyline.Protocol;

	public class ContextMenu
	{
		public static void AddIpIgmpCommand(SLProtocol protocol, string vlan)
		{
			string command = BuildCommand(vlan);

			var apiTableCommands = protocol.GetApiTableCommands();

			if (apiTableCommands.Contains(command))
			{
				protocol.ShowInformationMessage("IP IGMP Snooping command already exists for VLAN " + vlan);

				return;
			}

			AddNewCommand(protocol, command);
			UpdateActiveCommands(protocol, command, apiTableCommands);

			protocol.CheckTrigger(9609);
		}

		public static void RemoveAllCommands(SLProtocol protocol)
		{
			var apiRowKeysToDelete = protocol.GetApiPollingKeysToCommands()
				.Where(x => x.Value.Command.Contains(Commands.IpIgmpSnoopingCommand))
				.Select(x => x.Key)
				.ToList();

			if (apiRowKeysToDelete.Count > 0)
			{
				protocol.DeleteRow(Parameter.Pollingtable.tablePid, apiRowKeysToDelete);
			}

			var snoopingKeysDelete = protocol.GetIpIgmpSnoopingKeysToVlans().Select(x => x.Key).ToList();
			Table.UnlinkRowsFromKeys(protocol, snoopingKeysDelete);

			protocol.ClearAllKeys(Parameter.Ipigmpsnoopingtable.tablePid);
			protocol.SetParameter(Parameter.ipigmpactivecommands_9801, String.Empty);
		}

		public static void RemoveFromActiveCommands(SLProtocol protocol, string command)
		{
			string activeCommands = Convert.ToString(protocol.GetParameter(Parameter.ipigmpactivecommands_9801));
			var activeCommandsSplitted = activeCommands.Split(';').ToList();

			activeCommandsSplitted.Remove(command);

			string updatedActiveCommands = String.Join(";", activeCommandsSplitted);

			protocol.SetParameter(Parameter.ipigmpactivecommands_9801, updatedActiveCommands);
		}

		public static void RemoveIpIgmpCommand(SLProtocol protocol, string vlan)
		{
			string command = BuildCommand(vlan);

			var apiRow = protocol.GetApiPollingKeysToCommands().FirstOrDefault(x => x.Value.Command == command);

			if (apiRow.Key == null || !apiRow.Value.CanDeleteRow(protocol))
			{
				return;
			}

			UpdateResourcesAndSnoopingTables(protocol, command);
			protocol.DeleteRow(Parameter.Pollingtable.tablePid, apiRow.Key);
		}

		public static void UpdateActiveCommands(SLProtocol protocol, string newCommand, List<string> apiTableCommands)
		{
			apiTableCommands.Add(newCommand);
			var activeCommands = apiTableCommands.Where(x => x.Contains(Commands.IpIgmpSnoopingCommand)).Select(x => Commands.ExtractVlan(x));
			string activeCommandsJoined = String.Join(";", activeCommands);
			protocol.SetParameter(Parameter.ipigmpactivecommands_9801, activeCommandsJoined);
		}

		public static void UpdateResourcesAndSnoopingTables(SLProtocol protocol, string command)
		{
			var snoopingRows = protocol.GetIpIgmpSnoopingKeysToVlans();

			var snoopingKeysDelete = new List<string>();

			foreach (var snoopingRow in snoopingRows)
			{
				if (String.IsNullOrWhiteSpace(snoopingRow.Value) || command.Contains(snoopingRow.Value))
				{
					snoopingKeysDelete.Add(snoopingRow.Key);
				}
			}

			RemoveFromActiveCommands(protocol, command);
			protocol.DeleteRow(Parameter.Ipigmpsnoopingtable.tablePid, snoopingKeysDelete);
			Table.UnlinkRowsFromKeys(protocol, snoopingKeysDelete);
		}

		private static void AddNewCommand(SLProtocol protocol, string command)
		{
			var newCommandRow = new PollingtableQActionRow
			{
				Pollinginstance = Guid.NewGuid().ToString(),
				Pollingcommand = command,
				Pollingcommunicationtype = (int)Commands.ApiCommunicationTypes.CliSsh,
				Pollingfrequency = 60,
				Pollingstatus = 1,
				Pollinginformation = "-1",
				Pollinglastpolled = -1,
			};

			protocol.AddRow(Parameter.Pollingtable.tablePid, newCommandRow);
		}

		private static string BuildCommand(string vlan)
		{
			return String.Join(" ", Commands.IpIgmpSnoopingCommand, vlan);
		}
	}
}
