namespace Skyline.Protocol
{
	using System;
	using System.Collections.Generic;

	using IpIgmpSnooping;

	using Skyline.DataMiner.Scripting;

	public class IgmpData
	{
		public IgmpData(string vlan, string groupAddressMc, string groupAddressSource, string version, string type, string portList)
		{
			Vlan = vlan;
			GroupAddressMc = groupAddressMc;
			GroupAddressSource = groupAddressSource;
			Version = version;
			Type = type;
			PortList = portList;
			GroupAddressSourceList = new List<string>();
		}

		public IgmpData()
		{
			GroupAddressSourceList = new List<string>();
		}

		public string GroupAddressMc { get; set; }

		public string GroupAddressSource { get; set; }

		public List<string> GroupAddressSourceList { get; set; }

		public string PortList { get; set; }

		public string Type { get; set; }

		public string Version { get; set; }

		public string Vlan { get; set; }

		public void AddSnoopingRow(List<IpigmpsnoopingtableQActionRow> snoopingRows, int index, IgmpData row, string sourceAddress, Format format, Dictionary<string, IpIgmpSnoopingTableData> tableData, List<string> snoopingPrimaryKeys)
		{
			string instance = $"{row.Vlan}/{index}";
			snoopingPrimaryKeys.Add(instance);
			bool existingRow = tableData.TryGetValue(instance, out var data);

			var snoopingRow = new IpigmpsnoopingtableQActionRow
			{
				Ipigmpsnoopinginstance_9501 = instance,
				Ipigmpsnoopingvlan_9502 = row.Vlan,
				Ipigmpsnoopinggroupaddress_9503 = row.GroupAddressMc,
				Ipigmpsnoopingversion_9504 = row.Version,
				Ipigmpsnoopingtype_9505 = row.Type,
				Ipigmpsnoopingportlist_9506 = row.PortList,
				Ipigmpsnoopinggroupaddresssource_9507 = sourceAddress,
				Ipigmpsnoopingdisplaykey_9509 = instance,
				Ipigmpsnoopinglabel_9508 = existingRow ? data.Label : String.Empty,
				Ipigmpsnoopingresourceforeignkey_9510 = existingRow ? data.ForeignKey : "-1",
			};

			if (format.Equals(Format.Instance_Label) && !String.IsNullOrEmpty(data?.Label))
			{
				snoopingRow.Ipigmpsnoopingdisplaykey_9509 = $"{instance}/{data.Label}";
			}

			snoopingRows.Add(snoopingRow);
		}

		internal virtual int AddRowOrRows(List<IpigmpsnoopingtableQActionRow> snoopingRows, int index, Format format, Dictionary<string, IpIgmpSnoopingTableData> ipIgmpSnoopingTableData, List<string> snoopingPrimaryKeys)
		{
			return index;
		}

		internal virtual IgmpData BuildPreviousRow(IgmpData previousRow)
		{
			return previousRow;
		}
	}
}
//---------------------------------
// IpIgmpSnooping\IgmpDataWithoutType.cs
//---------------------------------
namespace Skyline.Protocol
{
	using System.Collections.Generic;

	using IpIgmpSnooping;

	using Skyline.DataMiner.Scripting;

	public class IgmpDataWithoutType : IgmpData
	{
		public IgmpDataWithoutType(string vlan, string groupAddressMc, string version) : base(vlan, groupAddressMc, "-1", version, "-1", "-1")
		{
		}

		internal override int AddRowOrRows(List<IpigmpsnoopingtableQActionRow> snoopingRows, int index, Format format, Dictionary<string, IpIgmpSnoopingTableData> ipIgmpSnoopingTableData, List<string> snoopingPrimaryKeys)
		{
			foreach (string sourceAdress in GroupAddressSourceList)
			{
				index++;
				AddSnoopingRow(snoopingRows, index, this, sourceAdress, format, ipIgmpSnoopingTableData, snoopingPrimaryKeys);
			}

			return index;
		}

		internal override IgmpData BuildPreviousRow(IgmpData previousRow)
		{
			return this;
		}
	}
}
//---------------------------------
// IpIgmpSnooping\IgmpDataWithoutVlan.cs
//---------------------------------
namespace Skyline.Protocol
{
	public class IgmpDataWithoutVlan : IgmpData
	{
		public IgmpDataWithoutVlan(string groupAddressSource, string type, string portList) : base("-1", "-1", groupAddressSource, "-1", type, portList)
		{
		}

		internal override IgmpData BuildPreviousRow(IgmpData previousRow)
		{
			previousRow.GroupAddressSourceList.Add(GroupAddressSource);

			if (previousRow.Type == "-1")
			{
				previousRow.Type = Type;
				previousRow.PortList = PortList;
			}

			return previousRow;
		}
	}
}
//---------------------------------
// IpIgmpSnooping\IgmpDataWithoutVlanAndGroup.cs
//---------------------------------
namespace Skyline.Protocol
{
	public class IgmpDataWithoutVlanAndGroup : IgmpData
	{
		public IgmpDataWithoutVlanAndGroup(string type, string portList) : base("-1", "-1", "-1", "-1", type, portList)
		{
		}

		internal override IgmpData BuildPreviousRow(IgmpData previousRow)
		{
			string portList = previousRow.PortList;
			previousRow.PortList = portList + ";" + PortList;

			return previousRow;
		}
	}
