namespace IpIgmpSnooping
{
	using System;
	using System.Collections.Generic;

	using Skyline.DataMiner.Scripting;
	using Skyline.Protocol;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	public class IpIgmpSnoopingTable
	{
		public static List<ExpectedsnoopingQActionRow> GetIpIgmpSnoopingTableAsExpectedRows(SLProtocol protocol)
		{
			var data = new List<ExpectedsnoopingQActionRow>();
			uint[] colsToGet = new uint[]
			{
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinginstance_9501,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopingvlan_9502,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinggroupaddress_9503,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopingportlist_9506,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinggroupaddresssource_9507,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopingresourceforeignkey_9510,
			};

			object[] ipIgmpSnoopingTable = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Ipigmpsnoopingtable.tablePid, colsToGet);

			if (ipIgmpSnoopingTable == null || ipIgmpSnoopingTable.Length != 6)
			{
				return data;
			}

			object[] ipIgmpSnoopingInstances = (object[])ipIgmpSnoopingTable[0];
			object[] ipIgmpSnoopingVlan = (object[])ipIgmpSnoopingTable[1];
			object[] ipIgmpSnoopingGroupAddress = (object[])ipIgmpSnoopingTable[2];
			object[] ipIgmpSnoopingPortList = (object[])ipIgmpSnoopingTable[3];
			object[] ipIgmpSnoopingGroupAddressSource = (object[])ipIgmpSnoopingTable[4];
			object[] ipIgmpSnoopingForeignKey = (object[])ipIgmpSnoopingTable[5];

			if (Common.CheckIfOneColumnIsNull(new List<object[]> { ipIgmpSnoopingInstances, ipIgmpSnoopingVlan, ipIgmpSnoopingGroupAddress, ipIgmpSnoopingPortList, ipIgmpSnoopingGroupAddressSource, ipIgmpSnoopingForeignKey }))
			{
				return data;
			}

			for (int i = 0; i < ipIgmpSnoopingInstances.Length; i++)
			{
				var ipIgmpSnoopingTableData = new ExpectedsnoopingQActionRow
				{
					Expectedsnoopingid_10101 = Convert.ToString(ipIgmpSnoopingInstances[i]),
					Expectedsnoopingvlan_10103 = Convert.ToString(ipIgmpSnoopingVlan[i]),
					Expectedsnoopinggroupaddress_10104 = Convert.ToString(ipIgmpSnoopingGroupAddress[i]),
					Expectedsnoopingsourcegroupaddress_10105 = Convert.ToString(ipIgmpSnoopingGroupAddressSource[i]),
					Expectedsnoopingportchannel_10106 = Convert.ToString(ipIgmpSnoopingPortList[i]),
					Expectedsnoopingresourceforeignkey_10107 = Convert.ToString(ipIgmpSnoopingForeignKey[i]),
				};

				data.Add(ipIgmpSnoopingTableData);
			}

			return data;
		}

		/// <summary>
		///     Get the Label and Resource Foreign Key columns as a Dictionary.
		/// </summary>
		/// <param name="protocol">Link to Skyline DataMiner</param>
		public static Dictionary<string, IpIgmpSnoopingTableData> GetLabelsAndForeignKeys(SLProtocol protocol)
		{
			var data = new Dictionary<string, IpIgmpSnoopingTableData>();
			uint[] colsToGet = new uint[]
			{
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinginstance_9501,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinglabel_9508,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopingresourceforeignkey_9510,
			};

			object[] ipIgmpSnoopingTable = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Ipigmpsnoopingtable.tablePid, colsToGet);

			if (ipIgmpSnoopingTable == null || ipIgmpSnoopingTable.Length <= 2)
			{
				return data;
			}

			object[] ipIgmpSnoopingInstances = (object[])ipIgmpSnoopingTable[0];
			object[] ipIgmpSnoopingLabels = (object[])ipIgmpSnoopingTable[1];
			object[] ipIgmpSnoopingForeignKeys = (object[])ipIgmpSnoopingTable[2];

			if (ipIgmpSnoopingInstances == null || ipIgmpSnoopingLabels == null || ipIgmpSnoopingForeignKeys == null)
			{
				return data;
			}

			for (int i = 0; i < ipIgmpSnoopingInstances.Length; i++)
			{
				var ipIgmpSnoopingTableData = new IpIgmpSnoopingTableData { Label = Convert.ToString(ipIgmpSnoopingLabels[i]), ForeignKey = Convert.ToString(ipIgmpSnoopingForeignKeys[i]) };
				data.Add(Convert.ToString(ipIgmpSnoopingInstances[i]), ipIgmpSnoopingTableData);
			}

			return data;
		}

		/// <summary>
		///     Compose and fill in the DisplayKey of the table using the selected format.
		/// </summary>
		/// <param name="protocol">Link to Skyline DataMiner.</param>
		/// <param name="formatDisplayKey">The selected format of the displayKey.</param>
		public static void SetDisplayKeys(SLProtocolExt protocol, Format formatDisplayKey)
		{
			uint[] colsToGet = new uint[]
			{
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinginstance_9501,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinglabel_9508,
			};

			object[] ipIgmpSnoopingTable = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Ipigmpsnoopingtable.tablePid, colsToGet);
			object[] ipIgmpSnoopingInstances = (object[])ipIgmpSnoopingTable[0];
			object[] ipIgmpSnoopingLabels = (object[])ipIgmpSnoopingTable[1];

			var lsPks = new List<string>();
			var lsDks = new List<object>();

			for (int i = 0; i < ipIgmpSnoopingInstances.Length; i++)
			{
				string sInstance = Convert.ToString(ipIgmpSnoopingInstances[i]);
				string sDisplayKey = sInstance; // default value

				if (formatDisplayKey.Equals(Format.Instance_Label))
				{
					sDisplayKey += "/" + Convert.ToString(ipIgmpSnoopingLabels[i]);
				}

				lsPks.Add(sInstance);
				lsDks.Add(sDisplayKey);
			}

			protocol.ipigmpsnoopingtable.SetColumn(Parameter.Ipigmpsnoopingtable.Pid.ipigmpsnoopingdisplaykey_9509, lsPks.ToArray(), lsDks.ToArray());
		}
	}
