namespace QAction_1
{
	using System;
	using System.Collections.Generic;
	using System.Linq;
	using System.Xml.Linq;

	using Skyline.DataMiner.Scripting;
	using Skyline.Protocol;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	public class IpInterfaceBrief
	{
		private readonly SLProtocol _protocol;

		public IpInterfaceBrief(SLProtocol protocol)
		{
			_protocol = protocol;
		}

		private enum ActiveState
		{
			Main = 0,

			Standby = 1,
		}

		public void ProcessShowHsrpBrief(XElement response)
		{
			var data = new List<ShowHsrpBriefData>();
			string[] existingInterfaceNames = _protocol.GetKeys(Parameter.Ipinterfacebrieftable.tablePid);

			foreach (var row in response.Descendants("ROW_grp_detail"))
			{
				string interfaceName = row.Element("sh_if_index").Value;

				if (!existingInterfaceNames.Contains(interfaceName))
				{
					continue;
				}

				data.Add(GetShowHsrpBriefData(interfaceName, row));
			}

			if (data.Any())
			{
				object[] keys = data.Select(o => o.InterfaceName as object).ToArray();

				object[] columnInfo = new object[]
				{
					Parameter.Ipinterfacebrieftable.tablePid,
					Parameter.Ipinterfacebrieftable.Pid.ipinterfacebriefstandbyipaddress_12903,
					Parameter.Ipinterfacebrieftable.Pid.ipinterfacebriefactive_12904,
					Parameter.Ipinterfacebrieftable.Pid.ipinterfacebriefgroupaddress_12907,
				};

				object[] values = new object[]
				{
					keys, data.Select(o => o.StandbyIpAddress as object).ToArray(), data.Select(o => o.Active as object).ToArray(), data.Select(o => o.GroupAddress as object).ToArray(),
				};

				_protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnInfo, values);
			}
		}

		public void ProcessShowInterface(XElement response)
		{
			var data = new List<ShowInterfaceData>();
			string[] existingInterfaceNames = _protocol.GetKeys(Parameter.Ipinterfacebrieftable.tablePid);

			foreach (var row in response.Descendants("ROW_interface"))
			{
				string interfaceName = row.Element("interface").Value;
				bool isEthernet = interfaceName.StartsWith("Ethernet");

				if (isEthernet)
				{
					interfaceName = interfaceName.Replace("Ethernet", "Eth");
				}

				if (!existingInterfaceNames.Contains(interfaceName))
				{
					continue;
				}

				data.Add(GetShowInterfaceData(interfaceName, row, isEthernet));
			}

			if (data.Any())
			{
				object[] keys = data.Select(o => o.InterfaceName as object).ToArray();

				object[] columnInfo = new object[]
				{
					Parameter.Ipinterfacebrieftable.tablePid,
					Parameter.Ipinterfacebrieftable.Pid.ipinterfacebriefipaddress_12902,
					Parameter.Ipinterfacebrieftable.Pid.ipinterfacebriefmacaddress_12905,
					Parameter.Ipinterfacebrieftable.Pid.ipinterfacebriefsubnet_12906,
				};

				object[] values = new object[]
				{
					keys, data.Select(o => o.IpAddress as object).ToArray(), data.Select(o => o.MacAddress as object).ToArray(), data.Select(o => o.Subnet as object).ToArray(),
				};

				_protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnInfo, values);
			}
		}

		public void ProcessShowIpInterfaceBrief(XElement response)
		{
			var tableRows = new List<object[]>();
			string[] interfaceNamesInTable = _protocol.GetKeys(Parameter.Ipinterfacebrieftable.tablePid);
			var existingInterfaceNames = new List<string>();

			foreach (var row in response.Descendants("ROW_intf"))
			{
				string interfaceName = row.Element("intf-name").Value;
				existingInterfaceNames.Add(interfaceName);

				if (interfaceName == "Lo0" || interfaceNamesInTable.Contains(interfaceName))
				{
					continue;
				}

				var tableRow = new IpinterfacebrieftableQActionRow
				{
					Ipinterfacebrieftableinterface_12901 = interfaceName,
					Ipinterfacebriefipaddress_12902 = "-1",
					Ipinterfacebriefstandbyipaddress_12903 = "-1",
					Ipinterfacebriefactive_12904 = -1,
					Ipinterfacebriefmacaddress_12905 = "-1",
					Ipinterfacebriefsubnet_12906 = "-1",
					Ipinterfacebriefgroupaddress_12907 = "-1",
				};

				tableRows.Add(tableRow.ToObjectArray());
			}

			if (tableRows.Any())
			{
				_protocol.FillArray(Parameter.Ipinterfacebrieftable.tablePid, tableRows, NotifyProtocol.SaveOption.Partial);
			}

			List<string> obsoleteInterfaceNames = interfaceNamesInTable.Where(i => !existingInterfaceNames.Any(e => e == i)).ToList();
			if (obsoleteInterfaceNames.Any())
			{
				_protocol.DeleteRow(Parameter.Ipinterfacebrieftable.tablePid, obsoleteInterfaceNames.ToArray());
			}
		}

		private ShowHsrpBriefData GetShowHsrpBriefData(string interfaceName, XElement row)
		{
			var data = new ShowHsrpBriefData
			{
				InterfaceName = interfaceName,
				GroupAddress = row.Element("sh_vip").Value,
			};

			if (row.Element("sh_group_state").Value == "Active")
			{
				data.Active = ActiveState.Main;
				data.StandbyIpAddress = row.Element("sh_standby_router_addr").Value;
			}
			else
			{
				data.Active = ActiveState.Standby;
				data.StandbyIpAddress = row.Element("sh_active_router_addr").Value;
			}

			return data;
		}

		private ShowInterfaceData GetShowInterfaceData(string interfaceName, XElement row, bool isEthernet)
		{
			string ipElementName;
			string maskBitsElementName;
			string macAddressElementName;

			if (isEthernet)
			{
				ipElementName = "eth_ip_addr";
				maskBitsElementName = "eth_ip_mask";
				macAddressElementName = "eth_hw_addr";
			}
			else
			{
				ipElementName = "svi_ip_addr";
				maskBitsElementName = "svi_ip_mask";
				macAddressElementName = "svi_mac";
			}

			string ipAddress = row.Element(ipElementName).Value;
			int maskBits = Convert.ToInt32(row.Element(maskBitsElementName).Value);
			string macAddress = row.Element(macAddressElementName).Value;

			var data = new ShowInterfaceData
			{
				InterfaceName = interfaceName,
				IpAddress = ipAddress,
				Subnet = GetSubnetCidrNotation(ipAddress, maskBits),
				MacAddress = Common.CleanMacAddress(macAddress),
			};

			return data;
		}

		private string GetSubnetCidrNotation(string ipAddress, int maskBits)
		{
			string[] ipBytes = ipAddress.Split('.');

			if (ipBytes.Length != 4)
			{
				return ipAddress;
			}

			byte[] networkAddressParts = new byte[4];
			int mask = Int32.MaxValue << (32 - maskBits);

			for (int i = 0; i <= 3; i++)
			{
				if (!Byte.TryParse(ipBytes[i], out byte ipByte))
				{
					return ipAddress;
				}

				int bitsToRightShift = (3 - i) * 8;

				networkAddressParts[i] = (byte)(ipByte & (mask >> bitsToRightShift));
			}

			return $"{String.Join(".", networkAddressParts)}/{maskBits}";
		}

		private class ShowHsrpBriefData
		{
			public ActiveState Active { get; set; }

			public string GroupAddress { get; set; }

			public string InterfaceName { get; set; }

			public string StandbyIpAddress { get; set; }
		}

		private class ShowInterfaceData
		{
			public string InterfaceName { get; set; }

			public string IpAddress { get; set; }

			public string MacAddress { get; set; }

			public string Subnet { get; set; }
		}
	}
}
