namespace QAction_1
{
	using System;
	using System.Collections.Generic;
	using System.Xml.Linq;

	using Skyline.DataMiner.Scripting;
	using Skyline.Protocol;

	public class MacAddresses
	{
		private readonly SLProtocol _protocol;

		public MacAddresses(SLProtocol protocol)
		{
			_protocol = protocol;
		}

		public void ProcessShowMacAddressTable(XElement response)
		{
			var tableRows = new List<object[]>();

			foreach (var row in response.Descendants("ROW_mac_address"))
			{
				string vlanId = row.Element("disp_vlan").Value;
				string macAddress = Common.CleanMacAddress(row.Element("disp_mac_addr").Value);

				var tableRow = new MacaddresstableQActionRow
				{
					Macaddressinstance_1901 = $"{vlanId}/{macAddress}",
					Macaddresstablemacaddress_1902 = macAddress,
					Macaddressvlanid_1903 = vlanId,
					Macaddressports_1904 = row.Element("disp_port").Value,
					Macaddresstype_1905 = row.Element("disp_type").Value,
					Macaddressage_1906 = GetAge(row.Element("disp_age").Value),
					Macaddresssecure_1907 = row.Element("disp_is_secure").Value == "T" ? 1 : 0,
					Macaddressnotify_1908 = row.Element("disp_is_ntfy").Value == "T" ? 1 : 0,
				};

				tableRows.Add(tableRow.ToObjectArray());
			}

			_protocol.FillArray(Parameter.Macaddresstable.tablePid, tableRows, NotifyProtocol.SaveOption.Full);
		}

		private static int GetAge(string age)
		{
			Int32.TryParse(age, out int ageNum);

			return ageNum;
		}
	}
}
