namespace QAction_1.Nbm
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using Resources;

	using Skyline.DataMiner.Scripting;

	public class NbmInterface
	{
		public NbmInterface(string name, List<string> multicastIps, List<string> sourceIps)
		{
			Name = name;
			MulticastIps = multicastIps;
			SourceIps = sourceIps;
		}

		public List<string> MulticastIps { get; set; }

		public string Name { get; set; }

		public List<string> SourceIps { get; set; }

		public static List<NbmInterface> GetNbmInterfaces(List<NbmRowData> nbmRows)
		{
			var nbmInterfaces = new List<NbmInterface>();

			foreach (var nbmRow in nbmRows)
			{
				var nbmRowInterfaces = GetNbmRowInterfaces(nbmRow);

				if (nbmRowInterfaces.Count == 0)
				{
					continue;
				}

				foreach (string nbmRowInterface in nbmRowInterfaces)
				{
					var nbmInterfaceData = Exists(nbmInterfaces, nbmRowInterface);

					if (nbmInterfaceData == null)
					{
						CreateNbmInterface(nbmInterfaces, nbmRow, nbmRowInterface);

						continue;
					}

					UpdateNbmInterface(nbmRow, nbmInterfaceData);
				}
			}

			return nbmInterfaces;
		}

		private static void CreateNbmInterface(List<NbmInterface> nbmInterfaces, NbmRowData nbmRow, string nbmRowInterface)
		{
			var newNbmInterface = new NbmInterface(nbmRowInterface, new List<string> { nbmRow.MulticastIp }, new List<string> { nbmRow.SourceIp });
			nbmInterfaces.Add(newNbmInterface);
		}

		private static NbmInterface Exists(List<NbmInterface> nbmInterfaces, string nbmInterfaceName)
		{
			return nbmInterfaces.FirstOrDefault(x => x.Name.Equals(nbmInterfaceName));
		}

		private static List<string> GetNbmRowInterfaces(NbmRowData nbmRow)
		{
			var nbmRowIntf = new List<string>();

			if (!String.IsNullOrWhiteSpace(nbmRow.SourceIntf))
			{
				nbmRowIntf.Add(nbmRow.SourceIntf);
			}

			if (!String.IsNullOrWhiteSpace(nbmRow.EgressIntf))
			{
				string[] egressIntf = nbmRow.EgressIntf.Split(new[] { ',', ' ' }, StringSplitOptions.RemoveEmptyEntries);
				nbmRowIntf.AddRange(egressIntf);
			}

			return nbmRowIntf.Select(x => UpdateInterfaceName(x)).ToList();
		}

		private static string UpdateInterfaceName(string ipAddress)
		{
			return ipAddress.Replace("Eth", "Ethernet");
		}

		private static void UpdateNbmInterface(NbmRowData nbmRow, NbmInterface nbmInterfaceData)
		{
			if (!nbmInterfaceData.MulticastIps.Contains(nbmRow.MulticastIp))
			{
				nbmInterfaceData.MulticastIps.Add(nbmRow.MulticastIp);
			}

			if (!nbmInterfaceData.SourceIps.Contains(nbmRow.SourceIp))
			{
				nbmInterfaceData.SourceIps.Add(nbmRow.SourceIp);
			}
		}
	}

	public class NbmRowData
	{
		public NbmRowData(string multicastIp, string sourceIp, string sourceIntf, string egressIntf)
		{
			MulticastIp = multicastIp;
			SourceIp = sourceIp;
			SourceIntf = sourceIntf;
			EgressIntf = egressIntf;
		}

		public string EgressIntf { get; set; }

		public string MulticastIp { get; set; }

		public string SourceIntf { get; set; }

		public string SourceIp { get; set; }

		public static List<NbmRowData> GetNbmFlows(SLProtocolExt protocol)
		{
			int tablePid = Parameter.Nbmflowstable.tablePid;

			uint[] columnsIdx = new uint[]
			{
				Parameter.Nbmflowstable.Idx.nbmflowsmcastgrp_14102,
				Parameter.Nbmflowstable.Idx.nbmflowssrcip_14103,
				Parameter.Nbmflowstable.Idx.nbmflowssrcintf_14104,
				Parameter.Nbmflowstable.Idx.nbmflowsoifs_14111,
			};

			NbmRowData returnSelector(string multicastIp, string sourceIp, string sourceInt, string egressInt)
			{
				return new NbmRowData(multicastIp, sourceIp, sourceInt, egressInt);
			}

			return protocol.GetColumns(tablePid, columnsIdx, (Func<string, string, string, string, NbmRowData>)returnSelector).ToList();
		}
	}
}
