namespace QAction_1.NbmStatistics
{
	using System;

	using QAction_1.RateCalculator;

	using Skyline.DataMiner.Scripting;

	public class Statistics
	{
		public static double CalculateNbmBandwidth(double currentBitrate, int bandwidth)
		{
			return currentBitrate / bandwidth * 100;
		}

		public static double GetCurrentBitrateInMegaBitsPerSecond(RateCalculatorHelper rateCalculatorHelper, string key, object octetValue, DateTime now)
		{
			return ConvertBitsToMegaBitsPerSecond(CalculateBitrate(rateCalculatorHelper, key, octetValue, now));
		}

		private static double ConvertBitsToMegaBitsPerSecond(double bitsPerSecond)
		{
			return bitsPerSecond / 1_000_000;
		}

		private static double CalculateBitrate(RateCalculatorHelper rateCalculatorHelper, string key, object octetValue, DateTime currentTimestampUtc)
		{
			rateCalculatorHelper.LoadConfiguration(Parameter.Nbmflowstable.tablePid, Parameter.Nbmflowstable.Idx.nbmflowsbitrateondatesdata_14118, key, octetValue);

			double octetRate = Convert.ToDouble(rateCalculatorHelper.CalculateOctetRate(currentTimestampUtc));
			return octetRate > 0 ? octetRate * 8 : octetRate;
		}
	}
}
