namespace QAction_1.OpenConfig
{
	using System;
	using System.Text.RegularExpressions;

	/// <summary>
	/// Helpers class that is used to create the display key for the interfaces table.
	/// </summary>
	public static class DisplayKeyUtil
	{
		/// <summary>
		/// Expands the name into a more readable name.
		/// </summary>
		/// <param name="name">Name of the interface.</param>
		/// <returns>Expanded name.</returns>
		public static string ExpandName(string name)
		{
			var m = Regex.Match(name, @"^(?<tag>(lo|eth))\d+(\/\d+)*$");

			if (m.Success)
			{
				string tag = m.Groups["tag"].Value;

				string expandedTag = String.Empty;

				switch (tag)
				{
					case "eth":
						expandedTag = "Ethernet";
						break;

					case "lo":
						expandedTag = "loopback";
						break;

					default:

						// Do nothing.
						break;
				}

				string expandedName = name.Replace(tag, expandedTag);

				return expandedName;
			}
			else
			{
				return name;
			}
		}

		/// <summary>
		/// Creates the display key based on the incoming values.
		/// </summary>
		/// <param name="name">Name of the interface.</param>
		/// <param name="description">Description of the interface.</param>
		/// <returns>The created display key.</returns>
		public static string GetDisplayKey(string name, string description)
		{
			string displayKey = ExpandName(name) + "/" + description;

			return displayKey;
		}
	}
}
//---------------------------------
// PollingTableExtensions.cs
//---------------------------------
namespace QAction_1
{
	using System;
	using System.Collections.Generic;

	using Skyline.DataMiner.Scripting;
	using Skyline.Protocol;

	public static class PollingTableExtensions
	{
		public static void HandleWriteApiPollingPollNow(this SLProtocolExt protocol, object[] row)
		{
			if (!Convert.ToBoolean(Convert.ToInt32(row[4])))
			{
				return;
			}

			var commandRow = new CommandRow
			{
				Instance = Convert.ToString(row[0]),
				Command = Convert.ToString(row[1]),
				TimeStamp = Convert.ToDouble(row[6]),
			};

			int value = Convert.ToInt32(row[2]);

			if (value.Equals(1))
			{
				Commands.SendCommands(protocol, new List<CommandRow> { commandRow }, new List<CommandRow>(), new List<CommandRow>(), new List<CommandRow>());
			}
			else if (value.Equals(3))
			{
				Commands.SendCommands(protocol, new List<CommandRow>(), new List<CommandRow>(), new List<CommandRow> { commandRow }, new List<CommandRow>());
			}
			else
			{
				Commands.SendCommands(protocol, new List<CommandRow>(), new List<CommandRow>(), new List<CommandRow>(), new List<CommandRow> { commandRow });
			}
		}
	}
}
