namespace QAction_1.RateCalculator
{
	using System;

	using Skyline.DataMiner.Scripting;
	using Skyline.DataMiner.Utils.Rates.Common;
	using Skyline.DataMiner.Utils.SafeConverters;

	public class RateCalculatorHelper
	{
		private readonly RateCalculatorGetter getter;
		private readonly TimeSpan maxDelta;
		private readonly TimeSpan minDelta;
		private readonly RateCalculatorSetter setter;

		public RateCalculatorHelper(SLProtocol protocol, TimeSpan minimumDelta, TimeSpan maximumDelta)
		{
			minDelta = minimumDelta;
			maxDelta = maximumDelta;
			getter = new RateCalculatorGetter(protocol);
			setter = new RateCalculatorSetter(protocol);
		}

		public double CalculateOctetRate(DateTime currentTimestampUtc)
		{
			ulong octetCount = SafeConvert.ToUInt64(Convert.ToDouble(getter.OctetValue));
			double octetRate;

			// Based on DateTime (typically used with HTTP, serial...)
			Rate64OnDateTime rate64OnDatesHelper = Rate64OnDateTime.FromJsonString(Convert.ToString(getter.OctetRateOnDatesData), minDelta, maxDelta);
			octetRate = rate64OnDatesHelper.Calculate(octetCount, currentTimestampUtc);
			setter.UpdateDatesData(rate64OnDatesHelper);
			return octetRate;
		}

		public void LoadConfiguration(int tablePid, int dataRateIdx, string key, object octetValue)
		{
			getter.LoadGetConfigurationData(tablePid, dataRateIdx, key, octetValue);
			setter.LoadSetConfigurationData(tablePid, dataRateIdx, key);
		}
	}
}
