	using System.Linq;

	using Skyline.DataMiner.Scripting;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	public static class SLProtocolExtensions
	{
		private static readonly Type DateTimeType = typeof(DateTime);

		/// <summary>
		///     Converts an object to the desired type.
		/// </summary>
		/// <typeparam name="T">Type of the result.</typeparam>
		/// <param name="obj">Object to convert.</param>
		/// <returns>The converted object.</returns>
		public static T ChangeType<T>(this object obj) where T : IConvertible
		{
			if (obj == null)
			{
				return default;
			}

			var type = typeof(T);

			if (type.IsEnum)
			{
				return (T)Enum.ToObject(type, obj.ChangeType<int>());
			}

			if (type == DateTimeType)
			{
				object date = DateTime.FromOADate(Convert.ToDouble(obj));

				return (T)date;
			}

			return (T)Convert.ChangeType(obj, type);
		}

		public static void DeleteRow(this SLProtocol protocol, int tablePid, List<string> list)
		{
			if (list.Any())
			{
				protocol.DeleteRow(tablePid, list.ToArray());
			}
		}

		public static Dictionary<string, ApiPollingRow> GetApiPollingKeysToCommands(this SLProtocol protocol)
		{
			uint[] columnsToGet = new uint[]
			{
				Parameter.Pollingtable.Idx.pollinginstance_17201,
				Parameter.Pollingtable.Idx.pollingcommand_17202,
				Parameter.Pollingtable.Idx.pollingstatus_17205,
			};

			return protocol.GetColumns(
				Parameter.Pollingtable.tablePid,
				columnsToGet,
				(string idx, string apiCommand, bool status) => new ApiPollingRow { Key = idx, Command = apiCommand, Status = status }).ToDictionary(x => x.Key, x => x);
		}

		public static List<string> GetApiTableCommands(this SLProtocol protocol)
		{
			int apiTablePid = Parameter.Pollingtable.tablePid;

			uint[] apiTableCommandsIdx = new uint[] { Parameter.Pollingtable.Idx.pollingcommand_17202 };

			object[] commands = (object[])((object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, apiTablePid, apiTableCommandsIdx))[0];

			return commands.Select(command => Convert.ToString(command)).ToList();
		}

		public static Dictionary<string, double> GetColumnAsDictionary(this SLProtocol protocol, int iTableId, uint iKeysIndex, uint iColumnIdx)
		{
			object[] aoColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, iTableId, new[] { iKeysIndex, iColumnIdx });
			object[] aoKeys = (object[])aoColumns[0];
			object[] aoValues = (object[])aoColumns[1];

			var dictReturnValue = new Dictionary<string, double>();

			for (int i = 0; i < aoKeys.Length; i++)
			{
				dictReturnValue.Add(Convert.ToString(aoKeys[i]), Convert.ToDouble(aoValues[i]));
			}

			return dictReturnValue;
		}

		/// <summary>
		///     Gets five columns from a table and returns an array with the given selector.
		/// </summary>
		/// <typeparam name="T1">Type of the first Column.</typeparam>
		/// <typeparam name="T2">Type of the second Column.</typeparam>
		/// <typeparam name="TReturn">Type of the return value.</typeparam>
		/// <param name="protocol"><see cref="SLProtocol" /> instance used to communicate with DataMiner.</param>
		/// <param name="tableId">Id of the Table.</param>
		/// <param name="columnsIdx">Array with the Columns Indexes.</param>
		/// <param name="returnSelector">A function to map each column element to a return element.</param>
		/// <returns>An <see cref="IEnumerable{T}" /> of <typeparamref name="TReturn" /> with the desired columns.</returns>
		/// <exception cref="ArgumentOutOfRangeException">
		///     Number of columns doesn't match the number of returned members.
		/// </exception>
		public static IEnumerable<TReturn> GetColumns<T1, T2, TReturn>(
			this SLProtocol protocol,
			int tableId,
			uint[] columnsIdx,
			Func<T1, T2, TReturn> returnSelector)
			where T1 : IConvertible
			where T2 : IConvertible
		{
			if (protocol == null)
			{
				throw new ArgumentNullException("protocol");
			}

			if (columnsIdx == null)
			{
				throw new ArgumentNullException("columnsIdx");
			}

			if (returnSelector == null)
			{
				throw new ArgumentNullException("returnSelector");
			}

			if (columnsIdx.Length != 2)
			{
				throw new ArgumentOutOfRangeException(
					"columnsIdx",
					"Number of columns has to be 3");
			}

			object[] columns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, tableId, columnsIdx);

			for (int i = 0; i < ((object[])columns[0]).Length; i++)
			{
				yield return returnSelector(
					((object[])columns[0])[i].ChangeType<T1>(),
					((object[])columns[1])[i].ChangeType<T2>());
			}
		}

		/// <summary>
		///     Gets five columns from a table and returns an array with the given selector.
		/// </summary>
		/// <typeparam name="T1">Type of the first Column.</typeparam>
		/// <typeparam name="T2">Type of the second Column.</typeparam>
		/// <typeparam name="T3">Type of the third Column.</typeparam>
		/// <typeparam name="TReturn">Type of the return value.</typeparam>
