		/// <param name="returnSelector">A function to map each column element to a return element.</param>
		/// <returns>An <see cref="IEnumerable{T}" /> of <typeparamref name="TReturn" /> with the desired columns.</returns>
		/// <exception cref="ArgumentOutOfRangeException">
		///     Number of columns doesn't match the number of returned members.
		/// </exception>
		public static IEnumerable<TReturn> GetColumns<T1, T2, T3, TReturn>(this SLProtocol protocol, int tableId, uint[] columnsIdx, Func<T1, T2, T3, TReturn> returnSelector)
			where T1 : IConvertible where T2 : IConvertible where T3 : IConvertible
		{
			if (protocol == null)
			{
				throw new ArgumentNullException("protocol");
			}

			if (columnsIdx == null)
			{
				throw new ArgumentNullException("columnsIdx");
			}

			if (returnSelector == null)
			{
				throw new ArgumentNullException("returnSelector");
			}

			if (columnsIdx.Length != 3)
			{
				throw new ArgumentOutOfRangeException("columnsIdx", "Number of columns has to be 3");
			}

			object[] columns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, tableId, columnsIdx);

			for (int i = 0; i < ((object[])columns[0]).Length; i++)
			{
				yield return returnSelector(((object[])columns[0])[i].ChangeType<T1>(), ((object[])columns[1])[i].ChangeType<T2>(), ((object[])columns[2])[i].ChangeType<T3>());
			}
		}

		/// <summary>
		///     Gets five columns from a table and returns an array with the given selector.
		/// </summary>
