namespace Resources
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using Skyline.DataMiner.Scripting;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	public class Table
	{
		public static DeviceresourcetableQActionRow GenerateRow(List<string> existingNames)
		{
			string guid = Guid.NewGuid().ToString();

			return new DeviceresourcetableQActionRow
			{
				Deviceresourcetableindex = guid,
				Deviceresourcetablecustomname = GetCustomName(existingNames),
				Deviceresourcetablestaticjoinstablefk = "-1",
				Deviceresourcetableipigmpsnoopingtablefk_1105 = "-1",
			};
		}

		public static string GetCustomName(List<string> existingNames)
		{
			int couting = 0;
			int value = 1;
			int maxCount = existingNames.Count + 1;

			while (couting <= maxCount)
			{
				string toCheck = "Device " + value;

				if (!existingNames.Contains(toCheck))
				{
					existingNames.Add(toCheck);

					return toCheck;
				}

				value++;
				couting++;
			}

			return String.Empty;
		}

		/// <summary>
		///     Removes the link between a resource and the provided IP IGMP Snooping Table Rows.
		/// </summary>
		/// <param name="protocol">Link with the SLProtocol process.</param>
		/// <param name="ipIgmpRowsToUnlink">IP IGMP Snooping table row keys to unlink.</param>
		public static void UnlinkRowsFromKeys(SLProtocol protocol, List<string> ipIgmpRowsToUnlink)
		{
			uint[] indexes = new uint[]
			{
				Parameter.Deviceresourcetable.Idx.deviceresourcetableindex_1101,
				Parameter.Deviceresourcetable.Idx.deviceresourcetableipigmpsnoopingtablefk_1105,
			};
			var igmpKeyToResources = protocol.GetColumns(
					Parameter.Deviceresourcetable.tablePid,
					indexes,
					(string key, string igmpKey) => { return new { Key = key, IgmpKey = igmpKey }; }).GroupBy(x => x.IgmpKey)
				.ToDictionary(
					x => x.Key,
					x => x.Select(group => group.Key).ToList());

			var valuesToSet = new Dictionary<string, string>();

			foreach (string vlan in ipIgmpRowsToUnlink)
			{
				if (!igmpKeyToResources.TryGetValue(vlan, out var resourcesForVlan))
				{
					continue;
				}

				foreach (string resource in resourcesForVlan)
				{
					valuesToSet[resource] = "-1";
				}
			}

			protocol.NotifyProtocol(
				(int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN,
				new object[] { Parameter.Deviceresourcetable.tablePid, Parameter.Deviceresourcetable.Pid.deviceresourcetableipigmpsnoopingtablefk_1105 },
				new object[] { valuesToSet.Keys.ToArray<object>(), valuesToSet.Values.ToArray<object>() });
		}

		/// <summary>
		///     Removes the link between a resource and the provided Static Joins Table Rows.
		/// </summary>
		/// <param name="protocol">Link with the SLProtocol process.</param>
		/// <param name="staticJoinRowsToUnlink">Static Joins table row keys to unlink.</param>
		public static void UnlinkRowsFromKeysForStaticJoins(SLProtocol protocol, List<string> staticJoinRowsToUnlink)
		{
			uint[] indexes = new uint[]
			{
				Parameter.Deviceresourcetable.Idx.deviceresourcetableindex_1101,
				Parameter.Deviceresourcetable.Idx.deviceresourcetablestaticjoinstablefk_1103,
			};
			var staticJoinKeyToResources = protocol.GetColumns(
					Parameter.Deviceresourcetable.tablePid,
					indexes,
					(string key, string staticJoinKey) => { return new { Key = key, StaticJoinKey = staticJoinKey }; }).GroupBy(x => x.StaticJoinKey)
				.ToDictionary(
					x => x.Key,
					x => x.Select(group => group.Key).ToList());

			var valuesToSet = new Dictionary<string, string>();

			foreach (string vlan in staticJoinRowsToUnlink)
			{
				if (!staticJoinKeyToResources.TryGetValue(vlan, out var resourcesForInterfaceName))
				{
					continue;
				}

				foreach (string resource in resourcesForInterfaceName)
				{
					valuesToSet[resource] = "-1";
				}
			}

			protocol.NotifyProtocol(
				(int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN,
				new object[] { Parameter.Deviceresourcetable.tablePid, Parameter.Deviceresourcetable.Pid.deviceresourcetablestaticjoinstablefk_1103 },
				new object[] { valuesToSet.Keys.ToArray<object>(), valuesToSet.Values.ToArray<object>() });
		}
	}
}
