		internal enum DisplayKeyFormat
		{
			Name = 0,

			NameAndDescription = 1,
		}

		public class Response
		{
			private readonly Dictionary<string, string> flags = new Dictionary<string, string>
			{
				{ "D", "Down" },
				{ "P", "Up in port-channel" },
				{ "I", "Individual" },
				{ "H", "Hot-standby (LACP only)" },
				{ "s", "Suspended" },
				{ "r", "Module-removed" },
				{ "b", "BFD Session Wait" },
				{ "S", "Switched" },
				{ "R", "Routed" },
				{ "U", "Up" },
				{ "p", "Up in delay-lacp mode" },
				{ "M", "Not in use. Min-links not met" },
			};

			private readonly SLProtocolExt protocol;

			private readonly Dictionary<string, int> vlanStateMap = new Dictionary<string, int>
			{
				{ "active", 1 },
				{ "suspended", 2 },
			};

			public Response(SLProtocolExt protocol, string command, string response)
			{
				this.protocol = protocol;
				Command = command;
				FullResponse = response;
			}

			public string Command { get; set; }

			public string FullResponse { get; set; }

			public string Parse()
			{
				var response = XDocument.Parse(FullResponse).Root;

				switch (Command)
				{
					case "show ptp clock":
						Parse_PtpClock(response);

						break;

					case "show ptp clock foreign-masters record":
						Parse_PtpClockForeignMasterRecord(response);

						break;

					case "show ptp brief":
						Parse_PtpBrief(response);

						break;

					case "show ptp counters all":
						Parse_PtpCounters(response);

						break;

					case "show ptp parent":
						Parse_PtpParent(response);

						break;

					case "show ptp time-property":
						Parse_PtpTimeProperty(response);

						break;

					case "show ip igmp snooping groups 224.0.1.129":
						Parse_ShowIpIgmpSnoopingGroups(response);

						break;

					case "show interface transceiver details":
						Parse_InterfaceTransceiverDetails(response);

						break;

					case "show flow rtp details":
						Parse_FlowRtpDetails(response);

						break;

					case "show flow rtp errors active":
						Parse_FlowRtpErrorsActive(response);

						break;

					case "show ptp corrections":
						Parse_PtpCorrections(response);

						break;

					case "show interface":
						{
							Parse_InterfaceRate(response);
							var ipInterfaceBrief = new IpInterfaceBrief(protocol);
							ipInterfaceBrief.ProcessShowInterface(response);
						}

						break;

					case "show ip interface brief":
						{
							var ipInterfaceBrief = new IpInterfaceBrief(protocol);
							ipInterfaceBrief.ProcessShowIpInterfaceBrief(response);
						}

						break;

					case "show hsrp brief":
						{
							var ipInterfaceBrief = new IpInterfaceBrief(protocol);
							ipInterfaceBrief.ProcessShowHsrpBrief(response);
						}

						break;

					case "show mac address-table":
						var macAddresses = new MacAddresses(protocol);
						macAddresses.ProcessShowMacAddressTable(response);

						break;

					case "show nbm interface bandwidth":
						Parse_NbmInterfaces(response);

						break;

					case "show nbm flows detail":
						Parse_NbmFlows(response);

						break;

					case "show nbm flows statistics":
						Parse_NbmFlowsStatistics(response);

						break;

					case "show port-channel summary":
						ParsePortChannel(response);

						break;

					case "show vpc role":
						Parse_VpcRole(response);

						break;

					case "show clock":
						Parse_NtpClock(response);

						break;

					case "show ntp peer-status":
						Parse_NtpPeerStatus(response);

						break;

					case "show vlan brief":
						Parse_Vlan(response);

						break;

					default:
						protocol.Log("QA" + protocol.QActionID + "|Response.Parse|Unknown Command Type|" + Command, LogType.Error, LogLevel.NoLogging);

						return "communication problem";
				}

				return "Polled Successfully";
			}

