			private static object[] TransposeRowsToColumns(List<object[]> rows, bool discardNullValues = false)
			{
				if (rows == null)
				{
					throw new ArgumentNullException("rows");
				}

				if (rows.Count < 1)
				{
					return new object[] { };
				}

				object[][] tableRows = rows.ToArray();
				int columnCount = tableRows[0].Length;
				var columns = new List<object>();

				for (int i = 0; i < columnCount; i++)
				{
					if (!discardNullValues)
					{
						columns.Add(tableRows.Select(row => row[i]).ToArray());

						continue;
					}

					object[] column = tableRows.Select(row => row[i]).Where(cell => cell != null).ToArray();

					if (column.Length > 0)
					{
						columns.Add(column);
					}
				}

				return columns.ToArray();
			}

			private static void UpdateIfVlanMap(Dictionary<string, List<string>> ifVlanMap, string vlanId, string[] portsSplit)
			{
				foreach (string port in portsSplit)
				{
					if (String.IsNullOrWhiteSpace(port))
					{
						continue;
					}

					if (!ifVlanMap.ContainsKey(port))
					{
						ifVlanMap.Add(port, new List<string> { vlanId });
					}
					else
					{
						ifVlanMap[port].Add(vlanId);
					}
				}
			}

			private static double GetUptimeSeconds(string uptime)
			{
				string patternTimeOfDay = @"(\d+):(\d+):(\d+)";
				if (Regex.IsMatch(uptime, patternTimeOfDay))
				{
					var groups = Regex.Match(uptime, patternTimeOfDay).Groups;
					int hours = Convert.ToInt32(groups[1].Value);
					int minutes = Convert.ToInt32(groups[2].Value);
					int seconds = Convert.ToInt32(groups[3].Value);

					return (hours * 3600) + (minutes * 60) + seconds;
				}

				string patternDays = @"(\d+)d(\d+)h";
				if (Regex.IsMatch(uptime, patternDays))
				{
					var groups = Regex.Match(uptime, patternDays).Groups;
					int days = Convert.ToInt32(groups[1].Value);
					int hours = Convert.ToInt32(groups[2].Value);

					return ((days * 24) + hours) * 3600;
				}

				string patternWeeks = @"(\d+)w(\d+)d";
				if (Regex.IsMatch(uptime, patternWeeks))
				{
					var groups = Regex.Match(uptime, patternWeeks).Groups;
					int weeks = Convert.ToInt32(groups[1].Value);
					int days = Convert.ToInt32(groups[2].Value);

					return ((weeks * 7) + days) * 24 * 3600;
				}

				string patternMonths = @"(\d+)m(\d+)w";
				if (Regex.IsMatch(uptime, patternMonths))
				{
					var groups = Regex.Match(uptime, patternMonths).Groups;
					int months = Convert.ToInt32(groups[1].Value);
					int weeks = Convert.ToInt32(groups[2].Value);

					return ((months * 30.437) + (weeks * 7)) * 24 * 3600;
				}

				string patternYears = @"(\d+)y(\d+)m";
				if (Regex.IsMatch(uptime, patternYears))
				{
					var groups = Regex.Match(uptime, patternYears).Groups;
					int years = Convert.ToInt32(groups[1].Value);
					int months = Convert.ToInt32(groups[2].Value);

					return ((years * 12) + months) * 30.437 * 24 * 3600;
				}

				return 0;
			}

			private static double CalculatePacketRate(long currentPacketAmount, long oldPacketAmount, double timeDiffSeconds)
			{
				long packetsDiff = currentPacketAmount - oldPacketAmount;

				return packetsDiff / timeDiffSeconds;
			}

			private void DeleteExtraTableKeys(List<string> newRowKeys)
			{
				string[] nbmFlowKeys = protocol.nbmflowstable.Keys;

				if (nbmFlowKeys.Length == 0)
				{
					return;
				}

				var rowsToDelete = new List<string>();

				foreach (string key in nbmFlowKeys)
				{
					if (newRowKeys.Contains(key))
					{
						continue;
					}

					rowsToDelete.Add(key);
				}

				if (rowsToDelete.Count > 0)
				{
					protocol.DeleteRow(Parameter.Nbmflowstable.tablePid, rowsToDelete.ToArray());
				}
			}

			private Dictionary<string, double> GetColumnAsDictionary(int iTableId, uint iKeysIndex, uint iColumnIdx)
			{
				object[] aoColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, iTableId, new[] { iKeysIndex, iColumnIdx });
				object[] aoKeys = (object[])aoColumns[0];
				object[] aoValues = (object[])aoColumns[1];

				var dictReturnValue = new Dictionary<string, double>();

				for (int i = 0; i < aoKeys.Length; i++)
				{
					dictReturnValue.Add(Convert.ToString(aoKeys[i]), Convert.ToDouble(aoValues[i]));
				}

				return dictReturnValue;
			}

			private List<string> GetInterfaceBuffer()
			{
				string _buffer = Convert.ToString(protocol.GetParameter(Parameter.vlaninterfacebuffer));
				string[] buffer = _buffer.Split(';');

				return buffer.ToList();
			}

			private string GetPortList(IEnumerable<XElement> ports)
			{
				var portList = new StringBuilder();

				foreach (var port in ports)
				{
					string format = Xml.GetStringNode(port, "port");

					portList.Append(format);

					if (flags.TryGetValue(Xml.GetStringNode(port, "port-status"), out string portStatus))
					{
						portList.Append("(" + portStatus + ")");
					}

					portList.Append(";");
				}

				portList.Remove(portList.Length - 1, 1);

				return portList.ToString();
			}

			private Dictionary<string, NbmflowstableQActionRow> GetPreviousNbmFlowData()
			{
				uint[] columnsIdx = new uint[]
				{
					Parameter.Nbmflowstable.Idx.nbmflowsindex_14101,
					Parameter.Nbmflowstable.Idx.nbmflowsbwmbps_14109,
					Parameter.Nbmflowstable.Idx.nbmflowsbytes_14113,
					Parameter.Nbmflowstable.Idx.nbmflowsbitrate_14114,
				};

				var nbmFlowData = protocol.GetColumns(
					Parameter.Nbmflowstable.tablePid,
					columnsIdx,
					(string key, double bandwitdth, ulong bytes, double bitrate) =>
					{
						return new NbmflowstableQActionRow
						{
							Nbmflowsindex_14101 = key,
							Nbmflowsbwmbps_14109 = bandwitdth,
							Nbmflowsbytes_14113 = bytes,
							Nbmflowsbitrate_14114 = bitrate,
						};
					}).ToDictionary(x => x.Key);

				return nbmFlowData;
			}

			private List<string> GetPropertiesData()
			{
				uint[] propertyParamIds = new uint[]
				{
					Parameter.dcfnbmmulticastinterfaceproperty_14201,
					Parameter.dcfnbmsourceipinterfaceproperty_14202,
				};

				object[] propertiesData = (object[])protocol.GetParameters(propertyParamIds);

				var multicastAction = (PropertyAction)Convert.ToInt32(propertiesData[0]);
				var sourceIpAction = (PropertyAction)Convert.ToInt32(propertiesData[1]);

				var interfaceProperties = new List<string>();

				if (multicastAction == PropertyAction.AddDcfProperties)
				{
					interfaceProperties.Add("MC");
				}

				if (sourceIpAction == PropertyAction.AddDcfProperties)
				{
					interfaceProperties.Add("Source IP");
				}

				return interfaceProperties;
			}

			private string GetTimeSource(string rawTimeSource)
			{
				try
				{
					int startIndex = rawTimeSource.IndexOf("(", StringComparison.Ordinal);
					int endIndex = rawTimeSource.IndexOf(")", StringComparison.Ordinal);

					return rawTimeSource.Substring(startIndex + 1, endIndex - startIndex - 1).ToLower();
				}
				catch
				{
					protocol.Log("QA" + protocol.QActionID + "|GetTimeSource|Error parsing time-source", LogType.Error, LogLevel.NoLogging);

					return "na";
				}
			}

			private void Parse_FlowRtpDetails(XElement root)
			{
				var detailedInterfaces = DetailedInterface.GetDetailedInterfaces(protocol);
				var interfaceKeyMapping = detailedInterfaces.SafeToDictionary(x => x.Name);

				protocol.SetParameter(Parameter.rtp_flow_flowtimeout, Xml.GetIntNode(root, "flow-timeout"));

				var rows = new List<object[]>();

				foreach (var xRtpFlow in root.Descendants("ROW_flow_rtp"))
				{
					var rtp = RtpFlow.Parse(xRtpFlow);

					interfaceKeyMapping.TryGetValue(rtp.InterfaceName, out var intf);

					var row = new Rtp_flowQActionRow
					{
						Rtp_flow_index = rtp.Key,
						Rtp_flow_interfacefk = intf != null ? intf.Index : String.Empty,
						Rtp_flow_interfacerxfk = intf != null ? intf.Index : String.Empty,
						Rtp_flow_interfacetxfk = intf != null ? intf.Index : String.Empty,
						Rtp_flow_bridgedomainid = rtp.BridgeDomainId,
						Rtp_flow_bytespersec = rtp.BytesPerSec / 1024.0,
						Rtp_flow_bitspersec = rtp.BitsPerSec / 1024.0,
						Rtp_flow_destinationip = rtp.DestinationIp,
						Rtp_flow_destinationport = rtp.DestinationPort,
						Rtp_flow_flowindex = rtp.FlowIndex,
						Rtp_flow_flowtype = rtp.FlowType,
						Rtp_flow_interfacename = rtp.InterfaceName,
						Rtp_flow_packetcount = rtp.PacketCount,
						Rtp_flow_protocol = rtp.Protocol,
						Rtp_flow_sourceip = rtp.SourceIp,
						Rtp_flow_sourceport = rtp.SourcePort,
						Rtp_flow_starttime = rtp.StartTime,
					};

					rows.Add(row);
				}

				protocol.FillArray(Parameter.Rtp_flow.tablePid, rows, NotifyProtocol.SaveOption.Full);
			}

			private void Parse_FlowRtpErrorsActive(XElement root)
			{
				var rows = new List<object[]>();

				foreach (var xRtpFlow in root.Descendants("ROW_flow_rtp"))
