							Rtp_flow_errors_index = rtp.Key + "_" + i,
							Rtp_flow_errors_fk = rtp.Key,
							Rtp_flow_errors_lossstart = error.LossStart,
							Rtp_flow_errors_packetloss = error.PacketLoss,
						};

						rows.Add(row);
					}
				}

				protocol.FillArray(Parameter.Rtp_flow_errors.tablePid, rows, NotifyProtocol.SaveOption.Full);
			}

			private void Parse_InterfaceRate(XElement root)
			{
				var rows = root.Descendants("ROW_interface").ToList();
				var tableRows = new List<IfratetableQActionRow>();

				object[] aoName = new object[rows.Count];
				object[] aoDescription = new object[rows.Count];
				int count = 0;

				var disabledInterfaces = protocol.GetDisabledInterfaces();
				var displayKeyFormat = (DisplayKeyFormat)Convert.ToInt32(protocol.GetParameter(Parameter.ifratetabledisplaykeyformat_12498));

				foreach (var row in rows)
				{
					string index = Xml.GetStringNode(row, "interface");

					if (disabledInterfaces.Contains(index))
					{
						continue;
					}

					string description;

					switch (displayKeyFormat)
					{
						case DisplayKeyFormat.NameAndDescription:
							string desc = Xml.GetStringNode(row, "desc");

							if (desc == null)
							{
								description = index;
							}
							else
							{
								description = $"{index}/{desc}";
							}

							break;

						case DisplayKeyFormat.Name:
						default:
							description = index;

							break;
					}

					var tableRow = new IfratetableQActionRow
					{
						Ifrateindex = index,
						Ifratedescription_12532 = description,
						Ifrateloadintervaltx1 = Xml.GetDoubleNode(row, "eth_load_interval1_rx"),
						Ifrateinratebits1 = Convert.ToDouble(Xml.GetDoubleNode(row, "eth_inrate1_bits")) / 1000000.0,
						Ifrateinratepkts1 = Xml.GetDoubleNode(row, "eth_inrate1_pkts"),
						Ifrateloadintervalrx1 = Xml.GetDoubleNode(row, "eth_load_interval1_tx"),
						Ifrateoutratebits1 = Convert.ToDouble(Xml.GetDoubleNode(row, "eth_outrate1_bits")) / 1000000.0,
						Ifrateoutratepkts1 = Xml.GetDoubleNode(row, "eth_outrate1_pkts"),
						Ifrateinratesummarybits1 = Xml.GetStringNode(row, "eth_inrate1_summary_bits"),
						Ifrateinratesummarypkts1 = Xml.GetStringNode(row, "eth_inrate1_summary_pkts"),
						Ifrateoutratesummarybits1 = Xml.GetStringNode(row, "eth_outrate1_summary_bits"),
						Ifrateoutratesummarypkts1 = Xml.GetStringNode(row, "eth_outrate1_summary_pkts"),
						Ifrateloadintervaltx2 = Xml.GetDoubleNode(row, "eth_load_interval2_rx"),
						Ifrateinratebits2 = Convert.ToDouble(Xml.GetDoubleNode(row, "eth_inrate2_bits")) / 1000000.0,
						Ifrateinratepkts2 = Xml.GetDoubleNode(row, "eth_inrate2_pkts"),
						Ifrateloadintervalrx2 = Xml.GetDoubleNode(row, "eth_load_interval2_tx"),
						Ifrateoutratebits2 = Convert.ToDouble(Xml.GetDoubleNode(row, "eth_outrate2_bits")) / 1000000.0,
						Ifrateoutratepkts2 = Xml.GetDoubleNode(row, "eth_outrate2_pkts"),
						Ifrateinratesummarybits2 = Xml.GetStringNode(row, "eth_inrate2_summary_bits"),
						Ifrateinratesummarypkts2 = Xml.GetStringNode(row, "eth_inrate2_summary_pkts"),
						Ifrateoutratesummarybits2 = Xml.GetStringNode(row, "eth_outrate2_summary_bits"),
						Ifrateoutratesummarypkts2 = Xml.GetStringNode(row, "eth_outrate2_summary_pkts"),
						Ifrateinunicast = Xml.GetDoubleNode(row, "eth_inucast"),
						Ifrateinmulticast = Xml.GetDoubleNode(row, "eth_inmcast"),
						Ifrateinbroadcast = Xml.GetDoubleNode(row, "eth_inbcast"),
						Ifrateinpkts = Xml.GetDoubleNode(row, "eth_inpkts"),
						Ifrateinbytes = Xml.GetDoubleNode(row, "eth_inbytes"),
						Ifrateoutunicast = Xml.GetDoubleNode(row, "eth_outucast"),
						Ifrateoutmulticast = Xml.GetDoubleNode(row, "eth_outmcast"),
						Ifrateoutbroadcast = Xml.GetDoubleNode(row, "eth_outbcast"),
						Ifrateoutpkts = Xml.GetDoubleNode(row, "eth_outpkts"),
						Ifrateoutbytes = Xml.GetDoubleNode(row, "eth_outbytes"),
					};

					tableRows.Add(tableRow);

					aoName[count] = Xml.GetStringNode(row, "interface");
					aoDescription[count] = Xml.GetStringNode(row, "state_rsn_desc");
					count++;
				}

				protocol.ifratetable.FillArray(tableRows.ToArray());

				SetStateDescription(aoName, aoDescription);
			}

			private void Parse_InterfaceTransceiverDetails(XElement root)
			{
				var interfaceRows = root.Descendants("ROW_interface");
				var intRows = new List<Sfp_interfacesQActionRow>();
				var laneRows = new List<Sfp_interfaces_lanesQActionRow>();

				var sfpInterfacesLanesDisplayKeyFormat = SfpInterfacesLanesDisplayKeyFormat.GetValue(protocol);
				var interfaceCustomDescriptionByKey = sfpInterfacesLanesDisplayKeyFormat == SfpInterfacesLanesDisplayKeyFormat.Options.Index_CustomDescription ?
					InterfaceTable.AliasDetailed.GetValueByKey(protocol) :
					new Dictionary<string, string>();

				var interfaceNameByKey = InterfaceTable.Name.GetValueByKey(protocol);

				foreach (var interfaceRow in interfaceRows)
				{
					string interfaceIndex = Xml.GetStringNode(interfaceRow, "interface");

					if (interfaceIndex == null)
					{
						// Invalid interface row
						protocol.Log("QA" + protocol.QActionID + "|Parse_InterfaceTransceiverDetails|Invalid Interface Index|" + Environment.NewLine + interfaceRow, LogType.Error, LogLevel.NoLogging);

						continue;
					}

					if (!interfaceNameByKey.TryGetKeyByValue(interfaceIndex, out var interfaceKey))
					{
						interfaceKey = string.Empty;
					}

					if (!interfaceCustomDescriptionByKey.TryGetValue(interfaceKey, out string interfaceCustomDescription))
					{
						interfaceCustomDescription = string.Empty;
					}

					var row = new Sfp_interfacesQActionRow
					{
						Sfp_interfaces_ciscoid = Xml.GetIntNode(interfaceRow, "ciscoid"),
						Sfp_interfaces_ciscoidextended = Xml.GetIntNode(interfaceRow, "ciscoid_1"),
						Sfp_interfaces_ciscopartnum = Xml.GetStringNode(interfaceRow, "cisco_part_number", "-1"),
						Sfp_interfaces_ciscoproductid = Xml.GetStringNode(interfaceRow, "cisco_product_id", "-1"),
						Sfp_interfaces_ciscovendorid = Xml.GetStringNode(interfaceRow, "cisco_vendor_id", "-1"),
						Sfp_interfaces_index = interfaceIndex,
						Sfp_interfaces_linklength_9 = Xml.GetIntNode(interfaceRow, "len_9"),
						Sfp_interfaces_linklength_50 = Xml.GetIntNode(interfaceRow, "len_50"),
						Sfp_interfaces_linklength_50_om3 = Xml.GetIntNode(interfaceRow, "len_50_OM3"),
						Sfp_interfaces_linklength_625 = Xml.GetIntNode(interfaceRow, "len_625"),
						Sfp_interfaces_linklength_cu = Xml.GetIntNode(interfaceRow, "len_cu"),
						Sfp_interfaces_name = Xml.GetStringNode(interfaceRow, "name", "-1"),
						Sfp_interfaces_nombitrate = Xml.GetIntNode(interfaceRow, "nom_bitrate"),
						Sfp_interfaces_partnum = Xml.GetStringNode(interfaceRow, "partnum", "-1"),
						Sfp_interfaces_rev = Xml.GetStringNode(interfaceRow, "rev", "-1"),
						Sfp_interfaces_serialnum = Xml.GetStringNode(interfaceRow, "serialnum", "-1"),
						Sfp_interfaces_sfp = Xml.GetStringNode(interfaceRow, "sfp") == "present" ? 1 : 0,
						Sfp_interfaces_type = Xml.GetStringNode(interfaceRow, "type", "-1"),
						Sfp_interfaces_cabletype = Xml.GetStringNode(interfaceRow, "cable_type", "-1"),
						Sfp_interfacesforeignkey_12620 = interfaceKey,
					};

					intRows.Add(row);

					// Get Interface Lanes (some could have multiple (has the lane_number then))
					var lanes = interfaceRow.Descendants("ROW_lane").ToList();

					foreach (var lane in lanes)
					{
						int laneNumber = Xml.GetIntNode(lane, "lane_number");

						// When only 1 row is present, then there is no 'lane_number'. Manually assign 1 to it then.
						if (laneNumber == -1 && lanes.Count == 1)
						{
							laneNumber = 1;
						}

						var index = SfpInterfacesLanesTable.Index.Build(interfaceIndex, laneNumber);
						var displayKey = SfpInterfacesLanesTable.DisplayKey.Build(sfpInterfacesLanesDisplayKeyFormat, index, interfaceCustomDescription);

						var laneRow = SfpInterfacesLanesRowBuilder.Build(index, interfaceKey, displayKey, lane);
						laneRows.Add(laneRow);
					}
				}

				SfpInterfacesTable.FillArray(protocol, intRows);
				SfpInterfacesLanesTable.FillArray(protocol, laneRows);
			}

			private void Parse_NbmFlows(XElement root)
			{
				var rows = new List<object[]>();
				var rowKeys = new List<string>();

				var nbm = new List<NbmRowData>();

				foreach (var flow in root.Descendants("ROW_flows"))
				{
					string mcast_grp = flow.TryElement("mcast_grp").Value;
					string src_ip = flow.TryElement("src_ip").Value;

					string idx = String.Join("/", mcast_grp, src_ip);
					string uptimeString = flow.TryElement("uptime").Value;
					var uptime = GetUptimeSeconds(uptimeString);

					string src_intf = flow.TryElement("src_intf").Value;

					var oifs = flow.TryElement("TABLE_oifs").Elements("ROW_oifs")
						.Select(oif => oif.TryElement("oif_name").Value)
						.OrderBy(x => x);

					string egress_intf = String.Join(", ", oifs);

					object[] row = new NbmflowstableQActionRow
					{
						Nbmflowsindex = idx,
						Nbmflowsmcastgrp = mcast_grp,
						Nbmflowssrcip = src_ip,
						Nbmflowssrcintf = src_intf,
						Nbmflowsstatus = flow.TryElement("status").Value,
						Nbmflowsuptime = uptime,
						Nbmflowsnumrx = flow.TryElement("num_rx").Value,
						Nbmflowspoliced = flow.TryElement("policed").Value,
						Nbmflowsbwmbps = flow.TryElement("bw_mbps").Value,
						Nbmflowspriority = flow.TryElement("priority").Value,
						Nbmflowsoifs = egress_intf,
						Nbmflowssrcnbrdevice = flow.TryElement("src_nbr_device").Value,
					}.ToObjectArray();

					rows.Add(row);
					rowKeys.Add(idx);

					nbm.Add(new NbmRowData(mcast_grp, src_ip, src_intf, egress_intf));
				}

				if (rows.Count == 0)
				{
					DeleteExtraTableKeys(rowKeys);

					return;
				}

				object[] pids = new object[]
				{
					Parameter.Nbmflowstable.tablePid,
					Parameter.Nbmflowstable.Pid.nbmflowsindex_14101,
					Parameter.Nbmflowstable.Pid.nbmflowsmcastgrp_14102,
					Parameter.Nbmflowstable.Pid.nbmflowssrcip_14103,
					Parameter.Nbmflowstable.Pid.nbmflowssrcintf_14104,
					Parameter.Nbmflowstable.Pid.nbmflowsstatus_14105,
					Parameter.Nbmflowstable.Pid.nbmflowsuptime_14106,
					Parameter.Nbmflowstable.Pid.nbmflowsnumrx_14107,
					Parameter.Nbmflowstable.Pid.nbmflowspoliced_14108,
					Parameter.Nbmflowstable.Pid.nbmflowsbwmbps_14109,
					Parameter.Nbmflowstable.Pid.nbmflowspriority_14110,
					Parameter.Nbmflowstable.Pid.nbmflowsoifs_14111,
					Parameter.Nbmflowstable.Pid.nbmflowssrcnbrdevice_14112,
				};

				object[] columns = TransposeRowsToColumns(rows);
				var data = new List<object>
				{
					columns[0],
				};

				data.AddRange(columns);

				protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, pids, data.ToArray());

				DeleteExtraTableKeys(rowKeys);

				UpdateDcfProperties(nbm);
			}

			private void Parse_NbmFlowsStatistics(XElement root)
			{
				var rateCalculatorHelper = new RateCalculatorHelper(protocol, new TimeSpan(0, 0, 1), new TimeSpan(0, 10, 0));
				DateTime now = DateTime.UtcNow;

				var previousData = GetPreviousNbmFlowData();

				if (previousData.Count == 0)
				{
					return;
				}

				var rows = root.Descendants("ROW_stats");

				var flowKey = new List<object>();
				var flowBytes = new List<object>();
				var flowDroppedBytes = new List<object>();
				var flowBitrate = new List<object>();
				var flowBandwidthUtilization = new List<object>();

				foreach (var row in rows)
				{
					string rowKey = GetNbmFlowPrimaryKey(row);

					if (!previousData.ContainsKey(rowKey))
					{
						int exceptionValue = 0;

						flowKey.Add(rowKey);
						flowBytes.Add(exceptionValue);
						flowDroppedBytes.Add(exceptionValue);
						flowBitrate.Add(exceptionValue);
						flowBandwidthUtilization.Add(exceptionValue);

						continue;
					}

					flowKey.Add(rowKey);

					ulong currentBytes = Convert.ToUInt64(row.TryElement("bytes").Value);
					flowBytes.Add(currentBytes);

					ulong currentDroppedBytes = Convert.ToUInt64(row.TryElement("drop_bytes").Value);
					flowDroppedBytes.Add(currentDroppedBytes);

					double currentBitRate = Statistics.GetCurrentBitrateInMegaBitsPerSecond(rateCalculatorHelper, rowKey, currentBytes, now);
					flowBitrate.Add(currentBitRate);

					double currentBandwidthUtilization = Statistics.CalculateNbmBandwidth(currentBitRate, Convert.ToInt32(previousData[rowKey].Nbmflowsbwmbps_14109));
					flowBandwidthUtilization.Add(currentBandwidthUtilization);

					previousData.Remove(rowKey);
				}

				if (previousData.Count != 0)
				{
					int exceptionValue = 0;

					foreach (var row in previousData)
					{
						flowKey.Add(row.Key);
						flowBytes.Add(exceptionValue);
						flowDroppedBytes.Add(exceptionValue);
						flowBitrate.Add(exceptionValue);
						flowBandwidthUtilization.Add(exceptionValue);
					}
				}

				if (flowKey.Count > 0)
				{
					object[] pids = new object[]
					{
						Parameter.Nbmflowstable.tablePid,
						Parameter.Nbmflowstable.Pid.nbmflowsbytes_14113,
						Parameter.Nbmflowstable.Pid.nbmflowsbitrate_14114,
						Parameter.Nbmflowstable.Pid.nbmflowsbandwidthutilization_14115,
						Parameter.Nbmflowstable.Pid.nbmflowsdroppedbytes_14117,
					};

					object[] data = new object[]
					{
						flowKey.ToArray(),
						flowBytes.ToArray(),
						flowBitrate.ToArray(),
						flowBandwidthUtilization.ToArray(),
						flowDroppedBytes.ToArray(),
					};

					protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, pids, data);
				}
			}

