			private void Parse_PtpBrief(XElement root)
			{
				var rows = root.Descendants("ROW_ptp");
				int numberOfSlavePorts = 0;
				int numberOfMasterPorts = 0;
				var keysToRemove = protocol.GetKeys(Parameter.Ptpinterfaces.tablePid).ToList();

				foreach (var row in rows)
				{
					string index = Xml.GetStringNode(row, "ptp-ifindex") ?? Guid.NewGuid().ToString();
					keysToRemove.Remove(index);

					string state = Convert.ToString(Xml.GetStringNode(row, "state"));
					var tableRow = new PtpinterfacesQActionRow { Ptpinterfacesindex = index, Ptpinterfacesstate = state };

					protocol.ptpinterfaces.SetRow(tableRow, true);

					if (state == "master")
					{
						numberOfMasterPorts++;
					}

					if (state == "slave")
					{
						numberOfSlavePorts++;
					}
				}

				if (keysToRemove.Any())
				{
					protocol.ptpinterfaces.DeleteRow(keysToRemove);
				}

				int[] pids = { Parameter.ptpbriefnumberofmasterports, Parameter.ptpbriefnumberofslaveports };

				object[] values = new object[] { numberOfMasterPorts, numberOfSlavePorts };

				protocol.SetParameters(pids, values);
			}

			private void Parse_PtpClock(XElement root)
			{
				string error = Xml.GetStringNode(root, "clierror");

				if (!String.IsNullOrWhiteSpace(error))
				{
					throw new ArgumentException(error);
				}

				string clock_id = Xml.GetStringNode(root, "clock-id");
				double domain_id = Xml.GetDoubleNode(root, "domain-id");
				string slave_clock_oper = Xml.GetStringNode(root, "slave-clock-oper").ToLower();
				string master_clock_oper = Xml.GetStringNode(root, "master-clock-oper").ToLower();
				double num_ports = Xml.GetDoubleNode(root, "num-ports");
				double priority1 = Xml.GetDoubleNode(root, "priority1");
				double priority2 = Xml.GetDoubleNode(root, "priority2");
				double @class = Xml.GetDoubleNode(root, "class");
				double accuracy = Xml.GetDoubleNode(root, "accuracy");
				double scaled_log_variance = Xml.GetDoubleNode(root, "scaled-log-variance");
				double offset_from_master = Xml.GetDoubleNode(root, "offset-from-master");
				double mean_path_delay_to_master = Xml.GetDoubleNode(root, "mean-path-delay-to-master");
				double steps_removed = Xml.GetDoubleNode(root, "steps-removed");
				string device_type = Xml.GetStringNode(root, "device-type");
				string deviceType = String.Empty;

				if (device_type.Equals("gm", StringComparison.InvariantCultureIgnoreCase))
				{
					deviceType = "grandmaster-clock";
				}
				else if (device_type.Equals("bc", StringComparison.InvariantCultureIgnoreCase))
				{
					deviceType = "boundary-clock";
				}
				else if (device_type.Equals("tc", StringComparison.InvariantCultureIgnoreCase))
				{
					deviceType = "transparent-clock";
				}
				else
				{
					protocol.Log("QA" + protocol.QActionID + "|Run|Not a valid device type.", LogType.Information, LogLevel.NoLogging);
				}

				int[] pids =
				{
					Parameter.ptpclockid, Parameter.ptpdomainid, Parameter.ptpslaveclockoper, Parameter.ptpmasterclockoper, Parameter.ptpnumberofports, Parameter.ptppriority1, Parameter.ptppriority2,
					Parameter.ptpclass, Parameter.ptpaccuracy, Parameter.ptpscaledlogvariance, Parameter.ptpoffsetfrommaster, Parameter.ptpmeanpathdelaytomaster, Parameter.ptpstepsremoved,
					Parameter.ptpdevicetype,
				};

				object[] values = new object[]
				{
					clock_id, domain_id, slave_clock_oper, master_clock_oper, num_ports, priority1, priority2, @class, accuracy, scaled_log_variance, offset_from_master, mean_path_delay_to_master,
					steps_removed, deviceType,
				};

				protocol.SetParameters(pids, values);
			}

