			private void Parse_PtpCounters(XElement root)
			{
				// Get old values
				uint[] columnIdx = new uint[]
				{
					Parameter.Ptpinterfaces.Idx.ptpinterfacesindex_12201, Parameter.Ptpinterfaces.Idx.ptpinterfacestxannounce_12203, Parameter.Ptpinterfaces.Idx.ptpinterfacesrxannounce_12204,
					Parameter.Ptpinterfaces.Idx.ptpinterfacestxsync_12205, Parameter.Ptpinterfaces.Idx.ptpinterfacesrxsync_12206, Parameter.Ptpinterfaces.Idx.ptpinterfacestxfollowup_12207,
					Parameter.Ptpinterfaces.Idx.ptpinterfacesrxfollowup_12208, Parameter.Ptpinterfaces.Idx.ptpinterfacestxdelayrequest_12209,
					Parameter.Ptpinterfaces.Idx.ptpinterfacesrxdelayrequest_12210, Parameter.Ptpinterfaces.Idx.ptpinterfacestxdelayresponse_12211,
					Parameter.Ptpinterfaces.Idx.ptpinterfacesrxdelayresponse_12212, Parameter.Ptpinterfaces.Idx.ptpinterfacestxpdelayrequest_12213,
					Parameter.Ptpinterfaces.Idx.ptpinterfacesrxpdelayrequest_12214, Parameter.Ptpinterfaces.Idx.ptpinterfacestxpdelayresponse_12215,
					Parameter.Ptpinterfaces.Idx.ptpinterfacesrxpdelayresponse_12216, Parameter.Ptpinterfaces.Idx.ptpinterfacestxpdelayfollowup_12217,
					Parameter.Ptpinterfaces.Idx.ptpinterfacesrxpdelayfollowup_12218, Parameter.Ptpinterfaces.Idx.ptpinterfacestxmgmt_12219, Parameter.Ptpinterfaces.Idx.ptpinterfacesrxmgmt_12220,
					Parameter.Ptpinterfaces.Idx.ptpinterfacestimebefore_12248,
				};

				object[] ptpColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Ptpinterfaces.tablePid, columnIdx);

				object[] keys = (object[])ptpColumns[0];
				object[] txAnnounceColumn = (object[])ptpColumns[1];
				object[] rxAnnounceColumn = (object[])ptpColumns[2];
				object[] txSyncColumn = (object[])ptpColumns[3];
				object[] rxSyncColumn = (object[])ptpColumns[4];
				object[] txFollowUpColumn = (object[])ptpColumns[5];
				object[] rxFollowUpColumn = (object[])ptpColumns[6];
				object[] txDelayRequestColumn = (object[])ptpColumns[7];
				object[] rxDelayRequestColumn = (object[])ptpColumns[8];
				object[] txDelayResponseColumn = (object[])ptpColumns[9];
				object[] rxDelayResponseColumn = (object[])ptpColumns[10];
				object[] txPDelayRequestColumn = (object[])ptpColumns[11];
				object[] rxPDelayRequestColumn = (object[])ptpColumns[12];
				object[] txPDelayResponseColumn = (object[])ptpColumns[13];
				object[] rxPDelayResponseColumn = (object[])ptpColumns[14];
				object[] txDelayPDelayFollowUpColumn = (object[])ptpColumns[15];
				object[] rxDelayPDelayFollowUpColumn = (object[])ptpColumns[16];
				object[] txMgmtColumn = (object[])ptpColumns[17];
				object[] rxMgmtColumn = (object[])ptpColumns[18];
				object[] timeBeforeColumn = (object[])ptpColumns[19];

				var rows = root.Descendants("ROW_ptp");
				var tableRows = new List<PtpinterfacesQActionRow>();

				double lastMeasurementOaDate = default;

				if (!timeBeforeColumn.Any())
				{
					return;
				}

				foreach (object oatimeItem in timeBeforeColumn)
				{
					if (Convert.ToString(oatimeItem) != String.Empty)
					{
						Double.TryParse(Convert.ToString(oatimeItem), NumberStyles.Float, CultureInfo.InvariantCulture, out lastMeasurementOaDate);

						break;
					}
				}

				var lastMeasurementDateTime = DateTime.FromOADate(lastMeasurementOaDate);
				var currentTime = DateTime.UtcNow;
				double timeDiffSeconds = (currentTime - lastMeasurementDateTime).TotalSeconds;

				foreach (var row in rows)
				{
					string interfaceName = Xml.GetStringNode(row, "interface_name");
					double txAnnounce = Xml.GetDoubleNode(row, "tx-announce-pkts");
					double rxAnnounce = Xml.GetDoubleNode(row, "rx-announce-pkts");
					double txSync = Xml.GetDoubleNode(row, "tx-sync-pkts");
					double rxSync = Xml.GetDoubleNode(row, "rx-sync-pkts");
					double txFollowUp = Xml.GetDoubleNode(row, "tx-follow-up-pkts");
					double rxFollowUp = Xml.GetDoubleNode(row, "rx-follow-up-pkts");
					double txDelayRequest = Xml.GetDoubleNode(row, "tx-delay-req-pkts");
					double rxDelayRequest = Xml.GetDoubleNode(row, "rx-delay-req-pkts");
					double txDelayResponse = Xml.GetDoubleNode(row, "tx-delay-resp-pkts");
					double rxDelayResponse = Xml.GetDoubleNode(row, "rx-delay-resp-pkts");
					double txPDelayRequest = Xml.GetDoubleNode(row, "tx-pdelay-req-pkts");
					double rxPDelayRequest = Xml.GetDoubleNode(row, "rx-pdelay-req-pkts");
					double txPDelayResponse = Xml.GetDoubleNode(row, "tx-pdelay-resp-pkts");
					double rxPDelayResponse = Xml.GetDoubleNode(row, "rx-pdelay-resp-pkts");
					double txPDelayFollowUp = Xml.GetDoubleNode(row, "tx-pdelay-follow-up-pkts");
					double rxPDelayFollowUp = Xml.GetDoubleNode(row, "rx-pdelay-follow-up-pkts");
					double txMGMT = Xml.GetDoubleNode(row, "tx-mgmt-pkts");
					double rxMGMT = Xml.GetDoubleNode(row, "rx-mgmt-pkts");

					double txAnnounceRate = -1.0;
					double rxAnnounceRate = -1.0;
					double txSyncRate = -1.0;
					double rxSyncRate = -1.0;
					double txFollowUpRate = -1.0;
					double rxFollowUpRate = -1.0;
					double txDelayRequestRate = -1.0;
					double rxDelayRequestRate = -1.0;
					double txDelayResponseRate = -1.0;
					double rxDelayResponseRate = -1.0;
					double txPDelayRequestRate = -1.0;
					double rxPDelayRequestRate = -1.0;
					double txPDelayResponseRate = -1.0;
					double rxPDelayResponseRate = -1.0;
					double txPDelayFollowUpRate = -1.0;
					double rxPDelayFollowUpRate = -1.0;
					double txMGMTRate = -1.0;
					double rxMGMTRate = -1.0;

					int index = Array.IndexOf(keys, interfaceName);

					if (timeDiffSeconds > 0 && index != -1)
					{
						txAnnounceRate = CalculatePacketRate(Convert.ToInt64(txAnnounce), Convert.ToInt64(txAnnounceColumn[index]), timeDiffSeconds);
						rxAnnounceRate = CalculatePacketRate(Convert.ToInt64(rxAnnounce), Convert.ToInt64(rxAnnounceColumn[index]), timeDiffSeconds);
						txSyncRate = CalculatePacketRate(Convert.ToInt64(txSync), Convert.ToInt64(txSyncColumn[index]), timeDiffSeconds);
						rxSyncRate = CalculatePacketRate(Convert.ToInt64(rxSync), Convert.ToInt64(rxSyncColumn[index]), timeDiffSeconds);
						txFollowUpRate = CalculatePacketRate(Convert.ToInt64(txFollowUp), Convert.ToInt64(txFollowUpColumn[index]), timeDiffSeconds);
						rxFollowUpRate = CalculatePacketRate(Convert.ToInt64(rxFollowUp), Convert.ToInt64(rxFollowUpColumn[index]), timeDiffSeconds);
						txDelayRequestRate = CalculatePacketRate(Convert.ToInt64(txDelayRequest), Convert.ToInt64(txDelayRequestColumn[index]), timeDiffSeconds);
						rxDelayRequestRate = CalculatePacketRate(Convert.ToInt64(rxDelayRequest), Convert.ToInt64(rxDelayRequestColumn[index]), timeDiffSeconds);
						txDelayResponseRate = CalculatePacketRate(Convert.ToInt64(txDelayResponse), Convert.ToInt64(txDelayResponseColumn[index]), timeDiffSeconds);
						rxDelayResponseRate = CalculatePacketRate(Convert.ToInt64(rxDelayResponse), Convert.ToInt64(rxDelayResponseColumn[index]), timeDiffSeconds);
						txPDelayRequestRate = CalculatePacketRate(Convert.ToInt64(txPDelayRequest), Convert.ToInt64(txPDelayRequestColumn[index]), timeDiffSeconds);
						rxPDelayRequestRate = CalculatePacketRate(Convert.ToInt64(rxPDelayRequest), Convert.ToInt64(rxPDelayRequestColumn[index]), timeDiffSeconds);
						txPDelayResponseRate = CalculatePacketRate(Convert.ToInt64(txPDelayResponse), Convert.ToInt64(txPDelayResponseColumn[index]), timeDiffSeconds);
						rxPDelayResponseRate = CalculatePacketRate(Convert.ToInt64(rxPDelayResponse), Convert.ToInt64(rxPDelayResponseColumn[index]), timeDiffSeconds);
						txPDelayFollowUpRate = CalculatePacketRate(Convert.ToInt64(txPDelayFollowUp), Convert.ToInt64(txDelayPDelayFollowUpColumn[index]), timeDiffSeconds);
						rxPDelayFollowUpRate = CalculatePacketRate(Convert.ToInt64(rxPDelayFollowUp), Convert.ToInt64(rxDelayPDelayFollowUpColumn[index]), timeDiffSeconds);
						txMGMTRate = CalculatePacketRate(Convert.ToInt64(txMGMT), Convert.ToInt64(txMgmtColumn[index]), timeDiffSeconds);
						rxMGMTRate = CalculatePacketRate(Convert.ToInt64(rxMGMT), Convert.ToInt64(rxMgmtColumn[index]), timeDiffSeconds);
					}

					var tableRow = new PtpinterfacesQActionRow
					{
						Ptpinterfacesindex = interfaceName,
						Ptpinterfacestxannounce = txAnnounce,
						Ptpinterfacesrxannounce = rxAnnounce,
						Ptpinterfacestxsync = txSync,
						Ptpinterfacesrxsync = rxSync,
						Ptpinterfacestxfollowup = txFollowUp,
						Ptpinterfacesrxfollowup = rxFollowUp,
						Ptpinterfacestxdelayrequest = txDelayRequest,
						Ptpinterfacesrxdelayrequest = rxDelayRequest,
						Ptpinterfacestxdelayresponse = txDelayResponse,
						Ptpinterfacesrxdelayresponse = rxDelayResponse,
						Ptpinterfacestxpdelayrequest = txPDelayRequest,
						Ptpinterfacesrxpdelayrequest = rxPDelayRequest,
						Ptpinterfacestxpdelayresponse = txPDelayResponse,
						Ptpinterfacesrxpdelayresponse = rxPDelayResponse,
						Ptpinterfacestxpdelayfollowup = txPDelayFollowUp,
						Ptpinterfacesrxpdelayfollowup = rxPDelayFollowUp,
						Ptpinterfacestxmgmt = txMGMT,
						Ptpinterfacesrxmgmt = rxMGMT,
						Ptpinterfacestxannouncerate = txAnnounceRate,
						Ptpinterfacesrxannouncerate = rxAnnounceRate,
						Ptpinterfacestxsyncrate = txSyncRate,
						Ptpinterfacesrxsyncrate = rxSyncRate,
						Ptpinterfacestxfollowuprate = txFollowUpRate,
						Ptpinterfacesrxfollowuprate = rxFollowUpRate,
						Ptpinterfacestxdelayrequestrate = txDelayRequestRate,
						Ptpinterfacesrxdelayrequestrate = rxDelayRequestRate,
						Ptpinterfacestxdelayresponserate = txDelayResponseRate,
						Ptpinterfacesrxdelayresponserate = rxDelayResponseRate,
						Ptpinterfacestxpdelayrequestrate = txPDelayRequestRate,
						Ptpinterfacesrxpdelayrequestrate = rxPDelayRequestRate,
						Ptpinterfacestxpdelayresponserate = txPDelayResponseRate,
						Ptpinterfacesrxpdelayresponserate = rxPDelayResponseRate,
						Ptpinterfacestxpdelayfollowuprate = txPDelayFollowUpRate,
						Ptpinterfacesrxpdelayfollowuprate = rxPDelayFollowUpRate,
						Ptpinterfacestxmgmtrate = txMGMTRate,
						Ptpinterfacesrxmgmtrate = rxMGMTRate,
						Ptpinterfacestimebefore = currentTime,
					};

