			private void Parse_PtpPortInterface(string response, PtpinterfacesQActionRow row)
			{
				if (response == null)
				{
					protocol.Log("QA" + protocol.QActionID + String.Format("|Parse_PtpPortInterface|Received Empty Response Reply [{0}]", row.Key), LogType.Error, LogLevel.NoLogging);

					return;
				}

				XElement root;
				try
				{
					root = XDocument.Parse(response).Root;
				}
				catch (Exception)
				{
					protocol.Log($"QA{protocol.QActionID}|Parse_PtpPortInterface|Invalid PTP response\r\n" + response, LogType.Error, LogLevel.NoLogging);
					return;
				}

				var element = root.Descendants("ROW_ptp").First();

				string[] values = response.Split(Environment.NewLine.ToCharArray());

				SetPtpVlanInfo(values, row, element);
				SetPtpDelay(values, row, element);
				SetPtpAnnounceInterval(values, row, element);
				SetPtpSyncInterval(values, row, element);
				SetPtpAnnounceTimeout(values, row, element);
			}

