			private void Parse_ShowIpIgmpSnoopingGroups(XElement root)
			{
				var tableRows = new List<VlantableQActionRow>();
				var oldBuffer = GetInterfaceBuffer();
				var newBuffer = new List<string>();

				double vlanId = Xml.GetDoubleNode(root, "vlan-id");
				string groupAddress = Xml.GetStringNode(root, "addr");
				string groupVersion = Xml.GetStringNode(root, "GroupVersion");
				string type = Xml.GetStringNode(root, "static");

				var v2Rows = root.Descendants("v2-if-name");
				var stargRows = root.Descendants("star-g-if-name");

				var allRows = v2Rows.Concat(stargRows).GroupBy(row => row.Value).Select(row => row.FirstOrDefault());

				foreach (var vlanRow in allRows)
				{
					string interfaceName = vlanRow.Value;
					oldBuffer.Remove(interfaceName);
					newBuffer.Add(interfaceName);

					var row = new VlantableQActionRow
					{
						Vlaninterfacename = interfaceName,
						Vlanid = vlanId,
						Vlangroupaddress = groupAddress,
						Vlangroupversion = groupVersion,
						Vlantype = Convert.ToString(type) == "true" ? 1 : 2,
						Vlanstate = 1,
					};

					tableRows.Add(row);
				}

				protocol.vlantable.FillArrayNoDelete(tableRows.ToArray());

				foreach (string key in oldBuffer)
				{
					if (!String.IsNullOrWhiteSpace(key))
					{
						var row = (VlantableQActionRow)protocol.vlantable.GetRow(key);
						row.Vlanstate = 0;
						protocol.vlantable.SetRow(row);
					}
				}

				SetInterfaceBuffer(newBuffer);
			}

