			private void ParsePortChannel(XElement root)
			{
				var rows = root.Descendants("ROW_channel");

				var portChannelRows = new List<object[]>();

				foreach (var row in rows)
				{
					var layerStatus = new StringBuilder();

					if (flags.TryGetValue(Xml.GetStringNode(row, "layer"), out string layer))
					{
						layerStatus.Append(layer + " ");
					}

					if (flags.TryGetValue(Xml.GetStringNode(row, "status"), out string status))
					{
						layerStatus.Append(status);
					}

					string portChannelStatus = layerStatus.ToString();

					if (String.IsNullOrEmpty(portChannelStatus))
					{
						portChannelStatus = "-1";
					}

					string index = Xml.GetStringNode(row, "group");

					object[] portChannelRow = new PortchanneltableQActionRow
					{
						Portchannelgroup_9901 = index,
						Portchanneltype_9902 = Xml.GetStringNode(row, "type"),
						Portchannelstatus_9903 = portChannelStatus,
						Portchannelprotocol_9904 = Xml.GetStringNode(row, "prtcl"),
						Portchannelportlist_9905 = index + "/" + GetPortList(row.Descendants("ROW_member")),
					}.ToObjectArray();

					portChannelRows.Add(portChannelRow);
				}

				protocol.FillArray(Parameter.Portchanneltable.tablePid, portChannelRows, NotifyProtocol.SaveOption.Full);
			}

			private void PollViaNxApi(List<PtpinterfacesQActionRow> rows)
			{
				uint pollingIp = 9612;

				uint[] paramsToGet = new uint[]
				{
					pollingIp,
					Parameter.ptpusername_11200,
					Parameter.ptppassword_11201,
					Parameter.commandtimeouttime_9622,
					Parameter.nxapiversion_9624,
				};

				object[] parameters = (object[])protocol.GetParameters(paramsToGet);

				string host = Convert.ToString(parameters[0]);
				string username = Convert.ToString(parameters[1]);
				string password = Convert.ToString(parameters[2]);
				int commandTimeoutTime = Convert.ToInt32(parameters[3]);
				string nx_ApiVersion = Convert.ToString(parameters[4]);

				if (String.IsNullOrWhiteSpace(username) && String.IsNullOrWhiteSpace(password))
				{
					protocol.Log("QA" + protocol.QActionID + "|Not polling PTP as no credentials are specified!", LogType.Error, LogLevel.NoLogging);

					return;
				}

				var nx_Command = new Json.NxRequest.NX_API
				{
					ins_api = new Json.NxRequest.InsApi
					{
						chunk = "0",
						sid = "1",
						output_format = "xml",
						version = nx_ApiVersion,
						type = "cli_show",
						input = String.Empty,
					},
				};

				foreach (var row in rows)
				{
					try
					{
						string commandPtpPortInterface = String.Format("show ptp port interface {0}", row.Key);

						nx_Command.ins_api.input = commandPtpPortInterface;
						string post_data = Json.Serialize(nx_Command);

						string resultPtpPortInterface = SendHttpPostWithRetries(host, username, password, post_data, commandTimeoutTime, "application/xml");

						Parse_PtpPortInterface(resultPtpPortInterface, row);
						protocol.ptpinterfaces.SetRow(row);
					}
					catch (Exception ex)
					{
						protocol.Log($"QA{protocol.QActionID}|PollViaNXApi|[Error] - " + ex, LogType.Error, LogLevel.NoLogging);
					}
				}
			}

			private void PopulateInterfacesForVtpVlan(List<XElement> vlanList)
			{
				var vlanIfMap = new Dictionary<string, VtpvlandisplayedQActionRow>();

				foreach (var vlan in vlanList)
				{
					string vlanId = Xml.GetStringNode(vlan, "vlanshowbr-vlanid", String.Empty);
					string portsJoined = Xml.GetStringNode(vlan, "vlanshowplist-ifidx", String.Empty);
					string state = Xml.GetStringNode(vlan, "vlanshowbr-vlanstate", String.Empty);
					string name = Xml.GetStringNode(vlan, "vlanshowbr-vlanname", String.Empty);
					string index = "1." + vlanId;
					int stateI = vlanStateMap.TryGetValue(state, out int dictState) ? dictState : -1;

					portsJoined = portsJoined.Replace("Ethernet", "Eth");

					var row = new VtpvlandisplayedQActionRow
					{
						Vtpvlandisplayedinstance_7401 = index,
						Vtpvlandisplayedstate_7403 = stateI,
						Vtpvlandisplayedtype_7404 = -1,
						Vtpvlandisplayedname_7405 = name,
						Vtpvlandisplayedindex_7406 = Int16.Parse(vlanId),
						Vtpvlandisplayedinterfaces_7407 = portsJoined,
					};

					vlanIfMap.Add(vlanId, row);
				}

				protocol.vtpvlandisplayed.FillArray(vlanIfMap.Values.ToArray());

				StoreVlanIds(String.Join(";", vlanIfMap.Keys.ToArray()));
			}

			private void PopulateVlanForDetailedInterfaces(List<XElement> vlanList)
			{
				var ifVlanMap = new Dictionary<string, List<string>>();

				foreach (var vlan in vlanList)
				{
					string vlanId = Xml.GetStringNode(vlan, "vlanshowbr-vlanid", String.Empty);
					string portsJoined = Xml.GetStringNode(vlan, "vlanshowplist-ifidx", String.Empty);
					string[] portsSplit = portsJoined.Split(',');

					UpdateIfVlanMap(ifVlanMap, vlanId, portsSplit);
				}

				uint[] columnsToGet = new uint[]
				{
					Parameter.Interfacetable.Idx.interfaceindex_2801,
					Parameter.Interfacetable.Idx.interfacedescr_2802,
				};

				object[] interfaceCols = (object[])protocol.NotifyProtocol(
					(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
					Parameter.Interfacetable.tablePid,
					columnsToGet);

				object[] itfKeys = (object[])interfaceCols[0];
				object[] itfNames = (object[])interfaceCols[1];
				var valueByKey = new Dictionary<string, string>(itfKeys.Length);

				for (int i = 0; i < itfKeys.Length; i++)
				{
					string itfKey = Convert.ToString(itfKeys[i]);
					string itfName = Convert.ToString(itfNames[i]);

					if (ifVlanMap.ContainsKey(itfName))
					{
						ifVlanMap[itfName] = ifVlanMap[itfName].OrderBy(x => Int32.Parse(x)).ToList();
						valueByKey[itfKey] = String.Join(",", ifVlanMap[itfName]);
					}
					else
					{
						valueByKey[itfKey] = String.Empty;
					}
				}

				Skyline.Protocol.Api.InterfaceTable.Vlan.SetValues(protocol, valueByKey);
			}

			private void SetInterfaceBuffer(List<string> list)
			{
				string buffer = String.Join(";", list);
				protocol.SetParameter(Parameter.vlaninterfacebuffer, buffer);
			}

			private void SetStateDescription(object[] aoName, object[] aoDescription)
			{
				if (!aoName.Any() || !aoDescription.Any())
				{
					return;
				}

				uint[] columnIdx = new uint[]
				{
					Parameter.Interfacetable.Idx.interfaceindex_2801,
					Parameter.Interfacetable.Idx.interfacedescr_2802,
				};
				object[] columns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Interfacetable.tablePid, columnIdx);
				object[] itfKeys = (object[])columns[0];
				object[] itfNames = (object[])columns[1];

				var valueByKey = new Dictionary<string, string>(aoName.Length);
				for (int i = 0; i < aoName.Length; i++)
				{
					int index = Array.IndexOf(itfNames, aoName[i]);
					if (index == -1)
					{
						continue;
					}

					string key = Convert.ToString(itfKeys[index]);
					valueByKey[key] = Convert.ToString(aoDescription[i]);
				}

				Skyline.Protocol.Api.InterfaceTable.OperatorStatusDescription.SetValues(protocol, valueByKey);
			}

			private void StoreVlanIds(string vlanIds)
			{
				protocol.SetParameter(Parameter.allvlanids_7510, vlanIds);
			}

			private void UpdateDcfProperties(List<NbmRowData> nbmRows)
			{
				var propertiesOfInterest = GetPropertiesData();

				var dcfProperty = new DcfInterfaceProperty(protocol, propertiesOfInterest);
				dcfProperty.AddDcfProperties(nbmRows);
			}

