namespace Responses.XmlResponseParsing
{
	using System;
	using System.Linq;
	using System.Xml.Linq;

	internal class RtpFlow
	{
		private RtpFlow(XElement xml)
		{
			BridgeDomainId = Xml.GetIntNode(xml, "bridge-domain-id");
			BytesPerSec = Xml.GetInt64Node(xml, "bytes-per-sec");
			BitsPerSec = Xml.GetInt64Node(xml, "bits-per-sec");
			DestinationIp = Xml.GetStringNode(xml, "destination-ip");
			DestinationPort = Xml.GetIntNode(xml, "destination-port");
			FlowIndex = Xml.GetIntNode(xml, "flow-rtp-index");
			FlowType = Xml.GetStringNode(xml, "flow-type");
			InterfaceName = Xml.GetStringNode(xml, "if-name");
			PacketCount = Xml.GetInt64Node(xml, "packet-count");
			Protocol = Xml.GetIntNode(xml, "protocol");
			SourceIp = Xml.GetStringNode(xml, "source-ip");
			SourcePort = Xml.GetIntNode(xml, "source-port");
			StartTime = Xml.GetStringNode(xml, "start-time");

			Errors = xml.Descendants("ROW_flow_rtp_errors").Select(RtpFlowErrors.Parse).ToArray();
		}

		public long BitsPerSec { get; }

		public int BridgeDomainId { get; }

		public long BytesPerSec { get; }

		public string DestinationIp { get; }

		public int DestinationPort { get; }

		public RtpFlowErrors[] Errors { get; set; }

		public int FlowIndex { get; }

		public string FlowType { get; }

		public string InterfaceName { get; }

		public string Key => String.Join("_", BridgeDomainId, SourceIp, DestinationIp, SourcePort, DestinationPort, InterfaceName);

		public long PacketCount { get; }

		public int Protocol { get; }

		public string SourceIp { get; }

		public int SourcePort { get; }

		public string StartTime { get; }

		public static RtpFlow Parse(XElement rtp)
		{
			return new RtpFlow(rtp);
		}
	}

	internal class RtpFlowErrors
	{
		private RtpFlowErrors(XElement xml)
		{
			LossStart = Xml.GetStringNode(xml, "loss-start");
			LossEnd = Xml.GetStringNode(xml, "loss-end");
			PacketLoss = Xml.GetInt64Node(xml, "packet-loss");
		}

		public string LossEnd { get; }

		public string LossStart { get; }

		public long PacketLoss { get; }

		public static RtpFlowErrors Parse(XElement rtp)
		{
			return new RtpFlowErrors(rtp);
		}
	}
}
