namespace Responses.XmlResponseParsing
{
	using System;
	using System.Linq;
	using System.Xml.Linq;

	internal static class Xml
	{
		internal static double GetDoubleNode(XElement root, string node, double errorValue = -1)
		{
			try
			{
				var obj = root.Descendants(node).FirstOrDefault();

				return obj != null ? Convert.ToDouble(obj.Value) : errorValue;
			}
			catch (Exception)
			{
				return errorValue;
			}
		}

		internal static long GetInt64Node(XElement root, string node, long errorValue = -1)
		{
			try
			{
				var obj = root.Descendants(node).FirstOrDefault();

				return obj != null ? Convert.ToInt64(obj.Value) : errorValue;
			}
			catch (Exception)
			{
				return errorValue;
			}
		}

		internal static int GetIntNode(XElement root, string node, int errorValue = -1)
		{
			try
			{
				var obj = root.Descendants(node).FirstOrDefault();

				return obj != null ? Convert.ToInt32(obj.Value) : errorValue;
			}
			catch (Exception)
			{
				return errorValue;
			}
		}

		internal static string GetStringNode(XElement root, string node, string errorValue = null)
		{
			var obj = root.Descendants(node).FirstOrDefault();

			return obj != null ? Convert.ToString(obj.Value) : errorValue;
		}
	}
}
