			private const int ColumnId = Parameter.Interfacetable.Pid.interfaceoperstatusdescription_2826;

			public static void SetValues(SLProtocol protocol, Dictionary<string, string> valueByKey)
			{
				if (valueByKey == null)
				{
					throw new ArgumentNullException(nameof(valueByKey));
				}

				if (!valueByKey.Any())
				{
					return;
				}

				object[] keys = valueByKey.Keys.Cast<object>().ToArray();
				object[] values = valueByKey.Values.Cast<object>().ToArray();
				SetValuesSafe(protocol, keys, values);
			}

			private static void SetValuesSafe(SLProtocol protocol, object[] keys, object[] values)
			{
				object[] columnInfo = new object[]
				{
					TableId,
					ColumnId,
				};
				object[] columnValues = new object[]
				{
					keys,
					values,
				};
				protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnInfo, columnValues);
			}
		}

