				}

				if (!keys.Any())
				{
					return;
				}

				object[] keyCollection = keys.Cast<object>().ToArray();
				object[] valueCollection = Enumerable.Repeat((object)value, keyCollection.Length).ToArray();
				SetValuesSafe(protocol, keyCollection, valueCollection);
			}

