namespace Skyline.Protocol.Api
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using Skyline.DataMiner.Scripting;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	internal static class Table
	{
		internal static void FillArray(SLProtocol protocol, int tableId, IEnumerable<QActionTableRow> rows)
		{
			if (rows == null)
			{
				throw new ArgumentNullException(nameof(rows));
			}

			FillArray(protocol, tableId, rows.Select(row => row.ToObjectArray()));
		}

		private static void FillArray(SLProtocol protocol, int tableId, IEnumerable<object[]> rows)
		{
			protocol.FillArray(tableId, rows.ToList(), NotifyProtocol.SaveOption.Full);
		}

		internal static class Column
		{
			internal static Dictionary<string, object> GetValueByKey(SLProtocol protocol, int tableId, int indexColumn, int columnIndex)
			{
				var indexes = new[]
				{
					(uint)indexColumn,
					(uint)columnIndex,
				};
				var columns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, tableId, indexes);
				var keys = Array.ConvertAll((object[])columns[0], Convert.ToString);
				var values = (object[])columns[1];

				var result = new Dictionary<string, object>(keys.Length);
				for (int i = 0; i < keys.Length; i++)
				{
					result[keys[i]] = values[i];
				}

				return result;
			}

			internal static void SetValues(SLProtocol protocol, int tableId, int columnId, Dictionary<string, string> valueByKey)
			{
				if (valueByKey == null)
				{
					throw new ArgumentNullException(nameof(valueByKey));
				}

				if (!valueByKey.Any())
				{
					return;
				}

				var keys = valueByKey.Keys.Select(key => (object)key).ToArray();
				var values = valueByKey.Values.Select(value => (object)value).ToArray();
				SetValues(protocol, tableId, columnId, keys, values);
			}

			private static void SetValues(SLProtocol protocol, int tableId, int columnId, object[] keys, object[] values)
			{
				if (keys == null)
				{
					throw new ArgumentNullException(nameof(keys));
				}

				if (values == null)
				{
					throw new ArgumentNullException(nameof(values));
				}

				if (keys.Length != values.Length)
				{
					throw new InvalidOperationException();
				}

				if (!keys.Any())
				{
					return;
				}

				var columnInfo = new object[]
				{
					tableId,
					columnId,
				};
				var columnValues = new object[]
				{
					keys,
					values,
				};
				protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnInfo, columnValues);
			}
		}
	}
}
