namespace StaticJoins
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using Resources;

	using Skyline.DataMiner.Scripting;
	using Skyline.Protocol;

	public class ContextMenu
	{
		public static void AddStaticJoinsCommand(SLProtocol protocol, string interfaceName)
		{
			string command = BuildStaticJoinsCommand(interfaceName);

			var apiTableCommands = protocol.GetApiTableCommands();

			if (apiTableCommands.Contains(command))
			{
				protocol.ShowInformationMessage("Static Joins command already exists for Interface Name " + interfaceName);

				return;
			}

			AddNewCommand(protocol, command);
			UpdateStaticJoinsActiveCommands(protocol, command, apiTableCommands);

			protocol.CheckTrigger(9609);
		}

		public static void RemoveAllCommands(SLProtocol protocol)
		{
			var apiRowKeysToDelete = protocol.GetApiPollingKeysToCommands()
				.Where(x => x.Value.Command.Contains("sh running-config int "))
				.Select(x => x.Key)
				.ToList();

			if (apiRowKeysToDelete.Count > 0)
			{
				protocol.DeleteRow(Parameter.Pollingtable.tablePid, apiRowKeysToDelete);
			}

			var staticJoinsKeysDelete = protocol.GetIpIgmpSnoopingKeysToVlans().Select(x => x.Key).ToList();
			Table.UnlinkRowsFromKeysForStaticJoins(protocol, staticJoinsKeysDelete);

			protocol.ClearAllKeys(Parameter.Staticjoinstable.tablePid);
			protocol.SetParameter(Parameter.staticjoinsactivecommands_9806, String.Empty);
		}

		public static void RemoveFromActiveCommands(SLProtocol protocol, string command)
		{
			string activeCommands = Convert.ToString(protocol.GetParameter(Parameter.ipigmpactivecommands_9801));
			var activeCommandsSplitted = activeCommands.Split(';').ToList();

			activeCommandsSplitted.Remove(command);

			string updatedActiveCommands = String.Join(";", activeCommandsSplitted);

			protocol.SetParameter(Parameter.ipigmpactivecommands_9801, updatedActiveCommands);
		}

		public static void RemoveStaticJoinsCommand(SLProtocol protocol, string interfaceName)
		{
			string command = BuildStaticJoinsCommand(interfaceName);

			var apiRow = protocol.GetApiPollingKeysToCommands().FirstOrDefault(x => x.Value.Command == command);

			if (apiRow.Key == null || !apiRow.Value.CanDeleteRow(protocol))
			{
				return;
			}

			UpdateStaticJoinsTables(protocol, command);
			protocol.DeleteRow(Parameter.Pollingtable.tablePid, apiRow.Key);
		}

		public static void UpdateStaticJoinsActiveCommands(SLProtocol protocol, string newCommand, List<string> apiTableCommands)
		{
			apiTableCommands.Add(newCommand);
			var activeCommands = apiTableCommands.Where(x => x.Contains("sh running-config int ")).Select(x => Commands.ExtractInterfaceName(x));
			string activeCommandsJoined = String.Join(";", activeCommands);
			protocol.SetParameter(Parameter.staticjoinsactivecommands_9806, activeCommandsJoined);
		}

		public static void UpdateStaticJoinsTables(SLProtocol protocol, string command)
		{
			var staticJoinRows = protocol.GetStaticJoinsToInterfaceNames();

			var staticJoinKeysDelete = new List<string>();

			foreach (var staticJoinRow in staticJoinRows)
			{
				if (String.IsNullOrWhiteSpace(staticJoinRow.Value) || command.Contains(staticJoinRow.Value))
				{
					staticJoinKeysDelete.Add(staticJoinRow.Key);
				}
			}

			RemoveFromActiveCommands(protocol, command);
			protocol.DeleteRow(Parameter.Staticjoinstable.tablePid, staticJoinKeysDelete);
			Table.UnlinkRowsFromKeysForStaticJoins(protocol, staticJoinKeysDelete);
		}

		private static void AddNewCommand(SLProtocol protocol, string command)
		{
			var newCommandRow = new PollingtableQActionRow
			{
				Pollinginstance = Guid.NewGuid().ToString(),
				Pollingcommand = command,
				Pollingcommunicationtype = (int)Commands.ApiCommunicationTypes.CliSsh,
				Pollingfrequency = 60,
				Pollingstatus = 1,
				Pollinginformation = "-1",
				Pollinglastpolled = -1,
			};

			protocol.AddRow(Parameter.Pollingtable.tablePid, newCommandRow);
		}

		private static string BuildStaticJoinsCommand(string interfaceName)
		{
			return "sh running-config int " + interfaceName + " | include oif | no-more";
		}
	}
}

using System;

using Skyline.DataMiner.Scripting;

/// <summary>
///     DataMiner QAction Class.
/// </summary>
public static class QAction
{
	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			object[] parameters = (object[])protocol.GetParameters(new uint[] { Parameter.oldreboottime_11, Parameter.sysuptime_102 });

			if (parameters.Length != 2)
			{
				return;
			}

			int oldRebootTime = Convert.ToInt32(parameters[0]);
			int newTime = Convert.ToInt32(parameters[1]);

			if (newTime < oldRebootTime)
			{
				// DO NOT REMOVE!
				// The first set to 0 is needed to make sure the trigger is done again when the reboot flag is still active!
				protocol.SetParameter(Parameter.rebootflag_10, 0);
				protocol.SetParameters(new[] { Parameter.rebootflag_10, Parameter.oldreboottime_11 }, new object[] { 1, newTime });
			}
			else
			{
				protocol.SetParameter(Parameter.oldreboottime_11, newTime);
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

using System;
using System.Collections.Generic;

using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

/// <summary>
///     DataMiner QAction Class.
/// </summary>
public static class QAction
{
	private enum ButtonValue
	{
		DisableAll = 0,

		EnableAll = 1,
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			int trigger = protocol.GetTriggerParameter();
			var value = (ButtonValue)Convert.ToInt32(protocol.GetParameter(trigger));

			uint[] pollingtableColumnsToGetIDXs = new uint[] { Parameter.Pollingtable.Idx.pollinginstance_17201, Parameter.Pollingtable.Idx.pollingstatus_17205 };
			object[] pollingtableColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Pollingtable.tablePid, pollingtableColumnsToGetIDXs);

			object[] stringKeys = (object[])pollingtableColumns[0];
			object[] status = (object[])pollingtableColumns[1];

			object[] lastPolled = new object[stringKeys.Length];
			object[] information = new object[stringKeys.Length];
			string statusValue;

			if (value.Equals(ButtonValue.EnableAll))
			{
				statusValue = "1";

				if (Convert.ToBoolean(protocol.GetParameter(Parameter.telemetrysubscription_20001)))
				{
					protocol.SetParameter(Parameter.Write.telemetrysubscription_20051, 0);
				}
			}
			else
			{
				statusValue = "0";
			}

			for (int i = 0; i < stringKeys.Length; i++)
			{
				string key = Convert.ToString(stringKeys[i]);

				if (key == "7" && Convert.ToBoolean(status[i]) && value.Equals(ButtonValue.DisableAll))
				{
					Skyline.Protocol.Api.InterfaceTable.ClearAllKeys(protocol);
				}

				status[i] = statusValue;
				lastPolled[i] = "-1";
				information[i] = "-1";
			}

			var setTableData = new List<object>(2) { stringKeys, status };
			var setTablePids = new List<object>(2) { Parameter.Pollingtable.tablePid, Parameter.Pollingtable.Pid.pollingstatus_17205 };

			if (!value.Equals(ButtonValue.EnableAll))
			{
				setTablePids.Add(Parameter.Pollingtable.Pid.pollinglastpolled_17207);
				setTablePids.Add(Parameter.Pollingtable.Pid.pollinginformation_17206);
				setTableData.Add(lastPolled);
				setTableData.Add(information);
			}

			protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, setTablePids.ToArray(), setTableData.ToArray());
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

