					protocol.Sshdestinationfilename_17005 = String.Format("{0}_Config", protocol.ElementName);
				}
			}
			catch (Exception e)
			{
				protocol.Log(
					"QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|CheckSshDestinationFileName|Exception thrown:" + Environment.NewLine + e,
					LogType.Error,
					LogLevel.NoLogging);
			}
		}

		public void LoadPollingTable()
		{
			try
			{
				pollingTable = new PollingTable(protocol);
