			catch (Exception e)
			{
				protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|LoadPollingTable|Exception thrown:" + Environment.NewLine + e, LogType.Error, LogLevel.NoLogging);
			}
		}

