		public void SaveNewCommands(SLProtocolExt protocol)
		{
			var setTablePids = new List<object>(2) { Parameter.Pollingtable.tablePid, Parameter.Pollingtable.Pid.pollinglastpolled_17207 };

			for (int i = 0; i < Instance.Length; i++)
			{
				LastPolled[i] = "-1";
			}

			var setTableData = new List<object>(2) { Instance, LastPolled };

			protocol.NotifyProtocol((int)NotifyType.NT_FILL_ARRAY_WITH_COLUMN, setTablePids.ToArray(), setTableData.ToArray());
			protocol.pollingtable.FillArrayNoDelete(newRows.Cast<QActionTableRow>().ToArray());
		}

		private void AddCommand(string command, CommunicationTypes communicationType, int frequency, Statuses status, string instance = null)
		{
			if (CommandIsUnique(command) && NewInstance(instance))
			{
				if (String.IsNullOrWhiteSpace(instance))
				{
					instance = Guid.NewGuid().ToString();
				}

				var newCommandRow = new PollingtableQActionRow
				{
					Pollinginstance = instance,
					Pollingcommand = command,
					Pollingcommunicationtype = (int)communicationType,
					Pollingfrequency = frequency,
					Pollingstatus = (int)status,
					Pollinginformation = "-1",
					Pollinglastpolled = -1,
				};

				newRows.Add(newCommandRow);
			}
		}

		private bool CommandIsUnique(string command)
		{
			foreach (object existingCommand in Command)
			{
				string commandInTable = Convert.ToString(existingCommand);

				if (commandInTable.Equals(command))
				{
					return false;
				}

				if (commandInTable.StartsWith("sh ") && command.StartsWith("show "))
				{
					string restOfCommandInTable = commandInTable.Replace("sh ", String.Empty);
					string restOfCommand = command.Replace("show ", String.Empty);

					if (restOfCommandInTable.Equals(restOfCommand))
					{
						return false;
					}
				}
			}

			return true;
		}

		private bool NewInstance(string instance)
		{
			if (String.IsNullOrWhiteSpace(instance))
			{
				return true;
			}

			foreach (object existingInstance in Instance)
			{
				string instanceInTable = Convert.ToString(existingInstance);

				if (instanceInTable.Equals(instance))
				{
					return false;
				}
			}

			return true;
		}
	}
}

using System;
using System.Globalization;

using Skyline.DataMiner.Scripting;
using Skyline.Protocol;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

public class QAction
{
	/// <summary>
	///     Calculate the cpu utilization.
	/// </summary>
	/// <param name="protocol">Link with the SLProtocol Process.</param>
	public static void Run(SLProtocol protocol)
	{
		uint[] columnIdx = new uint[]
		{
			Parameter.Cpmcputotaltable.Idx.cpmcputotal1minrev_1002,
			Parameter.Cpmcputotaltable.Idx.cpmcputotalmemoryused_1003,
			Parameter.Cpmcputotaltable.Idx.cpmcputotalmemoryfree_1004,
		};

		object[] tableColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Cpmcputotaltable.tablePid, columnIdx);
		object[] colCpuTotalMinRev = (object[])tableColumns[0];
		object[] colCpuMemoryUsed = (object[])tableColumns[1];
		object[] colCpuMemoryFree = (object[])tableColumns[2];
		int iCount = colCpuTotalMinRev.Length;

		if (iCount == 0)
		{
			object[] prms = (object[])protocol.GetParameters(
				new uint[] { Parameter.csesyscpuutilization_1106, Parameter.csesysmemoryutilization_1107 });

			double cpu = Convert.ToDouble(prms[0]);
			double memory = Convert.ToDouble(prms[1]);

			protocol.SetParameters(
				new[] { Parameter.cpuusage_106, Parameter.memoryusage_107 },
				new object[] { cpu, memory });
		}
		else
		{
			try
			{
				double iCpuTotal = 0;
				double iUsedMem = 0;
				double iFreeMem = 0;

				for (int i = 0; i < iCount; i++)
				{
					Double.TryParse(
						Convert.ToString(colCpuTotalMinRev[i]),
						NumberStyles.Float,
						CultureInfo.InvariantCulture,
						out double dValue);

					iCpuTotal += dValue;
					Double.TryParse(
						Convert.ToString(colCpuMemoryUsed[i]).Replace(",", "."),
						NumberStyles.Float,
						CultureInfo.InvariantCulture,
						out double dValue2);

					iUsedMem += dValue2;
					Double.TryParse(
						Convert.ToString(colCpuMemoryFree[i]).Replace(",", "."),
						NumberStyles.Float,
						CultureInfo.InvariantCulture,
						out double dValue3);

					iFreeMem += dValue3;
				}

				// Calculating the CPU usage
				double iAvg = iCpuTotal / iCount;
				double cpuUsage = Convert.ToDouble(protocol.GetParameter(Parameter.cpuusage_106));

				if (!cpuUsage.IsCloseTo(iAvg, 0.00005))
				{
					protocol.SetParameter(Parameter.cpuusage_106, iAvg);
				}

				// Calculate the used memory in percentage
				double totalSizeMem = iUsedMem + iFreeMem;

				if (!Common.IsCloseToZero(totalSizeMem))
				{
					protocol.SetParameter(Parameter.memoryusage_107, iUsedMem / totalSizeMem * 100);
				}
			}
			catch (Exception e)
			{
				protocol.Log(
					"QA" + protocol.QActionID + "|Error Calculating CPU and Memory Usage" + e,
					LogType.Error,
					LogLevel.NoLogging);
			}
		}
	}
}

