/// <summary>
///     DataMiner QAction Class: QActionName.
/// </summary>
public static class QAction
{
	private static readonly List<string> CommandsToRepoll = new List<string>
	{
		"show clock",
		"show ntp peer-status",
	};

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			object[] pollingTable = (object[])protocol.NotifyProtocol(
				(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
				Parameter.Pollingtable.tablePid,
				new uint[] { Parameter.Pollingtable.Idx.pollinginstance_17201, Parameter.Pollingtable.Idx.pollingcommand_17202, Parameter.Pollingtable.Idx.pollingstatus_17205 });

			var keysToPoll = new List<string>();

			object[] keys = (object[])pollingTable[0];
			object[] commands = (object[])pollingTable[1];
			object[] status = (object[])pollingTable[2];

			for (int i = 0; i < keys.Length; i++)
			{
				string command = Convert.ToString(commands[i]);
				string key = Convert.ToString(keys[i]);
				bool enabled = Convert.ToInt32(status[i]) == 1;

				if (CommandsToRepoll.Contains(command) && enabled)
				{
					keysToPoll.Add(key);
				}
			}

			foreach (string key in keysToPoll)
			{
				protocol.HandleWriteApiPollingPollNow((PollingtableQActionRow)(object[])protocol.GetRow(Parameter.Pollingtable.tablePid, key));
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

