using SLNetMessages = Skyline.DataMiner.Net.Messages;

/// <summary>
///     DataMiner QAction Class: Change Devices.
/// </summary>
public static class QAction
{
	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			int devicesToPopulate = Convert.ToInt32(protocol.GetParameter(Parameter.Write.numberofdevices));

			uint[] col = new uint[] { Parameter.Deviceresourcetable.Idx.deviceresourcetablecustomname };
			object[] nameCol = (object[])((object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Deviceresourcetable.tablePid, col))[0];

			var existingNames = Array.ConvertAll(nameCol, x => Convert.ToString(x)).ToList();

			if (devicesToPopulate.Equals(existingNames.Count) || devicesToPopulate < existingNames.Count)
			{
				return;
			}

			var rowsDevice = new List<DeviceresourcetableQActionRow>();

			FillTableData(devicesToPopulate - existingNames.Count, existingNames, rowsDevice);
			protocol.deviceresourcetable.FillArrayNoDelete(rowsDevice.ToArray());

			protocol.SetParameter(Parameter.numberofdevices, devicesToPopulate);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void FillTableData(int devicesToPopulate, List<string> existingNames, List<DeviceresourcetableQActionRow> rowsDevice)
	{
		for (int i = 0; i < devicesToPopulate; i++)
		{
			var rowDevice = Table.GenerateRow(existingNames);

			rowsDevice.Add(rowDevice);
		}
	}
}

using System;
using System.Linq;

using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

/// <summary>
///     DataMiner QAction Class: Change table values.
/// </summary>
public static class QAction
{
	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			string key = protocol.RowKey();

			int trigger = protocol.GetTriggerParameter();

			string value = Convert.ToString(protocol.GetParameter(trigger));

			switch (trigger)
			{
				case Parameter.Write.deviceresourcetablecustomname_1152:
					ChangeName(protocol, key, value);

					break;

				case Parameter.Write.deviceresourcetablestaticjoinstablefk_1153:
					protocol.SetParameterIndexByKey(Parameter.Deviceresourcetable.tablePid, key, Parameter.Deviceresourcetable.Idx.deviceresourcetablestaticjoinstablefk_1103 + 1, value);

					break;

				case Parameter.Deviceresourcetable.Pid.Write.deviceresourcetabledelete_1154:
					int currentCount = Convert.ToInt32(protocol.GetParameter(Parameter.numberofdevices));
					protocol.DeleteRow(Parameter.Deviceresourcetable.tablePid, key);
					protocol.SetParameter(Parameter.numberofdevices, currentCount - 1);

					break;

				case Parameter.Write.deviceresourcetableipigmpsnoopingtablefk_1155:
					protocol.SetParameterIndexByKey(Parameter.Deviceresourcetable.tablePid, key, Parameter.Deviceresourcetable.Idx.deviceresourcetableipigmpsnoopingtablefk_1105 + 1, value);

					break;

				default:
					protocol.Log("QA" + protocol.QActionID + "|Run|Not expected", LogType.Error, LogLevel.NoLogging);

					break;
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void ChangeName(SLProtocol protocol, string key, string value)
	{
		uint[] col = new uint[] { Parameter.Deviceresourcetable.Idx.deviceresourcetablecustomname };
		object[] nameCol = (object[])((object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Deviceresourcetable.tablePid, col))[0];

		string[] existingNames = Array.ConvertAll(nameCol, x => Convert.ToString(x));

		if (!existingNames.Contains(value))
		{
			protocol.SetParameterIndexByKey(Parameter.Deviceresourcetable.tablePid, key, Parameter.Deviceresourcetable.Idx.deviceresourcetablecustomname + 1, value);
		}
		else
		{
			protocol.ShowInformationMessage("Name already exists");
		}
	}
}

