using QAction_1.Interfaces;

using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

public class QAction
{
	/// <summary>
	///     IP Route.
	/// </summary>
	/// <param name="protocol">Link with Skyline DataMiner.</param>
	public static void Run(SLProtocol protocol)
	{
		uint[] ipRouteColumnsToGet = new uint[]
		{
			Parameter.Iproutetable.Idx.iproutetableinstance_1401,
			Parameter.Iproutetable.Idx.iprouteifindex_1403,
		};

		object[] columns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Iproutetable.tablePid, ipRouteColumnsToGet);

		object[] keys = (object[])columns[0];
		object[] interfaceIndexes = (object[])columns[1];
		object[] names = new object[keys.Length];

		object[] interfaceColumns = InterfacesHelper.GetInterfaceAliasDetails(protocol);

		object[] interfaceKeys = (object[])interfaceColumns[0];
		object[] interfaceNames = (object[])interfaceColumns[1];
		object[] interfaceAlias = (object[])interfaceColumns[2];

		for (int i = 0; i < keys.Length; i++)
		{
			int iIndex = Array.IndexOf(interfaceKeys, Convert.ToString(interfaceIndexes[i]));

			if (iIndex != -1)
			{
				names[i] = interfaceNames[iIndex] + "/" + interfaceAlias[iIndex];
			}
		}

		object[] columnsToSet = new object[] { Parameter.Iproutetable.tablePid, Parameter.Iproutetable.Pid.iprouteinterface_1415 };
		protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnsToSet, new object[] { keys, names });
	}
}

