using System;

using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

public class QAction
{
	public static void Run(SLProtocol protocol)
	{
		int triggerParam = protocol.GetTriggerParameter();

		int tablePid = Parameter.Cefcfrupowerstatustable.tablePid;
		uint primaryKeyIndex = Parameter.Cefcfrupowerstatustable.Idx.cefcfrupowerstatusindexsupply_2601;
		int descriptionPid = Parameter.Cefcfrupowerstatustable.Pid.cefcfrupowerstatusdescriptionpowersupply_2605;

		if (triggerParam == Parameter.Cefcfrupowersupplyvaluetable.tablePid)
		{
			tablePid = Parameter.Cefcfrupowersupplyvaluetable.tablePid;
			primaryKeyIndex = Parameter.Cefcfrupowersupplyvaluetable.Idx.cefcfrupowersupplyvalueinstance_2701;
			descriptionPid = Parameter.Cefcfrupowersupplyvaluetable.Pid.cefcfrupowersupplyvaluedescription_2704;
		}

		try
		{
			UpdatePowerSupplyDescriptions(protocol, tablePid, primaryKeyIndex, descriptionPid);
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Error Processing Physical Name of Power Supply" + e, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void UpdatePowerSupplyDescriptions(SLProtocol protocol, int tablePid, uint primaryKeyIndex, int descriptionPid)
	{
		// processing physical power supply
		object[] powerSupplyColumns = (object[])protocol.NotifyProtocol(
			(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
			tablePid,
			new[] { primaryKeyIndex });

		object[] primaryKeys = (object[])powerSupplyColumns[0];

		object[] entPhysicalColumns = (object[])protocol.NotifyProtocol(
			(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
			Parameter.Entphysicaltable.tablePid,
			new uint[] { Parameter.Entphysicaltable.Idx.entphysicalindex_2401, Parameter.Entphysicaltable.Idx.entphysicalname_2402 });

		object[] entPhysicalKeys = (object[])entPhysicalColumns[0];
		object[] physicalNames = (object[])entPhysicalColumns[1];

		object[] descriptions = new object[primaryKeys.Length];

		if (primaryKeys.Length == 0 || entPhysicalKeys.Length == 0)
		{
			return;
		}

		for (int i = 0; i < primaryKeys.Length; i++)
		{
			int index = Array.IndexOf(entPhysicalKeys, Convert.ToString(primaryKeys[i]));

			if (index != -1)
			{
				descriptions[i] = physicalNames[index];
			}
			else
			{
				descriptions[i] = String.Empty;
			}
		}

		protocol.FillArrayWithColumn(
			tablePid,
			descriptionPid,
			primaryKeys,
			descriptions);
	}
