using System;

using QAction_1;
using QAction_1.OpenConfig;

using Skyline.DataMiner.Scripting;

/// <summary>
/// DataMiner QAction Class: Update Calculated Columns On Telemetry Change.
/// </summary>
public static class QAction
{
	public static bool AlmostEquals(this double double1, double double2, double precision = 0.0000001)
	{
		return Math.Abs(double1 - double2) <= precision;
	}

	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			var configurations = (object[])protocol.GetParameters(new uint[] { Parameter.telemetrysubscription_20001, Parameter.saveinterfaces_20008 });
			bool subscribeTelemetry = Convert.ToBoolean(configurations[0]);
			bool saveInterfaces = Convert.ToBoolean(configurations[1]);

			if (!subscribeTelemetry)
			{
				protocol.ClearAllKeys(Parameter.Openconfiginterfaces.tablePid);
				protocol.ClearAllKeys(Parameter.Openconfiginterfacesethernet.tablePid);

				if (!saveInterfaces)
				{
					Skyline.Protocol.Api.InterfaceTable.ClearAllKeys(protocol);
				}

				return;
			}

			int trigger = protocol.GetTriggerParameter();
			string key = protocol.RowKey();
			if (key.StartsWith("mgmt"))
			{
				// Skip the management interfaces.
				return;
			}

			if (trigger == Parameter.Openconfiginterfaces.tablePid && !protocol.Exists(Parameter.Openconfiginterfacesethernet.tablePid, key))
			{
				return;
			}

			if (trigger == Parameter.Openconfiginterfacesethernet.tablePid && !protocol.Exists(Parameter.Openconfiginterfaces.tablePid, key))
			{
				return;
			}

			var row = new OpenconfiginterfacesQActionRow((object[])protocol.GetRow(Parameter.Openconfiginterfaces.tablePid, key));
			var ethernetRow = new OpenconfiginterfacesethernetQActionRow((object[])protocol.GetRow(Parameter.Openconfiginterfacesethernet.tablePid, key));

			if (String.IsNullOrEmpty(Convert.ToString(row.Openconfiginterfacesinstance_20131)))
			{
				// Primary keys not filled in at first triggers.
				return;
			}

			SetInterfacesRow(protocol, row, ethernetRow);
			SetInterfacesRxRow(protocol, row, ethernetRow);
			SetInterfacesTxRow(protocol, row, ethernetRow);
		}
		catch (Exception ex)
		{
			protocol.Log($"QA{protocol.QActionID}|{protocol.GetTriggerParameter()}|Run|Exception thrown:{Environment.NewLine}{ex}", LogType.Error, LogLevel.NoLogging);
		}
	}

	private static double CalculateUtilization(double rxBitRate, double txBitRate)
	{
		double utilization = Defaults.NAIntValue;

		if (!AlmostEquals(rxBitRate, Defaults.NAIntValue) && !AlmostEquals(txBitRate, Defaults.NAIntValue))
		{
			utilization = (rxBitRate + txBitRate) / 1_000_000;
		}

		return utilization;
	}

	private static InterfacetableQActionRow GetInterfaceRow(SLProtocol protocol, OpenconfiginterfacesQActionRow row, OpenconfiginterfacesethernetQActionRow ethernetRow, double utilization)
	{
		int adminStatus = Convert.ToInt32(row.Openconfiginterfacesadminstatus_20103);

		double operatorStatus = Convert.ToDouble(row.Openconfiginterfacesoperatorstatus_20104);

		if (adminStatus == 2 || adminStatus == 3)
		{
			operatorStatus = 10; // Admin Down
		}

		double utilizationPercentage = Defaults.NAIntValue;
		double speed = Convert.ToDouble(ethernetRow.Openconfiginterfacesethernetportspeed_20204);
		if (!AlmostEquals(speed, Defaults.NAIntValue))
		{
			utilizationPercentage = utilization / speed * 100;
		}

		string key = Convert.ToString(row.Openconfiginterfacesinstance_20131);
		if (protocol.Exists(Parameter.Interfacetable.tablePid, key))
		{
			var interfaceRow = (InterfacetableQActionRow)(object[])protocol.GetRow(Parameter.Interfacetable.tablePid, key);

			interfaceRow.Interfacedescr_2802 = DisplayKeyUtil.ExpandName(Convert.ToString(row.Openconfiginterfacesindex_20101));
			interfaceRow.Interfacetype_2803 = row.Openconfiginterfacestype_20133;
			interfaceRow.Interfacemtu_2804 = row.Openconfiginterfacesmtu_20132;
			interfaceRow.Interfacespeed_2805 = speed;
			interfaceRow.Interfacephysaddress_2806 = ethernetRow.Openconfiginterfacesethernetmacaddress_20202;
			interfaceRow.Interfaceadminstatus_2807 = row.Openconfiginterfacesadminstatus_20103;
			interfaceRow.Interfaceoperstatus_2808 = operatorStatus;
			interfaceRow.Interfacelastchange_2809 = row.Openconfiginterfaceslastchange_20105;
			interfaceRow.Interfaceinerrors_2810 = row.Openconfiginterfacesinerrors_20106;
			interfaceRow.Interfaceouterrors_2811 = row.Openconfiginterfacesouterrors_20107;
			interfaceRow.Interfacedot3statsduplexstatus_2812 = ethernetRow.Openconfiginterfacesethernetduplexmode_20203;
			interfaceRow.Interfacealiasdetailed_2813 = row.Openconfiginterfacesdescription_20102;
			interfaceRow.Interfacebandwidth_2815 = ethernetRow.Openconfiginterfacesethernetportspeed_20204;
			interfaceRow.Interfaceutilizationif_2816 = utilization;
			interfaceRow.Interfaceerrorrxrate_2818 = row.Openconfiginterfacesinerrorrate_20108;
			interfaceRow.Interfaceerrortxrate_2819 = row.Openconfiginterfacesouterrorrate_20109;
			interfaceRow.Interfaceutilizationprcnt_2823 = utilizationPercentage;
			interfaceRow.Interfacedescription_2824 = row.Openconfiginterfacesdisplaykey_20128;

			return interfaceRow;
		}

		return new InterfacetableQActionRow
		{
			Interfaceindex_2801 = key,
			Interfacedescr_2802 = DisplayKeyUtil.ExpandName(Convert.ToString(row.Openconfiginterfacesindex_20101)),
			Interfacetype_2803 = row.Openconfiginterfacestype_20133,
