	private static void SetInterfacesRow(SLProtocol protocol, OpenconfiginterfacesQActionRow row, OpenconfiginterfacesethernetQActionRow ethernetRow)
	{
		double utilization = CalculateUtilization(Convert.ToDouble(row.Openconfiginterfacesrxbitrate_20111), Convert.ToDouble(row.Openconfiginterfacestxbitrate_20119));

		var interfaceRow = GetInterfaceRow(protocol, row, ethernetRow, utilization);
		SetRow(protocol, Parameter.Interfacetable.tablePid, interfaceRow.ToObjectArray(), interfaceRow.Key);
	}

	private static void SetInterfacesRxRow(SLProtocol protocol, OpenconfiginterfacesQActionRow row, OpenconfiginterfacesethernetQActionRow ethernetRow)
	{
		var interfaceRxRow = GetInterfaceRxRow(protocol, row, ethernetRow);
		SetRow(protocol, Parameter.Iftablerx.tablePid, interfaceRxRow.ToObjectArray(), interfaceRxRow.Key);
	}

	private static void SetInterfacesTxRow(SLProtocol protocol, OpenconfiginterfacesQActionRow row, OpenconfiginterfacesethernetQActionRow ethernetRow)
	{
		var interfaceTxRow = GetInterfaceTxRow(protocol, row, ethernetRow);
		SetRow(protocol, Parameter.Iftabletx.tablePid, interfaceTxRow.ToObjectArray(), interfaceTxRow.Key);
	}

	private static void SetRow(SLProtocol protocol, int tablePid, object[] row, string key)
	{
		if (protocol.Exists(tablePid, key))
		{
			protocol.SetRow(tablePid, key, row);
		}
		else
		{
			protocol.AddRow(tablePid, row);
		}
	}
