using System;
using System.Collections.Generic;

using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

/// <summary>
///     DataMiner QAction Class: Poll Policy Map.
/// </summary>
public static class QAction
{
	private enum ApiPollingStatus
	{
		Disabled,

		Enabled,
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			int trigger = protocol.GetTriggerParameter();

			string interfaceName = Skyline.Protocol.Api.InterfaceTable.Name.GetValue(protocol, protocol.RowKey());
			bool activate = Convert.ToBoolean(protocol.GetParameter(protocol.GetTriggerParameter()));

			string command;

			if (trigger.Equals(2880))
			{
				command = "sh policy-map int " + interfaceName + " type qos | json";
			}
			else
			{
				command = "sh running-config int " + interfaceName + " | include oif | no-more";
			}

			var dict = GetCommandColumn(protocol);

			if (dict.TryGetValue(command, out object[] obj))
			{
				string instance = Convert.ToString(obj[0]);
				bool isEnabled = Convert.ToBoolean(obj[1]);
				var status = isEnabled ? ApiPollingStatus.Enabled : ApiPollingStatus.Disabled;

				if (status.Equals(ApiPollingStatus.Disabled) && activate)
				{
					protocol.SetParameterIndexByKey(Parameter.Pollingtable.tablePid, instance, Parameter.Pollingtable.Idx.pollingstatus + 1, (int)ApiPollingStatus.Enabled);
				}

				if (status.Equals(ApiPollingStatus.Enabled) && !activate)
				{
					protocol.SetParameterIndexByKey(Parameter.Pollingtable.tablePid, instance, Parameter.Pollingtable.Idx.pollingstatus + 1, (int)ApiPollingStatus.Disabled);
				}

				// Do Nothing
			}

			if (activate)
			{
				AddOrUpdatePollingRow(protocol, command);
			}

			// Do Nothing
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void AddOrUpdatePollingRow(SLProtocolExt protocol, string command)
	{
		int communicationType = 1;
		int frequency = 300;
		int status = 1;

		string instance = Guid.NewGuid().ToString();

		var newCommandRow = new PollingtableQActionRow
		{
			Pollinginstance = instance,
			Pollingcommand = command,
			Pollingcommunicationtype = communicationType,
			Pollingfrequency = frequency,
			Pollingstatus = status,
			Pollinginformation = "-1",
			Pollinglastpolled = -1,
		};

		if (!protocol.Exists(Parameter.Pollingtable.tablePid, instance))
		{
			protocol.pollingtable.AddRow(newCommandRow);
		}
		else
		{
			protocol.pollingtable.SetRow(instance, newCommandRow.ToObjectArray());
		}
	}

	private static Dictionary<string, object[]> GetCommandColumn(SLProtocol protocol)
	{
		uint[] cols = new uint[]
		{
			Parameter.Pollingtable.Idx.pollinginstance,
			Parameter.Pollingtable.Idx.pollingcommand,
			Parameter.Pollingtable.Idx.pollingstatus,
		};

		object[] table = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Pollingtable.tablePid, cols);

		object[] instances = (object[])table[0];
		object[] commands = (object[])table[1];
		object[] status = (object[])table[2];

		var dict = new Dictionary<string, object[]>();

		for (int i = 0; i < instances.Length; i++)
		{
			dict.Add(Convert.ToString(commands[i]), new object[] { Convert.ToString(instances[i]), Convert.ToInt32(status[i]) });
		}

		return dict;
	}
}

using System;

using Skyline.DataMiner.Scripting;

using ExtendedOperationState = Skyline.Protocol.Api.InterfaceTable.ExtendedOperationState.Options;
using PreviousOperationState = Skyline.Protocol.Api.InterfaceTable.PreviousOperationState.Options;

/// <summary>
///     DataMiner QAction Class: extIfOperWrite.
/// </summary>
public static class QAction
{
	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			string rowKey = protocol.RowKey();

			int input = Convert.ToInt32(protocol.GetParameter(Parameter.Write.interfaceextendedoperationstate_2885));
			var row = Skyline.Protocol.Api.InterfaceTable.GetRow(protocol, rowKey);

			object currentValue = row.Interfaceoperstatus_2808;
			var extendedValue = (ExtendedOperationState)Convert.ToInt32(row.Interfaceextendedoperationstate_2835);
			var previousValue = (PreviousOperationState)Convert.ToInt32(row.Interfacepreviousoperationstate_2836);

			if (input == 1 && Convert.ToInt32(currentValue) == 2 && Convert.ToInt32(extendedValue) == 11)
			{
				extendedValue = ExtendedOperationState.Down;
				previousValue = PreviousOperationState.Down;
			}
			else if (input == 1 && Convert.ToInt32(currentValue) == 2 && Convert.ToInt32(previousValue) == 1)
			{
				extendedValue = ExtendedOperationState.DownAfterUp;
				previousValue = PreviousOperationState.DownAfterUp;
			}
			else if (input == 12 && Convert.ToInt32(currentValue) == 2)
			{
				extendedValue = ExtendedOperationState.DownAfterUp;
				previousValue = PreviousOperationState.Up;
			}
			else if (input == 11 && Convert.ToInt32(currentValue) == 2)
			{
				extendedValue = ExtendedOperationState.DownAfterAdminDown;
				previousValue = PreviousOperationState.AdminDown;
			}
			else
			{
				Skyline.Protocol.Api.InterfaceTable.ExtendedOperationState.SetValue(protocol, rowKey, (ExtendedOperationState)Convert.ToInt32(currentValue));
				return;
			}

			Skyline.Protocol.Api.InterfaceTable.ExtendedOperationState.SetValue(protocol, rowKey, extendedValue);
			Skyline.Protocol.Api.InterfaceTable.PreviousOperationState.SetValue(protocol, rowKey, previousValue);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

