using System;
using System.Collections.Generic;
using System.Text.RegularExpressions;

using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

public class QAction
{
	public enum Scale
	{
		Yocto = 1,

		Zepto = 2,

		Atto = 3,

		Femto = 4,

		Pico = 5,

		Nano = 6,

		Micro = 7,

		Milli = 8,

		Units = 9,

		Kilo = 10,

		Mega = 11,

		Giga = 12,

		Tera = 13,

		Exa = 14,

		Peta = 15,

		Zetta = 16,

		Yotta = 17,
	}

	/// <summary>
	///     Sensor Processing Names and Aggregate Ethernet Sensors.
	/// </summary>
	/// <param name="protocol">Link with Skyline DataMiner.</param>
	public static void Run(SLProtocol protocol)
	{
		uint[] columnsToGet = new uint[]
		{
			Parameter.Entsensorvaluetable.Idx.entsensorvalueindexsensor_3601,
			Parameter.Entsensorvaluetable.Idx.entsensorvaluescale_3603,
			Parameter.Entsensorvaluetable.Idx.entsensorvaluevalue_3604,
			Parameter.Entsensorvaluetable.Idx.entsensorvaluestatus_3605,
		};

		object[] aoColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Entsensorvaluetable.tablePid, columnsToGet);

		object[] keys = (object[])aoColumns[0];
		object[] scales = (object[])aoColumns[1];
		object[] values = (object[])aoColumns[2];
		object[] states = (object[])aoColumns[3];

		uint[] entPhysicalTableColumnsToGet = new uint[]
		{
			Parameter.Entphysicaltable.Idx.entphysicalindex_2401,
			Parameter.Entphysicaltable.Idx.entphysicalname_2402,
		};

		object[] aoColumnsPhy = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Entphysicaltable.tablePid, entPhysicalTableColumnsToGet);

		object[] aoKeysPhy = (object[])aoColumnsPhy[0];
		object[] aoNamePhy = (object[])aoColumnsPhy[1];

		object[] aoNewColumn = new object[keys.Length];

		var ethernetSensorRegex = new Regex("(Ethernet.*Lane *[0-9]*)");
		var ethernetSensors = new Dictionary<string, EthernetSensor>();

		try
		{
			if (keys.Length <= 0 || aoKeysPhy.Length <= 0)
			{
				return;
			}

			for (int i = 0; i < keys.Length; i++)
			{
				int iIndex = Array.IndexOf(aoKeysPhy, Convert.ToString(keys[i]));

				if (iIndex != -1)
				{
					string name = Convert.ToString(aoNamePhy[iIndex]);
					aoNewColumn[i] = name;
					ProcessEthernetSensorsTable(scales, values, states, ethernetSensorRegex, ethernetSensors, i, name);
				}
				else
				{
					aoNewColumn[i] = String.Empty;
				}
			}

			OffloadEthernetSensors(protocol, ethernetSensors);

			object[] columnsToSet = new object[] { Parameter.Entsensorvaluetable.tablePid, Parameter.Entsensorvaluetable.Pid.entsensorvaluename_3608 };
			protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnsToSet, new object[] { keys, aoNewColumn });
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Error Processing Physical Name of Sensor" + e, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static double CalculateValue(double value, Scale valueScale, Scale expectedUnit = Scale.Units)
	{
		int exp = (int)expectedUnit - (int)valueScale;

		return value / (1000 ^ exp);
	}

	private static void OffloadEthernetSensors(SLProtocol protocol, Dictionary<string, EthernetSensor> ethernetStats)
	{
		var rows = new List<object[]>();

		foreach (var item in ethernetStats)
		{
			rows.Add(new object[] { item.Key, item.Value.Temperature, item.Value.Voltage, item.Value.Current, item.Value.TransmitPower, item.Value.ReceivePower });
		}

		protocol.FillArray(Parameter.Ethernetsensors.tablePid, rows, NotifyProtocol.SaveOption.Full);
	}

	private static void ProcessEthernetSensorsTable(object[] scales, object[] values, object[] states, Regex ethernetSensorRegex, Dictionary<string, EthernetSensor> ethernetStats, int i, string name)
	{
		var match = ethernetSensorRegex.Match(name);

		if (match.Success && match.Groups.Count > 1)
		{
			string ethernetName = match.Groups[1].Value;

			if (!ethernetStats.TryGetValue(ethernetName, out var ethernetSensor))
			{
				ethernetSensor = new EthernetSensor();
				ethernetStats[ethernetName] = ethernetSensor;
			}

			int state = Convert.ToInt32(states[i]);
			var valueScale = (Scale)Convert.ToInt32(scales[i]);
			double value = -1;

			switch (state)
			{
				case 1: // OK

					value = Convert.ToDouble(values[i]);

					break;

				case 2: // Unavailable
					value = -2;

					break;

				case 3: // Non Operational
					value = -3;

					break;

				default:

					// Not possible to have other state.
					break;
			}

			name = name.ToLower();

			if (name.Contains("voltage"))
			{
				ethernetSensor.Voltage = CalculateValue(value, valueScale);
			}

			if (name.Contains("current"))
			{
				ethernetSensor.Current = CalculateValue(value, valueScale, Scale.Milli);
			}

			if (name.Contains("temperature"))
			{
				ethernetSensor.Temperature = CalculateValue(value, valueScale);
			}

			if (name.Contains("receive power"))
			{
				ethernetSensor.ReceivePower = CalculateValue(value, valueScale);
			}

			if (name.Contains("transmit power"))
			{
				ethernetSensor.TransmitPower = CalculateValue(value, valueScale);
			}

			// Ignore unknown Sensors.
		}
	}

	private class EthernetSensor
	{
		public EthernetSensor()
		{
			Voltage = -1;
			Current = -1;
			Temperature = -1;
			ReceivePower = -1;
			TransmitPower = -1;
		}

		public double Current { get; internal set; }

		public double ReceivePower { get; internal set; }

		public double Temperature { get; internal set; }

		public double TransmitPower { get; internal set; }

		public double Voltage { get; internal set; }
	}
}

