public static class QAction
{
	public static void CastInterface(SLProtocol protocol)
	{
		char delimiter = '.';
		object[] tableColums = (object[])protocol.NotifyProtocol(
			(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
			Parameter.Ipmcastinterfacetable.tablePid,
			new uint[] { Parameter.Ipmcastinterfacetable.Idx.ipmcastinterfacetableinstance_6201 });

		object[] tableInstances = (object[])tableColums[0];
		object[] versions = new object[tableInstances.Length];
		object[] interfaces = new object[tableInstances.Length];
		string[] values;

		try
		{
			if (tableInstances.Length != 0)
			{
				for (int i = 0; i < tableInstances.Length; i++)
				{
					values = Convert.ToString(tableInstances[i]).Split(delimiter);
					versions[i] = values[0];
					interfaces[i] = values[1];
				}

				object[] iPmCastInterfaceColumnPids = new object[]
				{
					Parameter.Ipmcastinterfacetable.tablePid,
					Parameter.Ipmcastinterfacetable.Pid.ipmcastinterfaceipversion_6207,
					Parameter.Ipmcastinterfacetable.Pid.ipmcastinterfaceifindex_6208,
				};

				protocol.NotifyProtocol(
					(int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN,
					iPmCastInterfaceColumnPids,
					new object[] { tableInstances, versions, interfaces });
			}
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Error Parsing Multicast Interface Index " + e, LogType.Error, LogLevel.NoLogging);
		}
	}

	public static void CastSsm(SLProtocol protocol)
	{
		char delimiter = '.';
		object[] tableColums = (object[])protocol.NotifyProtocol(
			(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
			Parameter.Ipmcastssmrangetable.tablePid,
			new uint[] { Parameter.Ipmcastssmrangetable.Idx.ipmcastssmrangetableinstance_6401 });

		object[] tableInstances = (object[])tableColums[0];
		object[] addTypes = new object[tableInstances.Length];
		object[] adds = new object[tableInstances.Length];
		object[] prefixes = new object[tableInstances.Length];
		string[] values;

		try
		{
			if (tableInstances.Length != 0)
			{
				for (int i = 0; i < tableInstances.Length; i++)
				{
					values = Convert.ToString(tableInstances[i]).Split(delimiter);
					addTypes[i] = values[0];
					adds[i] = Convert.ToString(tableInstances[i]).Substring(2, Convert.ToString(tableInstances[i]).Length - 4);
					prefixes[i] = values[values.Length - 1];
				}

				object[] iPmCastsSmRangeColumnPids = new object[]
				{
					Parameter.Ipmcastssmrangetable.tablePid,
					Parameter.Ipmcastssmrangetable.Pid.ipmcastssmrangeaddresstype_6407,
					Parameter.Ipmcastssmrangetable.Pid.ipmcastssmrangeaddress_6408,
					Parameter.Ipmcastssmrangetable.Pid.ipmcastssmrangeprefixlength_6409,
				};

				protocol.NotifyProtocol(
					(int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN,
					iPmCastsSmRangeColumnPids,
					new object[] { tableInstances, addTypes, adds, prefixes });
			}
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Error Parsing Multicast SSM Range Index " + e, LogType.Error, LogLevel.NoLogging);
		}
	}

	public static void Route(SLProtocol protocol)
	{
		char cDelimiter = '.';
		uint[] iPmCastRouteColumnIndexes = new uint[]
		{
			Parameter.Ipmcastroutetable.Idx.ipmcastroutetableinstance_6601,
			Parameter.Ipmcastroutetable.Idx.ipmcastrouteupstreamneighborhidden_6609,
			Parameter.Ipmcastroutetable.Idx.ipmcastroutertaddresshidden_6616,
		};

		object[] aoTableColums = (object[])protocol.NotifyProtocol(
			321 /*NT_GET_COLUMNS*/,
			Parameter.Ipmcastroutetable.tablePid,
			iPmCastRouteColumnIndexes);

		object[] tableInstances = (object[])aoTableColums[0];
		object[] upstreamNeighbors = (object[])aoTableColums[1];
		object[] toutingAddresses = (object[])aoTableColums[2];

		object[] newUpstreamIps = new object[tableInstances.Length];
		object[] newRoutingIps = new object[tableInstances.Length];
		object[] iPs = new object[tableInstances.Length];

		try
		{
			if (tableInstances.Length != 0)
			{
				for (int i = 0; i < tableInstances.Length; i++)
				{
					iPs[i] = Convert.ToString(tableInstances[i]).Split(cDelimiter).ToList()[0];

					newUpstreamIps[i] = Common.ConvertHexToDecIP(protocol, Convert.ToString(upstreamNeighbors[i]));
					newRoutingIps[i] = Common.ConvertHexToDecIP(protocol, Convert.ToString(toutingAddresses[i]));
				}

				object[] iPmCastRouteColumnPids = new object[]
				{
					Parameter.Ipmcastroutetable.tablePid,
					Parameter.Ipmcastroutetable.Pid.ipmcastroutegroupaddresstype_6626,
					Parameter.Ipmcastroutetable.Pid.ipmcastrouteupstreamneighbor_6627,
					Parameter.Ipmcastroutetable.Pid.ipmcastroutertaddress_6628,
				};

				protocol.NotifyProtocol(
					220 /*NT_SET_COLUMNS*/,
					iPmCastRouteColumnPids,
					new object[] { tableInstances, iPs, newUpstreamIps, newRoutingIps });
			}
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Error Parsing Multicast Route Index " + e, LogType.Error, LogLevel.NoLogging);
		}
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			int triggerPid = protocol.GetTriggerParameter();

			switch (triggerPid)
			{
				case Parameter.Ipmcastinterfacetable.tablePid:
					CastInterface(protocol);
					break;

				case Parameter.Ipmcastssmrangetable.tablePid:
					CastSsm(protocol);
					break;

				case Parameter.Ipmcastroutetable.tablePid:
					Route(protocol);
					break;

				case Parameter.Vtpvlantable.tablePid:
					Vlan(protocol);
					break;

				default:
					protocol.Log($"QA{protocol.QActionID}|Run|Parameter with trigger '{triggerPid}' not implemented.", LogType.Error, LogLevel.NoLogging);
					break;
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	public static void Vlan(SLProtocol protocol)
	{
		char delimiter = '.';
		object[] tableInstances = (object[])((object[])protocol.NotifyProtocol(
			(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
			Parameter.Vtpvlantable.tablePid,
			new uint[] { Parameter.Vtpvlantable.Idx.vtpvlantableinstance_7301 }))[0];

		object[] indexes = new object[tableInstances.Length];
		string[] values;

		try
		{
			if (tableInstances.Length != 0)
			{
				for (int i = 0; i < tableInstances.Length; i++)
				{
					values = Convert.ToString(tableInstances[i]).Split(delimiter);

					indexes[i] = values[1];
				}

				object[] interfaces = new object[indexes.Length];

				for (int i = 0; i < indexes.Length; i++)
				{
					interfaces[i] = -1;
				}

				InterfacesHelper.SetDetailedIfVlansToNA(protocol);

				protocol.NotifyProtocol(
					(int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN,
					new object[] { Parameter.Vtpvlantable.tablePid, Parameter.Vtpvlantable.Pid.vtpvlanindex_7306, Parameter.Vtpvlantable.Pid.vtpvlaninterfaces_7307 },
					new object[] { tableInstances, indexes, interfaces });

				SetVtpVlanDisplayed(protocol);
			}
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Error Parsing VLAN Index " + e, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void SetVtpVlanDisplayed(SLProtocol protocol)
	{
		uint[] columnsToGet = new uint[]
		{
			Parameter.Vtpvlantable.Idx.vtpvlantableinstance_7301,
