		object[] vtpVlanHidden = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Vtpvlantable.tablePid, columnsToGet);

		object[] columnsToSet = new object[]
