/// <summary>
///     DataMiner QAction Class: Filter L2 L3 Interface Table.
/// </summary>
public static class QAction
{
	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			uint[] columnsToGet = new uint[]
			{
				Parameter.Cl2l3hiddeniftable.Idx.cl2l3hiddeniftableinstance_7151,
				Parameter.Cl2l3hiddeniftable.Idx.cl2l3hiddenifmodeadmin_7152,
				Parameter.Cl2l3hiddeniftable.Idx.cl2l3hiddenifmodeoper_7153,
			};

			var l2l3InterfaceTable = protocol.GetColumns(
				Parameter.Cl2l3hiddeniftable.tablePid,
				columnsToGet,
				(string id, double adminMode, string operationalMode)
					=> new { Id = id, AdminMode = adminMode, OperationalMode = operationalMode });

			var disabledInterfaces = protocol.GetDisabledInterfaces();

			if (disabledInterfaces.Any())
			{
				l2l3InterfaceTable = l2l3InterfaceTable.Where(x => !disabledInterfaces.Contains(x.Id));
			}

			object[] columnsToSet = new object[]
			{
				l2l3InterfaceTable.Select(x => (object)x.Id).ToArray(),
				l2l3InterfaceTable.Select(x => (object)x.AdminMode).ToArray(),
				l2l3InterfaceTable.Select(x => (object)x.OperationalMode).ToArray(),
				l2l3InterfaceTable.Select(x => (object)x.Id).ToArray(),
			};

			protocol.FillArray(Parameter.Cl2l3iftable.tablePid, columnsToSet);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

using System;
using System.Collections.Generic;
using System.Globalization;
using System.Text;

using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

public class QAction
{
	public static double ParseHexToOADouble(string sRawHexValue)
	{
		string shexDtFormat = "yy.yy.MM.dd.HH.mm.ss";
		string[] saHexFormat = shexDtFormat.Split('.');
		int iFormatLength = saHexFormat.Length;

		string[] saData = sRawHexValue.Split('.');
		var lsData = new List<string>(6);

		int iItemCounter = 0;
		int iYearPos = -1;
		var sYearData = new StringBuilder();

		if (saData.Length < 7)
		{
			return -1;
		}

		for (int iPos = 0; iPos < 7; iPos++)
		{
			string sData = saData[iPos];

			if (iPos < iFormatLength && saHexFormat[iPos].ToLower() == "yy")
			{
				sYearData.Append(saData[iPos]);
				iYearPos = iItemCounter;
			}
			else
			{
				int ivalue = Int32.Parse(sData, NumberStyles.HexNumber);
				string sValue = Convert.ToString(ivalue);

				if (sValue.Length < 2)
				{
					sValue = "0" + sValue;
				}

				lsData.Add(sValue);
				iItemCounter++;
			}
		}

		if (sYearData.Length != 0)
		{
			lsData.Insert(iYearPos, Convert.ToString(Int32.Parse(sYearData.ToString(), NumberStyles.HexNumber)));
		}

		string sDt = String.Join(String.Empty, lsData);

		if (!DateTime.TryParseExact(sDt, "yyyyMMddHHmmss", CultureInfo.InvariantCulture, DateTimeStyles.None, out var myDateTime))
		{
			return -1;
		}

		return myDateTime.ToOADate();
	}

	public static void Run(SLProtocol protocol)
	{
		uint[] colsToGet = new uint[] { Parameter.Managementdomaintable.Idx.managementdomainindex_7801, Parameter.Managementdomaintable.Idx.managementdomainlastchangehidden_7806 };
		int colToSet = Parameter.Managementdomaintable.Pid.managementdomainlastchange_7820;

		object[] cols = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Managementdomaintable.tablePid, colsToGet);
		object[] keys = (object[])cols[0];
		object[] dates = (object[])cols[1];

		object[] newDates = new object[keys.Length];

		for (int i = 0; i < keys.Length; i++)
		{
			if (Convert.ToString(dates[i]).Equals("00.00.01.01.00.00.00.00"))
			{
				newDates[i] = -1;
			}
			else
			{
				newDates[i] = ParseHexToOADouble(Convert.ToString(dates[i]));
			}
		}

		protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, new object[] { Parameter.Managementdomaintable.tablePid, colToSet }, new object[] { keys, newDates });
	}
}

using System;
using System.Collections.Generic;

using Skyline.DataMiner.Scripting;

public class GenericTrap
{
	public GenericTrap(object trapInfo)
	{
		object[] _trapInfo = trapInfo as object[];

		if (_trapInfo.Length < 1)
		{
			throw new NotSupportedException("Received invalid trap information");
		}

		object[] generalTrapInfo = (object[])_trapInfo[0];
		ParseGeneralTrapInfo(generalTrapInfo);
		ParseTrapBindings(_trapInfo);
	}

	public Dictionary<int, Binding> Bindings { get; private set; }

	public string IP { get; private set; }

	public string Oid { get; private set; }

	public string TrapTime { get; private set; }

	private void ParseGeneralTrapInfo(object[] generalTrapInfo)
	{
		if (generalTrapInfo.Length != 3)
		{
			throw new NotSupportedException("Received invalid general trap information");
		}

		Oid = Convert.ToString(generalTrapInfo[0]);
		IP = Convert.ToString(generalTrapInfo[1]);
		TrapTime = Convert.ToString(generalTrapInfo[2]);
	}

	private void ParseTrapBindings(object[] trapInfo)
	{
		Bindings = new Dictionary<int, Binding>();

		for (int i = 1; i < trapInfo.Length; i++)
		{
			object[] _trapInfo = (object[])trapInfo[i];
			Bindings.Add(i, new Binding(Convert.ToString(_trapInfo[0]), _trapInfo[1]));
		}
	}

	public class Binding
	{
		public Binding(string oid, object value)
		{
			Oid = oid;
			Value = value;
		}

		public string Oid { get; }

		public object Value { get; }
	}
}

public class QAction
{
	public enum Selection
	{
		linkDown = 9010,

		linkUp = 9011,

		BGP = 9012,

		ColdStart = 9013,
	}

	public enum TriggerIds
	{
		RefreshIFTable = 15100,

		RefreshBGPTable = 4000,
	}

	public static void AddTrapRow(SLProtocolExt protocol, GenericTrap trap)
	{
		object[] row = new object[4];
		row[1] = trap.Oid;
		row[2] = DateTime.Now.ToOADate();
		row[3] = trap.IP;

		protocol.AddRowReturnKey(Parameter.Trapstable.tablePid, row);
	}

	/// <summary>
	///     Process the retrieved BGP traps.
	/// </summary>
	/// <param name="protocol">Link to Protocol.</param>
	/// <param name="trap">The Trap information.</param>
	public static void ProcessBgp(SLProtocolExt protocol, GenericTrap trap)
	{
		if (trap.Bindings.Count < 2)
		{
			protocol.Log(String.Format("QA{0}: (Run) Received invalid amount of bindings for BGP trap: {1}", protocol.QActionID, trap.Bindings.Count), LogType.Error, LogLevel.NoLogging);

			return;
		}

		GenericTrap.Binding binding;
		string bgpPeerRemoteAddr = String.Empty;
		int bgpState = 0;

		if (trap.Bindings.Count == 2)
		{
			// faulty RFC 1657 MIB where the bgpPeerRemoteAddr object is removed from the bindings.
			if (trap.Bindings.TryGetValue(2, out binding))
			{
				const string BGPEstablischedOID = "1.3.6.1.2.1.15.7.1";
				bgpPeerRemoteAddr = binding.Oid.Replace(BGPEstablischedOID, String.Empty).Trim('.');
				bgpState = Convert.ToInt32(binding.Value);
			}
		}
		else
		{
			if (trap.Bindings.TryGetValue(1, out binding))
			{
				bgpPeerRemoteAddr = Convert.ToString(binding.Value);
			}

			if (trap.Bindings.TryGetValue(3, out binding))
			{
				bgpState = Convert.ToInt32(binding.Value);
			}
		}

		if (protocol.bgppeertable.Exists(bgpPeerRemoteAddr))
		{
			protocol.bgppeertable[bgpPeerRemoteAddr, Parameter.Bgppeertable.Idx.bgppeerstate_4003] = bgpState;
		}
		else
		{
			// In case of missmatch: force re-poll of BGP Table (once)
			protocol.Log(String.Format("QA{0}: Process BGP Traps | Trap BGP Remote Address {1} not found in BGP Table", protocol.QActionID, bgpPeerRemoteAddr), LogType.Error, LogLevel.NoLogging);
			protocol.CheckTrigger((int)TriggerIds.RefreshBGPTable);
		}

		AddTrapRow(protocol, trap);
	}

	public static void ProcessColdStart(SLProtocolExt protocol, GenericTrap trap)
	{
		protocol.Log(String.Format("QA: (Run) Cold start OID: {0}", trap.Oid), LogType.Error, LogLevel.NoLogging);

		foreach (var binding in trap.Bindings)
		{
			protocol.Log(String.Format("QA: (Run) Cold start binding: {0} = {1}", binding.Key, binding.Value), LogType.Error, LogLevel.NoLogging);
		}
	}

	/// <summary>
	///     Process the retrieved linkUp and linkDown traps.
	/// </summary>
	/// <param name="protocol">Link to SLProtocol.</param>
	/// <param name="trap">The Trap information.</param>
	public static void ProcessLink(SLProtocolExt protocol, GenericTrap trap)
	{
		if (trap.Bindings.Count < 3)
		{
			protocol.Log(String.Format("QA{0}: (Run) Received invalid amount of bindings for LinkUp/LinkDown trap: {1}", protocol.QActionID, trap.Bindings.Count), LogType.Error, LogLevel.NoLogging);

			return;
		}

		if (!trap.Bindings.TryGetValue(1, out var interfaceIndexBinding))
		{
			return;
		}

		string interfaceIndex = Convert.ToString(interfaceIndexBinding.Value);

		if (protocol.interfacetable.Exists(interfaceIndex))
		{
			if (protocol.GetTriggerParameter() == 9010)
			{
				// down
				protocol.interfacetable[interfaceIndex, Parameter.Interfacetable.Idx.interfaceoperstatus_2808] = 2;
				protocol.iftable[interfaceIndex, Parameter.Iftable.Idx.iftableifoperstatus_15108] = 2;
			}
			else
			{
				// up
				if (trap.Bindings.TryGetValue(3, out var interfaceOperStatus))
				{
					int interfaceOperationalStatus = Convert.ToInt32(interfaceOperStatus.Value);
					protocol.interfacetable[interfaceIndex, Parameter.Interfacetable.Idx.interfaceoperstatus_2808] = interfaceOperationalStatus;
					protocol.iftable[interfaceIndex, Parameter.Iftable.Idx.iftableifoperstatus_15108] = interfaceOperationalStatus;
				}
			}
		}
		else
		{
			// In case of missmatch: force re-poll of the IF Table (once)
			protocol.Log(String.Format("QA{0}: Process Link Traps | Trap Interface {1} not found in Interface Table", protocol.QActionID, interfaceIndex), LogType.Error, LogLevel.NoLogging);
			protocol.CheckTrigger((int)TriggerIds.RefreshIFTable);
		}

		AddTrapRow(protocol, trap);
	}

	public static void Run(SLProtocolExt protocol, object trapInfo)
	{
		try
		{
			var select = (Selection)protocol.GetTriggerParameter();
			var trap = new GenericTrap(trapInfo);

			switch (select)
			{
				case Selection.BGP:
					ProcessBgp(protocol, trap);

					break;

				case Selection.ColdStart:
					ProcessColdStart(protocol, trap);

					break;

				default:
					ProcessLink(protocol, trap);

					break;
			}
		}
		catch (Exception e)
		{
			protocol.Log(String.Format("QA{0}: (Run) Error parsing LinkUp/Down trap: {1}", protocol.QActionID, e), LogType.Error, LogLevel.NoLogging);
		}
	}
}

using System;
using System.Collections.Generic;

using QAction_1.Interfaces;

using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

public class PtpIgmpJoinStatusHandler
{
	private readonly SLProtocol protocol;

	private string[] interfaceDescriptionColumn;

	private string[] interfaceIndexColumn;

	private string multicastStreamAddress;

	public PtpIgmpJoinStatusHandler(SLProtocol protocol)
	{
		this.protocol = protocol;
		RetrieveCurrentConfiguration();
	}

	public void UpdateIgmpJoinStatus(object[] addresses, object[] interfaces)
	{
		var joinedIgmpInterfaceDescriptions = GetJoinedIgmpInterfaceDescriptions(addresses, interfaces);

		for (int i = 0; i < joinedIgmpInterfaceDescriptions.Count; i++)
		{
			if (joinedIgmpInterfaceDescriptions[i].Contains("Ethernet"))
			{
				joinedIgmpInterfaceDescriptions[i] = joinedIgmpInterfaceDescriptions[i].Replace("Ethernet", "Eth");
			}
		}

		string[] ptpInterfaceIndexColumn = protocol.GetKeys(Parameter.Ptpinterfaces.tablePid);
		object[] ptpInterfacesIGMPJoinStatusColumn = new object[ptpInterfaceIndexColumn.Length];

		for (int i = 0; i < ptpInterfaceIndexColumn.Length; i++)
		{
			if (joinedIgmpInterfaceDescriptions.Contains(ptpInterfaceIndexColumn[i]))
			{
				ptpInterfacesIGMPJoinStatusColumn[i] = "Present";
			}
			else
			{
				ptpInterfacesIGMPJoinStatusColumn[i] = "Non Present";
			}
		}

		object[] columnsToSet = new object[] { Parameter.Ptpinterfaces.tablePid, Parameter.Ptpinterfaces.Pid.ptpinterfacesigmpjoinstatus_12249 };
		protocol.NotifyProtocol(
			 (int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN,
			 columnsToSet,
			 new object[] { Array.ConvertAll(ptpInterfaceIndexColumn, x => { return (object)x; }), ptpInterfacesIGMPJoinStatusColumn });
	}

	private List<string> GetJoinedIgmpInterfaceDescriptions(object[] addresses, object[] interfaces)
	{
		var igmpJoinedInterfaceDescriptions = new List<string>();

		if (String.IsNullOrEmpty(multicastStreamAddress))
		{
			return igmpJoinedInterfaceDescriptions;
		}

		string[] igmpAddress = Array.ConvertAll(addresses, x => { return Convert.ToString(x); });
		string[] igmpInterfaces = Array.ConvertAll(interfaces, x => { return Convert.ToString(x); });

		for (int i = 0; i < addresses.Length; i++)
		{
			if (igmpAddress[i] == multicastStreamAddress)
			{
				int interfaceIndex = Array.IndexOf(interfaceIndexColumn, igmpInterfaces[i]);

				if (interfaceIndex != -1)
				{
					igmpJoinedInterfaceDescriptions.Add(interfaceDescriptionColumn[interfaceIndex]);
				}
			}
		}

		return igmpJoinedInterfaceDescriptions;
	}

	private void RetrieveCurrentConfiguration()
	{
		multicastStreamAddress = Convert.ToString(protocol.GetParameter(Parameter.multicaststreamaddress_12270));

		object[] interfaceColumns = InterfacesHelper.GetInterfaceIndexAndDescriptionColumns(protocol);

		interfaceIndexColumn = Array.ConvertAll((object[])interfaceColumns[0], x => { return Convert.ToString(x); });
		interfaceDescriptionColumn = Array.ConvertAll((object[])interfaceColumns[1], x => { return Convert.ToString(x); });
	}
}

public class QAction
{
	/// <summary>
	///     Update Indexes.
	/// </summary>
	/// <param name="protocol">Link with Skyline DataMiner.</param>
	public static void Run(SLProtocol protocol)
	{
		object[] keys = (object[])((object[])protocol.NotifyProtocol(
			(int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS,
			Parameter.Igmpcachetable.tablePid,
			new uint[] { Parameter.Igmpcachetable.Idx.igmpcacheindex_9401 }))[0];

		object[] addresses = new object[keys.Length];
		object[] interfaces = new object[keys.Length];

		for (int i = 0; i < keys.Length; i++)
		{
			string key = Convert.ToString(keys[i]);
			int index = key.LastIndexOf('.');

			if (index != -1)
			{
				addresses[i] = key.Substring(0, index);

				if (index + 1 < key.Length)
				{
					interfaces[i] = key.Substring(index + 1);
				}
			}
		}

		object[] columnsToSet = new object[] { Parameter.Igmpcachetable.tablePid, Parameter.Igmpcachetable.Pid.igmpcacheaddress_9408, Parameter.Igmpcachetable.Pid.igmpcacheifindex_9409 };
		protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnsToSet, new object[] { keys, addresses, interfaces });

		var ptpIgmpJoinStatusHandler = new PtpIgmpJoinStatusHandler(protocol);
		ptpIgmpJoinStatusHandler.UpdateIgmpJoinStatus(addresses, interfaces);
	}
}

