using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Net;
using System.Net.Security;
using System.Security.Cryptography.X509Certificates;
using System.Text;

using Renci.SshNet;
using Renci.SshNet.Common;

using Skyline.DataMiner.Scripting;
using Skyline.Protocol;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

/// <summary>
///     DataMiner QAction Class: ProcessCommands.
/// </summary>
public class QAction
{
	public enum SshAuthStates
	{
		Failure,

		Success,
	}

	public static bool CheckCommunicationProblem(string result)
	{
		return result.Contains(Common.Defaults.CommunicationProblem);
	}

	/// <summary>
	///     Together with the AcceptAllCertifications method right
	///     below this causes to bypass errors caused by SLL-Errors.
	/// </summary>
	public static void IgnoreBadCertificates()
	{
		ServicePointManager.ServerCertificateValidationCallback = AcceptAllCertifications;
	}

	/// <summary>
	///     Process the command line table.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			var now = DateTime.UtcNow;
			uint pollingIp = 9612;

			uint[] paramsToGet = new uint[]
			{
				pollingIp,
				Parameter.sshusername,
				Parameter.sshpassword,
				Parameter.commandtimeouttime,
				Parameter.clicommunicationtype,
				Parameter.nxapiversion,
				Parameter.communicationissuestotalcount_9712,
			};

			object[] parameters = (object[])protocol.GetParameters(paramsToGet);

			string host = Convert.ToString(parameters[0]);
			string user = Convert.ToString(parameters[1]);
			string pwd = Convert.ToString(parameters[2]);
			int commandTimeout = Convert.ToInt32(parameters[3]);
			int communicationType = Convert.ToInt32(parameters[4]);
			string nx_ApiVersion = Convert.ToString(parameters[5]);
			int communicationIssuesTotalCount = Convert.ToInt32(parameters[6]);

			CheckSshAuth(protocol, host, user, pwd);

			var commandList = GetSortedCommandList(protocol);

			if (!commandList.Any())
			{
				protocol.SetParameter(Parameter.communicationissuestotalcount_9712, communicationIssuesTotalCount);

				return;
			}

			var keysToRemove = new List<string>();

			if (communicationType.Equals(1))
			{
				using (var client = new SshClient(host, user, pwd))
				{
					client.Connect();
					protocol.SetParameter(Parameter.sshloginstatus_9632, (int)SshAuthStates.Success);
					SendAllSshCommandsAndSaveResponsesInHistoryTable(protocol, now, commandTimeout, commandList, keysToRemove, client);
					client.Disconnect();
				}
			}
			else
			{
				// NX API
				communicationIssuesTotalCount = SendAllNxApiCommandsAndSaveInHistoryTable(
					protocol,
					now,
					host,
					user,
					pwd,
					commandTimeout,
					nx_ApiVersion,
					communicationIssuesTotalCount,
					commandList,
					keysToRemove);
			}

			if (keysToRemove.Any())
			{
				protocol.DeleteRow(Parameter.Commandtable.tablePid, keysToRemove.ToArray());
			}

			Common.DeleteCommandHistoryTableExtraRows(protocol);

			protocol.SetParameter(Parameter.communicationissuestotalcount_9712, communicationIssuesTotalCount);
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Run|" + e, LogType.Error, LogLevel.NoLogging);
			protocol.SetParameter(Parameter.sshloginstatus_9632, (int)SshAuthStates.Failure);
		}
	}

	/// <summary>
	///     In Short: the Method solves the Problem of broken Certificates.
	///     Sometime when requesting Data and the sending Webserverconnection
	///     is based on a SSL Connection, an Error is caused by Servers whoes
	///     Certificate(s) have Errors. Like when the Cert is out of date
	///     and much more... So at this point when calling the method,
	///     this behaviour is prevented.
	/// </summary>
	/// <param name="sender">Sender object.</param>
	/// <param name="certification">Certification object.</param>
	/// <param name="chain">Chain object.</param>
	/// <param name="sslPolicyErrors">SSL Policy Errors.</param>
	/// <returns>The return will always be true as we want to accept self-signed certificates.</returns>
	private static bool AcceptAllCertifications(object sender, X509Certificate certification, X509Chain chain, SslPolicyErrors sslPolicyErrors)
	{
		return true;
	}

	private static void CheckSshAuth(SLProtocol protocol, string host, string user, string pwd)
	{
		if (!String.IsNullOrEmpty(user) && !String.IsNullOrEmpty(pwd))
		{
			try
			{
				using (var client = new SshClient(host, user, pwd))
				{
					client.Connect();
					protocol.SetParameter(Parameter.sshloginstatus_9632, (int)SshAuthStates.Success);
					client.Disconnect();
				}
			}
			catch (Exception)
			{
				protocol.SetParameter(Parameter.sshloginstatus_9632, (int)SshAuthStates.Failure);
			}
		}
	}

	private static List<CommandRow> GetSortedCommandList(SLProtocol protocol)
	{
		try
		{
			return TryGetSortedCommandList(protocol);
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|GetCommandList|" + e, LogType.Error, LogLevel.NoLogging);

			return new List<CommandRow>();
		}
	}

	private static void HandleNxApiMultipleResult(SLProtocol protocol, DateTime now, CommandRow commandRow, List<string> commandsInLine, string result, int communicationProblemCount)
	{
		var multipleResults = Json.Deserialize<Json.NxMultipleResponses.NX_API>(result);

		if (multipleResults == null ||
			multipleResults.Ins_api == null ||
			multipleResults.Ins_api.Outputs == null ||
			multipleResults.Ins_api.Outputs.Output == null ||
			!commandsInLine.Count.Equals(multipleResults.Ins_api.Outputs.Output.Count))
		{
			protocol.AddRow(
				Parameter.Commandhistorytable.tablePid,
				new object[]
				{
					null,
					commandRow.Command,
					result,
					now.ToOADate(),
					communicationProblemCount,
				});

			return;
		}

		for (int i = 0; i < commandsInLine.Count; i++)
		{
			if (multipleResults.Ins_api.Outputs.Output[i] != null)
			{
				protocol.AddRow(
					Parameter.Commandhistorytable.tablePid,
					new object[]
					{
						null,
						commandsInLine[i],
						multipleResults.Ins_api.Outputs.Output[i].Body,
						communicationProblemCount,
					});
			}
			else
			{
				protocol.AddRow(
					Parameter.Commandhistorytable.tablePid,
					new object[]
					{
						null,
						commandsInLine[i],
						"Response failure",
						now.ToOADate(),
						communicationProblemCount,
					});
			}
		}
	}

	private static void HandleNxApiSingleResult(SLProtocol protocol, DateTime now, CommandRow commandRow, string result, int communicationProblemCount)
	{
		string code = String.Empty;
		var singleResult = Json.Deserialize<Json.NxSingleResponse.NX_API>(result);

		if (singleResult != null && singleResult.Ins_api != null &&
			singleResult.Ins_api.Outputs != null && singleResult.Ins_api.Outputs.Output != null)
		{
			result = singleResult.Ins_api.Outputs.Output.Body;
			code = singleResult.Ins_api.Outputs.Output.Code;
		}

		if (code.Equals("200") && commandRow.Command.Equals("clear nbm flows statistics"))
		{
			ResetNbmFlowsData(protocol);
			ResetPollingData(protocol);
		}

		object[] row = new object[] { null, commandRow.Command, result, now.ToOADate(), communicationProblemCount };
		protocol.AddRow(Parameter.Commandhistorytable.tablePid, row);
	}

	private static void ResetNbmFlowsData(SLProtocol protocol)
	{
		string[] keys = protocol.GetKeys(Parameter.Nbmflowstable.tablePid);
		object[] zeroArray = Enumerable.Repeat(0, keys.Length).Select(x => (object)x).ToArray();

		object[] pids = new object[]
		{
			Parameter.Nbmflowstable.tablePid,
			Parameter.Nbmflowstable.Pid.nbmflowsbytes_14113,
			Parameter.Nbmflowstable.Pid.nbmflowsbitrate_14114,
			Parameter.Nbmflowstable.Pid.nbmflowsbandwidthutilization_14115,
			Parameter.Nbmflowstable.Pid.nbmflowsdroppedbytes_14117,
		};

		object[] data = new object[]
		{
			keys.Select(x => (object)x).ToArray(),
			zeroArray,
			zeroArray,
			zeroArray,
			zeroArray,
		};

		protocol.NotifyProtocol(220 /* NT_FILL_ARRAY_WITH_COLUMN */, pids, data);
	}

	private static void ResetPollingData(SLProtocol protocol)
	{
		protocol.SetRow(Parameter.Pollingtable.tablePid, "70", new object[] { null, null, null, null, null, "Manual reset", DateTime.UtcNow });
	}

	private static int SendAllNxApiCommandsAndSaveInHistoryTable(
		SLProtocol protocol,
		DateTime now,
		string host,
		string user,
		string pwd,
		int commandTimeout,
		string nx_ApiVersion,
		int communicationIssuesTotalCount,
		List<CommandRow> commandList,
		List<string> keysToRemove)
	{
		var nx_Command = new Json.NxRequest.NX_API
		{
			ins_api = new Json.NxRequest.InsApi
			{
				chunk = "0",
				sid = "1",
				output_format = "json",
				version = nx_ApiVersion,
				type = "cli_conf",
				input = String.Empty,
			},
		};

		foreach (var commandRow in commandList)
		{
			if (commandRow == null)
			{
				continue;
			}

			// Split the command if it's a multiple command line otherwise it will have only one command
			var commandsInLine = new List<string>(commandRow.Command.Split(';'));

			string result = String.Empty;
			int communicationProblemCount = 0;

			try
			{
				nx_Command.ins_api.input = String.Join(" ; ", commandsInLine);

				string post_data = Json.Serialize(nx_Command);

				result = SendHttpPost(protocol, host, user, pwd, post_data, commandTimeout);

				if (CheckCommunicationProblem(result))
				{
					communicationProblemCount++;
					communicationIssuesTotalCount++;
				}

				if (commandsInLine.Count <= 1)
				{
					HandleNxApiSingleResult(protocol, now, commandRow, result, communicationProblemCount);
				}
				else
				{
					HandleNxApiMultipleResult(protocol, now, commandRow, commandsInLine, result, communicationProblemCount);
				}
			}
			catch (Exception e)
			{
				result = e.Message;

				if (CheckCommunicationProblem(result))
				{
					communicationProblemCount++;
					communicationIssuesTotalCount++;
				}

				protocol.AddRow(Parameter.Commandhistorytable.tablePid, new object[] { null, commandRow.Command, result, now.ToOADate(), communicationProblemCount });
			}

			keysToRemove.Add(commandRow.Key);
		}

		return communicationIssuesTotalCount;
	}

	private static void SendAllSshCommandsAndSaveResponsesInHistoryTable(
		SLProtocol protocol,
		DateTime now,
		int commandTimeout,
		List<CommandRow> commandList,
		List<string> keysToRemove,
		SshClient client)
	{
		foreach (var commandRow in commandList)
		{
			if (commandRow == null)
			{
				continue;
			}

			// Split the command if it's a multiple command line otherwise it will have only one command
			var commandsInLine = new List<string>(commandRow.Command.Split(';'));

			foreach (string command in commandsInLine)
			{
				string result = String.Empty;
				var sshCommand = client.CreateCommand(command);
				sshCommand.CommandTimeout = TimeSpan.FromMilliseconds(commandTimeout);

				try
				{
					sshCommand.Execute();

					result = sshCommand.Result;
				}
				catch (SshOperationTimeoutException sshException)
				{
					result = sshException.Message;
				}

				protocol.AddRow(
					Parameter.Commandhistorytable.tablePid,
					new object[] { null, command, result, now.ToOADate(), -1 });
			}

			keysToRemove.Add(commandRow.Key);
		}
	}

	private static string SendHttpPost(SLProtocol protocol, string host, string username, string password, string command, int commandTimeout)
	{
		try
		{
			IgnoreBadCertificates();

			var request = (HttpWebRequest)WebRequest.Create(new Uri(String.Format("https://{0}/ins", host)));

			request.KeepAlive = false;
			request.ProtocolVersion = HttpVersion.Version10;
			request.Method = "POST";
			request.UseDefaultCredentials = false;
			request.Proxy = null;
			request.Timeout = commandTimeout;

			string encoded = Convert.ToBase64String(Encoding.GetEncoding("ISO-8859-1").GetBytes(username + ":" + password));
			byte[] postBytes = Encoding.ASCII.GetBytes(command);

			request.Headers.Add("Authorization", "Basic " + encoded);
			request.ContentType = "application/json";
			request.ContentLength = postBytes.Length;

			using (var requestStream = request.GetRequestStream())
			{
				// Send the post
				requestStream.Write(postBytes, 0, postBytes.Length);
			}

			// grab te response and print it out to the console along with the status code
			using (var response = (HttpWebResponse)request.GetResponse())
			{
				using (var reader = new StreamReader(response.GetResponseStream()))
				{
					string responseData = reader.ReadToEnd();
					request.Abort();

					return responseData;
				}
			}
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Send HTTPS Failed|" + e.Message, LogType.Error, LogLevel.NoLogging);

			return Common.Defaults.CommunicationProblem;
		}
	}

	private static void SortCommands(List<CommandRow> commands)
	{
		commands.Sort(
			(x, y) =>
			{
				bool bFirstIsANumber = Int32.TryParse(x.Priority, out int outValueFirst);
				bool bSecondIsANumber = Int32.TryParse(y.Priority, out int outValueSecond);

				if (bFirstIsANumber && bSecondIsANumber)
				{
					return outValueFirst > outValueSecond ? 1 : -1;
				}

				if (bFirstIsANumber)
				{
					return -1;
				}

				return 1;
			});
	}

	private static List<CommandRow> TryGetSortedCommandList(SLProtocol protocol)
	{
		uint[] columnIndexes = new uint[]
		{
			Parameter.Commandtable.Idx.commandtableindex,
			Parameter.Commandtable.Idx.commandtablecommand,
			Parameter.Commandtable.Idx.commandtablepriority,
		};

		object[] columns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Commandtable.tablePid, columnIndexes);
		var keysToDelete = new List<string>();

		if (columns == null || columns.Length != 3)
		{
			return new List<CommandRow>(0);
		}

		object[] keys = (object[])columns[0];
		object[] commandColumn = (object[])columns[1];
		object[] priorityColumn = (object[])columns[2];

		var commands = new List<CommandRow>();

		for (int i = 0; i < keys.Length; i++)
		{
			if (commandColumn[i] != null && priorityColumn[i] != null)
			{
				var commandRow = new CommandRow
				{
					Key = Convert.ToString(keys[i]),
					Priority = Convert.ToString(priorityColumn[i]),
					Command = Convert.ToString(commandColumn[i]),
				};

				commands.Add(commandRow);

				continue;
			}

			keysToDelete.Add(Convert.ToString(keys[i]));
		}

		SortCommands(commands);

		if (keysToDelete.Count > 0)
		{
			protocol.DeleteRow(Parameter.Commandtable.tablePid, keysToDelete.ToArray());
		}

		return commands;
	}

	private class CommandRow
	{
		public string Command { get; set; }

		public string Key { get; set; }

		public string Priority { get; set; }
	}
}

using System;

using Skyline.DataMiner.Scripting;

/// <summary>
///     DataMiner QAction Class: Add Command.
/// </summary>
public class QAction
{
	/// <summary>
	///     Adds a command to the Command Table.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			AddCommandLine(protocol);

			// Process Command Table
			protocol.CheckTrigger(9600);
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|Run|" + e, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void AddCommandLine(SLProtocol protocol)
	{
		object commandObject = protocol.GetParameter(Parameter.Write.addcommand);

		// Command line will look like this:
		// 'PRIO1#run;printscr' where PRIO1 stands for priority=1 and 'run' and 'printscr' are two commands
		string commandLine = Convert.ToString(commandObject);

		if (String.IsNullOrWhiteSpace(commandLine))
		{
			return;
		}

		string command = commandLine;
		string priority = "N/A";

		string[] splitedCommandLine = commandLine.Split('#');

		if (splitedCommandLine.Length == 2)
		{
			// Get the priority value
			string value = splitedCommandLine[0].ToUpper();

			if (value.StartsWith("PRIO") && value.Length > 4)
			{
				value = value.Substring(4);

				if (!String.IsNullOrWhiteSpace(value) && Int32.TryParse(value, out int outValue))
				{
					priority = value;
				}
			}

			// Get the command
