/// <summary>
///     DataMiner QAction Class: API Polling.
/// </summary>
public static class QAction
{
	public enum CommunicationType
	{
		CLI = 1,

		NXAPI = 2,

		SNMP = 3,

		APIC = 4,
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			var listSsh = new List<CommandRow>();
			var listApi = new List<CommandRow>();
			var listSnmp = new List<CommandRow>();
			var listApic = new List<CommandRow>();

			GetCommandList(protocol, listSsh, listApi, listSnmp, listApic);

			if (listSsh.Any() || listApi.Any() || listSnmp.Any() || listApic.Any())
			{
				Commands.SendCommands(protocol, listSsh, listApi, listSnmp, listApic);
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void GetCommandList(SLProtocolExt protocol, List<CommandRow> listSsh, List<CommandRow> listApi, List<CommandRow> listSnmp, List<CommandRow> listApic)
	{
		var now = DateTime.UtcNow;

		uint[] cols = new uint[]
		{
			Parameter.Pollingtable.Idx.pollinginstance,
			Parameter.Pollingtable.Idx.pollingcommand,
			Parameter.Pollingtable.Idx.pollingcommunicationtype,
			Parameter.Pollingtable.Idx.pollingfrequency,
			Parameter.Pollingtable.Idx.pollingstatus,
			Parameter.Pollingtable.Idx.pollinglastpolled,
		};

		object[] table = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Pollingtable.tablePid, cols);

		object[] instances = (object[])table[0];
		object[] commands = (object[])table[1];
		object[] communicationTypes = (object[])table[2];
		object[] frequencys = (object[])table[3];
		object[] statuses = (object[])table[4];
		object[] lastpolled = (object[])table[5];

		for (int i = 0; i < instances.Length; i++)
		{
			if (Convert.ToBoolean(Convert.ToInt32(statuses[i])) && DateTime.FromOADate(Convert.ToDouble(lastpolled[i])).AddSeconds(Convert.ToInt32(frequencys[i])) < now)
			{
				var commandRow = new CommandRow
				{
					Instance = Convert.ToString(instances[i]),
					Command = Convert.ToString(commands[i]),
					TimeStamp = Convert.ToDouble(lastpolled[i]),
				};

				var communicationType = (CommunicationType)Convert.ToInt32(communicationTypes[i]);

				if (communicationType.Equals(CommunicationType.CLI))
				{
					listSsh.Add(commandRow);
				}
				else if (communicationType.Equals(CommunicationType.NXAPI))
				{
					listApi.Add(commandRow);
				}
				else if (communicationType.Equals(CommunicationType.SNMP))
				{
					listSnmp.Add(commandRow);
				}
				else
				{
					listApic.Add(commandRow);
				}
			}
		}
	}
}

