	private static bool IsInFiveMinuteInterval(double runStartTime)
	{
		TimeSpan definedTime = TimeSpan.FromSeconds(runStartTime);
		TimeSpan currentTime = DateTime.Now.TimeOfDay;

		double timeDifference = Math.Abs((definedTime - currentTime).TotalSeconds);
		double fiveMinutes = 5 * 60;

		return timeDifference <= fiveMinutes;
	}
