namespace QAction_12700.Handlers
{
	using System;
	using System.Collections.Generic;

	using Skyline.DataMiner.Scripting;
	using Skyline.Protocol.Api;

	using DisplayKeyFormat = Skyline.Protocol.Api.SfpInterfacesLanesDisplayKeyFormat.Options;

	public static class DisplayKeyFormatChangeHandler
	{
		public static void Handle(SLProtocol protocol, object value)
		{
			var displayKeyFormat = (DisplayKeyFormat)Convert.ToInt32(value);
			var displayKeyByKey = CalculateDisplayKeyByKey(protocol, displayKeyFormat);

			SfpInterfacesLanesTable.DisplayKey.SetValues(protocol, displayKeyByKey);
		}

		private static Dictionary<string, string> CalculateDisplayKeyByKey(SLProtocol protocol, DisplayKeyFormat displayKeyFormat)
		{
			var interfaceCustomDescriptionByKey = displayKeyFormat == DisplayKeyFormat.Index_CustomDescription ?
				InterfaceTable.AliasDetailed.GetValueByKey(protocol) :
				new Dictionary<string, string>(0);

			var interfaceKeyByKey = SfpInterfacesLanesTable.InterfaceKey.GetValueByKey(protocol);

			var displayKeyByKey = new Dictionary<string, string>(interfaceKeyByKey.Count);
			foreach (var kvpInterfaceKeyByKey in interfaceKeyByKey)
			{
				var index = kvpInterfaceKeyByKey.Key;
				var interfaceKey = kvpInterfaceKeyByKey.Value;
				var displayKey = CreateDisplayKey(displayKeyFormat, index, interfaceKey, interfaceCustomDescriptionByKey);

				displayKeyByKey[index] = displayKey;
			}

			return displayKeyByKey;
		}

		private static string CreateDisplayKey(DisplayKeyFormat displayKeyFormat, string index, string interfaceKey, Dictionary<string, string> interfaceCustomDescriptionByKey)
		{
			if (!interfaceCustomDescriptionByKey.TryGetValue(interfaceKey, out var interfaceCustomDescription))
			{
				interfaceCustomDescription = string.Empty;
			}

			return SfpInterfacesLanesTable.DisplayKey.Build(displayKeyFormat, index, interfaceCustomDescription);
		}
	}
}

