/// <summary>
///     DataMiner QAction Class: Get CLI Information.
/// </summary>
public static class QAction
{
	/// <summary>
	///     Parse the NBM Information.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	/// <param name="result">Result Information.</param>
	public static void ParseNbmInformation(SLProtocolExt protocol, string result)
	{
		if (String.IsNullOrWhiteSpace(result))
		{
			protocol.Log("QA" + protocol.QActionID + "|NBM Information is empty|", LogType.Error, LogLevel.NoLogging);

			return;
		}

		string[] table = result.Split(new[] { "\r\n", "\r", "\n" }, StringSplitOptions.None);

		if (table.Length <= 6)
		{
			return;
		}

		var nbmInterfaces = new List<NbminterfacestableQActionRow>();

		for (int i = 4; i < table.Length - 2; i++)
		{
			string[] line = table[i].Split('|');

			if (line.Length <= 11)
			{
				continue;
			}

			string index = line[1].Replace(" ", String.Empty);

			if (!Int32.TryParse(index, out int convIndex))
			{
				continue;
			}

			string[] splittedOpeningParenthesisLine2 = line[2].Split('(');
			string[] splittedClosingParethesisLine2Splitted = RemoveDuplicateSpaces(line[2].Split(')')[1]).Split(' ');
			nbmInterfaces.Add(
				new NbminterfacestableQActionRow
				{
					Nbminterfacesindex_14001 = convIndex,
					Nbminterfacesinterface_14002 = splittedOpeningParenthesisLine2[0].Replace(" ", String.Empty),
					Nbminterfacesiod_14003 = splittedOpeningParenthesisLine2[1].Split(')')[0].Replace(" ", String.Empty),
					Nbminterfacesslot_14004 = splittedClosingParethesisLine2Splitted[0],
					Nbminterfacesunit_14005 = splittedClosingParethesisLine2Splitted[1],
					Nbminterfacesslice_14006 = splittedClosingParethesisLine2Splitted[2],
					Nbminterfacesingressavailable_14007 = ConvertValueDouble(line[3]),
					Nbminterfacesingressusable_14008 = ConvertValueDouble(line[4]),
					Nbminterfacesingresscapacity_14009 = ConvertValueDouble(line[5]),
					Nbminterfacesegressavailable_14010 = ConvertValueDouble(line[6]),
					Nbminterfacesegressusable_14011 = ConvertValueDouble(line[7]),
					Nbminterfacesegresscapacity_14012 = ConvertValueDouble(line[8]),
					Nbminterfacesneighbordeviceid_14013 = line[9].Replace(" ", String.Empty),
					Nbminterfacesneighbordevicename_14014 = line[10].Replace(" ", String.Empty),
					Nbminterfacestype_14015 = line[11].Replace(" ", String.Empty),
				});

			protocol.Log("Count: " + nbmInterfaces.Count);

			if (nbmInterfaces.Any())
			{
				protocol.nbminterfacestable.FillArray(nbmInterfaces.Select(x => (QActionTableRow)x).ToArray());
			}
		}
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			object[] parameters = (object[])protocol.GetParameters(new uint[] { 9612, Parameter.sshusername_9630, Parameter.sshpassword_9631 });
			string host = Convert.ToString(parameters[0]);
			string username = Convert.ToString(parameters[1]);
			string password = Convert.ToString(parameters[2]);

			if (String.IsNullOrWhiteSpace(username) || String.IsNullOrWhiteSpace(password))
			{
				protocol.Log("QA" + protocol.QActionID + "|Not polling no credentials are specified!", LogType.Error, LogLevel.NoLogging);

				return;
			}

			using (var client = new SshClient(host, username, password))
			{
				client.Connect();

				if (!client.IsConnected)
				{
					protocol.Log("QA" + protocol.QActionID + "|Client could not connect", LogType.Error, LogLevel.NoLogging);

					return;
				}

				string result = String.Empty;
				var command = client.CreateCommand("show nbm interface bandwidth");
				command.CommandTimeout = TimeSpan.FromSeconds(10);

				try
				{
					command.Execute();
					result = command.Result;
					ParseNbmInformation(protocol, result);
				}
				catch (SshOperationTimeoutException)
				{
					client.Disconnect();
					protocol.Log("QA" + protocol.QActionID + "|Command " + command.CommandText + " has timed out", LogType.Error, LogLevel.NoLogging);
				}
				catch (Exception e)
				{
					client.Disconnect();
					protocol.Log("QA" + protocol.QActionID + "|Error|" + e, LogType.Error, LogLevel.NoLogging);
				}

				client.Disconnect();
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static double ConvertValueDouble(string cellValue)
	{
		if (cellValue.Contains("nan"))
		{
			return Int32.MaxValue;
		}

		string noWhitespacesValue = cellValue.Replace(" ", String.Empty);
		string noUnitsValue = noWhitespacesValue.Replace("%", String.Empty);

		if (!Double.TryParse(noUnitsValue, out double valueParsed))
		{
			return Int32.MaxValue;
		}

		return valueParsed;
	}

	/// <summary>
	///     Remove the Duplicate Spaces on a String.
	/// </summary>
	/// <param name="value">Input String to be validated.</param>
	/// <returns>A new String without duplicate spaces.</returns>
	private static string RemoveDuplicateSpaces(string value)
	{
		return String.Join(" ", value.Split(new[] { ' ' }, StringSplitOptions.RemoveEmptyEntries));
	}
}

