			trigger.ExecuteAction();
		}

		if (triggerPid == Parameter.Write.dcfnbmsourceipinterfaceproperty_14252)
		{
			Trigger trigger = new SourceIpTrigger(protocol, triggerValue);
			trigger.ExecuteAction();
		}
	}
}
