//---------------------------------

public class MulticastTrigger : Trigger
{
	public MulticastTrigger(SLProtocolExt protocol, int triggerValue) : base(protocol, triggerValue)
	{
	}

	protected override DcfInterfaceProperty DcfProperty
	{
		get
		{
			bool sourceIpToggleButtonValue = Convert.ToBoolean(Protocol.GetParameter(Parameter.dcfnbmsourceipinterfaceproperty_14202));

			if (TriggerValue == 1 && sourceIpToggleButtonValue)
			{
				return new DcfInterfaceProperty(Protocol, new List<string> { "MC", "Source IP" });
			}

			return new DcfInterfaceProperty(Protocol, new List<string> { "MC" });
		}
	}

	protected override void UpdateTriggerValue()
	{
		Protocol.SetParameter(Parameter.dcfnbmmulticastinterfaceproperty_14201, TriggerValue);
	}
}
