//---------------------------------
// Trigger\Trigger.cs
//---------------------------------

public abstract class Trigger
{
	protected readonly SLProtocolExt Protocol;

	protected readonly int TriggerValue;

	protected Trigger(SLProtocolExt protocol, int triggerValue)
	{
		Protocol = protocol;
		TriggerValue = triggerValue;
	}

	protected abstract DcfInterfaceProperty DcfProperty { get; }

	public void ExecuteAction()
	{
		if (TriggerValue == (int)PropertyAction.AddDcfProperties)
		{
			AddDcfProperties();
		}
		else
		{
			RemoveDcfProperties();
		}
	}

	protected abstract void UpdateTriggerValue();

	private void AddDcfProperties()
	{
		var nbmRows = NbmRowData.GetNbmFlows(Protocol);
		DcfProperty.AddDcfProperties(nbmRows);
		UpdateTriggerValue();
	}

	private void RemoveDcfProperties()
	{
		DcfProperty.RemoveDcfProperties();
		UpdateTriggerValue();
	}
}

