/// <summary>
/// DataMiner QAction Class.
/// </summary>
public static class QAction
{
	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			protocol.SetParameter(Parameter.Write.addcommand_9670, "clear nbm flows statistics");
		}
		catch (Exception ex)
		{
			protocol.Log($"QA{protocol.QActionID}|{protocol.GetTriggerParameter()}|Run|Exception thrown:{Environment.NewLine}{ex}", LogType.Error, LogLevel.NoLogging);
		}
	}
}

using System;
using System.Linq;

using Skyline.DataMiner.Library.Protocol.Identifiers;
using Skyline.DataMiner.Library.Protocol.Rates;
using Skyline.DataMiner.Net.Messages;
using Skyline.DataMiner.Scripting;

using Parameter = Skyline.DataMiner.Scripting.Parameter;

/// <summary>
///     Represents the ifTable.
/// </summary>
public class IfTable
{
	private enum GroupId
	{
		InterfaceTable = 15100,

		InterfaceXTable = 15200,
	}

	/// <summary>
	///     QAction entry point when table was successfully polled.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void ProcessTable(SLProtocolExt protocol)
	{
		try
		{
			var delta = RateCalculator.GetSnmpGroupExecutionDelta(protocol, (int)GroupId.InterfaceTable);
			var currentOctets_in = new ColumnIdentifier(Parameter.Iftable.Idx.iftableifinoctets_15110, Parameter.Iftable.Pid.iftableifinoctets_15110);
			var previousOctets_in = new ColumnIdentifier(Parameter.Iftable.Idx.iftableifinoctetsprevious_15123, Parameter.Iftable.Pid.iftableifinoctetsprevious_15123);
			var bitrates_in = new ColumnIdentifier(Parameter.Iftable.Idx.iftableifinbitrate_15125, Parameter.Iftable.Pid.iftableifinbitrate_15125);
			var input = new ValuesToRatesColumns(currentOctets_in, previousOctets_in, bitrates_in);
			var currentOctets_out = new ColumnIdentifier(Parameter.Iftable.Idx.iftableifoutoctets_15116, Parameter.Iftable.Pid.iftableifoutoctets_15116);
			var previousOctets_out = new ColumnIdentifier(Parameter.Iftable.Idx.iftableifoutoctetsprevious_15124, Parameter.Iftable.Pid.iftableifoutoctetsprevious_15124);
			var bitrates_out = new ColumnIdentifier(Parameter.Iftable.Idx.iftableifoutbitrate_15126, Parameter.Iftable.Pid.iftableifoutbitrate_15126);
			var output = new ValuesToRatesColumns(currentOctets_out, previousOctets_out, bitrates_out);
			var utilizationColumn = new ColumnIdentifier(Parameter.Iftable.Idx.iftableifbandwidthutilization_15127, Parameter.Iftable.Pid.iftableifbandwidthutilization_15127);
			var speedColumn = new ColumnIdentifier(Parameter.Iftable.Idx.iftableifspeed_15105, Parameter.Iftable.Pid.iftableifspeed_15105);
			var duplexColumn = new ColumnIdentifier(Parameter.Dot3statstable.tablePid, Parameter.Dot3statstable.Idx.dot3statsduplexstatus_15402, Parameter.Dot3statstable.Pid.dot3statsduplexstatus_15402);
			var utilization = new UtilizationColumns(utilizationColumn, speedColumn, duplexColumn);

			protocol.Log($"QA{protocol.QActionID}ProcessTable|current Octets in: " + Convert.ToInt32(Parameter.Iftable.Idx.iftableifinoctets_15110), LogType.DebugInfo, LogLevel.NoLogging);
			protocol.Log($"QA{protocol.QActionID}ProcessTable|current Octets out: " + Convert.ToInt32(Parameter.Iftable.Idx.iftableifoutoctets_15116), LogType.DebugInfo, LogLevel.NoLogging);
			protocol.Log($"QA{protocol.QActionID}ProcessTable|Speed (ifTable): " + Convert.ToInt32(Parameter.Iftable.Idx.iftableifspeed_15105), LogType.DebugInfo, LogLevel.NoLogging);

			var calculator = new RateCalculator(
				Parameter.Iftable.tablePid,
				Parameter.iftablebuffereddelta_15094,
				SpeedType.Low,
				DataConversionType.OctetsToBits,
				input,
				output)
			{
				Utilization = utilization,
				CurrentSysUptimePid = Parameter.sysuptime_102,
				PreviousSysUptimePid = Parameter.iftableprevioussysuptime_16010,
			};

			protocol.Log($"QA{protocol.QActionID}ProcessTable|Previous SysUptime: " + calculator.PreviousSysUptimePid + " |New SysUptime: " + calculator.CurrentSysUptimePid, LogType.DebugInfo, LogLevel.NoLogging);

			calculator.CalculateAndSetTable(protocol, delta, 1);
			CalculateOtherRatesAndSetColumns(protocol, delta);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|ProcessSuccess|Error: " + ex, LogType.Error, LogLevel.NoLogging);
			ProcessTimeout(protocol);
		}
	}

	/// <summary>
	///     QAction entry point when a timeout occurred while polling the ifTable table.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void ProcessTimeout(SLProtocol protocol)
	{
		try
		{
			RateCalculator.TimeoutOrError(protocol, Parameter.iftablebuffereddelta_15094, (int)GroupId.InterfaceTable);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|ProcessTimeout|Error: " + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void CalculateOtherRatesAndSetColumns(SLProtocol protocol, TimeSpan? delta)
	{
		uint[] rateColumnIdx = new uint[]
		{
			Parameter.Iftable.Idx.iftableifindex_15101,
			Parameter.Iftable.Idx.iftableifinerrors_15114,
			Parameter.Iftable.Idx.iftableifouterrors_15120,
			Parameter.Iftable.Idx.iftableifinerrorsprevious_15130,
			Parameter.Iftable.Idx.iftableifouterrorsprevious_15131,
			Parameter.Iftable.Idx.iftableifinerrorrate_15132,
			Parameter.Iftable.Idx.iftableifouterrorrate_15133,
			Parameter.Iftable.Idx.iftableifinucastpkts_15111,
			Parameter.Iftable.Idx.iftableifoutucastpkts_15117,
			Parameter.Iftable.Idx.iftableifinnucastpackets_15128,
			Parameter.Iftable.Idx.iftableifoutnucastpackets_15129,
			Parameter.Iftable.Idx.iftableifinucastpktsprevious_15134,
			Parameter.Iftable.Idx.iftableifoutucastpktsprevious_15135,
			Parameter.Iftable.Idx.iftableifinnucastpacketsprevious_15136,
			Parameter.Iftable.Idx.iftableifoutnucastpacketsprevious_15137,
			Parameter.Iftable.Idx.iftableifinpacketrate_15138,
			Parameter.Iftable.Idx.iftableifoutpacketrate_15139,
			Parameter.Iftable.Idx.iftableifindiscards_15113,
			Parameter.Iftable.Idx.iftableifoutdiscards_15119,
			Parameter.Iftable.Idx.iftableifindiscardsprevious_15140,
			Parameter.Iftable.Idx.iftableifoutdiscardsprevious_15141,
			Parameter.Iftable.Idx.iftableifindiscardsrate_15142,
			Parameter.Iftable.Idx.iftableifoutdiscardsrate_15143,
		};

		object[] rateColumns = (object[])protocol.NotifyProtocol(
			(int)NotifyType.NT_GET_TABLE_COLUMNS,
			Parameter.Iftable.tablePid,
			rateColumnIdx);

		object[] keys = (object[])rateColumns[0];
		uint[] inErrorsCurrent = Array.ConvertAll((object[])rateColumns[1], Convert.ToUInt32);
		uint[] outErrorsCurrent = Array.ConvertAll((object[])rateColumns[2], Convert.ToUInt32);
		uint[] inErrorsPrevious = Array.ConvertAll((object[])rateColumns[3], Convert.ToUInt32);
		uint[] outErrorsPrevious = Array.ConvertAll((object[])rateColumns[4], Convert.ToUInt32);
		double[] inErrorRatesPrevious = Array.ConvertAll((object[])rateColumns[5], Convert.ToDouble);
		double[] outErrorRatesPrevious = Array.ConvertAll((object[])rateColumns[6], Convert.ToDouble);
		uint[] inUnicastCurrent = Array.ConvertAll((object[])rateColumns[7], Convert.ToUInt32);
		uint[] outUnicastCurrent = Array.ConvertAll((object[])rateColumns[8], Convert.ToUInt32);
		uint[] inNonUnicastCurrent = Array.ConvertAll((object[])rateColumns[9], Convert.ToUInt32);
		uint[] outNonUnicastCurrent = Array.ConvertAll((object[])rateColumns[10], Convert.ToUInt32);
		uint[] inUnicastPrevious = Array.ConvertAll((object[])rateColumns[11], Convert.ToUInt32);
		uint[] outUnicastPrevious = Array.ConvertAll((object[])rateColumns[12], Convert.ToUInt32);
		uint[] inNonUnicastPrevious = Array.ConvertAll((object[])rateColumns[13], Convert.ToUInt32);
		uint[] outNonUnicastPrevious = Array.ConvertAll((object[])rateColumns[14], Convert.ToUInt32);
		double[] inPacketRatesPrevious = Array.ConvertAll((object[])rateColumns[15], Convert.ToDouble);
		double[] outPacketRatesPrevious = Array.ConvertAll((object[])rateColumns[16], Convert.ToDouble);
		uint[] inDiscardsCurrent = Array.ConvertAll((object[])rateColumns[17], Convert.ToUInt32);
		uint[] outDiscardsCurrent = Array.ConvertAll((object[])rateColumns[18], Convert.ToUInt32);
		uint[] inDiscardsPrevious = Array.ConvertAll((object[])rateColumns[19], Convert.ToUInt32);
		uint[] outDiscardsPrevious = Array.ConvertAll((object[])rateColumns[20], Convert.ToUInt32);
		double[] inDiscardRatesPrevious = Array.ConvertAll((object[])rateColumns[21], Convert.ToDouble);
		double[] outDiscardRatesPrevious = Array.ConvertAll((object[])rateColumns[22], Convert.ToDouble);

		double[] inErrorRateCurrent;
		double[] outErrorRateCurrent;
		double[] inPacketRatesCurrent;
		double[] outPacketRatesCurrent;
		double[] inDiscardRatesCurrent;
		double[] outDiscardRatesCurrent;

		if (delta.HasValue)
		{
			inErrorRateCurrent = Skyline.DataMiner.Library.Common.Rates.RateCalculator.CalculateRate(
				delta.Value.TotalMilliseconds,
				1,
				inErrorRatesPrevious,
				inErrorsCurrent,
				inErrorsPrevious,
				Skyline.DataMiner.Library.Common.Rates.DataConversionType.NoConversion);

			outErrorRateCurrent = Skyline.DataMiner.Library.Common.Rates.RateCalculator.CalculateRate(
				delta.Value.TotalMilliseconds,
				1,
				outErrorRatesPrevious,
				outErrorsCurrent,
				outErrorsPrevious,
				Skyline.DataMiner.Library.Common.Rates.DataConversionType.NoConversion);

			uint[] inPacketsCurrent = GetPacketCounts(inUnicastCurrent, inNonUnicastCurrent);
			uint[] inPacketsPrevious = GetPacketCounts(inUnicastPrevious, inNonUnicastPrevious);
			inPacketRatesCurrent = Skyline.DataMiner.Library.Common.Rates.RateCalculator.CalculateRate(
				delta.Value.TotalMilliseconds,
				1,
				inPacketRatesPrevious,
				inPacketsCurrent,
				inPacketsPrevious,
				Skyline.DataMiner.Library.Common.Rates.DataConversionType.NoConversion);

			uint[] outPacketsCurrent = GetPacketCounts(outUnicastCurrent, outNonUnicastCurrent);
			uint[] outPacketsPrevious = GetPacketCounts(outUnicastPrevious, outNonUnicastPrevious);
			outPacketRatesCurrent = Skyline.DataMiner.Library.Common.Rates.RateCalculator.CalculateRate(
				delta.Value.TotalMilliseconds,
				1,
				outPacketRatesPrevious,
				outPacketsCurrent,
				outPacketsPrevious,
				Skyline.DataMiner.Library.Common.Rates.DataConversionType.NoConversion);

			inDiscardRatesCurrent = Skyline.DataMiner.Library.Common.Rates.RateCalculator.CalculateRate(
				delta.Value.TotalMilliseconds,
				1,
				inDiscardRatesPrevious,
				inDiscardsCurrent,
				inDiscardsPrevious,
				Skyline.DataMiner.Library.Common.Rates.DataConversionType.NoConversion);

			outDiscardRatesCurrent = Skyline.DataMiner.Library.Common.Rates.RateCalculator.CalculateRate(
				delta.Value.TotalMilliseconds,
				1,
				outDiscardRatesPrevious,
				outDiscardsCurrent,
				outDiscardsPrevious,
				Skyline.DataMiner.Library.Common.Rates.DataConversionType.NoConversion);
		}
		else
		{
			double[] rateNotApplicable = Enumerable.Repeat(-1D, keys.Length).ToArray();
			inErrorRateCurrent = rateNotApplicable;
			outErrorRateCurrent = rateNotApplicable;
			inPacketRatesCurrent = rateNotApplicable;
			outPacketRatesCurrent = rateNotApplicable;
			inDiscardRatesCurrent = rateNotApplicable;
			outDiscardRatesCurrent = rateNotApplicable;
		}

		object[] ratePids = new object[]
		{
			Parameter.Iftable.tablePid,
			Parameter.Iftable.Pid.iftableifinerrorsprevious_15130,
			Parameter.Iftable.Pid.iftableifouterrorsprevious_15131,
			Parameter.Iftable.Pid.iftableifinerrorrate_15132,
			Parameter.Iftable.Pid.iftableifouterrorrate_15133,
			Parameter.Iftable.Pid.iftableifinucastpktsprevious_15134,
			Parameter.Iftable.Pid.iftableifoutucastpktsprevious_15135,
			Parameter.Iftable.Pid.iftableifinnucastpacketsprevious_15136,
			Parameter.Iftable.Pid.iftableifoutnucastpacketsprevious_15137,
			Parameter.Iftable.Pid.iftableifinpacketrate_15138,
			Parameter.Iftable.Pid.iftableifoutpacketrate_15139,
			Parameter.Iftable.Pid.iftableifindiscardsprevious_15140,
			Parameter.Iftable.Pid.iftableifoutdiscardsprevious_15141,
			Parameter.Iftable.Pid.iftableifindiscardsrate_15142,
			Parameter.Iftable.Pid.iftableifoutdiscardsrate_15143,
			false,
		};

		object[] rateValues = new object[]
		{
			keys,
			inErrorsCurrent.Cast<object>().ToArray(),
			outErrorsCurrent.Cast<object>().ToArray(),
			inErrorRateCurrent.Cast<object>().ToArray(),
			outErrorRateCurrent.Cast<object>().ToArray(),
			inUnicastCurrent.Cast<object>().ToArray(),
			outUnicastCurrent.Cast<object>().ToArray(),
			inNonUnicastCurrent.Cast<object>().ToArray(),
			outNonUnicastCurrent.Cast<object>().ToArray(),
			inPacketRatesCurrent.Cast<object>().ToArray(),
			outPacketRatesCurrent.Cast<object>().ToArray(),
			inDiscardsCurrent.Cast<object>().ToArray(),
			outDiscardsCurrent.Cast<object>().ToArray(),
			inDiscardRatesCurrent.Cast<object>().ToArray(),
			outDiscardRatesCurrent.Cast<object>().ToArray(),
		};

		protocol.NotifyProtocol((int)NotifyType.NT_FILL_ARRAY_WITH_COLUMN, ratePids, rateValues);
	}

	private static uint[] GetPacketCounts(uint[] unicastPacketCounts, uint[] nonUnicastPacketCounts)
	{
		return unicastPacketCounts.Zip(nonUnicastPacketCounts, UncheckedAddition).ToArray();
	}

	private static uint UncheckedAddition(uint unicastPacketCount, uint nonUnicastPacketCount)
	{
		return unchecked(unicastPacketCount + nonUnicastPacketCount);
	}
}

