		ulong[] inBroadcastPrevious = Array.ConvertAll((object[])rateColumns[11], Convert.ToUInt64);

		ulong[] outUnicastPrevious = Array.ConvertAll((object[])rateColumns[8], Convert.ToUInt64);
		ulong[] outMulticastPrevious = Array.ConvertAll((object[])rateColumns[10], Convert.ToUInt64);
		ulong[] outBroadcastPrevious = Array.ConvertAll((object[])rateColumns[12], Convert.ToUInt64);

		double[] inPacketRatesPrevious = Array.ConvertAll((object[])rateColumns[13], Convert.ToDouble);
		double[] outPacketRatesPrevious = Array.ConvertAll((object[])rateColumns[14], Convert.ToDouble);

		double[] inPacketRatesCurrent;
		double[] outPacketRatesCurrent;

		if (delta.HasValue)
		{
			ulong[] inPacketsCurrent = GetPacketCounts(inUnicastCurrent, inMulticastCurrent, inBroadcastCurrent);
			ulong[] inPacketsPrevious = GetPacketCounts(inUnicastPrevious, inMulticastPrevious, inBroadcastPrevious);
			inPacketRatesCurrent = Skyline.DataMiner.Library.Common.Rates.RateCalculator.CalculateRate(
				delta.Value.TotalMilliseconds,
				1,
				inPacketRatesPrevious,
				inPacketsCurrent,
				inPacketsPrevious,
				Skyline.DataMiner.Library.Common.Rates.DataConversionType.NoConversion);

			ulong[] outPacketsCurrent = GetPacketCounts(outUnicastCurrent, outMulticastCurrent, outBroadcastCurrent);
			ulong[] outPacketsPrevious = GetPacketCounts(outUnicastPrevious, outMulticastPrevious, outBroadcastPrevious);
			outPacketRatesCurrent = Skyline.DataMiner.Library.Common.Rates.RateCalculator.CalculateRate(
				delta.Value.TotalMilliseconds,
				1,
				outPacketRatesPrevious,
				outPacketsCurrent,
				outPacketsPrevious,
				Skyline.DataMiner.Library.Common.Rates.DataConversionType.NoConversion);
		}
		else
		{
			double[] rateNotApplicable = Enumerable.Repeat(-1D, keys.Length).ToArray();
			inPacketRatesCurrent = rateNotApplicable;
			outPacketRatesCurrent = rateNotApplicable;
		}

		object[] ratePids = new object[]
		{
			Parameter.Ifxtable.tablePid,
			Parameter.Ifxtable.Pid.ifxtableifinucastpktsprevious_15227,
			Parameter.Ifxtable.Pid.ifxtableifoutucastpktsprevious_15228,
			Parameter.Ifxtable.Pid.ifxtableifhcinmulticastpktsprevious_15229,
			Parameter.Ifxtable.Pid.ifxtableifhcoutmulticastpktsprevious_15231,
			Parameter.Ifxtable.Pid.ifxtableifhcinbroadcastpktsprevious_15230,
			Parameter.Ifxtable.Pid.ifxtableifhcoutbroadcastpktsprevious_15232,
			Parameter.Ifxtable.Pid.ifxtableifinpacketrate_15233,
			Parameter.Ifxtable.Pid.ifxtableifoutpacketrate_15234,
			false,
		};

		object[] rateValues = new object[]
		{
			keys,
			inUnicastCurrent.Cast<object>().ToArray(),
			outUnicastCurrent.Cast<object>().ToArray(),

			inMulticastCurrent.Cast<object>().ToArray(),
			outMulticastCurrent.Cast<object>().ToArray(),

			inBroadcastCurrent.Cast<object>().ToArray(),
			outBroadcastCurrent.Cast<object>().ToArray(),

			inPacketRatesCurrent.Cast<object>().ToArray(),
			outPacketRatesCurrent.Cast<object>().ToArray(),
		};

		protocol.NotifyProtocol((int)NotifyType.NT_FILL_ARRAY_WITH_COLUMN, ratePids, rateValues);
	}

	private static ulong[] GetPacketCounts(ulong[] unicastPacketCounts, ulong[] multicastPacketCounts, ulong[] broadcastPacketCounts)
	{
		return unicastPacketCounts.Zip(multicastPacketCounts, UncheckedAddition)
			.Zip(broadcastPacketCounts, UncheckedAddition)
			.ToArray();
	}

	private static ulong UncheckedAddition(ulong a, ulong b)
	{
		return unchecked(a + b);
	}
}

