using Skyline.DataMiner.Scripting;

/// <summary>
///     DataMiner QAction Class: Merge Interface Tables.
/// </summary>
public class QAction
{
	// RFC 2863: For interfaces that operate at 20,000,000 (20 million) bits per 	second or less, 32-bit byte and packet counters MUST be supported.
	// For interfaces that operate faster than 20,000,000 bits/second, and 	slower than 650,000,000 bits/second, 32-bit packet counters MUST be
	// supported and 64-bit octet counters MUST be supported. For interfaces that operate at 650,000,000 bits/second or faster, 64-bit packet counters AND 64-bit octet counters MUST be supported.
	// We choose to use 64-bit counters if the speed is higher than 20Mbps as this will result in fewer wraparounds.

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			var interfaceTablesMerger = new InterfaceTablesMerger(protocol);
			interfaceTablesMerger.MergeInterfaceTables();
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|Run|Error: " + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

using System;

using Skyline.DataMiner.Scripting;

/// <summary>
///     DataMiner QAction Class: Table SNMP Set.
/// </summary>
public class QAction
{
	private enum Trigger
	{
		L2L3IfTable = 7200,

		IfTable = 15100,

		IfXTable = 15200,
	}

	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			int triggerPid = protocol.GetTriggerParameter();
			string sRowKey = protocol.RowKey();
			object oValue = protocol.GetParameter(triggerPid);

			switch (triggerPid)
			{
				case Parameter.Write.interfaceadminstatus_2857:
					protocol.SetParameters(new[] { Parameter.iftablesetinstance_15099, Parameter.Write.iftableifadminstatus_15157 }, new[] { sRowKey, oValue });

					// Note: We poll the entire table so the bit rate calculation is triggered again using the correct values.
					// Polling just the cell or row could lead to wrong calculations.
					protocol.CheckTrigger((int)Trigger.IfTable);
					protocol.CheckTrigger((int)Trigger.IfXTable);

					break;

				case Parameter.Write.interfacepromiscuousmode_2877:
					protocol.SetParameters(new[] { Parameter.ifxtablesetinstance_15199, Parameter.Write.ifxtableifpromiscuousmode_15257 }, new[] { sRowKey, oValue });

					protocol.CheckTrigger((int)Trigger.IfXTable);

					break;

				case Parameter.Write.interfacealiasdetailed_2863:
					protocol.SetParameters(new[] { Parameter.ifxtablesetinstance_15199, Parameter.Write.ifxtableifalias_15259 }, new[] { sRowKey, oValue });

					protocol.CheckTrigger((int)Trigger.IfXTable);

					break;

				case Parameter.Write.interfacelinkupdowntrapenabledetailed_2864:
					protocol.SetParameters(new[] { Parameter.ifxtablesetinstance_15199, Parameter.Write.ifxtableiflinkupdowntrapenable_15255 }, new[] { sRowKey, oValue });

					protocol.CheckTrigger((int)Trigger.IfXTable);

					break;

				case Parameter.Write.cl2l3ifmodeadmin_7252:
					protocol.SetParameters(new[] { Parameter.cl2l3hiddenifsetinstance_7198, Parameter.Write.cl2l3hiddenifmodeadmin_7162 }, new[] { sRowKey, oValue });

					protocol.CheckTrigger((int)Trigger.L2L3IfTable);

					break;

				case Parameter.Write.measurementconfigurationmeasure_17915:
					protocol.CheckTrigger((int)Trigger.IfTable);
					protocol.CheckTrigger((int)Trigger.IfXTable);
					protocol.CheckTrigger((int)Trigger.L2L3IfTable);

					break;

				default:
					protocol.Log("QA" + protocol.QActionID + "|Unknown trigger parameter", LogType.Error, LogLevel.NoLogging);

					break;
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|Run|Error: " + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

using System;
using System.IO;
using System.Text.RegularExpressions;

using Renci.SshNet;
using Renci.SshNet.Common;

using Skyline.DataMiner.Scripting;

/// <summary>
///     DataMiner QAction Class: Save SSH Configuration.
/// </summary>
public static class QAction
{
	public static bool CheckConfigParams(string copyType, string filename, int sshPort)
	{
		return String.IsNullOrEmpty(copyType) || String.IsNullOrEmpty(filename) || sshPort == 0;
	}

	public static bool CheckSshInput(string userNameConnection, string passwordConnection)
	{
		return String.IsNullOrEmpty(userNameConnection) || String.IsNullOrEmpty(passwordConnection);
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			protocol.Sshconfigurationstatus_17106 = "In Progress";

			uint[] indexes = new uint[]
			{
				Parameter.sshconfigurationcopytype_17000,
				Parameter.sshconfigurationprotocoltype_17001,
				Parameter.sshipaddresremotehost_17002,
				Parameter.sshdestinationusername_17003,
				Parameter.sshdestinationpassword_17004,
				Parameter.sshdestinationfilename_17005,
				Parameter.sshusername_9630,
				Parameter.sshpassword_9631,
				9612,
				Parameter.sshtimeoutconfiguration_17007,
				Parameter.sshport_17008,
				Parameter.sshsftpscpport_17009,
				Parameter.sshsftpscppath_17010,
			};

			object[] paramValues = (object[])protocol.GetParameters(indexes);
			string copyType = Convert.ToString(paramValues[0]);
			string protocolType = Convert.ToString(paramValues[1]);
			string address = Convert.ToString(paramValues[2]);
			string userName = Convert.ToString(paramValues[3]);
			string password = Convert.ToString(paramValues[4]);
			string filename = Convert.ToString(paramValues[5]);
			string userNameConnection = Convert.ToString(paramValues[6]);
			string passwordConnection = Convert.ToString(paramValues[7]);
			string pollingIp = Convert.ToString(paramValues[8]);
			int commandTimeout = Convert.ToInt32(paramValues[9]);
			int sshPort = Convert.ToInt32(paramValues[10]);
			int sshPortRemote = Convert.ToInt32(paramValues[11]);
			string sshPath = Convert.ToString(paramValues[12]);
			string pathLocal = @"C:\Skyline DataMiner\Documents\DMA_COMMON_DOCUMENTS\CISCO Nexus";

			string completePath = Path.Combine(pathLocal, filename);

			if (CheckSshInput(userNameConnection, passwordConnection))
			{
				protocol.Sshconfigurationstatus_17106 = "Error: Empty SSH User-Password";

				return;
			}

			if (CheckConfigParams(copyType, filename, sshPort))
			{
				protocol.Sshconfigurationstatus_17106 = "Error: Empty Configuration Parameter(s)";

				return;
			}

			CommandAction(protocol, pollingIp, sshPort, userNameConnection, passwordConnection, commandTimeout, pathLocal, completePath, copyType);

			if (String.IsNullOrEmpty(address) || String.IsNullOrEmpty(protocolType) || sshPortRemote == 0 ||
				String.IsNullOrEmpty(userName) || String.IsNullOrEmpty(password))
			{
				protocol.Sshconfigurationstatus_17106 =
					"Empty Configuration Parameter(s),that required for remote server.";

				return;
			}

			if (!ValidateIPAddress(address))
			{
				protocol.Sshconfigurationstatus_17106 = "Error: Invalid IP";

				return;
			}

			if (protocolType.Equals("scp"))
			{
				ScpClientAction(protocol, address, userName, password, sshPortRemote, sshPath, completePath);
			}
			else
			{
				SftpClientAction(protocol, completePath, address, userName, password, sshPath, sshPortRemote);
			}

			protocol.Sshconfigurationstatus_17106 = "Process Finished";
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	public static bool TrySendCommand(int commandTimeout, SshClient client, string comand, out string result)
	{
		var sshCommand = client.CreateCommand(comand);
		sshCommand.CommandTimeout = TimeSpan.FromMilliseconds(commandTimeout);

		try
		{
			sshCommand.Execute();
			result = sshCommand.Result;

			return true;
		}
		catch (SshOperationTimeoutException sshException)
		{
			result = sshException.Message;

			return false;
		}
	}

	public static bool ValidateIPAddress(string ipAddress)
	{
		bool isIPAddress = false;

		string ipPattern = @"\b(?:(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)\.){3}(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)\b";

		var regex = new Regex(ipPattern);

		isIPAddress = regex.IsMatch(ipAddress);

		return isIPAddress;
	}

	private static void CommandAction(
		SLProtocolExt protocol,
		string pollingIp,
		int sshPort,
		string userNameConnection,
		string passwordConnection,
		int commandTimeout,
		string pathLocal,
		string completePath,
		string copyType)
	{
		using (var client = new SshClient(pollingIp, sshPort, userNameConnection, passwordConnection))
		{
			client.Connect();
			string command = String.Format("show {0}", copyType);
			string result = String.Empty;

			if (!TrySendCommand(commandTimeout, client, command, out result))
			{
				protocol.Sshconfigurationstatus_17106 = String.Format(
					"Error in command: {0} . Result: {1}",
					command,
					result);

				client.Disconnect();

				return;
			}

			if (!Directory.Exists(pathLocal))
			{
				Directory.CreateDirectory(pathLocal);
			}

			using (var sw = File.CreateText(completePath))
			{
				sw.WriteLine(result);
			}

			client.Disconnect();
		}
	}

	private static void ScpClientAction(SLProtocolExt protocol, string address, string userName, string password, int sshPortRemote, string sshPath, string completePath)
	{
		try
		{
			using (var scpClient = new ScpClient(address, sshPortRemote, userName, password))
			{
				scpClient.Connect();

				if (scpClient.IsConnected)
				{
					var f = new FileInfo(completePath);
					string uploadfile = f.FullName;

					scpClient.RemotePathTransformation = RemotePathTransformation.None;
					var fileStream = new FileStream(uploadfile, FileMode.Open);

					string remotePath = String.Empty;

					if (!String.IsNullOrEmpty(sshPath))
					{
						remotePath = String.Format("{0}\\{1}", sshPath, f.Name);
					}
					else
					{
						remotePath = f.Name;
					}

					scpClient.Upload(fileStream, remotePath);

					scpClient.Disconnect();
				}

				scpClient.Disconnect();
			}
		}
		catch (Exception e)
		{
			protocol.Sshconfigurationstatus_17106 = "Error loading file in server (SCP)";
			protocol.Log("QA" + protocol.QActionID + "|Run|" + e, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void SftpClientAction(SLProtocolExt protocol, string completePath, string address, string userName, string password, string sshPath, int sshPortRemote)
	{
		if (!File.Exists(completePath))
		{
			return;
		}

		try
		{
			var f = new FileInfo(completePath);
			string uploadfile = f.FullName;

			using (var sftpClient = new SftpClient(address, sshPortRemote, userName, password))
			{
				sftpClient.Connect();

				if (sftpClient.IsConnected)
				{
					var fileStream = new FileStream(uploadfile, FileMode.Open);
					string remotePath = String.Empty;

					if (!String.IsNullOrEmpty(sshPath))
					{
						remotePath = String.Format("{0}\\{1}", sshPath, f.Name);
					}
					else
					{
						remotePath = f.Name;
					}

					sftpClient.UploadFile(fileStream, remotePath);
					sftpClient.Disconnect();
				}
			}
		}
		catch (Exception e)
		{
			protocol.Sshconfigurationstatus_17106 = "Error loading file in server (SFTP)";
			protocol.Log("QA" + protocol.QActionID + "|Run|" + e, LogType.Error, LogLevel.NoLogging);
		}
	}
}

