/// <summary>
///     DataMiner QAction Class.
/// </summary>
public static class QAction
{
	private enum CommunicationTypes
	{
		CLI = 1,

		API = 2,

		SNMP = 3,

		APIC = 4,
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			string key = protocol.RowKey();
			var row = (PollingtableQActionRow)(object[])protocol.GetRow(Parameter.Pollingtable.tablePid, key);

			int triggerParam = protocol.GetTriggerParameter();

			string command = Convert.ToString(row.Pollingcommand_17202);
			Guid rowGuid;

			switch (triggerParam)
			{
				case 17252 /*Parameter.Pollingtable.Pid.Write.pollingCommand_17252*/:

					if (!Guid.TryParse(key, out rowGuid))
					{
						protocol.ShowInformationMessage("This command cannot be changed.");

						return;
					}

					string newCommand = Convert.ToString(protocol.GetParameter(triggerParam));
					protocol.SetParameterIndexByKey(Parameter.Pollingtable.tablePid, key, Parameter.Pollingtable.Idx.pollingcommand_17202 + 1, newCommand);

					break;

				case 17253 /*Parameter.Pollingtable.Pid.Write.pollingCommunicationType_17253*/:
					if (!Guid.TryParse(key, out rowGuid))
					{
						var type = (CommunicationTypes)Convert.ToInt32(row.Pollingcommunicationtype_17203);
						protocol.ShowInformationMessage("This info can only be retrieved using " + type + ".");

						return;
					}

					string newType = Convert.ToString(protocol.GetParameter(triggerParam));
					protocol.SetParameterIndexByKey(Parameter.Pollingtable.tablePid, key, Parameter.Pollingtable.Idx.pollingcommunicationtype_17203 + 1, newType);

					break;

				case Parameter.Pollingtable.Pid.Write.pollingdeletecommand_17208:
					if (!Guid.TryParse(key, out rowGuid))
					{
						protocol.ShowInformationMessage("This command cannot be deleted.");

						return;
					}

					HandleWriteApiPollingDeleteCommand(protocol, Convert.ToBoolean(row.Pollingstatus_17205), command, key);

					break;

				case Parameter.Pollingtable.Pid.Write.pollingpollnow_17209:
					protocol.HandleWriteApiPollingPollNow(row);

					break;

				case 17255 /*Parameter.Pollingtable.Pid.Write.pollingstatus_17255*/:
					HandleWriteApiPollingStatus(protocol, command, triggerParam, key, row);

					break;

				default:
					protocol.Log("QA" + protocol.QActionID + "|Run|Not expected", LogType.Error, LogLevel.NoLogging);

					break;
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void CheckForVlanPollDuplicate(SLProtocolExt protocol, string key, string newStatus)
	{
		switch (newStatus)
		{
			case "0":
				{
					object vlanSnmpStatus = protocol.GetParameterIndexByKey(Parameter.Pollingtable.tablePid, "27", Parameter.Pollingtable.Idx.pollingstatus_17205 + 1);
					object vlanNxApiStatus = protocol.GetParameterIndexByKey(Parameter.Pollingtable.tablePid, "79", Parameter.Pollingtable.Idx.pollingstatus_17205 + 1);

					// Both SNMP and NX API for VTP VLAN are disabled
					if (String.Equals(vlanSnmpStatus.ToString(), "0") && String.Equals(vlanNxApiStatus.ToString(), "0"))
					{
						// Clear VTP Vlan Table and Hidden Table if both are disabled
						protocol.CheckTrigger(9705);
						protocol.CheckTrigger(9706);

						DisableVlanColIfNoNxApi(protocol);

						return;
					}

					// NX API disabled, SNMP enabled
					if (String.Equals(key, "79"))
					{
						DisableVlanColIfNoNxApi(protocol);
						protocol.CheckTrigger(9800); // Trigger SNMP Poll of VTP VLAN
					}
				}

				break;

			case "1":
				{
					EnsureOnlyOneVtpVlanPollIsEnabled(protocol, key);
				}

				break;

			default:

				// do nothing
				break;
		}
	}

	private static void CheckInterfacesStatus(SLProtocolExt protocol, string key, PollingtableQActionRow row)
	{
		if (key != "7")
		{
			return;
		}

		var configurations = (object[])protocol.GetParameters(new uint[] { Parameter.telemetrysubscription_20001, Parameter.saveinterfaces_20008 });
		bool subscribeTelemetry = Convert.ToBoolean(configurations[0]);
		bool saveInterfaces = Convert.ToBoolean(configurations[1]);

		if (Convert.ToBoolean(row.Pollingstatus_17205) && subscribeTelemetry)
		{
			protocol.SetParameter(Parameter.Write.telemetrysubscription_20051, 0);
		}

		if (!Convert.ToBoolean(row.Pollingstatus_17205) && !saveInterfaces)
		{
			Skyline.Protocol.Api.InterfaceTable.ClearAllKeys(protocol);
		}
	}

	private static void DisableVlanColIfNoNxApi(SLProtocolExt protocol)
	{
		object[] keysVtp = protocol.GetKeys(Parameter.Vtpvlandisplayed.tablePid).Cast<object>().ToArray();
		object[] vlanColVtp = Enumerable.Repeat((object)-1, keysVtp.Length).ToArray();
		protocol.NotifyProtocol(
			(int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN,
			new object[] { Parameter.Vtpvlandisplayed.tablePid, Parameter.Vtpvlandisplayed.Pid.vtpvlandisplayedinterfaces_7407 },
			new object[] { keysVtp, vlanColVtp });

		var keysIf = Skyline.Protocol.Api.InterfaceTable.GetKeys(protocol);
		Skyline.Protocol.Api.InterfaceTable.Vlan.SetValue(protocol, keysIf, "-1");
	}

	private static void EnsureOnlyOneVtpVlanPollIsEnabled(SLProtocolExt protocol, string key)
	{
		if (String.Equals(key, "79"))
		{
			// Set "VTP VLAN" snmp poll to false if it is enabled
			if (Convert.ToString(protocol.GetParameterIndexByKey(Parameter.Pollingtable.tablePid, "27", Parameter.Pollingtable.Idx.pollingstatus_17205 + 1)) == "1")
			{
				protocol.SetParameterIndexByKey(Parameter.Pollingtable.tablePid, "27", Parameter.Pollingtable.Idx.pollingstatus_17205 + 1, "0");
			}

			protocol.CheckTrigger(9706); // Clear SNMP Hidden Table
		}
		else
		{
			// Set "show vlan brief" nx poll to false if it is enabled
			if (Convert.ToString(protocol.GetParameterIndexByKey(Parameter.Pollingtable.tablePid, "79", Parameter.Pollingtable.Idx.pollingstatus_17205 + 1)) == "1")
			{
				protocol.SetParameterIndexByKey(Parameter.Pollingtable.tablePid, "79", Parameter.Pollingtable.Idx.pollingstatus_17205 + 1, "0");
			}

			protocol.CheckTrigger(9706); // Clear SNMP Hidden Table
			protocol.CheckTrigger(9800); // Trigger SNMP Poll of VTP VLAN

			DisableVlanColIfNoNxApi(protocol);
		}
	}

	private static string GetInterfaceKey(SLProtocol protocol, string interfaceToDisable)
	{
		object[] table = InterfacesHelper.GetInterfaceIndexAndDescriptionColumns(protocol);

		object[] instances = (object[])table[0];
		object[] names = (object[])table[1];

		for (int i = 0; i < instances.Length; i++)
		{
			if (Convert.ToString(names[i]).Equals(interfaceToDisable))
			{
				return Convert.ToString(instances[i]);
			}
		}

		return String.Empty;
	}

	private static List<string> GetJoinsToDelete(SLProtocolExt protocol, string interfaceName)
	{
		uint[] cols = new uint[]
		{
			Parameter.Staticjoinstable.indexColumn,
			Parameter.Staticjoinstable.Idx.staticjoinsinterfacename,
		};

		object[] table = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Staticjoinstable.tablePid, cols);

		object[] instances = (object[])table[0];
		object[] interfaceNames = (object[])table[1];

		var toDelete = new List<string>();

		for (int i = 0; i < instances.Length; i++)
		{
			if (Convert.ToString(interfaceNames[i]).Equals(interfaceName))
			{
				toDelete.Add(Convert.ToString(instances[i]));
			}
		}

		return toDelete;
	}

	private static List<string> GetKeysToDelete(SLProtocol protocol, string keyToDelete)
	{
		uint[] cols = new uint[]
		{
			Parameter.Policymaptable.indexColumn,
			Parameter.Policymaptable.Idx.policymapforeignkey,
		};

		object[] table = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Policymaptable.tablePid, cols);

		object[] instances = (object[])table[0];
		object[] foreignKeys = (object[])table[1];

		var list = new List<string>();

		for (int i = 0; i < instances.Length; i++)
		{
			if (Convert.ToString(foreignKeys[i]).Equals(keyToDelete))
			{
				list.Add(Convert.ToString(instances[i]));
			}
		}

		return list;
	}

	private static List<string> GetVrfRowsToDelete(SLProtocolExt protocol, string vrfName)
	{
		uint[] cols = new uint[]
		{
			Parameter.Routestable.indexColumn,
			Parameter.Routestable.Idx.routesvrfname,
		};

		object[] table = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Routestable.tablePid, cols);

		object[] instances = (object[])table[0];
		object[] vrfNames = (object[])table[1];

		var toDelete = new List<string>();

		for (int i = 0; i < instances.Length; i++)
		{
			if (Convert.ToString(vrfNames[i]).Equals(vrfName))
			{
				toDelete.Add(Convert.ToString(instances[i]));
			}
		}

		return toDelete;
	}

	private static void HandleActivation(SLProtocolExt protocol, string interfaceTableKey, int columnIndex)
	{
		bool activate = Convert.ToInt32(protocol.GetParameter(protocol.GetTriggerParameter())).Equals(1);

		if (activate)
		{
			Skyline.Protocol.Api.InterfaceTable.SetParameterIndexByKey(protocol, interfaceTableKey, columnIndex, 1);
		}
		else
		{
			Skyline.Protocol.Api.InterfaceTable.SetParameterIndexByKey(protocol, interfaceTableKey, columnIndex, 0);
		}
	}

	private static void HandleWriteApiPollingDeleteCommand(SLProtocolExt protocol, bool status, string command, string key)
	{
		var apiPollingRow = new ApiPollingRow
		{
			Key = key,
			Status = status,
		};

		if (!apiPollingRow.CanDeleteRow(protocol))
		{
			return;
		}

		if (command.Contains("policy-map"))
		{
			var list = GetKeysToDelete(protocol, key);
			protocol.DeleteRow(Parameter.Policymaptable.tablePid, list);
		}

		if (command.Contains("ip route"))
		{
			string vrfName = command.Split(' ')[3];

			if (!String.IsNullOrEmpty(vrfName))
			{
				var list = GetVrfRowsToDelete(protocol, vrfName);
				protocol.DeleteRow(Parameter.Routestable.tablePid, list);
			}
		}

		if (command.Contains("include oif"))
		{
			string interfaceName = command.Split(' ')[3];

			if (!String.IsNullOrEmpty(interfaceName))
			{
				var list = GetJoinsToDelete(protocol, interfaceName);
				protocol.DeleteRow(Parameter.Staticjoinstable.tablePid, list);
			}
		}

		if (command.Contains(Commands.IpIgmpSnoopingCommand))
		{
			// ContextMenu.UpdateResourcesAndSnoopingTables(protocol, command);
			protocol.ShowInformationMessage(
				"This command is managed by the IP IGMP Snooping Table.\n Go to protocol page IGMP->Resources and use the table available actions to add/delete IP IMGP snooping VLAN commands.");

			return;
		}

		// do nothing, as we can expect other commands to be present.
		protocol.DeleteRow(Parameter.Pollingtable.tablePid, key);
	}

	private static void HandleWriteApiPollingStatus(SLProtocolExt protocol, string command, int triggerParam, string key, PollingtableQActionRow row)
	{
		if (command.StartsWith("sh policy-map int"))
		{
			string interfaceToDisable = command.Split(' ')[3];

			string interfaceTableKey = GetInterfaceKey(protocol, interfaceToDisable);

			if (!String.IsNullOrEmpty(interfaceTableKey))
			{
				HandleActivation(protocol, interfaceTableKey, Parameter.Interfacetable.Idx.interfacepollpolicymap);
			}
		}
		else if (command.StartsWith("sh running-config int") && command.Contains("include oif"))
		{
			string interfaceToDisable = command.Split(' ')[3];

			string interfaceTableKey = GetInterfaceKey(protocol, interfaceToDisable);

			if (!String.IsNullOrEmpty(interfaceTableKey))
			{
				HandleActivation(protocol, interfaceTableKey, Parameter.Interfacetable.Idx.interfacepollstaticjoin);
			}
		}
		else
		{
			protocol.Log("QA" + protocol.QActionID + "|HandleWriteApiPollingStatus|Not a valid command.", LogType.Information, LogLevel.NoLogging);
		}

		NbmStatisticsActions(protocol, command);

		string newStatus = Convert.ToString(protocol.GetParameter(triggerParam));

		if (newStatus == "0")
		{
			protocol.SetParameterIndexByKey(Parameter.Pollingtable.tablePid, key, Parameter.Pollingtable.Idx.pollinginformation_17206 + 1, "-1");
			protocol.SetParameterIndexByKey(Parameter.Pollingtable.tablePid, key, Parameter.Pollingtable.Idx.pollinglastpolled_17207 + 1, "-1");
		}

		CheckInterfacesStatus(protocol, key, row);

		// Do nothing
		// Special check for VTP VLAN SNMP and NX API status
		if (String.Equals(key, "79") || String.Equals(key, "27"))
		{
			CheckForVlanPollDuplicate(protocol, key, newStatus);
		}
	}

	private static void NbmStatisticsActions(SLProtocolExt protocol, string command)
	{
		if (command.StartsWith("show nbm flows statistics"))
		{
			bool isApic = Convert.ToBoolean(protocol.GetParameter(Parameter.nbmflowsstatisticspollingtype_14400));

			if (isApic)
			{
				// Disabling APIC command from Polling table.
				protocol.pollingtable[NbmStatisticsCommand.Apic, Parameter.Pollingtable.Idx.pollingstatus_17205] = 0;

				// Setting Polling Type to Default
				protocol.SetParameter(Parameter.nbmflowsstatisticspollingtype_14400, 0);
			}
		}

		if (command.StartsWith("NBM Flow Statistics"))
		{
			bool isApic = Convert.ToBoolean(protocol.GetParameter(Parameter.nbmflowsstatisticspollingtype_14400));

			if (!isApic)
			{
				// Disabling Default command from Polling table.
				protocol.pollingtable[NbmStatisticsCommand.Default, Parameter.Pollingtable.Idx.pollingstatus_17205] = 0;

				// Setting Polling Type to APIC
				protocol.SetParameter(Parameter.nbmflowsstatisticspollingtype_14400, 1);
			}
		}
	}
}

