/// <summary>
///     DataMiner QAction Class: Process CDP Cache Rows.
/// </summary>
public static class QAction
{
	private enum CdpState
	{
		Connected,

		Disconnected,
	}

	private enum OptionState
	{
		Enabled,

		Disabled,
	}

	private enum RowState
	{
		Updated = 1,

		Equal,

		New,

		Deleted,

		Recreated,
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			int autoClearState = Convert.ToInt32(protocol.GetParameter(Parameter.cdpcachedataautoclear_17698));

			uint[] columnsToGet = new uint[]
			{
				Parameter.Cdpcachetable.indexColumn,
				Parameter.Cdpcachetable.Idx.cdpcachedeviceid_17705,
				Parameter.Cdpcachetable.Idx.cdpcachedeviceport_17706,
				Parameter.Cdpcachetable.Idx.cdpcacherowstate_17724,
				Parameter.Cdpcachetable.Idx.cdpcachename_17726,
			};

			var cdpCache = protocol.GetColumns(
				Parameter.Cdpcachetable.tablePid,
				columnsToGet,
				(string id, string deviceId, string devicePort, int rowState, string name)
					=> new CdpCache(id, deviceId, devicePort, rowState, name)).ToList();

			var rowsToDelete = new List<string>();

			foreach (var row in cdpCache)
			{
				int cdpState = row.RowState != (int)RowState.Deleted ? (int)CdpState.Connected : (int)CdpState.Disconnected;

				if (autoClearState == (int)OptionState.Enabled && cdpState == (int)CdpState.Disconnected)
				{
					rowsToDelete.Add(row.ID);
				}
				else
				{
					row.State = cdpState;
				}
			}

			if (rowsToDelete.Any())
			{
				protocol.DeleteRow(Parameter.Cdpcachetable.tablePid, rowsToDelete.ToArray());
				cdpCache.RemoveAll(x => rowsToDelete.Contains(x.ID));
			}

			if (cdpCache.Any())
			{
				object[] pids = new object[] { Parameter.Cdpcachetable.tablePid, Parameter.Cdpcachetable.Pid.cdpcachestate_17725, Parameter.Cdpcachetable.Pid.cdpcachename_17726 };
				object[] values = new object[] { cdpCache.Select(x => (object)x.ID).ToArray(), cdpCache.Select(x => (object)x.State).ToArray(), cdpCache.Select(x => (object)x.Name).ToArray() };

				protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, pids, values);
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}
//---------------------------------
// CdpCache.cs
//---------------------------------

internal class CdpCache
{
	public string DeviceID;

	public string DevicePort;

	public string ID;

	public string Name;

	public int RowState;

	public int State;

	public CdpCache(string id, string deviceId, string devicePort, int rowState, string name)
	{
		ID = id;
		DeviceID = deviceId;
		DevicePort = devicePort;
		Name = !String.IsNullOrWhiteSpace(deviceId) && !String.IsNullOrWhiteSpace(devicePort) ? DeviceID + "_" + DevicePort : name;
		RowState = rowState;
	}
}

