/// <summary>
///     DataMiner QAction Class: Enable/Disable All Measurement Config.
/// </summary>
public static class QAction
{
	private enum Trigger
	{
		L2L3IfTable = 7200,

		IfTable = 15100,

		IfXTable = 15200,
	}

	public static object[] GetMeasurementConfigState(string[] keys, int enableState, int[] opstates)
	{
		if (enableState < 2)
		{
			return Enumerable.Repeat((object)enableState, keys.Length).ToArray();
		}

		var values = new List<object>();

		foreach (int opstate in opstates)
		{
			if (opstate == 1)
			{
				values.Add(opstate);
			}
			else
			{
				values.Add(0);
			}
		}

		return values.ToArray();
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			int enableState = Convert.ToInt16(protocol.GetParameter(protocol.GetTriggerParameter()));
			uint[] idx = new uint[]
			{
				Parameter.Measurementconfigurationtable.Idx.measurementconfigurationindex_17901,
				Parameter.Measurementconfigurationtable.Idx.measurementconfigurationifopstate_17906,
			};

			var measurementConfig = protocol.GetColumns(
				Parameter.Measurementconfigurationtable.tablePid,
				idx,
				(string id, int state)
					=> new { Id = id, OpState = state }).ToArray();

			string[] keys = measurementConfig.Select(x => x.Id).ToArray();
			int[] opstates = measurementConfig.Select(x => x.OpState).ToArray();
			object[] values = GetMeasurementConfigState(keys, enableState, opstates);

			protocol.SetParametersIndexByKey(Enumerable.Repeat(Parameter.Measurementconfigurationtable.tablePid, keys.Length).ToArray(), keys, Enumerable.Repeat(5, keys.Length).ToArray(), values);
			protocol.CheckTrigger((int)Trigger.IfTable);
			protocol.CheckTrigger((int)Trigger.IfXTable);
			protocol.CheckTrigger((int)Trigger.L2L3IfTable);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

