/// <summary>
///     DataMiner QAction Class: Process Remote Rows.
/// </summary>
public static class QAction
{
	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			uint[] columnsToGet = new uint[]
			{
				Parameter.Lldpsolutionremtable.Idx.lldpsolutionremtableinstance_18401,
				Parameter.Lldpsolutionremtable.Idx.lldpsolutionremtablelldpremsyscapsupportedbitmask_18409,
				Parameter.Lldpsolutionremtable.Idx.lldpsolutionremtablelldpremsyscapenabledbitmask_18410,
			};

			object[] columns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Lldpsolutionremtable.tablePid, columnsToGet);
			object[] keys = (object[])columns[0];

			if (!keys.Any())
			{
				return;
			}

			object[] supportedCapabilitiesBitmasks = (object[])columns[1];
			object[] enabledCapabilitiesBitmasks = (object[])columns[2];

			object[] supportedCapabilities = new object[keys.Length];
			object[] enabledCapabilities = new object[keys.Length];

			for (int i = 0; i < keys.Length; i++)
			{
				supportedCapabilities[i] = new LldpCapabilities(Convert.ToByte(supportedCapabilitiesBitmasks[i])).GetCapabilities();
				enabledCapabilities[i] = new LldpCapabilities(Convert.ToByte(enabledCapabilitiesBitmasks[i])).GetCapabilities();
			}

			protocol.FillArrayWithColumn(Parameter.Lldpsolutionremtable.tablePid, Parameter.Lldpsolutionremtable.Pid.lldpsolutionremtablelldpremsyscapsupported_18411, keys, supportedCapabilities);
			protocol.FillArrayWithColumn(Parameter.Lldpsolutionremtable.tablePid, Parameter.Lldpsolutionremtable.Pid.lldpsolutionremtablelldpremsyscapenabled_18412, keys, enabledCapabilities);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

