using Skyline.DataMiner.Scripting;

using SLNetMessages = Skyline.DataMiner.Net.Messages;

/// <summary>
///     DataMiner QAction Class: Validate Traps.
/// </summary>
public static class QAction
{
	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			object[] values = (object[])protocol.GetParameters(new uint[] { Parameter.trapdebug_18703, Parameter.maximumagetraps_18701, Parameter.maximumnumbertraps_18702 });
			int debugEnabled = Convert.ToInt32(values[0]);
			int maximumTime = Convert.ToInt32(values[1]);
			int maximumTraps = Convert.ToInt32(values[2]);

			if (debugEnabled == 1)
			{
				uint[] trapIndexes = new uint[] { Parameter.Trapstable.Idx.trapsindex_18601, Parameter.Trapstable.Idx.trapstimestamp_18603 };
				object[] columns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Trapstable.tablePid, trapIndexes);

				object[] keys = (object[])columns[0];
				object[] timestamps = (object[])columns[1];
				ProcessDuration(protocol, maximumTime, keys, timestamps);
				ProcessTotalRows(protocol, maximumTraps, keys);
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static void ProcessDuration(SLProtocol protocol, int maximumTime, object[] keys, object[] timestamps)
	{
		var slKeysToRemove = new List<string>();

		var dtNow = DateTime.Now;

		for (int i = 0; i < keys.Length; i++)
		{
			var dt = DateTime.FromOADate(Convert.ToDouble(timestamps[i]));

			if ((dtNow - dt).TotalDays > maximumTime)
			{
				slKeysToRemove.Add(Convert.ToString(keys[i]));
			}
		}

		protocol.DeleteRow(Parameter.Trapstable.tablePid, slKeysToRemove.ToArray());
	}

	private static void ProcessTotalRows(SLProtocol protocol, int maximumTraps, object[] keys)
	{
		if (keys.Length > maximumTraps)
		{
			int totalRows = keys.Length;
			var keysNumber = Array.ConvertAll(keys, x => Convert.ToInt32(x)).ToList();
			keysNumber.Sort();
			var slKeysToRemove = new List<string>();

			foreach (int key in keysNumber)
			{
				slKeysToRemove.Add(Convert.ToString(key));
				totalRows--;

				if (totalRows == maximumTraps)
				{
					break;
				}
			}

			protocol.DeleteRow(Parameter.Trapstable.tablePid, slKeysToRemove.ToArray());
		}
	}
}

