namespace QAction_19000
{
	using System;
	using System.Collections.Generic;

	using QAction_1;
	using QAction_1.Interfaces;

	using Skyline.DataMiner.Scripting;

	internal class DetailedIFVlanContextMenu
	{
		private enum APIMode
		{
			CLI = 1,

			NX = 2,
		}

		internal static void Run(SLProtocolExt protocol, object contextMenu)
		{
			object vlanNxApiStatus = protocol.GetParameterIndexByKey(Parameter.Pollingtable.tablePid, "79", Parameter.Pollingtable.Idx.pollingstatus_17205 + 1);

			if (!String.Equals(vlanNxApiStatus.ToString(), "1"))
			{
				protocol.Log("QA" + protocol.QActionID + "|Context Menu|Action denied when VTP VLAN NX API is disabled", LogType.Error, LogLevel.NoLogging);

				return;
			}

			if (!(contextMenu is string[] contextMenuData) || contextMenuData.Length < 4)
			{
				return;
			}

			string action = contextMenuData[1];

			string vlanId = contextMenuData[2];

			var keys = new List<string>();

			for (int i = 3; i < contextMenuData.Length; i++)
			{
				keys.Add(contextMenuData[i]);
			}

			object[] interfaceCols = InterfacesHelper.GetInterfaceIndexAndDescriptionColumns(protocol);

			object[] keysCol = (object[])interfaceCols[0];
			object[] namesCol = (object[])interfaceCols[1];

			var names = new List<string>();

			for (int i = 0; i < keysCol.Length; i++)
			{
				if (keys.Contains(keysCol[i].ToString()))
				{
					names.Add(namesCol[i].ToString());
				}
			}

			var commands = new List<string>();
			GetCommands(commands, action, vlanId, names);
			SendCommands(protocol, commands);

			PollVlanNxApi(protocol);
		}

		private static void GetCommands(List<string> commands, string action, string vlanId, List<string> names)
		{
			commands.Add("config");

			foreach (string k in names)
			{
				commands.Add(String.Format("interface {0}", k));
				commands.Add(String.Format("switchport trunk allowed vlan {0} {1}", action, vlanId));
			}
		}

		private static void PollVlanNxApi(SLProtocolExt protocol)
		{
			var row = (PollingtableQActionRow)(object[])protocol.GetRow(Parameter.Pollingtable.tablePid, "79");
			protocol.HandleWriteApiPollingPollNow(row);
		}

		private static void SendCommands(SLProtocol protocol, List<string> commands)
		{
			uint[] paramsToGet = new uint[] { Parameter.sshusername, Parameter.sshpassword };
			object[] parameters = (object[])protocol.GetParameters(paramsToGet);

			string user = Convert.ToString(parameters[0]);
			string pwd = Convert.ToString(parameters[1]);

			if (String.IsNullOrWhiteSpace(user) || String.IsNullOrWhiteSpace(pwd))
			{
				protocol.Log("QA" + protocol.QActionID + "|SendCommands|Credentials are empty", LogType.Error, LogLevel.NoLogging);

				return;
			}

			protocol.SetParameter(Parameter.Write.clicommunicationtype_9673, (int)APIMode.NX);
			protocol.SetParameter(Parameter.Write.addcommand_9670, String.Join(";", commands));
		}
	}
}
