internal class ExpectedSnoopingContextMenu : ContextMenuTableManagerBase
{
	private static string exceptionalValue = "-1";

	public ExpectedSnoopingContextMenu(SLProtocol protocol, object contextMenuData, int tablePid) : base(protocol, contextMenuData, tablePid)
	{
	}

	protected override void AddItem()
	{
		ExpectedSnoopingActions(Protocol, TablePid, Data);
	}

	protected override void DeleteItems()
	{
		Protocol.DeleteRow(TablePid, Data);
	}

	protected override void EditItem()
	{
		throw new NotSupportedException();
	}

	private static ExpectedsnoopingQActionRow CreateRow(string[] data, string key, StateMapping state, string foreignKey)
	{
		return new ExpectedsnoopingQActionRow
		{
			Expectedsnoopingid_10101 = key,
			Expectedsnoopingstate_10102 = state,
			Expectedsnoopingvlan_10103 = data[0],
			Expectedsnoopinggroupaddress_10104 = data[1],
			Expectedsnoopingsourcegroupaddress_10105 = data[2],
			Expectedsnoopingportchannel_10106 = data[3],
			Expectedsnoopingresourceforeignkey_10107 = foreignKey,
		};
	}

	private static void ExpectedSnoopingActions(SLProtocol protocol, int tablePid, string[] data)
	{
		string key = GetKey(protocol, tablePid);
		var currentIgmpSnoopingData = IpIgmpSnoopingTable.GetIpIgmpSnoopingTableAsExpectedRows(protocol);

		var existingRow = currentIgmpSnoopingData.FirstOrDefault(RowExists(data));

		StateMapping state = StateMapping.Missing;
		string resourceForeignKey = exceptionalValue;
		if (existingRow != null)
		{
			state = StateMapping.Available;
		}

		if (!String.IsNullOrEmpty(data[4]))
		{
			resourceForeignKey = data[4];
		}

		if (protocol.Exists(Parameter.Deviceresourcetable.tablePid, resourceForeignKey) || resourceForeignKey.Equals(exceptionalValue))
		{
			TryCreateExpectedSnoopingRow(protocol, tablePid, data, key, state, resourceForeignKey);
		}
		else
		{
			protocol.ShowInformationMessage("Resource with key " + resourceForeignKey + " does not exist.");
		}
	}

	private static void TryCreateExpectedSnoopingRow(SLProtocol protocol, int tablePid, string[] data, string key, StateMapping state, string foreignKey)
	{
		uint[] columnsToGetIdx = new uint[]
		{
			Parameter.Expectedsnooping.Idx.expectedsnoopingid_10101,
			Parameter.Expectedsnooping.Idx.expectedsnoopingvlan_10103,
			Parameter.Expectedsnooping.Idx.expectedsnoopinggroupaddress_10104,
			Parameter.Expectedsnooping.Idx.expectedsnoopingsourcegroupaddress_10105,
			Parameter.Expectedsnooping.Idx.expectedsnoopingportchannel_10106,
		};

		object[] columns = (object[])protocol.NotifyProtocol(321, tablePid, columnsToGetIdx);
		string[] primaryKeyColumn = Array.ConvertAll((object[])columns[0], Convert.ToString);
		string[] vlanColumn = Array.ConvertAll((object[])columns[1], Convert.ToString);
		string[] groupAddressColumn = Array.ConvertAll((object[])columns[2], Convert.ToString);
		string[] sourceColumn = Array.ConvertAll((object[])columns[3], Convert.ToString);
		string[] portChannelColumn = Array.ConvertAll((object[])columns[4], Convert.ToString);

		for (int i = 0; i < vlanColumn.Length; i++)
		{
			var isRowIdentical = Commands.IsIdenticalSnoopingRow(
				vlanColumn[i],
				groupAddressColumn[i],
				sourceColumn[i],
				portChannelColumn[i],
				data[0],
				data[1],
				data[2],
				data[3]);

			if (isRowIdentical)
			{
				if (foreignKey.Equals(exceptionalValue))
				{
					protocol.ShowInformationMessage("Row already exists.");
					return;
				}

				protocol.SetRow(tablePid, primaryKeyColumn[i], new object[] { null, null, null, null, null, null, foreignKey });
				protocol.ShowInformationMessage("Resource foreign key of existing row updated.");
				return;
			}
		}

		var row = CreateRow(data, key, state, foreignKey);
		protocol.AddRow(tablePid, row);
	}

	private static string GetFirstAvailableNumber(List<int> keys)
	{
		int result = 0;

		foreach (int number in keys)
		{
			if (number > result)
			{
				break;
			}

			result = number + 1;
		}

		return Convert.ToString(result);
	}

	private static string GetKey(SLProtocol protocol, int tablePid)
	{
		var keys = Array.ConvertAll(protocol.GetKeys(tablePid), x => Convert.ToInt32(x)).ToList();
		keys.Sort();

		var key = GetFirstAvailableNumber(keys);
		return key;
	}

	private static Func<ExpectedsnoopingQActionRow, bool> RowExists(string[] data)
	{
		return x =>
		{
			bool sameVlan = Convert.ToString(x.Expectedsnoopingvlan_10103).Equals(data[0]);
			bool sameGroupAddress = Convert.ToString(x.Expectedsnoopinggroupaddress_10104).Equals(data[1]);
			bool sameSourceGroupAddress = Convert.ToString(x.Expectedsnoopingsourcegroupaddress_10105).Equals(data[2]);
			bool containsPortChannel = Convert.ToString(x.Expectedsnoopingportchannel_10106).Split().Contains(data[3]);
			return sameVlan && sameGroupAddress && sameSourceGroupAddress && containsPortChannel;
		};
	}
}
