		private List<ExpectedstaticjoinsQActionRow> GetStaticJoinsTableAsExpectedRows(SLProtocol protocol)
		{
			var data = new List<ExpectedstaticjoinsQActionRow>();
			uint[] colsToGet = new uint[]
			{
				Parameter.Staticjoinstable.Idx.staticjoinsinstance_17601,
				Parameter.Staticjoinstable.Idx.staticjoinsstaticjoin_17602,
				Parameter.Staticjoinstable.Idx.staticjoinsinterfacename_17603,
				Parameter.Staticjoinstable.Idx.staticjoinsresourceforeignkey_17604,
			};

			object[] staticJoinsTable = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Staticjoinstable.tablePid, colsToGet);

			object[] staticJoinInstances = (object[])staticJoinsTable[0];
			object[] staticJoins = (object[])staticJoinsTable[1];
			object[] staticJoinInterfaceNames = (object[])staticJoinsTable[2];
			object[] staticJoinForeignKeys = (object[])staticJoinsTable[3];

			if (Common.CheckIfOneColumnIsNull(new List<object[]> { staticJoinInstances, staticJoins, staticJoinInterfaceNames, staticJoinForeignKeys }))
			{
				return data;
			}

			for (int i = 0; i < staticJoinInstances.Length; i++)
			{
				var staticJoinTableData = new ExpectedstaticjoinsQActionRow
				{
					Expectedstaticjoinsid_10201 = Convert.ToString(staticJoinInstances[i]),
					Expectedstaticjoinsinterfacename_10203 = Convert.ToString(staticJoinInterfaceNames[i]),
					Expectedstaticjoinsstaticjoin_10204 = Convert.ToString(staticJoins[i]),
					Expectedstaticjoinsresourceforeignkey_10205 = Convert.ToString(staticJoinForeignKeys[i]),
				};

				data.Add(staticJoinTableData);
			}

			return data;
		}

		private Func<ExpectedstaticjoinsQActionRow, bool> RowExists()
		{
			return x =>
			{
				bool interfaceName = Convert.ToString(x.Expectedstaticjoinsinterfacename_10203).Trim().Equals(Data[0].Trim());
				bool staticJoin = Convert.ToString(x.Expectedstaticjoinsstaticjoin_10204).Trim().Equals(Data[1].Trim());
				return interfaceName && staticJoin;
			};
