namespace QAction_19000
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using IpIgmpSnooping;

	using Skyline.DataMiner.Scripting;

	internal class IpIgmpSnoopingContextMenu
	{
		internal static void Run(SLProtocol protocol, object contextMenu)
		{
			object[] contextMenuData = (object[])contextMenu;

			var action = (Actions)Convert.ToUInt32(contextMenuData[1]);
			string vlan;

			switch (action)
			{
				case Actions.AddIpIgmpCommand:
					vlan = Convert.ToString(contextMenuData[2]);
					ContextMenu.AddIpIgmpCommand(protocol, vlan);

					break;

				case Actions.RemoveIpIgmpCommand:
					vlan = Convert.ToString(contextMenuData[2]);
					ContextMenu.RemoveIpIgmpCommand(protocol, vlan);
					UpdateExpectedSnoopingOnRemove(protocol, vlan);

					break;

				case Actions.RemoveAll:
					ContextMenu.RemoveAllCommands(protocol);
					UpdateExpectedSnoopingOnRemoveAll(protocol);

					break;

				default:
					protocol.Log("QA" + protocol.QActionID + "|Run|Context Menu Action unexpected.", LogType.Error, LogLevel.NoLogging);

					break;
			}
		}

		private static void UpdateExpectedSnoopingOnRemove(SLProtocol protocol, string vlan)
		{
			var expectedSnoopingPid = Parameter.Expectedsnooping.tablePid;
			var table = new QActionTable(protocol, expectedSnoopingPid, "Expectedsnooping");

			uint[] columnsToGetIdx = new uint[]
				{
				Parameter.Expectedsnooping.Idx.expectedsnoopingid_10101,
				Parameter.Expectedsnooping.Idx.expectedsnoopingvlan_10103,
				};
			object[] columns = (object[])protocol.NotifyProtocol(321 /* NT_GET_TABLE_COLUMNS */, expectedSnoopingPid, columnsToGetIdx);
			string[] keyColumn = Array.ConvertAll((object[])columns[0], Convert.ToString);
			string[] vlanColumn = Array.ConvertAll((object[])columns[1], Convert.ToString);

			List<string> keys = new List<string>();

			for (int i = 0; i < vlanColumn.Length; i++)
			{
				if (vlanColumn[i].Equals(vlan))
				{
					keys.Add(keyColumn[i]);
				}
			}

			object[] values = Enumerable.Repeat((object)0, keys.Count).ToArray();
			table.SetColumn(Parameter.Expectedsnooping.Pid.expectedsnoopingstate_10102, keys.ToArray(), values);
		}

		private static void UpdateExpectedSnoopingOnRemoveAll(SLProtocol protocol)
		{
			var expectedSnoopingPid = Parameter.Expectedsnooping.tablePid;
			var table = new QActionTable(protocol, expectedSnoopingPid, "Expectedsnooping");

			var keys = protocol.GetKeys(expectedSnoopingPid);
			object[] values = Enumerable.Repeat((object)0, keys.Length).ToArray();
			table.SetColumn(Parameter.Expectedsnooping.Pid.expectedsnoopingstate_10102, keys, values);
		}
	}
}
