namespace QAction_19000
{
	using System;

	using Skyline.DataMiner.Scripting;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	internal class PollingTableContextMenu
	{
		public static void AddCommand(SLProtocolExt protocol, object[] commandInformation)
		{
			string command = Convert.ToString(commandInformation[2]);

			if (CommandIsUnique(protocol, command))
			{
				int communicationType = Convert.ToInt32(commandInformation[3]);
				int frequency = Convert.ToInt32(commandInformation[4]);
				int status = Convert.ToInt32(commandInformation[5]);

				string instance = Guid.NewGuid().ToString();

				var newCommandRow = new PollingtableQActionRow
				{
					Pollinginstance = instance,
					Pollingcommand = command,
					Pollingcommunicationtype = communicationType,
					Pollingfrequency = frequency,
					Pollingstatus = status,
					Pollinginformation = "-1",
					Pollinglastpolled = -1,
				};

				protocol.pollingtable.AddRow(newCommandRow);
			}
			else
			{
				protocol.ShowInformationMessage("Command already exists");
			}
		}

		internal static void Run(SLProtocolExt protocol, object contextMenu)
		{
			object[] contextMenuData = (object[])contextMenu;

			AddCommand(protocol, contextMenuData);

			protocol.CheckTrigger(9609);
		}

		private static bool CommandIsUnique(SLProtocolExt protocol, string command)
		{
			uint[] cols = new uint[]
			{
				Parameter.Pollingtable.Idx.pollingcommand,
			};

			object[] table = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Pollingtable.tablePid, cols);

			object[] commands = (object[])table[0];

			for (int i = 0; i < commands.Length; i++)
			{
				string commandInTable = Convert.ToString(commands[i]);

				if (commandInTable.Equals(command))
				{
					return false;
				}

				if (commandInTable.StartsWith("sh ") && command.StartsWith("show "))
				{
					string restOfCommandIntable = commandInTable.Replace("sh ", String.Empty);
					string restOfCommand = command.Replace("show ", String.Empty);

					if (restOfCommandIntable.Equals(restOfCommand))
					{
						return false;
					}
				}
			}

			return true;
		}
	}
}
