using System;
using System.Collections.Generic;

using QAction_20001.OpenConfig;
using QAction_20001.OpenConfig.Utilities;

using Skyline.DataMiner.DataSources.OpenConfig.Gnmi.Api;
using Skyline.DataMiner.DataSources.OpenConfig.Gnmi.Models;
using Skyline.DataMiner.DataSources.OpenConfig.Gnmi.Protocol.DataMapper;
using Skyline.DataMiner.DataSources.OpenConfig.Gnmi.Utils;
using Skyline.DataMiner.Scripting;

//---------------------------------
// QAction_20001.cs
//---------------------------------

/// <summary>
/// DataMiner QAction Class: OpenConfig Streaming Telemetry.
/// </summary>
public class QAction : IDisposable
{
	private readonly object clientLock = new object();

	private DataSourceConfiguration clientConfig;

	/// <summary>
	/// The OpenConfig client, we retain until we dispose to avoid the connect overhead.
	/// </summary>
	private GnmiClient gnmiClient;

	/// <summary>
	/// Indicates if the gNMI client is busy connecting.
	/// </summary>
	/// <remarks>Waiting on gNMI client connection takes 15s timeout when not available. Poll group is executed every 10s. Without this boolean there are threads starting at a higher rate than are finishing, which leads to a thread memory leak.</remarks>
	private bool isConnecting;

	private bool isDisposed;

	private bool isSubscribed;

	private SLProtocol protocol;

	public void Dispose()
	{
		Dispose(true);
		GC.SuppressFinalize(this);
	}

	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public void Run(SLProtocolExt protocol)
	{
		try
		{
			int trigger = protocol.GetTriggerParameter();
			this.protocol = protocol;
			var configurationIds = new uint[]
			{
				Parameter.telemetrysubscription_20001,
				Parameter.saveinterfaces_20008,
				Parameter.telemetrysampleinterval_20009,
			};
			var configurations = (object[])protocol.GetParameters(configurationIds);
			bool subscribeTelemetry = Convert.ToBoolean(configurations[0]);
			bool saveInterfaces = Convert.ToBoolean(configurations[1]);
			var telemtrySampleInterval = TimeSpan.FromSeconds(Convert.ToInt32(configurations[2]));

			if (!subscribeTelemetry && !saveInterfaces)
			{
				Skyline.Protocol.Api.InterfaceTable.ClearAllKeys(protocol);
			}

			if (trigger == Parameter.telemetrysubscription_20001)
			{
				if (subscribeTelemetry)
				{
					SetSnmpPollStatusToDisabled(protocol);
					SubscribeInterfaces(telemtrySampleInterval);
				}
				else
				{
					protocol.ClearAllKeys(Parameter.Openconfiginterfaces.tablePid);
					protocol.ClearAllKeys(Parameter.Openconfiginterfacesethernet.tablePid);

					Dispose();
				}
			}

			if (trigger == Parameter.telemetrysampleinterval_20009 && subscribeTelemetry)
			{
				isSubscribed = false;
				gnmiClient?.Dispose();
				gnmiClient = null;
				SubscribeInterfaces(telemtrySampleInterval);
			}

			if (trigger == 88 /*Startup*/&& subscribeTelemetry)
			{
				SetSnmpPollStatusToDisabled(protocol);
				SubscribeInterfaces(telemtrySampleInterval);
			}
		}
		catch (Exception ex)
		{
			protocol.Log($"QA{protocol.QActionID}|{protocol.GetTriggerParameter()}|Run|Exception thrown:{Environment.NewLine}{ex}", LogType.Error, LogLevel.NoLogging);
		}
	}

	private static DataMinerConnectorDataMapper GetDataMapper(SLProtocol protocol)
	{
		var mappings = new Mappings(protocol);
		var inventory = new List<IDataMinerConnectorDataEntity>
		{
			mappings.OpenConfigInterfaceColumns(),
			mappings.OpenConfigInterfaceEthernetColumns(),
		};

		var dataMapper = new DataMinerConnectorDataMapper(protocol, inventory);

		return dataMapper;
	}

	/// <summary>
	/// Reads out the configuration to connect with the gNMI client.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol.</param>
	/// <returns>Configuration that is needed to connect.</returns>
	private static DataSourceConfiguration ReadConfiguration(SLProtocol protocol)
	{
		var dataSourceConfiguration = new DataSourceConfiguration();

		if (!protocol.IsEmpty(Parameter.datasourceip))
		{
			dataSourceConfiguration.IpAddress = Convert.ToString(protocol.GetParameter(Parameter.datasourceip_20002));
		}

		if (!protocol.IsEmpty(Parameter.datasourceport))
		{
			dataSourceConfiguration.Port = Convert.ToUInt32(protocol.GetParameter(Parameter.datasourceport_20003));
		}

		if (!protocol.IsEmpty(Parameter.datasourceusername))
		{
			dataSourceConfiguration.UserName = Convert.ToString(protocol.GetParameter(Parameter.datasourceusername_20004));
		}

		if (!protocol.IsEmpty(Parameter.datasourcepassword))
		{
			dataSourceConfiguration.Password = Convert.ToString(protocol.GetParameter(Parameter.datasourcepassword_20005));
		}

		dataSourceConfiguration.ClientCertificate = Convert.ToString(protocol.GetParameter(Parameter.clientcertificate_20006));

		return dataSourceConfiguration;
	}

	private static void SetSnmpPollStatusToDisabled(SLProtocolExt protocol)
	{
		if (!Convert.ToBoolean(protocol.GetParameterIndexByKey(Parameter.Pollingtable.tablePid, "7", Parameter.Pollingtable.Idx.pollingstatus_17205 + 1)))
		{
			return;
		}

		var row = new PollingtableQActionRow
		{
			Pollinginstance_17201 = "7",
			Pollingstatus_17205 = 0,
			Pollinginformation_17206 = "-1",
			Pollinglastpolled_17207 = "-1",
		};

		protocol.pollingtable.SetRow(row);
	}

	/// <summary>
	/// Disposing the QAction, this will dispose the internal gNMI client.
	/// </summary>
	/// <param name="disposing">Boolean indicating if the QAction is being disposed.</param>
	private void Dispose(bool disposing)
	{
		if (disposing && !isDisposed)
		{
			isSubscribed = false;
			isConnecting = false;
			isDisposed = true;
			gnmiClient?.Dispose();
			gnmiClient = null;
		}
	}

	/// <summary>
	/// Get the gNMI client, or sets up the connection if not done yet.
	/// </summary>
	/// <returns>gNMI client.</returns>
	private GnmiClient GetClient()
	{
		// Lock is needed because QAction is queued. When being triggered multiple times at the same moment, it would create multiple gnmiClients without the lock.
		lock (clientLock)
		{
			// We haven not attached the "change configuration" trigger yet, so we simply read it out and check if it has changed
			var config = ReadConfiguration(protocol);

			if (gnmiClient == null)
			{
				ILogger logger = new MiddleWareLogger(protocol);
				gnmiClient = new GnmiClient((uint)protocol.DataMinerID, (uint)protocol.ElementID, protocol.ElementName, config, logger);
				clientConfig = config;
				var dataMapper = GetDataMapper(protocol);
				gnmiClient.SetDataMapper(dataMapper);
				gnmiClient.ConnectionStateChanged += GnmiClientOnConnectionStateChanged;
			}
			else
			{
				VerifyConnectionConfiguration(config);
			}

			if (!gnmiClient.IsConnected)
			{
				protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|GetClient|Connecting...", LogType.Information, LogLevel.NoLogging);
				try
				{
					isConnecting = true;
					gnmiClient.Connect();
					isConnecting = false;
				}
				catch
				{
					isConnecting = false;
					throw;
				}
			}

			return gnmiClient;
		}
	}

	/// <summary>
	/// Called when the connection state of the gNMI client changes and adapts the element timeout state accordingly.
	/// </summary>
	/// <param name="sender">Sender that triggered the event.</param>
	/// <param name="e">Event arguments.</param>
	private void GnmiClientOnConnectionStateChanged(object sender, EventArgs e)
	{
		if (isDisposed)
		{
			return;
		}

		bool isConnected = gnmiClient.IsConnected;
		string previousConnectionState = Convert.ToString(protocol.GetParameter(Parameter.grpcconnectionstate_20007));
		if (!String.IsNullOrWhiteSpace(previousConnectionState))
		{
			bool wasConnected = previousConnectionState == "1";
			if (wasConnected == isConnected)
			{
				return;
			}
		}

		string setConnectionState = isConnected ? "1" : "0";
		protocol.NotifyProtocol((int)Skyline.DataMiner.Net.Messages.NotifyType.NT_CHANGE_COMMUNICATION_STATE, isConnected, 99);
		protocol.SetParameter(Parameter.grpcconnectionstate_20007, setConnectionState);
	}

	/// <summary>
	/// Verifies if the expected subscriptions were being done.
	/// </summary>
	/// <param name="telemetrySampleInterval">The sample interval for the Telemetry counter.</param>
	private void SubscribeInterfaces(TimeSpan telemetrySampleInterval)
	{
		if (isSubscribed || isConnecting)
		{
			return; // Is already subscribed so this thread can return without having to wait for the lock.
		}

		lock (clientLock)
		{
			if (isSubscribed || isConnecting)
			{
				return; // Subscription happened while waiting on lock so this thread can return.
			}

			var client = GetClient();
			client.Subscribe("ethernet", new[] { "interfaces/interface/ethernet/state" }); // ON_CHANGE
			client.Subscribe("interfaces", new[] { "interfaces/interface/state" }); // ON_CHANGE
			client.Subscribe("counters", telemetrySampleInterval, new[] { "interfaces/interface/state/counters" }); // SAMPLE

			isSubscribed = true;
		}
	}

	/// <summary>
	/// Changes the configuration on the gNMI client in case the settings changed.
	/// </summary>
	/// <param name="config">New configuration for the gNMI client.</param>
	private void VerifyConnectionConfiguration(DataSourceConfiguration config)
	{
		if (config.Equals(clientConfig))
		{
			return;
		}

		try
		{
			isConnecting = true; // Changing configuration means a reconnect internally.
			gnmiClient.ChangeConfiguration(config);
			clientConfig = config;
			isConnecting = false;
		}
		catch
		{
			isConnecting = false;
			throw;
		}
	}
}
