namespace QAction_20001.OpenConfig.Models
{
	using System;

	using QAction_1.RateCalculator;

	using Skyline.DataMiner.DataSources.OpenConfig.Gnmi.Protocol.DataMapper.Args;
	using Skyline.DataMiner.Scripting;

	namespace QAction_20001.OpenConfig.RateCalculator
	{
		internal class OpenConfigRateCalculatorHelper : RateCalculatorHelper
		{
			public OpenConfigRateCalculatorHelper(SLProtocol protocol, TimeSpan minimumDelta, TimeSpan maximumDelta) : base(protocol, minimumDelta, maximumDelta)
			{
			}

			internal object CalculateInterfaceInBitrate(DataMinerConnectorRateArgs args)
			{
				LoadateArgsConfiguration(Parameter.Openconfiginterfaces.tablePid, Parameter.Openconfiginterfaces.Idx.openconfiginterfacesinbitrateondatesdata_20134, args);

				double octetRate = Convert.ToDouble(CalculateOctetRate(args.CurrentTimestampUtc));
				return octetRate > 0 ? octetRate * 8 : octetRate;
			}

			internal object CalculateInterfaceInDiscardrate(DataMinerConnectorRateArgs args)
			{
				LoadateArgsConfiguration(Parameter.Openconfiginterfaces.tablePid, Parameter.Openconfiginterfaces.Idx.openconfiginterfacesindiscardrateondatesdata_20135, args);
				return CalculateOctetRate(args.CurrentTimestampUtc);
			}

			internal object CalculateInterfaceInErrorrate(DataMinerConnectorRateArgs args)
			{
				LoadateArgsConfiguration(Parameter.Openconfiginterfaces.tablePid, Parameter.Openconfiginterfaces.Idx.openconfiginterfacesinerrorrateondatesdata_20137, args);
				return CalculateOctetRate(args.CurrentTimestampUtc);
			}

			internal object CalculateInterfaceOutBitrate(DataMinerConnectorRateArgs args)
			{
				LoadateArgsConfiguration(Parameter.Openconfiginterfaces.tablePid, Parameter.Openconfiginterfaces.Idx.openconfiginterfacesoutbitrateondatesdata_20136, args);
				double octetRate = Convert.ToDouble(CalculateOctetRate(args.CurrentTimestampUtc));
				return octetRate > 0 ? octetRate * 8 : octetRate;
			}

			internal object CalculateInterfaceOutDiscardrate(DataMinerConnectorRateArgs args)
			{
				LoadateArgsConfiguration(Parameter.Openconfiginterfaces.tablePid, Parameter.Openconfiginterfaces.Idx.openconfiginterfacesoutdiscardrateondatesdata_20139, args);
				return CalculateOctetRate(args.CurrentTimestampUtc);
			}

			internal object CalculateInterfaceOutErrorrate(DataMinerConnectorRateArgs args)
			{
				LoadateArgsConfiguration(Parameter.Openconfiginterfaces.tablePid, Parameter.Openconfiginterfaces.Idx.openconfiginterfacesouterrorrateondatesdata_20138, args);
				return CalculateOctetRate(args.CurrentTimestampUtc);
			}

			private void LoadateArgsConfiguration(int tablePid, int dataRateIdx, DataMinerConnectorRateArgs args)
			{
				LoadConfiguration(tablePid, dataRateIdx, args.PrimaryKey, args.CurrentValue);
			}
		}
	}
}
