namespace QAction_20001.OpenConfig.Utilities
{
	using Skyline.DataMiner.DataSources.OpenConfig.Gnmi.Utils;
	using Skyline.DataMiner.Scripting;

	public class MiddleWareLogger : ILogger
	{
		private readonly SLProtocol _protocol;

		/// <summary>
		/// Initializes a new instance of the <see cref="MiddleWareLogger"/> class.
		/// </summary>
		/// <param name="protocol">Link with SLProtocol.</param>
		public MiddleWareLogger(SLProtocol protocol)
		{
			_protocol = protocol;
		}

		/// <summary>
		/// Logs a message when an action is undertaken.
		/// </summary>
		/// <param name="message">Message to be logged.</param>
		public void LogDebug(string message)
		{
			_protocol.Log(message, LogType.DebugInfo, LogLevel.Level2);
		}

		/// <summary>
		/// Logs a message when the process encountered an exception when handling a request.
		/// </summary>
		/// <param name="message">Message to be logged.</param>
		public void LogError(string message)
		{
			_protocol.Log(message, LogType.Error, LogLevel.NoLogging);
		}

		/// <summary>
		/// Logs a message when the process encountered a problem that could not be handled without loss of functionality.
		/// </summary>
		/// <param name="message">Message to be logged.</param>
		public void LogFatal(string message)
		{
			_protocol.Log(message, LogType.Error, LogLevel.NoLogging);
		}

		/// <summary>
		/// Logs a message for fundamental process execution.
		/// </summary>
		/// <param name="message">Message to be logged.</param>
		public void LogInfo(string message)
		{
			_protocol.Log(message, LogType.Information, LogLevel.NoLogging);
		}

		/// <summary>
		/// Logs a message to trace every action or function call being executed.
		/// </summary>
		/// <param name="message">Message to be logged.</param>
		public void LogTrace(string message)
		{
			_protocol.Log(message, LogType.DebugInfo, LogLevel.Level4);
		}

		/// <summary>
		/// Logs a message when the process received an invalid request.
		/// </summary>
		/// <param name="message">Message to be logged.</param>
		public void LogWarning(string message)
		{
			_protocol.Log(message, LogType.Error, LogLevel.NoLogging);
		}
	}
}
//---------------------------------
// OpenConfig\ValueConverter.cs
//---------------------------------
namespace QAction_20001.OpenConfig
{
	using System;
	using System.Collections.Generic;
	using System.Text.RegularExpressions;

	using QAction_1;
	using QAction_1.Interfaces;
	using QAction_1.OpenConfig;

	using QAction_20001.OpenConfig.Models;

	using Skyline.DataMiner.DataSources.OpenConfig.Gnmi.Protocol.DataMapper.Args;
	using Skyline.DataMiner.Library.Common.Rates;
	using Skyline.DataMiner.Scripting;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	public class ValueConverter
	{
		private static readonly Dictionary<string, AdminState> AdminStateMap = new Dictionary<string, AdminState> { { "UP", AdminState.Up }, { "DOWN", AdminState.Down }, { "TESTING", AdminState.Testing } };

		private static readonly Dictionary<string, DuplexMode> DuplexModeMap = new Dictionary<string, DuplexMode> { { "FULL", DuplexMode.Full }, { "HALF", DuplexMode.Half }, { "UNKNOWN", DuplexMode.Unknown } };

		private static readonly DateTime Epoch = new DateTime(1970, 1, 1, 0, 0, 0, DateTimeKind.Utc);

		private static readonly Dictionary<string, OperState> OperStateMap = new Dictionary<string, OperState> { { "UP", OperState.Up }, { "DOWN", OperState.Down }, { "TESTING", OperState.Testing }, { "UNKNOWN", OperState.Unknown }, { "DORMANT", OperState.Dormant }, { "NOT_PRESENT", OperState.NotPresent }, { "LOWER_LAYER_DOWN", OperState.LowerLayerDown } };

		private readonly SLProtocol protocol;

		public ValueConverter(SLProtocol protocol)
		{
			this.protocol = protocol;
		}

		/// <summary>
		/// Converts the administrator state into a discreet value.
		/// </summary>
		/// <param name="rawValue">Raw value that enters from data source.</param>
		/// <returns>Converted value to be set on the parameter.</returns>
		public static object ConvertToAdminStateEnumValue(DataMinerConnectorRawValueArgs rawValue)
		{
			if (rawValue != null && rawValue.Value is string sValue && AdminStateMap.TryGetValue(sValue, out var state))
			{
				int iState = (int)state;
				return iState;
			}

			return Defaults.NAIntValue;
		}

		/// <summary>
		/// Converts the duplex mode into a discreet value.
		/// </summary>
		/// <param name="rawValue">Raw value that enters from data source.</param>
		/// <returns>Converted value to be set on the parameter.</returns>
		public static object ConvertToDuplexModeEnumValue(DataMinerConnectorRawValueArgs rawValue)
		{
			if (rawValue != null && rawValue.Value is string sValue && DuplexModeMap.TryGetValue(sValue, out var duplexMode))
			{
				int iState = (int)duplexMode;
				return iState;
			}

			return Defaults.NAIntValue;
		}

		/// <summary>
		/// Converts the operator state into a discreet value.
		/// </summary>
		/// <param name="rawValue">Raw value that enters from data source.</param>
		/// <returns>Converted value to be set on the parameter.</returns>
		public static object ConvertToOperStateEnumValue(DataMinerConnectorRawValueArgs rawValue)
		{
			if (rawValue != null && rawValue.Value is string sValue && OperStateMap.TryGetValue(sValue, out var state))
			{
				int iState = (int)state;
				return iState;
			}

			return Defaults.NAIntValue;
		}

		/// <summary>
		/// Creates the display key based on the incoming values.
		/// </summary>
		/// <param name="triggerValues">Values that are part of the display key.</param>
		/// <returns>Display key to be set on the parameter.</returns>
		public static string CreateDisplayKey(DataMinerConnectorTriggerValueArgs triggerValues)
		{
			string description;
			if (triggerValues.Values.TryGetValue(Parameter.Openconfiginterfaces.Pid.openconfiginterfacesdescription_20102, out object descriptionVal))
			{
				description = Convert.ToString(descriptionVal);
			}
			else
			{
				description = String.Empty;
			}

			if (String.IsNullOrEmpty(description) || description == "-1")
			{
				return DisplayKeyUtil.ExpandName(triggerValues.PrimaryKey);
			}

			return DisplayKeyUtil.GetDisplayKey(triggerValues.PrimaryKey, description);
		}

		/// <summary>
		/// Custom implementation of the bit rate calculator.
		/// </summary>
		/// <param name="rateValues">Values that are needed to calculate the rate on.</param>
		/// <returns>Calculated rate.</returns>
		public static object CustomBitRates(DataMinerConnectorRateArgs rateValues)
		{
			if (rateValues == null)
			{
				return Defaults.NoIntValue;
			}

			if (rateValues.CurrentTimestampUtc <= rateValues.PreviousTimestampUtc || !UInt64.TryParse(Convert.ToString(rateValues.CurrentValue), out ulong uiNewValue) || !UInt64.TryParse(Convert.ToString(rateValues.PreviousValue), out ulong uiOldValue) || uiOldValue > uiNewValue)
			{
				return Defaults.NoIntValue;
			}

			var ts = rateValues.CurrentTimestampUtc - rateValues.PreviousTimestampUtc;
			double rate = 8.0 * Convert.ToDouble(uiNewValue - uiOldValue) / ts.TotalSeconds;
			return rate;
		}

		public static ulong GetPacketCounts(ulong unicastPacketCount, ulong multicastPacketCounts, ulong broadcastPacketCounts)
		{
			return unchecked(unicastPacketCount + multicastPacketCounts + broadcastPacketCounts);
		}

		public double CalculateDateTime(long ticks)
		{
			var dateTime = Epoch.AddSeconds(ticks / 1e9);

			if (dateTime.Ticks == new DateTime(1970, 1, 1, 1, 0, 0, DateTimeKind.Utc).Ticks)
			{
				double uptime = Convert.ToDouble(protocol.GetParameter(Parameter.sysuptime_102));

				return DateTime.Now.Subtract(TimeSpan.FromSeconds(uptime)).ToOADate();
			}

			return dateTime.ToOADate();
		}

		/// <summary>
		/// Converts the epoch time into a date time value.
		/// </summary>
		/// <param name="rawValue">Raw value that enters from data source.</param>
		/// <returns>Converted value to be set on the parameter.</returns>
		public object ConvertEpochTimeUtcTicksToOadate(DataMinerConnectorRawValueArgs rawValue)
		{
			if (rawValue?.Value != null)
			{
				return CalculateDateTime(Convert.ToInt64(rawValue.Value));
			}

			return Defaults.NAIntValue;
		}

		internal static object ConvertToInterfaceTypeEnumValue(DataMinerConnectorRawValueArgs rawValue)
		{
			int type = -1;
			if (rawValue != null && rawValue.Value is string value && Enum.TryParse(value, true, out InterfaceTypes enumValue))
			{
				return (int)enumValue;
			}

			return type;
		}

		internal static object ConvertToSpeedValue(DataMinerConnectorRawValueArgs rawValue)
		{
			double speed = -1;
			if (rawValue != null && rawValue.Value is string sValue)
			{
				var rgx = new Regex(@"(\d+)", RegexOptions.IgnoreCase);
				var match = rgx.Match(sValue);

				if (match.Success)
				{
					return Convert.ToDouble(match.Groups[0].Value) * 1000;
				}
			}

			return speed;
		}

		/// <summary>
		/// Custom implementation of the rate calculator.
		/// </summary>
		/// <param name="rateValues">Values that are needed to calculate the rate on.</param>
		/// <returns>Calculated rate.</returns>
		internal static object CustomRates(DataMinerConnectorRateArgs rateValues)
		{
			if (rateValues == null)
			{
				return Defaults.NoIntValue;
			}

			if (rateValues.CurrentTimestampUtc <= rateValues.PreviousTimestampUtc || !UInt64.TryParse(Convert.ToString(rateValues.CurrentValue), out ulong uiNewValue) || !UInt64.TryParse(Convert.ToString(rateValues.PreviousValue), out ulong uiOldValue) || uiOldValue > uiNewValue)
			{
				return Defaults.NoIntValue;
			}

			var ts = rateValues.CurrentTimestampUtc - rateValues.PreviousTimestampUtc;
			double rate = Convert.ToDouble(uiNewValue - uiOldValue) / ts.TotalSeconds;
			return rate;
		}

		internal static string FullName(DataMinerConnectorTriggerValueArgs triggerValues)
		{
			return DisplayKeyUtil.ExpandName(triggerValues.PrimaryKey);
		}

		internal object PacketRxRate(DataMinerConnectorTriggerValueArgs triggerValues)
		{
			string key = triggerValues.PrimaryKey;
			var row = (OpenconfiginterfacesQActionRow)(object[])protocol.GetRow(Parameter.Openconfiginterfaces.tablePid, key);

			ulong packetsPrevious = Convert.ToUInt64(row.Openconfiginterfacespacketsrxprevious_20129);
			ulong packetRatesRxPrevious = Convert.ToUInt64(row.Openconfiginterfacesrxpacketrate_20112);

			if (!triggerValues.Values.TryGetValue(Parameter.Openconfiginterfaces.Pid.openconfiginterfacesrxunicastpackets_20114, out object unicast))
			{
				return Defaults.NoIntValue;
			}

			if (!triggerValues.Values.TryGetValue(Parameter.Openconfiginterfaces.Pid.openconfiginterfacesrxmulticastpackets_20115, out object multicast))
			{
				return Defaults.NoIntValue;
			}

			if (!triggerValues.Values.TryGetValue(Parameter.Openconfiginterfaces.Pid.openconfiginterfacesrxbroadcastpackets_20116, out object broadcast))
			{
				return Defaults.NoIntValue;
			}

			ulong packetsCurrent = GetPacketCounts(Convert.ToUInt64(unicast), Convert.ToUInt64(multicast), Convert.ToUInt64(broadcast));
			double packetRatesCurrent = RateCalculator.CalculateRate(10000, 1, packetRatesRxPrevious, packetsCurrent, packetsPrevious, DataConversionType.NoConversion);

			object[] columnsToSet = new object[]
			{
				Parameter.Openconfiginterfaces.tablePid,
				Parameter.Openconfiginterfaces.Pid.openconfiginterfacespacketsrxprevious_20129,
			};

			object[] values = new object[]
			{
				new object[] { key },
				new object[] { packetsCurrent },
			};

			protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnsToSet, values);

			return packetRatesCurrent;
		}

		internal object PacketTxRate(DataMinerConnectorTriggerValueArgs triggerValues)
		{
			string key = triggerValues.PrimaryKey;
			var row = (OpenconfiginterfacesQActionRow)(object[])protocol.GetRow(Parameter.Openconfiginterfaces.tablePid, key);

			ulong packetsPrevious = Convert.ToUInt64(row.Openconfiginterfacespacketstxprevious_20130);
			ulong packetRatesTxPrevious = Convert.ToUInt64(row.Openconfiginterfacestxpacketrate_20120);

			if (!triggerValues.Values.TryGetValue(Parameter.Openconfiginterfaces.Pid.openconfiginterfacestxunicastpackets_20122, out object unicast))
			{
				return Defaults.NoIntValue;
			}

			if (!triggerValues.Values.TryGetValue(Parameter.Openconfiginterfaces.Pid.openconfiginterfacestxmulticastpackets_20123, out object multicast))
			{
				return Defaults.NoIntValue;
			}

			if (!triggerValues.Values.TryGetValue(Parameter.Openconfiginterfaces.Pid.openconfiginterfacestxbroadcastpackets_20124, out object broadcast))
			{
				return Defaults.NoIntValue;
			}

			ulong packetsCurrent = GetPacketCounts(Convert.ToUInt64(unicast), Convert.ToUInt64(multicast), Convert.ToUInt64(broadcast));
			double packetRatesCurrent = RateCalculator.CalculateRate(10000, 1, packetRatesTxPrevious, packetsCurrent, packetsPrevious, DataConversionType.NoConversion);

			object[] columnsToSet = new object[]
			{
				Parameter.Openconfiginterfaces.tablePid,
				Parameter.Openconfiginterfaces.Pid.openconfiginterfacespacketstxprevious_20130,
			};

			object[] values = new object[]
			{
				new object[] { key },
				new object[] { packetsCurrent },
			};

			protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_FILL_ARRAY_WITH_COLUMN, columnsToSet, values);

			return packetRatesCurrent;
		}
	}
}

using System;
