using Skyline.DataMiner.Scripting;

//---------------------------------
// QAction_9000000.cs
//---------------------------------

/// <summary>
///     DataMiner QAction Class.
/// </summary>
public static class QAction
{
	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocolExt protocol)
	{
		try
		{
			var knownTypes = GetKnownTypes().ToList();
			var customSerializer = SerializerFactory.CreateInterAppSerializer(typeof(Message), knownTypes);

			string raw = Convert.ToString(protocol.GetParameter(protocol.GetTriggerParameter()));
			var receivedCall = InterAppCallFactory.CreateFromRaw(raw, customSerializer);

			ProcessInterAppCall(protocol, receivedCall);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private static Dictionary<Type, Type> GetExecutorMapping()
	{
		return new Dictionary<Type, Type>
		{
			{ typeof(LoginRequest), typeof(LoginRequestExecutor) },
			{ typeof(HttpRequest), typeof(HttpRequestExecutor) },
			{ typeof(GetIpamInstancesRequest), typeof(GetIpamInstancesExecutor) },
		};
	}

	private static IEnumerable<Type> GetKnownTypes()
	{
		yield return typeof(LoginRequest);
		yield return typeof(LoginResponse);
		yield return typeof(HttpRequest);
		yield return typeof(HttpResponse);
		yield return typeof(GetIpamInstancesRequest);
		yield return typeof(GetIpamInstancesResponse);
		yield return typeof(IpamInstance);
		yield return typeof(List<IpamInstance>);
	}

	private static void ProcessInterAppCall(SLProtocolExt protocol, IInterAppCall interAppCall)
	{
		var mapping = GetExecutorMapping();

		foreach (var message in interAppCall.Messages)
		{
			var ra = message.ReturnAddress;
			protocol.Log(String.Format("Message {0}, return address {1}, {2}", message.Guid, ra.AgentId + "/" + ra.ElementId + "/" + ra.ParameterId, message), LogType.Information, LogLevel.Level1);

			message.TryExecute(protocol, protocol, mapping, out var returnMessage);

			if (returnMessage != null)
			{
				protocol.Log(String.Format("Response {0}, {1}", returnMessage.Guid, returnMessage), LogType.Information, LogLevel.Level1);

				returnMessage.Send(
					protocol.SLNet.RawConnection,
					message.ReturnAddress.AgentId,
					message.ReturnAddress.ElementId,
					message.ReturnAddress.ParameterId,
					GetKnownTypes().ToList());
			}
		}
	}
}
//---------------------------------
// Executors\GetIpamInstancesExecutor.cs
