namespace InterAppCalls.Executors
{
	using System;
	using System.Collections.Generic;
	using System.Linq;

	using InterAppCalls.Helpers;
	using InterAppCalls.Messages;
	using InterAppCalls.Models;

	using QAction_1.Interfaces;

	using Skyline.DataMiner.CommunityLibrary.Utility.Protocol;
	using Skyline.DataMiner.Library.Common.InterAppCalls.CallSingle;
	using Skyline.DataMiner.Library.Common.InterAppCalls.MessageExecution;
	using Skyline.DataMiner.Scripting;

	public class GetIpamInstancesExecutor : MessageExecutor<GetIpamInstancesRequest>
	{
		private static readonly InterfaceTypes[] EthernetTypes = new[]
			{
				InterfaceTypes.EthernetCSMACD,
				InterfaceTypes.Ethernet3Mbit,
				InterfaceTypes.FastEthernet,
				InterfaceTypes.FastEthernetFX,
				InterfaceTypes.GigabitEthernet,
				InterfaceTypes.AviciOpticalEthernet,
				InterfaceTypes.Alcatel_LucentEthernetLinkProtection,
			};

		private GetIpamInstancesResponse _response;

		public GetIpamInstancesExecutor(GetIpamInstancesRequest request)
			: base(request)
		{
		}

		private enum PortSubtypes
		{
			NA = -1,

			InterfaceAlias = 1,

			PortComponent = 2,

			MACAddress = 3,

			NetworkAddress = 4,

			InterfaceName = 5,

			AgentCircuitID = 6,

			Local = 7,
		}

		public static List<IpamInstance> GetArpIpamInstances(List<Arp> arps, List<IpRoute> ipRoutes, List<Remote> remotes, List<VtpVlan> vlans, List<InterfaceDetailed> interfaces, string elementName, List<MacAddress> macAddresses)
		{
			var interfaceIpRoutes = ipRoutes.Where(o => IpRoute.IsCorrectIpFormat(o.SubnetMask) && o.SubnetMask != "255.255.255.255")
				.GroupBy(o => o.InterfaceId).ToDictionary(o => o.Key, o => o.ToList());

			var ipamInstances = new List<IpamInstance>();

			foreach (var arp in arps)
			{
				var interfaceDetailed = interfaces.FirstOrDefault(x => x.Id == arp.InterfaceId);
				var vlan = GetVlanData(interfaceDetailed, vlans);

				var ipamInstance = new IpamInstance
				{
					IpAddress = arp.NetworkAddress,
					Description = arp.Description,
					MacAddress = arp.PhysicalAddress,
					VlanId = vlan.Id,
					VlanName = vlan.Name,
					ElementName = String.Empty,
					PortName = String.Empty,
					DefaultGateway = String.Empty,
					Subnet = String.Empty,
				};

				IpRoute route = null;

				if (interfaceIpRoutes.TryGetValue(Convert.ToString(arp.InterfaceId), out var routes))
				{
					route = routes.OrderBy(o => o.GetSubnetBits()).First();

					ipamInstance.DefaultGateway = route.DefaultGateway;
					ipamInstance.Subnet = route.GetSubnet();
				}

				if (interfaceDetailed != null && IsPhysicallyConnectedToPort(arp, interfaceDetailed, route, macAddresses))
				{
					ipamInstance.PortName = interfaceDetailed.Name;
					ipamInstance.ElementName = elementName;
				}
				else
				{
					var remote = remotes.FirstOrDefault(o => o.MacAddress == arp.PhysicalAddress && !o.EnabledCapabilities.IsBridge() && o.PortSubtypeId == (int)PortSubtypes.InterfaceName);

					if (remote != null)
					{
						ipamInstance.PortName = remote.PortId;
						ipamInstance.ElementName = elementName;
					}
				}

				ipamInstances.Add(ipamInstance);
			}

			return ipamInstances;
		}

		public static List<IpamInstance> GetIpInterfaceBriefInstances(string elementName, List<IpInterfaceBrief> interfaceBriefInfo)
		{
			var candidates = interfaceBriefInfo.Where(item => item.Interface.StartsWith("Eth"));
			var result = new List<IpamInstance>(candidates.Count());
			foreach (var interfaceBriefItem in candidates)
			{
				var instance = new IpamInstance
				{
					IpAddress = interfaceBriefItem.IpAddress,
					Description = String.Empty,
					MacAddress = interfaceBriefItem.MacAddress,
					VlanId = 0,
					VlanName = "Default",
					ElementName = elementName,
					PortName = interfaceBriefItem.Interface.Replace("Eth", "Ethernet"),
					DefaultGateway = String.Empty,
					Subnet = String.Empty,
				};
				result.Add(instance);
			}

			return result;
		}

		public static List<IpamInstance> GetMacIpamInstances(List<MacAddress> macAddresses, List<InterfaceDetailedVlan> interfaceVlans, string elementName)
		{
			var ipamInstances = new List<IpamInstance>();

			var macAddressCandidates = macAddresses.GroupBy(x => x.Ports).Where(group => group.Count() == 1).Select(group => group.First()).ToList();
			var detailedInterfacesWithOneVlan = interfaceVlans.Where(x => !String.IsNullOrEmpty(x.Vlan) && !x.Vlan.Contains(",")).ToList();

			foreach (var macAddressCandidate in macAddressCandidates)
			{
				string nameToFind;

				if (macAddressCandidate.Ports.StartsWith("Po"))
				{
					nameToFind = macAddressCandidate.Ports.Replace("Po", "port-channel");
				}
				else if (macAddressCandidate.Ports.StartsWith("Eth"))
				{
					nameToFind = macAddressCandidate.Ports.Replace("Eth", "Ethernet");
				}
				else
				{
					continue;
				}

				var detailedInterface = detailedInterfacesWithOneVlan.FirstOrDefault(o => o.Name.Equals(nameToFind));

				if (detailedInterface != null)
				{
					var ipamInstance = new IpamInstance
					{
						IpAddress = String.Empty,
						Description = String.Empty,
						MacAddress = macAddressCandidate.Address,
						VlanId = 0,
						VlanName = "Default",
						ElementName = elementName,
						PortName = detailedInterface.Name,
						DefaultGateway = String.Empty,
						Subnet = String.Empty,
					};

					ipamInstances.Add(ipamInstance);
				}
			}

			return ipamInstances;
		}

		public static VtpVlan GetVlanData(InterfaceDetailed interfaceDetailed, List<VtpVlan> vlans)
		{
			int vlanId = 1;
			string vlanName = "Default";
			string prefix = "Vlan";
			if (interfaceDetailed != null && interfaceDetailed.Type == InterfaceTypes.PropVirtual && interfaceDetailed.Name.StartsWith(prefix) &&
				Int32.TryParse(interfaceDetailed.Name.Substring(prefix.Length, interfaceDetailed.Name.Length - prefix.Length), out int n))
			{
				vlanId = n;
				var vlan = vlans.FirstOrDefault(x => x.Id == n);
				vlanName = vlan != null ? vlan.Name : $"{prefix}{vlanId}";
			}

			return new VtpVlan
			{
				Id = vlanId,
				Name = vlanName,
			};
		}

		public static List<IpamInstance> GetVlanIpamInstances(List<IpInterfaceBrief> ipInterfaceBriefs, List<VtpVlan> vtpVlans, List<string> hsrps)
		{
			var ipamInstances = new List<IpamInstance>();

			foreach (var ipInterfaceBrief in ipInterfaceBriefs)
			{
				var vtpVlan = vtpVlans.FirstOrDefault(o => o.Id == ipInterfaceBrief.GetVlanId());
				int vlanId = vtpVlan == null ? 1 : vtpVlan.Id;

				if (ipInterfaceBrief.IpAddress != "-1")
				{
					var main = ipInterfaceBrief.GetIpamInstance(true, vlanId, vtpVlan?.Name, hsrps);
					ipamInstances.Add(main);
				}

				if (ipInterfaceBrief.StandbyIpAddress != "-1")
				{
					var standby = ipInterfaceBrief.GetIpamInstance(false, vlanId, vtpVlan?.Name, hsrps);
					ipamInstances.Add(standby);
				}
			}

			return ipamInstances;
		}

		public override Message CreateReturnMessage()
		{
			return _response;
		}

		public override void DataGets(object dataSource)
		{
			var protocol = (SLProtocol)dataSource;

			var hsrps = protocol.GetColumn<string>(Parameter.Chsrpgrptable.tablePid, columnIdx: Parameter.Chsrpgrptable.Idx.chsrpgrpvirtualipaddr_4211).ToList();
			var arps = protocol.GetArps();
			var ipRoutes = protocol.GetIpRoutes(hsrps);
			var remotes = protocol.GetRemotes();
			var interfaces = protocol.GetInterfacesDetailed();
			var vlans = protocol.GetDisplayedVtpVlans();
			var macAddresses = protocol.GetMacAddresses();
			var ipams = GetArpIpamInstances(arps, ipRoutes, remotes, vlans, interfaces, protocol.ElementName, macAddresses);
			var interfaceVlans = protocol.GetInterfacesDetailedVlan();

			ipams.AddRange(GetMacIpamInstances(macAddresses, interfaceVlans, protocol.ElementName));

			var ipInterfaceBriefs = protocol.GetIpInterfaceBriefs();
			var vtpVlans = protocol.GetVtpVlans();
			ipams.AddRange(GetVlanIpamInstances(ipInterfaceBriefs, vtpVlans, hsrps));

			ipams.AddRange(GetIpInterfaceBriefInstances(protocol.ElementName, ipInterfaceBriefs));

			_response = new GetIpamInstancesResponse(Message.Guid) { IpamInstances = ipams };
		}

		public override void DataSets(object dataDestination)
		{
			// Not applicable
		}

		public override void Modify()
		{
			// Not applicable
		}

		public override void Parse()
		{
			// Not applicable
		}

		public override bool Validate()
		{
			return true;
		}

		private static bool IsPhysicallyConnectedToPort(Arp arp, InterfaceDetailed interfaceDetailed, IpRoute route, List<MacAddress> macAddresses)
		{
			return (EthernetTypes.Contains(interfaceDetailed.Type) && !macAddresses.Exists(x => x.Address == arp.PhysicalAddress)) || (route != null && route.SubnetMask.Equals("255.255.255.252"));
		}
	}
}
