namespace InterAppCalls.Executors
{
	using System;
	using System.IO;
	using System.Net;
	using System.Text;

	public static class HttpHelper
	{
		public static string ReadResponse(WebResponse response)
		{
			var responseStream = response.GetResponseStream();

			using (var reader = new StreamReader(responseStream))
			{
				return reader.ReadToEnd();
			}
		}

		public static WebResponse SendRequest(string host, string url, string method, string data, string token)
		{
			var uri = new Uri("http://" + host + "/" + url);

			var request = (HttpWebRequest)WebRequest.Create(uri);
			request.Method = method;
			request.UseDefaultCredentials = false;
			request.ContentType = "application/json";
			request.KeepAlive = false;

			if (!String.IsNullOrEmpty(token))
			{
				if (request.CookieContainer == null)
				{
					request.CookieContainer = new CookieContainer();
				}

				request.CookieContainer.Add(new Cookie("APIC-Cookie", token, "/", uri.Host));
			}

			if (method == "POST")
			{
				byte[] postBytes = Encoding.ASCII.GetBytes(data);
				request.ContentLength = postBytes.Length;

				using (var requestStream = request.GetRequestStream())
				{
					requestStream.Write(postBytes, 0, postBytes.Length); // Send the post
				}
			}

			return request.GetResponse();
		}
	}
}
