namespace InterAppCalls.Executors
{
	using System;
	using System.Net;

	using InterAppCalls.Messages;

	using Skyline.DataMiner.Library.Common.InterAppCalls.CallSingle;
	using Skyline.DataMiner.Library.Common.InterAppCalls.MessageExecution;
	using Skyline.DataMiner.Scripting;

	public class HttpRequestExecutor : MessageExecutor<HttpRequest>
	{
		private readonly HttpResponse response;

		public HttpRequestExecutor(HttpRequest message) : base(message)
		{
			response = new HttpResponse();
		}

		public override Message CreateReturnMessage()
		{
			response.Guid = Message.Guid;

			return response;
		}

		public override void DataGets(object dataSource)
		{
			var protocol = (SLProtocolExt)dataSource;

			try
			{
				string host = Convert.ToString(protocol.GetParameter(9612));
				string token = Message.LoginToken;

				try
				{
					if (String.IsNullOrWhiteSpace(token))
					{
						var loginResp = LoginRequestExecutor.Login(protocol, host);
						token = loginResp.Token;
					}

					var httpResponse = HttpHelper.SendRequest(host, Message.Url, Message.Method, Message.Body, token);

					ProcessResponse(httpResponse);
				}
				catch (WebException ex)
				{
					if (ex.Response != null)
					{
						ProcessResponse(ex.Response);
					}

					throw;
				}
			}
			catch (Exception ex)
			{
				protocol.Log("QA" + protocol.QActionID + "|HTTP action failed:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
				response.ExceptionMessage = ex.Message;
				response.ExceptionFull = ex.ToString();
			}
		}

		public override void DataSets(object dataDestination)
		{
		}

		public override void Modify()
		{
		}

		public override void Parse()
		{
		}

		public override bool Validate()
		{
			return !String.IsNullOrEmpty(Message.Method) &&
				   !String.IsNullOrEmpty(Message.Url);
		}

		private void ProcessResponse(WebResponse httpResponse)
		{
			using (httpResponse)
			{
				response.Result = HttpHelper.ReadResponse(httpResponse);

				if (httpResponse is HttpWebResponse webResponse)
				{
					using (webResponse)
					{
						response.StatusCode = webResponse.StatusCode;
						response.StatusDescription = webResponse.StatusDescription;
					}
				}
			}
		}
	}
}
