namespace InterAppCalls.Executors
{
	using System;
	using System.Net;

	using InterAppCalls.Messages;

	using Newtonsoft.Json.Linq;

	using Skyline.DataMiner.Library.Common.InterAppCalls.CallSingle;
	using Skyline.DataMiner.Library.Common.InterAppCalls.MessageExecution;
	using Skyline.DataMiner.Scripting;

	public class LoginRequestExecutor : MessageExecutor<LoginRequest>
	{
		private LoginResponse response;

		public LoginRequestExecutor(LoginRequest message) : base(message)
		{
		}

		public static LoginResponse Login(SLProtocol protocol, string host)
		{
			object[] values = (object[])protocol.GetParameters(new uint[] { Parameter.sshusername_9630, Parameter.sshpassword_9631 });
			string username = Convert.ToString(values[0]);
			string password = Convert.ToString(values[1]);

			string request = @"{
	""aaaUser"" : {
		""attributes"" : {
			""name"" : """ + username + @""",
			""pwd"" : """ + password + @"""
		}
	}
}";

			string url = "api/aaaLogin.json";

			var httpResponse = HttpHelper.SendRequest(host, url, "POST", request, null);

			using (httpResponse)
			{
				string result = HttpHelper.ReadResponse(httpResponse);

				var json = JObject.Parse(result);
				string token = json["imdata"][0]["aaaLogin"]["attributes"]["token"].Value<string>();

				return new LoginResponse
				{
					Result = result,
					Token = token,
				};
			}
		}

		public override Message CreateReturnMessage()
		{
			response.Guid = Message.Guid;

			return response;
		}

		public override void DataGets(object dataSource)
		{
			var protocol = (SLProtocolExt)dataSource;

			response = new LoginResponse();

			try
			{
				string host = Convert.ToString(protocol.GetParameter(9612));

				try
				{
					response = Login(protocol, host);
				}
				catch (WebException ex)
				{
					if (ex.Response != null)
					{
						using (ex.Response)
						{
							response.Result = HttpHelper.ReadResponse(ex.Response);
						}
					}

					throw;
				}
			}
			catch (Exception ex)
			{
				protocol.Log("QA" + protocol.QActionID + "|Login failed:" + Environment.NewLine + response.Result + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
				response.ExceptionMessage = ex.Message;
				response.ExceptionFull = ex.ToString();
			}
		}

		public override void DataSets(object dataDestination)
		{
		}

		public override void Modify()
		{
		}

		public override void Parse()
		{
		}

		public override bool Validate()
		{
			// nothing to validate
			return true;
		}
	}
}
