namespace InterAppCalls.Helpers
{
	using System;
	using System.Collections.Generic;
	using System.Linq;
	using System.Net;

	using InterAppCalls.Models;

	using QAction_1.Interfaces;

	using Skyline.DataMiner.CommunityLibrary.Utility.Protocol;
	using Skyline.DataMiner.Scripting;

	public static class ProtocolExtensions
	{
		private static readonly int Ospf = 13;

		public static string CidrToMask(int cidr)
		{
			uint mask = (cidr == 0) ? 0 : UInt32.MaxValue << (32 - cidr);
			byte[] bytes = BitConverter.GetBytes(mask).Reverse().ToArray();

			return new IPAddress(bytes).ToString();
		}

		public static List<Arp> GetArps(this SLProtocol protocol)
		{
			uint[] paramsToGet = new uint[]
			{
				Parameter.Ipnettomediatable.Idx.ipnettomediaindexnetmedia_1601,
				Parameter.Ipnettomediatable.Idx.ipnettomediaifindex_1602,
				Parameter.Ipnettomediatable.Idx.ipnettomediaphysaddress_1603,
				Parameter.Ipnettomediatable.Idx.ipnettomedianetaddress_1604,
			};

			var keysDisplayKeysMap = protocol.GetKeysToDisplayKeysMap(Parameter.Ipnettomediatable.tablePid);

			return protocol.GetColumns(
				Parameter.Ipnettomediatable.tablePid,
				paramsToGet,
				(string id, string interfaceId, string mac, string ip) =>
				{
					return new Arp
					{
						Id = id,
						Description = keysDisplayKeysMap[id],
						InterfaceId = interfaceId,
						NetworkAddress = ip,
						PhysicalAddress = mac,
					};
				}).ToList();
		}

		public static string GetDefaultGateway(List<string> hsrps, string subnetMask)
		{
			if (String.IsNullOrEmpty(subnetMask) || subnetMask == "0.0.0.0")
			{
				return String.Empty;
			}

			string[] netMask = subnetMask.Split('/');

			if (netMask.Length != 2)
			{
				return String.Empty;
			}

			string mask = CidrToMask(Convert.ToInt16(netMask[1]));

			string networkAddress = netMask[0];
			string result = hsrps.Find(x => GetNetworkAddress(x, mask) == networkAddress);
			return result ?? String.Empty;
		}

		public static List<VtpVlan> GetDisplayedVtpVlans(this SLProtocol protocol)
		{
			uint[] paramsToGet = new uint[]
			{
				Parameter.Vtpvlandisplayed.Idx.vtpvlandisplayedindex_7406,
