		public static List<IpInterfaceBrief> GetIpInterfaceBriefs(this SLProtocol protocol)
		{
			uint[] paramsToGet = new uint[]
			{
				Parameter.Ipinterfacebrieftable.Idx.ipinterfacebrieftableinterface_12901,
				Parameter.Ipinterfacebrieftable.Idx.ipinterfacebriefipaddress_12902,
				Parameter.Ipinterfacebrieftable.Idx.ipinterfacebriefstandbyipaddress_12903,
				Parameter.Ipinterfacebrieftable.Idx.ipinterfacebriefmacaddress_12905,
				Parameter.Ipinterfacebrieftable.Idx.ipinterfacebriefsubnet_12906,
				Parameter.Ipinterfacebrieftable.Idx.ipinterfacebriefgroupaddress_12907,
			};

			return protocol.GetColumns(
				Parameter.Ipinterfacebrieftable.tablePid,
				paramsToGet,
				(string itf, string ip, string standby, string mac, string subnet, string groupAddress) =>
				{
					return new IpInterfaceBrief
					{
						Interface = itf,
						IpAddress = ip,
						StandbyIpAddress = standby,
						MacAddress = mac,
						Subnet = subnet,
						GroupAddress = groupAddress,
					};
				}).ToList();
		}

		public static List<IpRoute> GetIpRoutes(this SLProtocol protocol, List<string> hsrps)
		{
			uint[] paramsToGet = new uint[]
			{
				Parameter.Iproutetable.Idx.iproutetableinstance_1401,
				Parameter.Iproutetable.Idx.iprouteifindex_1403,
				Parameter.Iproutetable.Idx.iproutemask_1412,
				Parameter.Iproutetable.Idx.iprouteproto_1410,
			};

			object[] columns = (object[])protocol.NotifyProtocol(321, Parameter.Iproutetable.tablePid, paramsToGet);
			object[] ips = (object[])columns[0];
			object[] interfaceIndexes = (object[])columns[1];
			object[] masks = (object[])columns[2];
			object[] routingMechanisms = (object[])columns[3];
			var ipRoutes = new List<IpRoute>();

			for (int i = 0; i < ips.Length; i++)
			{
				if (Convert.ToInt16(routingMechanisms[i]) == Ospf)
				{
					continue;
				}

				string mask = Convert.ToString(masks[i]);

				var ipRoute = new IpRoute
				{
					DefaultGateway = GetDefaultGateway(hsrps, mask),
					InterfaceId = Convert.ToString(interfaceIndexes[i]),
					IpAddress = Convert.ToString(ips[i]),
					SubnetMask = mask,
				};

				ipRoutes.Add(ipRoute);
			}

			return ipRoutes;
		}

		public static List<MacAddress> GetMacAddresses(this SLProtocol protocol)
		{
			uint[] paramsToGet = new uint[]
			{
				Parameter.Macaddresstable.Idx.macaddresstablemacaddress_1902,
				Parameter.Macaddresstable.Idx.macaddressports_1904,
			};

			return protocol.GetColumns(
				Parameter.Macaddresstable.tablePid,
				paramsToGet,
				(string address, string ports) =>
				{
					return new MacAddress
					{
						Address = address,
						Ports = ports,
					};
				}).ToList();
		}

		public static string GetNetworkAddress(string ipAddress, string mask)
		{
			string[] ipOctetsStr = ipAddress.Split('.');
			string[] subnetOctetsStr = mask.Split('.');

			if (ipOctetsStr.Length != 4 || subnetOctetsStr.Length != 4)
			{
				throw new ArgumentException($"Invalid IP {ipAddress} or mask {mask}.");
			}

			string[] resultOctets = new string[4];

			for (int i = 0; i < 4; i++)
			{
				byte ipOctet = Convert.ToByte(ipOctetsStr[i]);
				byte subnetOctet = Convert.ToByte(subnetOctetsStr[i]);
				resultOctets[i] = (ipOctet & subnetOctet).ToString();
			}

			return String.Join(".", resultOctets);
		}

		public static List<Remote> GetRemotes(this SLProtocol protocol)
		{
			uint[] paramsToGet = new uint[]
			{
				Parameter.Lldpsolutionremtable.Idx.lldpsolutionremtablelldpremchassisid_18403,
				Parameter.Lldpsolutionremtable.Idx.lldpsolutionremtablelldpremportidsubtype_18404,
				Parameter.Lldpsolutionremtable.Idx.lldpsolutionremtablelldpremportid_18405,
				Parameter.Lldpsolutionremtable.Idx.lldpsolutionremtablelldpremsyscapenabledbitmask_18410,
			};

			return protocol.GetColumns(
				Parameter.Lldpsolutionremtable.tablePid,
				paramsToGet,
				(string chassisId, int portSubtypeId, string portId, byte enabledCapabilitiesBitmask) =>
				{
					return new Remote
					{
						MacAddress = chassisId,
						PortSubtypeId = portSubtypeId,
						PortId = portId,
						EnabledCapabilities = new LldpCapabilities(enabledCapabilitiesBitmask),
					};
				}).ToList();
		}

		public static List<VtpVlan> GetVtpVlans(this SLProtocol protocol)
		{
			uint[] paramsToGet = new uint[]
			{
				Parameter.Vtpvlantable.Idx.vtpvlanindexhidden_7302,
				Parameter.Vtpvlantable.Idx.vtpvlanname_7305,
			};

			return protocol.GetColumns(
				Parameter.Vtpvlantable.tablePid,
				paramsToGet,
				(int id, string name) =>
				{
					return new VtpVlan
					{
						Id = id,
						Name = name,
					};
				}).ToList();
		}
	}
