namespace InterAppCalls.Models
{
	using System;
	using System.Collections.Generic;
	using System.Text.RegularExpressions;

	using InterAppCalls.Helpers;

	public class IpInterfaceBrief
	{
		public string GroupAddress { get; set; }

		public string Interface { get; set; }

		public string IpAddress { get; set; }

		public string MacAddress { get; set; }

		public string StandbyIpAddress { get; set; }

		public string Subnet { get; set; }

		public IpamInstance GetIpamInstance(bool main, int vlanId, string vlanName, List<string> hsrps)
		{
			string ipAddress = main ? IpAddress : StandbyIpAddress;
			return new IpamInstance
			{
				IpAddress = ipAddress,
				MacAddress = MacAddress,
				DefaultGateway = ProtocolExtensions.GetDefaultGateway(hsrps, Subnet),
				Description = Interface,
				Subnet = Subnet,
				VlanId = vlanId,
				VlanName = vlanName,
			};
		}

		public int? GetVlanId()
		{
			var regex = new Regex(@"Vlan(?<vlanId>[0-9]+)");

			var match = regex.Match(Interface);

			if (!match.Success)
			{
				return null;
			}

			return Convert.ToInt32(match.Groups["vlanId"].Value);
		}
	}
}
