namespace InterAppCalls.Models
{
	using System;
	using System.Linq;

	public class IpRoute
	{
		public string DefaultGateway { get; set; }

		public string InterfaceId { get; set; }

		public string IpAddress { get; set; }

		public string SubnetMask { get; set; }

		public static bool IsCorrectIpFormat(string ip)
		{
			if (ip == null)
			{
				return false;
			}

			string[] ipBytes = ip.Split('.');

			if (ipBytes.Length != 4)
			{
				return false;
			}

			foreach (string ipByte in ipBytes)
			{
				if (!Byte.TryParse(ipByte, out _))
				{
					return false;
				}
			}

			return true;
		}

		public string GetSubnet()
		{
			return $"{IpAddress}/{GetSubnetBits()}";
		}

		public int GetSubnetBits()
		{
			if (SubnetMask == null)
			{
				return 0;
			}

			string[] ipBytes = SubnetMask.Split('.');

			if (ipBytes.Length != 4)
			{
				return 0;
			}

			int ones = 0;

			foreach (string ipByte in ipBytes)
			{
				if (!Byte.TryParse(ipByte, out byte result))
				{
					return 0;
				}

				ones += Convert.ToString(result, 2).ToCharArray().Count(c => c == '1');
			}

			return ones;
		}
	}
}
