namespace InterAppCalls.Models
{
	using System;

	[Flags]
	public enum LldpCapability
	{
		None = 0,

		Other = 1,

		Repeater = 2,

		Bridge = 4,

		Wlan = 8,

		Router = 16,

		Telephone = 32,

		Docsis = 64,

		Station = 128,
	}

	public class Remote
	{
		public LldpCapabilities EnabledCapabilities { get; set; }

		public string MacAddress { get; set; }

		public string PortId { get; set; }

		public int PortSubtypeId { get; set; }
	}

	public class LldpCapabilities
	{
		private readonly LldpCapability _bitmask;

		public LldpCapabilities(byte bitmask)
		{
			_bitmask = (LldpCapability)bitmask;
		}

		public string GetCapabilities()
		{
			return String.Format("{0:G}", _bitmask);
		}

		public bool IsBridge()
		{
			return _bitmask.HasFlag(LldpCapability.Bridge);
		}
	}
}
