using System;
using System.Collections.Generic;
using System.Linq;

using IAC.CiscoNexus.Executors;
using IAC.CiscoNexus.Messages;
using IAC.CiscoNexus.Resources;

using Skyline.DataMiner.Core.InterAppCalls.Common.CallBulk;
using Skyline.DataMiner.Core.InterAppCalls.Common.Shared;
using Skyline.DataMiner.Scripting;

//---------------------------------
// QAction_9000002.cs
//---------------------------------

/// <summary>
/// DataMiner QAction Class: Inter App Calls New.
/// New InterApp QAction has been created that makes use of the Skyline.DataMiner.Core.InterAppCalls.Common NuGet.
/// InterApp messages and resources have been added to the QAction instead of the NuGet due to incompatibility issues related to NuGet versions in CISCO Nexus and Skyline Flow Tracking connectors.
/// </summary>
public static class QAction
{
	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			string raw = Convert.ToString(protocol.GetParameter(Parameter.clp_interapp_receive_new_9000002));
			var knownTypes = GetKnownTypes();
			IInterAppCall receivedCall = InterAppCallFactory.CreateFromRaw(raw, knownTypes);

			var msgToExecutor = GetExecutorMapping();

			foreach (var message in receivedCall.Messages)
			{
				message.TryExecute(protocol, protocol, msgToExecutor, out var returnMessage);

				if (returnMessage == null)
				{
					break;
				}

				if (IsLocalReturnAddress(protocol, message.ReturnAddress))
				{
					returnMessage.Send(
						protocol.SLNet.RawConnection,
						message.ReturnAddress.AgentId,
						message.ReturnAddress.ElementId,
						message.ReturnAddress.ParameterId,
						knownTypes.ToList());
					continue;
				}

				IInterAppCall interAppCall2 = InterAppCallFactory.CreateNew();
				interAppCall2.Messages.Add(returnMessage);
				interAppCall2.Send(protocol.SLNet.RawConnection, message.ReturnAddress.AgentId, message.ReturnAddress.ElementId, message.ReturnAddress.ParameterId, knownTypes.ToList());
			}
		}
		catch (Exception ex)
		{
			protocol.Log($"QA{protocol.QActionID}|{protocol.GetTriggerParameter()}|Run|Exception thrown:{Environment.NewLine}{ex}", LogType.Error, LogLevel.NoLogging);
		}
	}

	private static Dictionary<Type, Type> GetExecutorMapping()
	{
		return new Dictionary<Type, Type>
		{
			{ typeof(GetNbmMulticastSourceIpPairsRequest), typeof(GetNbmMulticastSourceIpPairsRequestExecutor) },
		};
	}

	private static IEnumerable<Type> GetKnownTypes()
	{
		yield return typeof(NbmMulticastSourceIpPair);
		yield return typeof(GetNbmMulticastSourceIpPairsRequest);
		yield return typeof(GetNbmMulticastSourceIpPairsResponse);
	}

	private static bool IsLocalReturnAddress(SLProtocol protocol, ReturnAddress returnAddress)
	{
		return returnAddress.AgentId.Equals(protocol.DataMinerID) && returnAddress.ElementId.Equals(protocol.ElementID);
	}
}
//---------------------------------
// CiscoNexus\Executors\GetNbmMulticastSourceIpPairsRequestExecutor.cs
