namespace IAC.CiscoNexus.Executors
{
	using System;
	using System.Collections.Generic;

	using IAC.CiscoNexus.Messages;
	using IAC.CiscoNexus.Resources;

	using Skyline.DataMiner.Core.InterAppCalls.Common.CallSingle;
	using Skyline.DataMiner.Core.InterAppCalls.Common.MessageExecution;
	using Skyline.DataMiner.Core.InterAppCalls.Common.Shared;
	using Skyline.DataMiner.Scripting;

	using SLNetMessages = Skyline.DataMiner.Net.Messages;

	public class GetNbmMulticastSourceIpPairsRequestExecutor : MessageExecutor<GetNbmMulticastSourceIpPairsRequest>
	{
		private GetNbmMulticastSourceIpPairsResponse _response;

		public GetNbmMulticastSourceIpPairsRequestExecutor(GetNbmMulticastSourceIpPairsRequest message) : base(message)
		{
		}

		public override Message CreateReturnMessage()
		{
			return _response;
		}

		public override void DataGets(object dataSource)
		{
			SLProtocol protocol = dataSource as SLProtocol;

			_response = new GetNbmMulticastSourceIpPairsResponse
			{
				NbmMulticastSourceIpPairs = GetData(protocol),
				Source = new Source
				{
					ElementId = protocol.ElementID,
					AgentId = protocol.DataMinerID,
					Name = protocol.ElementName,
				},
			};
		}

		public override void DataSets(object dataDestination)
		{
			// Do nothing
		}

		public override void Modify()
		{
			// Do nothing
		}

		public override void Parse()
		{
			// Do nothing
		}

		public override bool Validate()
		{
			return true;
		}

		private static List<NbmMulticastSourceIpPair> GetData(SLProtocol protocol)
		{
			var nbmFlowsColumnsToGetIDXs = new uint[] { Parameter.Nbmflowstable.Idx.nbmflowsmcastgrp_14102, Parameter.Nbmflowstable.Idx.nbmflowssrcip_14103 };
			var nbmFlowsColumns = (object[])protocol.NotifyProtocol((int)SLNetMessages.NotifyType.NT_GET_TABLE_COLUMNS, Parameter.Nbmflowstable.tablePid, nbmFlowsColumnsToGetIDXs);

			object[] multicastColumn = (object[])nbmFlowsColumns[0];
			object[] sourceIpColumn = (object[])nbmFlowsColumns[1];

			if (multicastColumn.Length == 0)
			{
				return new List<NbmMulticastSourceIpPair>();
			}

			List<NbmMulticastSourceIpPair> nbmMulticastSourceIpPairs = new List<NbmMulticastSourceIpPair>(multicastColumn.Length);

			for (int i = 0; i < multicastColumn.Length; i++)
			{
				NbmMulticastSourceIpPair nbmMulticastSourceIpPair = new NbmMulticastSourceIpPair
				{
					MulticastGroup = Convert.ToString(multicastColumn[i]),
					SourceIp = Convert.ToString(sourceIpColumn[i]),
				};

				nbmMulticastSourceIpPairs.Add(nbmMulticastSourceIpPair);
			}

			return nbmMulticastSourceIpPairs;
		}
	}
}
