using System;

using Skyline.DataMiner.Scripting;
using Skyline.Protocol;

/// <summary>
/// DataMiner QAction Class: Expected Snooping/Static Joins Sets.
/// </summary>
public static class QAction
{
	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		try
		{
			var triggerPid = protocol.GetTriggerParameter();

			var writeParamValue = protocol.GetParameter(triggerPid);

			var expectedTableRowKey = protocol.RowKey();

			if (IsSnooping(triggerPid))
			{
				UpdateExpectedSnoopingRowState(protocol, expectedTableRowKey, triggerPid, writeParamValue);
			}
			else if (IsStaticJoins(triggerPid))
			{
				UpdateExpectedStaticJoinRowState(protocol, expectedTableRowKey, triggerPid, writeParamValue);
			}
			else
			{
				// Do nothing
			}
		}
		catch (Exception ex)
		{
			protocol.Log($"QA{protocol.QActionID}|{protocol.GetTriggerParameter()}|Run|Exception thrown:{Environment.NewLine}{ex}", LogType.Error, LogLevel.NoLogging);
		}
	}

	private static bool IsSnooping(int triggerPid)
	{
		switch (triggerPid)
		{
			case Parameter.Write.expectedsnoopingvlan_10153:
				return true;

			case Parameter.Write.expectedsnoopinggroupaddress_10154:
				return true;

			case Parameter.Write.expectedsnoopingsourcegroupaddress_10155:
				return true;

			case Parameter.Write.expectedsnoopingportchannel_10156:
				return true;

			default:
				return false;
		}
	}

	private static bool IsStaticJoins(int triggerPid)
	{
		switch (triggerPid)
		{
			case Parameter.Write.expectedstaticjoinsinterfacename_10253:
				return true;

			case Parameter.Write.expectedstaticjoinsstaticjoin_10254:
				return true;

			default:
				return false;
		}
	}

	private static void UpdateExpectedSnoopingRowState(SLProtocol protocol, string expectedTableRowKey, int triggerPid, object writeParamValue)
	{
		var expectedSnoopingVlanIdx = Parameter.Expectedsnooping.Idx.expectedsnoopingvlan_10103;
		var expectedSnoopingGroupAddressIdx = Parameter.Expectedsnooping.Idx.expectedsnoopinggroupaddress_10104;
		var expectedSnoopingSourceGroupAddressIdx = Parameter.Expectedsnooping.Idx.expectedsnoopingsourcegroupaddress_10105;
		var expectedSnoopingPortChannelIdx = Parameter.Expectedsnooping.Idx.expectedsnoopingportchannel_10106;
		object[] expectedSnoopingRow = (object[])protocol.GetRow(Parameter.Expectedsnooping.tablePid, expectedTableRowKey);

		switch (triggerPid)
		{
			case Parameter.Write.expectedsnoopingvlan_10153:
				expectedSnoopingRow[expectedSnoopingVlanIdx] = writeParamValue;
				break;

			case Parameter.Write.expectedsnoopinggroupaddress_10154:
				expectedSnoopingRow[expectedSnoopingGroupAddressIdx] = writeParamValue;
				break;

			case Parameter.Write.expectedsnoopingsourcegroupaddress_10155:
				expectedSnoopingRow[expectedSnoopingSourceGroupAddressIdx] = writeParamValue;
				break;

			case Parameter.Write.expectedsnoopingportchannel_10156:
				expectedSnoopingRow[expectedSnoopingPortChannelIdx] = writeParamValue;
				break;

			default:
				protocol.Log($"QA{protocol.QActionID}|{protocol.GetTriggerParameter()}|Run|Unknown trigger for QA10153", LogType.Error, LogLevel.NoLogging);
				break;
		}

		int tablePid = Parameter.Ipigmpsnoopingtable.tablePid;
		uint[] columnsToGetIdx = new uint[]
			{
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopingvlan_9502,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinggroupaddress_9503,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopinggroupaddresssource_9507,
				Parameter.Ipigmpsnoopingtable.Idx.ipigmpsnoopingportlist_9506,
			};

		if (ExpectedSnoopingRowExists(protocol, expectedSnoopingRow))
		{
			protocol.ShowInformationMessage("Expected Snooping row with defined values already exists.");

			return;
		}

		protocol.SetRow(Parameter.Expectedsnooping.tablePid, protocol.RowKey(), expectedSnoopingRow);

		object[] columns = (object[])protocol.NotifyProtocol(321 /* NT_GET_TABLE_COLUMNS */, tablePid, columnsToGetIdx);
		object[] vlanColumn = (object[])columns[0];
		object[] groupAddressColumn = (object[])columns[1];
		object[] groupAddressSourceColumn = (object[])columns[2];
		object[] portListColumn = (object[])columns[3];
		for (int i = 0; i < vlanColumn.Length; i++)
		{
			var isRowIdentical = Commands.IsIdenticalSnoopingRow(
				vlanColumn[i],
				groupAddressColumn[i],
				groupAddressSourceColumn[i],
				portListColumn[i],
				expectedSnoopingRow[expectedSnoopingVlanIdx],
				expectedSnoopingRow[expectedSnoopingGroupAddressIdx],
				expectedSnoopingRow[expectedSnoopingSourceGroupAddressIdx],
				expectedSnoopingRow[expectedSnoopingPortChannelIdx]);

			if (isRowIdentical)
			{
				SetSnoopingStatus(protocol, available: true, expectedTableRowKey);
				return;
			}
		}

		SetSnoopingStatus(protocol, available: false, expectedTableRowKey);
	}

	private static bool ExpectedSnoopingRowExists(SLProtocol protocol, object[] expectedSnoopingRow)
	{
		int expectedTablePid = Parameter.Expectedsnooping.tablePid;
		uint[] expectedColumnsToGetIdx = new uint[]
			{
				Parameter.Expectedsnooping.Idx.expectedsnoopingvlan_10103,
				Parameter.Expectedsnooping.Idx.expectedsnoopinggroupaddress_10104,
				Parameter.Expectedsnooping.Idx.expectedsnoopingsourcegroupaddress_10105,
				Parameter.Expectedsnooping.Idx.expectedsnoopingportchannel_10106,
			};
		object[] expectedColumns = (object[])protocol.NotifyProtocol(321 /* NT_GET_TABLE_COLUMNS */, expectedTablePid, expectedColumnsToGetIdx);
		object[] vlanExpectedColumns = (object[])expectedColumns[0];
		object[] groupAddressExpectedColumns = (object[])expectedColumns[1];
		object[] sourceGroupAddressExpectedColumns = (object[])expectedColumns[2];
		object[] portChannelExpectedColumns = (object[])expectedColumns[3];

		for (int i = 0; i < vlanExpectedColumns.Length; i++)
		{
			var isRowIdentical = Commands.IsIdenticalSnoopingRow(
				vlanExpectedColumns[i],
				groupAddressExpectedColumns[i],
				sourceGroupAddressExpectedColumns[i],
				portChannelExpectedColumns[i],
				expectedSnoopingRow[2],
				expectedSnoopingRow[3],
				expectedSnoopingRow[4],
				expectedSnoopingRow[5]);

			if (isRowIdentical)
			{
				return true;
			}
		}

		return false;
	}

	private static void UpdateExpectedStaticJoinRowState(SLProtocol protocol, string expectedTableRowKey, int triggerPid, object writeParamValue)
	{
		var interfaceNameIdx = Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsinterfacename_10203;
		var staticJoinIdx = Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsstaticjoin_10204;
		object[] expectedStaticJoinsRow = (object[])protocol.GetRow(Parameter.Expectedstaticjoins.tablePid, expectedTableRowKey);

		switch (triggerPid)
		{
			case Parameter.Write.expectedstaticjoinsinterfacename_10253:
				expectedStaticJoinsRow[Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsinterfacename_10203] = writeParamValue;
				break;

			case Parameter.Write.expectedstaticjoinsstaticjoin_10254:
				expectedStaticJoinsRow[Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsstaticjoin_10204] = writeParamValue;
				break;

			default:
				protocol.Log($"QA{protocol.QActionID}|{protocol.GetTriggerParameter()}|Run|Unknown trigger for QA10153", LogType.Error, LogLevel.NoLogging);
				break;
		}

		int tablePid = Parameter.Staticjoinstable.tablePid;
		uint[] columnsToGetIdx = new uint[]
			{
				Parameter.Staticjoinstable.Idx.staticjoinsinterfacename_17603,
				Parameter.Staticjoinstable.Idx.staticjoinsstaticjoin_17602,
			};

		if (ExpectedStaticJoinsRowExists(protocol, expectedStaticJoinsRow))
		{
			protocol.ShowInformationMessage("Expected Static Joins row with defined values already exists.");

			return;
		}

		protocol.SetRow(Parameter.Expectedstaticjoins.tablePid, protocol.RowKey(), expectedStaticJoinsRow);

		object[] columns = (object[])protocol.NotifyProtocol(321 /* NT_GET_TABLE_COLUMNS */, tablePid, columnsToGetIdx);
		string[] interfaceNameColumn = Array.ConvertAll((object[])columns[0], Convert.ToString);
		string[] staticJoinColumn = Array.ConvertAll((object[])columns[1], Convert.ToString);
		for (int i = 0; i < interfaceNameColumn.Length; i++)
		{
			var isRowIdentical = Commands.IsIdenticalStaticJoinsRow(interfaceNameColumn[i], staticJoinColumn[i], expectedStaticJoinsRow[interfaceNameIdx], expectedStaticJoinsRow[staticJoinIdx]);
			if (isRowIdentical)
			{
				SetStaticJoinsStatus(protocol, available: true, expectedTableRowKey);
				return;
			}
		}

		SetStaticJoinsStatus(protocol, available: false, expectedTableRowKey);
	}

	private static bool ExpectedStaticJoinsRowExists(SLProtocol protocol, object[] expectedStaticJoinsRow)
	{
		int expectedTablePid = Parameter.Expectedstaticjoins.tablePid;
		uint[] expectedColumnsToGetIdx = new uint[]
			{
				Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsinterfacename_10203,
				Parameter.Expectedstaticjoins.Idx.expectedstaticjoinsstaticjoin_10204,
			};
		object[] expectedColumns = (object[])protocol.NotifyProtocol(321 /* NT_GET_TABLE_COLUMNS */, expectedTablePid, expectedColumnsToGetIdx);
		object[] interfaceNameExpectedColumns = (object[])expectedColumns[0];
		object[] staticJoinsExpectedColumns = (object[])expectedColumns[1];

		for (int i = 0; i < interfaceNameExpectedColumns.Length; i++)
		{
			var isRowIdentical = Commands.IsIdenticalStaticJoinsRow(
				interfaceNameExpectedColumns[i],
				staticJoinsExpectedColumns[i],
				expectedStaticJoinsRow[2],
				expectedStaticJoinsRow[3]);

			if (isRowIdentical)
			{
				return true;
			}
		}

		return false;
	}

	private static void SetSnoopingStatus(SLProtocol protocol, bool available, string expectedTableRowKey)
	{
		object[] rowData = new object[] { null, available ? 1 : 0, null, null, null, null, null };
		protocol.SetRow(Parameter.Expectedsnooping.tablePid, expectedTableRowKey, rowData);
	}

	private static void SetStaticJoinsStatus(SLProtocol protocol, bool available, string expectedTableRowKey)
	{
		object[] rowData = new object[] { null, available ? 1 : 0, null, null, null };
		protocol.SetRow(Parameter.Expectedstaticjoins.tablePid, expectedTableRowKey, rowData);
	}
}
